Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bqqg45z8v4whd','SELECT B.SVRID_FK, B.DBID_GEN_FK, B.ID_GEN_FK, B.COLID_GEN,B. "LENGTH", C. "NAME" COLTYPENAME, B. "NAME", B. "PREC", B. "SCALE", B.STATUS NULLABLE, B.CDEFAULT, B.STATUS, B.DB_TYPE, B.USERTYPE, B.COLID FROM STAGE_SYB12_SYSOBJECTS A, STAGE_SYB12_SYSCOLUMNS B, STAGE_SYB12_SYSTYPES C, STAGE_SYB12_SYSUSERS D WHERE A.OBJID_GEN = B.ID_GEN_FK AND A.DBID_GEN_FK = B.DBID_GEN_FK AND A.SVRID_FK = B.SVRID_FK AND A.DBID_GEN_FK = C.DBID_GEN_FK AND A.SVRID_FK = C.SVRID_FK AND B.USERTYPE = C.USERTYPE AND A.DB_UID = D.DB_UID AND A.SVRID_FK = D.SVRID_FK AND A.DBID_GEN_FK = D.DBID_GEN_FK AND D.SUID>0 AND A.SVRID_FK = :B1 AND A.DB_TYPE = ''U '' ORDER BY B.COLID',73169);
