Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('78xu9z93vxs46','SELECT R_C1.COLID_GEN MYCOLID, R_C1.ID_GEN_FK MYID, R_C1. "NAME" MYNAME, BASE_TYPE.BASE_NAME MYBASENAME, CASE WHEN ( ( R_C1. "PRECISION" = 0 ) OR ( R_C1. "PRECISION" IS NULL ) ) THEN SS2K5ALLPLATFORM.GETPRECISION(BASE_TYPE.BASE_NAME,R_C1. "MAX_LENGTH",R_C1. "SCALE") ELSE SS2K5ALLPLATFORM.GETPRECISION(BASE_TYPE.BASE_NAME,R_C1. "PRECISION",R_C1. "SCALE") END MYPRECISION, SS2K5ALLPLATFORM.GETNEWSCALE(BASE_TYPE.BASE_NAME, CASE WHEN ( ( R_C1. "PRECISION" = 0 ) OR ( R_C1. "PRECISION" IS NULL ) ) THEN R_C1. "MAX_LENGTH" ELSE R_C1. "PRECISION" END,R_C1. "SCALE") MYSCALE , CASE WHEN R_C1.IS_NULLABLE=1 THEN ''Y'' ELSE ''N'' END MYNULLABLE, DC.DEFINITION MYDEFINITION, P.VALUE COMMENTS FROM STAGE_SS2K5_COLUMNS R_C1 , STAGE_SS2K5_TABLES TABST, (SELECT (SELECT TT.NAME FROM STAGE_SS2K5_TYPES TT WHERE TT.USER_TYPE_ID = T.SYSTEM_TYPE_ID AND TT.SVRID_FK = :B1 AND TT.DBID_GEN_FK =T.DBID_GEN_FK ) BASE_NAME, T.USER_TYPE_ID T_USER_TYPE_ID, T.DBID_GEN_FK T_DBID_GEN_FK FROM STAGE_SS2K5_TYPES T WHERE T.SVRID_FK = :B1 ) BASE_TYPE, (SELECT * FROM STAGE_SS2K5_DT_CONSTRAINTS X WHERE X.OBJECT_ID != 0 AND X.OBJECT_ID IS NOT NULL AND X.SVRID_FK =:B1 ) DC, STAGE_SS2K5_SYSPROPERTIES P WHERE TABST.OBJID_GEN = R_C1.ID_GEN_FK AND BASE_TYPE.T_USER_TYPE_ID = R_C1.USER_TYPE_ID AND DC.OBJECT_ID (+) = R_C1.DEFAULT_OBJECT_ID AND ( ( DC.DBID_GEN_FK =R_C1.DBID_GEN_FK ) OR ( DC.DBID_GEN_FK IS NULL ) ) AND TABST.SVRID_FK = :B1 AND TABST.DBID_GEN_FK =R_C1.DBID_GEN_FK AND BASE_TYPE.T_DBID_GEN_FK =R_C1.DBID_GEN_FK AND R_C1.SVRID_FK = :B1 AND R_C1.ID_GEN_FK = :B2 AND P.CLASS(+) = 1 AND P.SVRID_FK(+) = :B1 AND P.MAJOR_ID(+) = R_C1.OBJECT_ID AND P.MINOR_ID(+) = R_C1.COLUMN_ID AND P.DBID_GEN_FK(+) = R_C1.DBID_GEN_FK ORDER BY R_C1.COLUMN_ID',73335);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2np1as0v23g5n','SELECT I.OBJECT_ID_GEN , I. "OBJECT_ID" MYTABLEID, I. "INDEX_ID" MYINDEXID, I. "NAME" MYINDEXNAME, I. "IS_UNIQUE" MYISUNIQUE, O. "NAME" MYTABLENAME, LT.OBJID_GEN MYGENTABLEID, P.VALUE COMMENTS, I.DBID_GEN_FK DBIDGENFK FROM STAGE_SS2K5_INDEXES I, STAGE_SS2K5_OBJECTS O, STAGE_SS2K5_TABLES LT, STAGE_SS2K5_SYSPROPERTIES P WHERE O.TYPE IN (''U'', ''V'', ''U '', ''V '') AND O. "OBJECT_ID" = I. "OBJECT_ID" AND I.NAME NOT LIKE ''_WA_Sys%'' AND I.IS_PRIMARY_KEY = 0 AND EXISTS (SELECT 1 FROM MD_TABLES MDT WHERE MDT.ID=LT.OBJID_GEN ) AND LT.OBJECT_ID = O.OBJECT_ID AND I.SVRID_FK = :B1 AND O.SVRID_FK = :B1 AND LT.SVRID_FK = :B1 AND I.DBID_GEN_FK = O.DBID_GEN_FK AND O.DBID_GEN_FK = LT.DBID_GEN_FK AND P.CLASS(+) = 7 AND P.SVRID_FK(+) = :B1 AND P.MAJOR_ID(+) = I.OBJECT_ID AND P.MINOR_ID(+) = I.INDEX_ID AND P.DBID_GEN_FK(+) = I.DBID_GEN_FK AND LT.NAME NOT IN (''sysdiagrams'')',73335);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7tp2ykd001srd','INSERT INTO MD_TRIGGERS ( "ID", TABLE_OR_VIEW_ID_FK, TRIGGER_ON_FLAG, TRIGGER_NAME, NATIVE_SQL, "LANGUAGE", COMMENTS ) (SELECT A.OBJID_GEN, ( CASE WHEN (V.TYPE = ''V'') THEN V.OBJID_GEN ELSE (SELECT T.OBJID_GEN FROM STAGE_SS2K5_TABLES T WHERE T.OBJECT_ID = A.PARENT_OBJECT_ID AND T.SVRID_FK = :B1 AND T.DBID_GEN_FK = A.DBID_GEN_FK ) END), CASE WHEN (V.TYPE = ''V'') THEN ''V'' ELSE ''T'' END, A. "NAME", B.DEFINITION, ''MSTSQL'', P.VALUE COMMENTS FROM STAGE_SS2K5_OBJECTS A, STAGE_SS2K5_SQL_MODULES B, STAGE_SS2K5_OBJECTS V, STAGE_SS2K5_SYSPROPERTIES P WHERE A. "TYPE" =''TR'' AND V.OBJECT_ID = A.PARENT_OBJECT_ID AND A. "OBJECT_ID" = B. "OBJECT_ID" AND A.IS_MS_SHIPPED=0 AND ((EXISTS (SELECT 1 FROM MD_VIEWS V WHERE V.ID = V.OBJID_GEN )) OR (EXISTS (SELECT 1 FROM MD_TABLES TT, STAGE_SS2K5_TABLES TS WHERE TT.ID = TS.OBJID_GEN AND TS.OBJECT_ID = V.OBJECT_ID AND A.DBID_GEN_FK = TS.DBID_GEN_FK AND TS.SVRID_FK = :B1 AND TS.NAME NOT IN (''sysdiagrams'') ) ) ) AND A.SVRID_FK = :B1 AND B.SVRID_FK = :B1 AND V.SVRID_FK = :B1 AND A.DBID_GEN_FK = B.DBID_GEN_FK AND V.DBID_GEN_FK = B.DBID_GEN_FK AND P.CLASS(+) = 1 AND P.SVRID_FK(+) = :B1 AND P.MAJOR_ID(+) = A.OBJECT_ID AND P.MINOR_ID(+) = 0 AND P.DBID_GEN_FK(+) = A.DBID_GEN_FK ) ',73335);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2ay7xbbf1y8g5','SELECT (SELECT COUNT(1) FROM MD_TABLES MDT2 WHERE MDT2.ID=RT.OBJID_GEN ) ONEIFRTCAPTURED, FK.NAME FK_NAME, FKC.CONSTRAINT_OBJECT_ID FKC_CONSTRAINT_OBJECT_ID, LC.NAME LC_NAME, (SELECT S.NAME FROM STAGE_SS2K5_SCHEMAS S WHERE S.SCHEMA_ID = RT.SCHEMA_ID AND S.SVRID_FK = :B2 AND S.DBID_GEN_FK = FK.DBID_GEN_FK AND S.DBID_GEN_FK = :B1 ) SCHEMANAME, RT.NAME REFTABLENAME, RC.NAME REFCOLUMNNAME, FKC.CONSTRAINT_COLUMN_ID FKC_CONSTRAINT_COLUMN_ID , LC.COLID_GEN LC_COLID_GEN, RC.COLID_GEN RC_COLID_GEN, LT.OBJID_GEN LT_OBJID_GEN, RT.OBJID_GEN RT_OBJID_GEN FROM STAGE_SS2K5_FN_KEYS FK, STAGE_SS2K5_FN_KEY_COLUMNS FKC, STAGE_SS2K5_COLUMNS LC, STAGE_SS2K5_COLUMNS RC, STAGE_SS2K5_TABLES RT, STAGE_SS2K5_TABLES LT WHERE FK.OBJECT_ID = :B3 AND FK.OBJECT_ID = FKC.CONSTRAINT_OBJECT_ID AND LC.OBJECT_ID = FKC.PARENT_OBJECT_ID AND LC.COLUMN_ID = FKC.PARENT_COLUMN_ID AND RC.OBJECT_ID = FKC.REFERENCED_OBJECT_ID AND RC.COLUMN_ID = FKC.REFERENCED_COLUMN_ID AND FKC.REFERENCED_OBJECT_ID = RT.OBJECT_ID AND FKC.PARENT_OBJECT_ID = LT.OBJECT_ID AND FK.SVRID_FK = :B2 AND FKC.SVRID_FK = :B2 AND LC.SVRID_FK = :B2 AND RC.SVRID_FK = :B2 AND RT.SVRID_FK = :B2 AND LT.SVRID_FK = :B2 AND FKC.DBID_GEN_FK = FK.DBID_GEN_FK AND LC.DBID_GEN_FK = FK.DBID_GEN_FK AND RC.DBID_GEN_FK = FK.DBID_GEN_FK AND RT.DBID_GEN_FK = FK.DBID_GEN_FK AND LT.DBID_GEN_FK = FK.DBID_GEN_FK AND FK.DBID_GEN_FK = :B1 AND EXISTS (SELECT 1 FROM MD_TABLES MDT WHERE MDT.ID=LT.OBJID_GEN ) ORDER BY FKC.CONSTRAINT_COLUMN_ID ',73335);
