Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fnk22pj785d10','SELECT A.SVRID_FK MYSVRID, T.OBJID_GEN MYTABLEID, A. "NAME" MYTABLENAME, B. "NAME" MYCOLUMNNAME, B.COLID_GEN MYCOLID, B. "RULE_OBJECT_ID" MYRULEID, M.DEFINITION MYMODULEDEFINITION, P.VALUE COMMENTS FROM STAGE_SS2K5_OBJECTS A, STAGE_SS2K5_COLUMNS B, STAGE_SS2K5_OBJECTS C , STAGE_SS2K5_TABLES T, STAGE_SS2K5_SQL_MODULES M, STAGE_SS2K5_SYSPROPERTIES P WHERE A. "TYPE" = ''U'' AND B. "OBJECT_ID" = A. "OBJECT_ID" AND C.OBJECT_ID = A. "OBJECT_ID" AND B. "RULE_OBJECT_ID" > 0 AND M.OBJECT_ID =B.RULE_OBJECT_ID AND T.OBJECT_ID = A.OBJECT_ID AND A.SVRID_FK = :B1 AND T.SVRID_FK = :B1 AND B.SVRID_FK = :B1 AND C.SVRID_FK = :B1 AND M.SVRID_FK = :B1 AND A.DBID_GEN_FK = B.DBID_GEN_FK AND C.DBID_GEN_FK = A.DBID_GEN_FK AND T.DBID_GEN_FK = A.DBID_GEN_FK AND M.DBID_GEN_FK = A.DBID_GEN_FK AND T.NAME NOT IN (''sysdiagrams'') AND EXISTS (SELECT 1 FROM MD_TABLES MDT WHERE MDT.ID=T.OBJID_GEN ) AND P.CLASS(+) = 1 AND P.SVRID_FK(+) = :B1 AND P.MAJOR_ID(+) = A.OBJECT_ID AND P.MINOR_ID(+) = 0 AND P.DBID_GEN_FK(+) = A.DBID_GEN_FK ',73335);
