Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('c3dz2cu5rhhhu','SELECT A.OBJID_GEN MYID, TRIM(A.NAME) MYNAME, CASE WHEN A.TYPE = ''UQ'' THEN ''UNIQUE'' ELSE ''PK'' END MYTYPE, T.OBJID_GEN MYTABLE, ''MSTSQL'' MYLANGUAGE, P.VALUE COMMENTS FROM STAGE_SS2K5_OBJECTS A, STAGE_SS2K5_OBJECTS A2, STAGE_SS2K5_TABLES T, STAGE_SS2K5_SYSPROPERTIES P WHERE ( A.TYPE =''PK'' OR A.TYPE =''UQ'' ) AND A2.TYPE IN (''U'', ''U '') AND A2.OBJECT_ID = A.PARENT_OBJECT_ID AND T.OBJECT_ID = A2.OBJECT_ID AND A.SVRID_FK = :B1 AND A2.SVRID_FK = :B1 AND T.SVRID_FK = :B1 AND T.DBID_GEN_FK = A2.DBID_GEN_FK AND A.DBID_GEN_FK = A2.DBID_GEN_FK AND T.NAME NOT IN (''sysdiagrams'') AND EXISTS ( SELECT 1 FROM MD_TABLES WHERE ID = T.OBJID_GEN ) AND P.CLASS(+) = 1 AND P.SVRID_FK(+) = :B1 AND P.MAJOR_ID(+) = A.OBJECT_ID AND P.MINOR_ID(+) = 0 AND P.DBID_GEN_FK(+) = A.DBID_GEN_FK ',73335);
