Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('1g44h746jabzr','SELECT DISTINCT A.CUSTOMERID CUSTOMERID , A.CUSTOMERNAME , A.UCIF_ID UCICID , CASE WHEN NVL(B.AUTHORISATIONSTATUS, '' '') IN ( ''MP'',''NP'' ) THEN ''MP'' WHEN NVL(B.AUTHORISATIONSTATUS, '' '') IN ( ''1A'' ) THEN ''1A'' WHEN NVL(B.AUTHORISATIONSTATUS, '' '') IN ( ''A'' ) THEN ''A'' ELSE ''No MOC Done'' END AUTHORISATIONSTATUS , CASE WHEN NVL(A.AUTHORISATIONSTATUS, '' '') IN ( ''MP'',''NP'' ) THEN ''1st Approval Pending'' WHEN NVL(A.AUTHORISATIONSTATUS, '' '') IN ( ''1A'' ) THEN ''2nd Approval Pending'' WHEN NVL(A.AUTHORISATIONSTATUS, '' '') IN ( ''A'' ) THEN ''Authorised'' ELSE ''No MOC Done'' END AUTHORISATIONSTATUSDESC , ''CustomerLevel'' TABLENAME , NVL(B.MODIFYBY, B.CREATEDBY) CRMODBY , NVL(B.DATEMODIFIED, B.DATECREATED) CRMODDATE , NVL(B.FIRSTLEVELAPPROVEDBY, B.CREATEDBY) CRAPPBY , NVL(B.FIRSTLEVELDATEAPPROVED, B.DATECREATED) CRAPPDATE , NVL(B.FIRSTLEVELAPPROVEDBY, B.MODIFYBY) MODAPPBY , NVL(B.FIRSTLEVELDATEAPPROVED, B.DATEMODIFIED) MODAPPDATE , B.CHANGEFIELDS FROM CURDAT_RBL_MISDB_PROD.CUSTOMERBASICDETAIL A LEFT JOIN ADHOCACL_CHANGEDETAILS_MOD B ON A.CUSTOMERID = B.CUSTOMERID AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 AND B.AUTHORISATIONSTATUS IN ( ''MP'',''NP'',''1A'',''A'' ) WHERE ( ( A.CUSTOMERID = :B4 ) OR ( A.UCIF_ID = :B3 ) ) AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND :B2 NOT IN ( 16,17,20 ) ',79351);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2h07wv0qwpwvc','SELECT A.CUSTOMERID CUSTOMERID , CH.CUSTOMERNAME , A.UCIF_ID UCICID , CASE WHEN NVL(A.AUTHORISATIONSTATUS, '' '') IN ( ''MP'',''NP'' ) THEN ''MP'' WHEN NVL(A.AUTHORISATIONSTATUS, '' '') IN ( ''1A'' ) THEN ''1A'' WHEN NVL(A.AUTHORISATIONSTATUS, '' '') IN ( ''A'' ) THEN ''A'' ELSE ''No MOC Done'' END AUTHORISATIONSTATUS , CASE WHEN NVL(A.AUTHORISATIONSTATUS, '' '') IN ( ''MP'',''NP'' ) THEN ''1st Approval Pending'' WHEN NVL(A.AUTHORISATIONSTATUS, '' '') IN ( ''1A'' ) THEN ''2nd Approval Pending'' WHEN NVL(A.AUTHORISATIONSTATUS, '' '') IN ( ''A'' ) THEN ''Authorised'' ELSE ''No MOC Done'' END AUTHORISATIONSTATUSDESC , ''CustomerLevel'' TABLENAME , A.CREATEDBY , A.DATECREATED , A.APPROVEDBY , A.DATEAPPROVED , A.MODIFYBY , A.DATEMODIFIED , A.FIRSTLEVELAPPROVEDBY , A.FIRSTLEVELDATEAPPROVED , '' '' CHANGEFIELDS FROM ADHOCACL_CHANGEDETAILS A LEFT JOIN CURDAT_RBL_MISDB_PROD.CUSTOMERBASICDETAIL CH ON A.CUSTOMERID = CH.CUSTOMERID AND CH.EFFECTIVEFROMTIMEKEY <= :B1 AND CH.EFFECTIVETOTIMEKEY >= :B1 WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND NVL(A.AUTHORISATIONSTATUS, ''A'') IN ( ''A'' ) UNION SELECT DISTINCT A.CUSTOMERID CUSTOMERID , CH.CUSTOMERNAME , A.UCIF_ID UCICID , CASE WHEN NVL(A.AUTHORISATIONSTATUS, '' '') IN ( ''MP'',''NP'' ) THEN ''MP'' WHEN NVL(A.AUTHORISATIONSTATUS, '' '') IN ( ''1A'' ) THEN ''1A'' WHEN NVL(A.AUTHORISATIONSTATUS, '' '') IN ( ''A'' ) THEN ''A'' ELSE ''No MOC Done'' END AUTHORISATIONSTATUS , CASE WHEN NVL(A.AUTHORISATIONSTATUS, '' '') IN ( ''MP'',''NP'' ) THEN ''1st Approval Pending'' WHEN NVL(A.AUTHORISATIONSTATUS, '' '') IN ( ''1A'' ) THEN ''2nd Approval Pending'' WHEN NVL(A.AUTHORISATIONSTATUS, '' '') IN ( ''A'' ) THEN ''Authorised'' ELSE ''No MOC Done'' END AUTHORISATIONSTATUSDESC , ''CustomerLevel'' TABLENAME , A.CREATEDBY , A.DATECREATED , A.APPROVEDBY , A.DATEAPPROVED , A.MODIFYBY , A.DATEMODIFIED , A.FIRSTLEVELAPPROVEDBY , A.FIRSTLEVELDATEAPPROVED , A.CHANGEFIELDS FROM ADHOCACL_CHANGEDETAILS_MOD A LEFT JOIN CURDAT_RBL_MISDB_PROD.CUSTOMERBASICDETAIL CH ON A.CUSTOMERID = CH.CUSTOMERID AND CH.EFFECTIVEFROMTIMEKEY <= :B1 AND CH.EFFECTIVETOTIMEKEY >= :B1 WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND NVL(A.AUTHORISATIONSTATUS, ''A'') IN ( ''NP'',''MP'',''1A'' ) ',79351);
