Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3bcujmnv5v9fa','SELECT A.PAN_NO , A.UCIC_ID , A.CUSTOMERID , A.CUSTOMERNAME , C.BANKINGARRANGEMENTALT_KEY , C.ARRANGEMENTDESCRIPTION , UTILS.CONVERT_TO_VARCHAR2(A.BORROWERDEFAULTDATE,20,P_STYLE=>103) BORROWERDEFAULTDATE , A.LEADBANKALT_KEY , B.BANKNAME , H.PARAMETERNAME DEFAULTSTATUS , D.EXPOSUREBUCKETALT_KEY , D.BUCKETNAME , UTILS.CONVERT_TO_VARCHAR2(A.REFERENCEDATE,20,P_STYLE=>103) REFERENCEDATE , UTILS.CONVERT_TO_VARCHAR2(A.REVIEWEXPIRYDATE,20,P_STYLE=>103) REVIEWEXPIRYDATE , UTILS.CONVERT_TO_VARCHAR2(A.RP_APPROVALDATE,20,P_STYLE=>103) RP_APPROVALDATE , E.RPNATUREALT_KEY , E.RPDESCRIPTION , A.IF_OTHER , UTILS.CONVERT_TO_VARCHAR2(A.RP_EXPIRYDATE,20,P_STYLE=>103) RP_EXPIRYDATE , UTILS.CONVERT_TO_VARCHAR2(A.RP_IMPLDATE,20,P_STYLE=>103) RP_IMPLDATE , I.PARAMETERNAME RP_IMPLSTATUS , A.RP_FAILED , UTILS.CONVERT_TO_VARCHAR2(A.REVISED_RP_EXPIRY_DATE,20,P_STYLE=>103) REVISED_RP_EXPIRY_DATE , UTILS.CONVERT_TO_VARCHAR2(A.ACTUAL_IMPL_DATE,20,P_STYLE=>103) ACTUAL_IMPL_DATE , UTILS.CONVERT_TO_VARCHAR2(A.RP_OUTOFDATEALLBANKSDEADLINE,20,P_STYLE=>103) RP_OUTOFDATEALLBANKSDEADLINE , A.ISBANKEXPOSURE , G.ASSETCLASSALT_KEY , G.ASSETCLASSNAME , UTILS.CONVERT_TO_VARCHAR2(RISKREVIEWEXPIRYDATE,20,P_STYLE=>103) RISKREVIEWEXPIRYDATE , ''RPHIstory'' TABLENAME FROM RP_PORTFOLIO_DETAILS A LEFT JOIN DIMBANKRP B ON A.LEADBANKALT_KEY = B.BANKRPALT_KEY JOIN DIMBANKINGARRANGEMENT C ON A.BANKINGARRANGEMENTALT_KEY = C.BANKINGARRANGEMENTALT_KEY JOIN DIMEXPOSUREBUCKET D ON A.EXPOSUREBUCKETALT_KEY = D.EXPOSUREBUCKETALT_KEY JOIN DIMRESOLUTIONPLANNATURE E ON A.RPNATUREALT_KEY = E.RPNATUREALT_KEY JOIN DIMASSETCLASS G ON A.ASSETCLASSALT_KEY = G.ASSETCLASSALT_KEY JOIN ( SELECT PARAMETERALT_KEY , PARAMETERNAME , ''BorrowerDefaultStatus'' TABLENAME FROM DIMPARAMETER WHERE DIMPARAMETERNAME = ''BorrowerDefaultStatus'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 ) H ON H.PARAMETERALT_KEY = A.DEFAULTSTATUSALT_KEY JOIN ( SELECT PARAMETERALT_KEY , PARAMETERNAME , ''ImplementationStatus'' TABLENAME FROM DIMPARAMETER WHERE DIMPARAMETERNAME = ''ImplementationStatus'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 ) I ON I.PARAMETERALT_KEY = A.RP_IMPLSTATUSALT_KEY WHERE A.CUSTOMERID = :B2 ORDER BY A.REFERENCEDATE ',79696);
