Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('69312caa5c92g','MERGE INTO RBL_TEMPDB.TEMPADVACOTHERFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID, ''N'' FROM RBL_TEMPDB.TEMPADVACOTHERFINANCIALDETAIL A WHERE NOT EXISTS ( SELECT 1 FROM RBL_MISDB_PROD.ADVACOTHERFINANCIALDETAIL B WHERE B.EFFECTIVETOTIMEKEY = 49999 AND B.ACCOUNTENTITYID = A.ACCOUNTENTITYID )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ISCHANGED = ''N''',79645);
