Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4mgntcxyqdvgk','MERGE INTO RBL_MISDB_PROD.ADVACOTHERFINANCIALDETAIL AA USING (SELECT AA.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVACOTHERFINANCIALDETAIL AA WHERE AA.EFFECTIVETOTIMEKEY = 49999 AND NOT EXISTS ( SELECT 1 FROM RBL_TEMPDB.TEMPADVACOTHERFINANCIALDETAIL BB WHERE AA.ACCOUNTENTITYID = BB.ACCOUNTENTITYID AND BB.EFFECTIVETOTIMEKEY = 49999 )) SRC ON ( AA.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, DATEMODIFIED = POS_3, MODIFIEDBY = ''SSISUSER''',79645);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bcczdf9kj4rtp','MERGE INTO RBL_TEMPDB.TEMPADVACOTHERFINANCIALDETAIL TEMP USING (SELECT TEMP.ROWID ROW_ID, ACCT.ENTITYKEY FROM RBL_TEMPDB.TEMPADVACOTHERFINANCIALDETAIL TEMP JOIN ( SELECT "TEMPADVACOTHERFINANCIALDETAIL".ACCOUNTENTITYID , (:B1 + ROW_NUMBER() OVER ( ORDER BY ( SELECT 1 FROM DUAL ) )) ENTITYKEY FROM RBL_TEMPDB.TEMPADVACOTHERFINANCIALDETAIL WHERE "TEMPADVACOTHERFINANCIALDETAIL".ENTITYKEY = 0 OR "TEMPADVACOTHERFINANCIALDETAIL".ENTITYKEY IS NULL ) ACCT ON TEMP.ACCOUNTENTITYID = ACCT.ACCOUNTENTITYID WHERE TEMP.ISCHANGED IN ( ''N'',''C'' ) ) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.ENTITYKEY = SRC.ENTITYKEY',79645);
