Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bc7q4wzf9zt4v','INSERT INTO TT_TEMP_83 ( SELECT B.REFSYSTEMACID , B.UCICID , B.REFCUSTOMERID , A.COLLATERALID , B.COLLATERALVALUEATSANCTIONINRS COLLATERALVALUEATSANCTIONINRS , B.COLLATERALVALUEASONNPADATEINRS COLLATERALVALUEASONNPADATEINRS , A.CURRENTVALUE COLLATERALVALUEATTHETIMEOFLASTREVIEWINRS , UTILS.CONVERT_TO_VARCHAR2(A.VALUATIONDATE,20,P_STYLE=>103) VALUATIONDATE , A.CURRENTVALUE LATESTCOLLATERALVALUEINRS , A.EXPIRYBUSINESSRULE , A.PERIODINMONTH , UTILS.CONVERT_TO_VARCHAR2(A.VALUATIONEXPIRYDATE,20,P_STYLE=>103) VALUEEXPIRATIONDATE , B.TAGGINGALT_KEY , NVL(A.AUTHORISATIONSTATUS, ''A'') AUTHORISATIONSTATUS , A.EFFECTIVEFROMTIMEKEY , A.EFFECTIVETOTIMEKEY , A.CREATEDBY , A.DATECREATED , A.APPROVEDBY , A.DATEAPPROVED , A.MODIFIEDBY , A.DATEMODIFIED , (CASE WHEN B.TAGGINGALT_KEY = 1 THEN B.REFCUSTOMERID WHEN B.TAGGINGALT_KEY = 2 THEN B.REFSYSTEMACID WHEN B.TAGGINGALT_KEY = 4 THEN B.UCICID END) TAGGINGID , ''CollateralSearchGridData'' TABLENAME FROM CURDAT_RBL_MISDB_PROD.ADVSECURITYDETAIL B LEFT JOIN CURDAT_RBL_MISDB_PROD.ADVSECURITYVALUEDETAIL A ON A.COLLATERALID = B.COLLATERALID WHERE B.EFFECTIVEFROMTIMEKEY <= :B3 AND B.EFFECTIVETOTIMEKEY >= :B3 AND NVL(A.AUTHORISATIONSTATUS, ''A'') = ''A'' AND ( :B2 = 1 AND B.REFCUSTOMERID = :B1 OR :B2 = 2 AND B.REFSYSTEMACID = :B1 OR :B2 = 4 AND B.UCICID = :B1 ) )',80199);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0ccrzj7hhzk77','INSERT INTO TT_TEMP_84 ( SELECT B.REFSYSTEMACID , B.UCICID , B.REFCUSTOMERID , A.COLLATERALID , B.COLLATERALVALUEATSANCTIONINRS COLLATERALVALUEATSANCTIONINRS , B.COLLATERALVALUEASONNPADATEINRS COLLATERALVALUEASONNPADATEINRS , A.CURRENTVALUE COLLATERALVALUEATTHETIMEOFLASTREVIEWINRS , UTILS.CONVERT_TO_VARCHAR2(A.VALUATIONDATE,20,P_STYLE=>103) VALUATIONDATE , A.CURRENTVALUE LATESTCOLLATERALVALUEINRS , A.EXPIRYBUSINESSRULE , A.PERIODINMONTH , UTILS.CONVERT_TO_VARCHAR2(A.VALUATIONEXPIRYDATE,20,P_STYLE=>103) VALUEEXPIRATIONDATE , B.TAGGINGALT_KEY , NVL(A.AUTHORISATIONSTATUS, ''A'') AUTHORISATIONSTATUS , A.EFFECTIVEFROMTIMEKEY , A.EFFECTIVETOTIMEKEY , A.CREATEDBY , A.DATECREATED , A.APPROVEDBY , A.DATEAPPROVED , A.MODIFIEDBY , A.DATEMODIFIED , (CASE WHEN B.TAGGINGALT_KEY = 1 THEN B.REFCUSTOMERID WHEN B.TAGGINGALT_KEY = 2 THEN B.REFSYSTEMACID WHEN B.TAGGINGALT_KEY = 4 THEN B.UCICID END) TAGGINGID , ''CollateralSearchGridData'' TABLENAME FROM CURDAT_RBL_MISDB_PROD.ADVSECURITYDETAIL B LEFT JOIN CURDAT_RBL_MISDB_PROD.ADVSECURITYVALUEDETAIL A ON A.COLLATERALID = B.COLLATERALID JOIN DIMPARAMETER C ON B.TAGGINGALT_KEY = C.PARAMETERALT_KEY AND C.DIMPARAMETERNAME = ''DimRatingType'' WHERE B.EFFECTIVEFROMTIMEKEY <= :B3 AND B.EFFECTIVETOTIMEKEY >= :B3 AND A.EFFECTIVEFROMTIMEKEY <= :B3 AND A.EFFECTIVETOTIMEKEY >= :B3 AND NVL(A.AUTHORISATIONSTATUS, ''A'') = ''A'' AND :B2 = C.PARAMETERALT_KEY AND ( :B2 = 1 AND B.REFCUSTOMERID = :B1 OR :B2 = 2 AND B.REFSYSTEMACID = :B1 OR :B2 = 4 AND B.UCICID = :B1 ) )',80201);
