Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('000bbuysh6nun','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL B USING (SELECT B.ROWID ROW_ID, (CASE WHEN B.BALANCESHEETDATE IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', B.BALANCESHEETDATE, :B2 ) ELSE 0 END) AS DPD_BS_DATE FROM CURDAT_RBL_MISDB_PROD.INVESTMENTBASICDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL C ON A.ISSUERENTITYID = C.ISSUERENTITYID AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL B ON A.INVENTITYID = B.INVENTITYID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 JOIN RBL_MISDB_PROD.DIMINSTRUMENTTYPE INS ON INS.EFFECTIVEFROMTIMEKEY <= :B1 AND INS.EFFECTIVETOTIMEKEY >= :B1 AND INS.INSTRUMENTTYPEALT_KEY = A.INSTRTYPEALT_KEY WHERE B.DPD_BS_DATE IS NOT NULL AND LISTEDSHARES = ''Unlisted'' AND NVL(INS.INSTRUMENTTYPESUBGROUP, '' '') IN ( ''Equity'' ) ) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET DPD_BS_DATE = SRC.DPD_BS_DATE',79245);
