Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('97c9msd9md4x4','MERGE INTO GTT_CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, ''U'' FROM GTT_CUSTOMERCAL A JOIN TT_TEMPTABLE1_16 B ON A.UCIF_ID = B.UCIF_ID JOIN RBL_MISDB_PROD.DIMASSETCLASS C ON C.ASSETCLASSALT_KEY = A.SYSASSETCLASSALT_KEY AND ( C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 ) WHERE ( NOT ( NVL(A.ASSET_NORM, ''NORMAL'') = ''ALWYS_NPA'' ) AND C.ASSETCLASSGROUP = ''NPA'' AND NOT ( NVL(A.FLGDEG, ''N'') = ''Y'' ) ) AND ( NVL(A.FLGPROCESSING, ''N'') = ''N'' )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGUPG = ''U''',84097);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bt1sh8dp1jwtw','INSERT INTO GTT_TEMPMINASSETCLASS ( SELECT UCIFID , MAX(NVL(FINALASSETCLASSALT_KEY, 1)) FINALASSETCLASSALT_KEY , MIN(NPIDT) NPIDT FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTBASICDETAIL B ON A.INVENTITYID = B.INVENTITYID AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL C ON B.ISSUERENTITYID = C.ISSUERENTITYID AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 WHERE NVL(FINALASSETCLASSALT_KEY, 1) > 1 AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 GROUP BY UCIFID )',79245);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('9jcj0nd8fma0c','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID, CONCAT(CONCAT(DEGREASON, '',NPA DUE TO Linkage By Issuerid=''), D.ACID) AS POS_2, CASE WHEN C.STATUSDATE < A.NPIDT THEN C.STATUSDATE ELSE A.NPIDT END AS POS_3 FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL B ON A.REFISSUERID = B.ISSUERID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 JOIN GTT_HISTORYDATA1 C ON B.UCIFID = C.UCIFID AND C.STATUSTYPE = ''Settlement'' LEFT JOIN GTT_HISTORYDATA2 D ON C.UCIFID = D.UCIFID WHERE A.FINALASSETCLASSALT_KEY > 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DEGREASON = POS_2, A.NPIDT = POS_3',79245);
