Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('ggz7kztg7brd2','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID, ''ALWYS_NPA'' FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTBASICDETAIL BB ON A.INVENTITYID = BB.INVENTITYID AND BB.EFFECTIVEFROMTIMEKEY <= :B1 AND BB.EFFECTIVETOTIMEKEY >= :B1 JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL CC ON CC.ISSUERENTITYID = BB.ISSUERENTITYID AND CC.EFFECTIVEFROMTIMEKEY <= :B1 AND CC.EFFECTIVETOTIMEKEY >= :B1 WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND NVL(UCIFID, '' '') IN ( ''RBL008827709'',''RBL003034380'',''RBL002980785'' ) ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ASSET_NORM = ''ALWYS_NPA''',79245);
