Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bwd3jbt5ta0aj','INSERT INTO TT_TEMPTABLE1_16 ( SELECT A.UCIF_ID , TOTALCOUNT FROM ( SELECT A.UCIF_ID , COUNT(1) TOTALCOUNT FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.UCIF_ID = B.UCIF_ID WHERE ( A.FLGPROCESSING = ''N'' ) AND A.UCIF_ID IS NOT NULL GROUP BY A.UCIF_ID ) A JOIN ( SELECT A.UCIF_ID , COUNT(1) TOTALDPD_MAXCOUNT FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.UCIF_ID = B.UCIF_ID WHERE ( B.DPD_INTSERVICE <= B.REFPERIODINTSERVICEUPG AND B.DPD_NOCREDIT <= B.REFPERIODNOCREDITUPG AND B.DPD_OVERDRAWN <= B.REFPERIODOVERDRAWNUPG AND B.DPD_OVERDUE <= B.REFPERIODOVERDUEUPG AND B.DPD_RENEWAL <= B.REFPERIODREVIEWUPG AND B.DPD_STOCKSTMT <= B.REFPERIODSTKSTATEMENTUPG ) AND B.FINALASSETCLASSALT_KEY NOT IN ( 1 ) AND ( A.FLGPROCESSING = ''N'' ) AND B.ASSET_NORM NOT IN ( ''ALWYS_NPA'',''ALWYS_STD'' ) AND NVL(A.MOCSTATUSMARK, ''N'') = ''N'' AND A.UCIF_ID IS NOT NULL GROUP BY A.UCIF_ID ) B ON A.UCIF_ID = B.UCIF_ID AND A.TOTALCOUNT = B.TOTALDPD_MAXCOUNT )',84097);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4xqnhr3xmub78','MERGE INTO MAIN_PRO.CUSTOMERCAL A USING ( SELECT A.ROWID ROW_ID, ''U'' FROM MAIN_PRO.CUSTOMERCAL A INNER JOIN GTT_NPA_SELLER B ON A.UCIFENTITYID=B.UCIFENTITYID INNER JOIN RBL_MISDB_PROD.DIMASSETCLASS C ON C.ASSETCLASSALT_KEY=A.SYSASSETCLASSALT_KEY AND (C.EFFECTIVEFROMTIMEKEY<=:B1 AND C.EFFECTIVETOTIMEKEY>=:B1 ) WHERE NVL(A.ASSET_NORM,''NORMAL'')<>''ALWYS_NPA'' AND C.ASSETCLASSGROUP =''NPA'' )SRC ON (A.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET A.FLGUPG = ''U''',84097);
