Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('9r0w153u367z3','SELECT ''SolutionGlobalHistory'' TABLENAME , A.PARAMETERALT_KEY , A.PARAMETERNAME , A.PARAMETERVALUEALT_KEY , B.PARAMETERNAME PARAMETERVALUE , A.PARAMETERNATUREALT_KEY , C.PARAMETERNAME NATURENAME , UTILS.CONVERT_TO_VARCHAR2(A.FROM_DATE,20,P_STYLE=>103) FROM_DATE , UTILS.CONVERT_TO_VARCHAR2(A.TO_DATE,20,P_STYLE=>103) TO_DATE , A.PARAMETERSTATUSALT_KEY , D.PARAMETERNAME STATUSNAME , A.CREATEDBY , UTILS.CONVERT_TO_VARCHAR2(A.DATECREATED,20,P_STYLE=>103) DATECREATED , A.APPROVEDBY , UTILS.CONVERT_TO_VARCHAR2(A.DATEAPPROVED,20,P_STYLE=>103) DATEAPPROVED , A.MODIFIEDBY , UTILS.CONVERT_TO_VARCHAR2(A.DATEMODIFIED,20,P_STYLE=>103) DATEMODIFIED FROM SOLUTIONGLOBALPARAMETER A JOIN ( SELECT PARAMETER_KEY , PARAMETERALT_KEY , PARAMETERNAME , ''Frequency'' TABLENAME FROM DIMPARAMETER WHERE EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 AND DIMPARAMETERNAME = ''Frequency'' ) B ON A.PARAMETERVALUEALT_KEY = B.PARAMETERALT_KEY JOIN ( SELECT PARAMETER_KEY , PARAMETERALT_KEY , PARAMETERNAME , ''Nature'' TABLENAME FROM DIMPARAMETER WHERE EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 AND DIMPARAMETERNAME = ''Nature'' ) C ON A.PARAMETERNATUREALT_KEY = C.PARAMETERALT_KEY JOIN ( SELECT PARAMETER_KEY , PARAMETERALT_KEY , PARAMETERNAME , ''ParameterStatus'' TABLENAME FROM DIMPARAMETER WHERE EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 AND DIMPARAMETERNAME = ''ParameterStatus'' ) D ON A.PARAMETERSTATUSALT_KEY = D.PARAMETERALT_KEY WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND A.PARAMETERALT_KEY IN ( 1,2,13 ) AND A.PARAMETERALT_KEY = :B2 UNION ALL SELECT ''SolutionGlobalHistory'' TABLENAME , A.PARAMETERALT_KEY , A.PARAMETERNAME , A.PARAMETERVALUEALT_KEY , B.PARAMETERNAME PARAMETERVALUE , A.PARAMETERNATUREALT_KEY , C.PARAMETERNAME NATURENAME , UTILS.CONVERT_TO_VARCHAR2(A.FROM_DATE,20,P_STYLE=>103) FROM_DATE , UTILS.CONVERT_TO_VARCHAR2(A.TO_DATE,20,P_STYLE=>10