Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('9x4g7kjxaw4j6','MERGE INTO GTT_CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, ''U'' FROM GTT_CUSTOMERCAL A JOIN GTT_TEMPTABLE B ON A.UCIF_ID = B.UCIF_ID JOIN RBL_MISDB_PROD.DIMASSETCLASS C ON C.ASSETCLASSALT_KEY = A.SYSASSETCLASSALT_KEY AND ( C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 ) WHERE ( NOT ( NVL(A.ASSET_NORM, ''NORMAL'') = ''ALWYS_NPA'' ) AND C.ASSETCLASSGROUP = ''NPA'' AND NOT ( NVL(A.FLGDEG, ''N'') = ''Y'' ) ) AND ( NVL(A.FLGPROCESSING, ''N'') = ''N'' )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGUPG = ''U''',84097);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('aqpbtygjvppus','INSERT INTO GTT_TEMPTABLEREFCUSTOMERID ( SELECT A.REFCUSTOMERID , TOTALCOUNT FROM ( SELECT A.REFCUSTOMERID , COUNT(1) TOTALCOUNT FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( A.FLGPROCESSING = ''N'' ) AND A.UCIF_ID IS NULL AND A.REFCUSTOMERID IS NOT NULL GROUP BY A.REFCUSTOMERID ) A JOIN ( SELECT A.REFCUSTOMERID , COUNT(1) TOTALDPD_MAXCOUNT FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( B.DPD_INTSERVICE <= B.REFPERIODINTSERVICEUPG AND B.DPD_NOCREDIT <= B.REFPERIODNOCREDITUPG AND B.DPD_OVERDRAWN <= B.REFPERIODOVERDRAWNUPG AND B.DPD_OVERDUE <= B.REFPERIODOVERDUEUPG AND B.DPD_RENEWAL <= B.REFPERIODREVIEWUPG AND B.DPD_STOCKSTMT <= B.REFPERIODSTKSTATEMENTUPG ) AND B.INITIALASSETCLASSALT_KEY NOT IN ( 1 ) AND ( A.FLGPROCESSING = ''N'' ) AND B.ASSET_NORM NOT IN ( ''ALWYS_NPA'',''ALWYS_STD'' ) AND NVL(A.MOCSTATUSMARK, ''N'') = ''N'' AND A.UCIF_ID IS NULL AND A.REFCUSTOMERID IS NOT NULL GROUP BY A.REFCUSTOMERID ) B ON A.REFCUSTOMERID = B.REFCUSTOMERID AND A.TOTALCOUNT = B.TOTALDPD_MAXCOUNT )',84097);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8czgycvq83v09','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING(SELECT A.ROWID ROW_ID FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A INNER JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL D ON A.REFISSUERID = D.ISSUERID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 INNER JOIN GTT_TEMPTABLE B ON D.UCIFID=B.UCIF_ID INNER JOIN RBL_MISDB_PROD.DIMASSETCLASS C ON C.ASSETCLASSALT_KEY=A.FINALASSETCLASSALT_KEY AND (C.EFFECTIVEFROMTIMEKEY<=:B1 AND C.EFFECTIVETOTIMEKEY>=:B1 ) WHERE (NOT(NVL(A.ASSET_NORM,''NORMAL'')=''ALWYS_NPA'' ) AND C.ASSETCLASSGROUP =''NPA'' AND NOT(NVL(A.FLGDEG,''N'')=''Y'')) )SRC ON (A.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET A.FLGUPG=''U''',84097);
