Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2rgdkup3fdbtp','MERGE INTO GTT_CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, ''U'' FROM GTT_CUSTOMERCAL A JOIN GTT_TEMPTABLEREFCUSTOMERID B ON A.REFCUSTOMERID = B.REFCUSTOMERID JOIN RBL_MISDB_PROD.DIMASSETCLASS C ON C.ASSETCLASSALT_KEY = A.SYSASSETCLASSALT_KEY AND ( C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 ) WHERE ( NOT ( NVL(A.ASSET_NORM, ''NORMAL'') = ''ALWYS_NPA'' ) AND C.ASSETCLASSGROUP = ''NPA'' AND NOT ( NVL(A.FLGDEG, ''N'') = ''Y'' ) ) AND ( NVL(A.FLGPROCESSING, ''N'') = ''N'' )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGUPG = ''U''',84097);
