Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('35cxkuj3gj6qa','INSERT INTO GTT_TEMPTABLE ( SELECT A.UCIF_ID , TOTALCOUNT FROM ( SELECT A.UCIF_ID ,COUNT(1) TOTALCOUNT FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.UCIF_ID = B.UCIF_ID WHERE ( A.FLGPROCESSING = ''N'' ) AND A.UCIF_ID IS NOT NULL AND B.ASSET_NORM NOT IN (''ALWYS_STD'') GROUP BY A.UCIF_ID UNION ALL SELECT B.UCIFID,COUNT(1) TOTALCOUNT FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A INNER JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL B ON A.REFISSUERID=B.ISSUERID AND A.EFFECTIVEFROMTIMEKEY<=:B1 AND A.EFFECTIVETOTIMEKEY>=:B1 AND B.EFFECTIVEFROMTIMEKEY<=:B1 AND B.EFFECTIVETOTIMEKEY>=:B1 AND A.ASSET_NORM NOT IN (''ALWYS_STD'') GROUP BY B.UCIFID UNION ALL SELECT A.UCIC_ID,COUNT(1) TOTALCOUNT FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A WHERE A.EFFECTIVEFROMTIMEKEY<=:B1 AND A.EFFECTIVETOTIMEKEY>=:B1 GROUP BY A.UCIC_ID ) A JOIN ( SELECT A.UCIF_ID , COUNT(1) TOTALDPD_MAXCOUNT FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.UCIF_ID = B.UCIF_ID WHERE ( B.DPD_INTSERVICE <= B.REFPERIODINTSERVICEUPG AND B.DPD_NOCREDIT <= B.REFPERIODNOCREDITUPG AND B.DPD_OVERDRAWN <= B.REFPERIODOVERDRAWNUPG AND B.DPD_OVERDUE <= B.REFPERIODOVERDUEUPG AND B.DPD_RENEWAL <= B.REFPERIODREVIEWUPG AND B.DPD_STOCKSTMT <= B.REFPERIODSTKSTATEMENTUPG ) AND B.INITIALASSETCLASSALT_KEY NOT IN ( 1 ) AND ( A.FLGPROCESSING = ''N'' ) AND B.ASSET_NORM NOT IN ( ''ALWYS_NPA'',''ALWYS_STD'' ) AND NVL(A.MOCSTATUSMARK, ''N'') = ''N'' AND A.UCIF_ID IS NOT NULL AND NVL(B.UNSERVIEDINT,0)=0 AND NVL(B.ACCOUNTSTATUS,''N'')<>''Z'' AND ( (FACILITYTYPE IN(''CC'',''OD'') AND NVL(INTOVERDUE,0)=0) OR (NVL(FACILITYTYPE,'''') NOT IN(''CC'',''OD''))) UNION ALL SELECT B.UCIFID,COUNT(1) TOTALDPD_MAXCOUNT FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A INNER JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL B ON A.REFISSUERID=B.ISSUERID AND A.EFFECTIVEFROMTIMEKEY<=:B1 AND A.EFFECTIVETOTIMEKEY>=:B1 AND B.EFFECTIVEFROMTIMEKEY<=:B1 AND B.EFFECTIVETOTIMEKEY>=:B1 WHERE ((NVL(A.DPD_DIVOVERDUE,0)<=0) AND (NVL(A.PARTIALREDUMPTIONDPD,0)<=0) AND NVL(DPD_BS_DATE,0)<:B2 AND NVL(FINALASSETCLASSALT_KEY,1)<>1 AND A.ASSET_NORM NOT IN (''ALWYS_STD'')) GROUP BY B.UCIFID UNION ALL SELECT A.UCIC_ID,COUNT(1) TOTALDPD_MAXCOUNT FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A WHERE A.EFFECTIVEFROMTIMEKEY<=:B1 AND A.EFFECTIVETOTIMEKEY>=:B1 AND ( NVL(A.DPD,0)<=0 AND NVL(FINALASSETCLASSALT_KEY,1)<>1) GROUP BY A.UCIC_ID ) B ON A.UCIF_ID = B.UCIF_ID AND A.TOTALCOUNT = B.TOTALDPD_MAXCOUNT )',84097);
