Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('6wut8bfjkbbgd','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL B USING (SELECT B.ROWID ROW_ID, CASE WHEN NVL(DPD, 0) < 0 THEN 0 ELSE NVL(DPD, 0) END AS POS_2, CASE WHEN NVL(DPD_MATURITY, 0) < 0 THEN 0 ELSE NVL(DPD_MATURITY, 0) END AS POS_3, CASE WHEN NVL(DPD_DIVOVERDUE, 0) < 0 THEN 0 ELSE NVL(DPD_DIVOVERDUE, 0) END AS POS_4, CASE WHEN NVL(PARTIALREDUMPTIONDPD, 0) < 0 THEN 0 ELSE NVL(PARTIALREDUMPTIONDPD, 0) END AS POS_5, CASE WHEN NVL(DPD_BS_DATE, 0) < 0 THEN 0 ELSE NVL(DPD_BS_DATE, 0) END AS POS_6 FROM CURDAT_RBL_MISDB_PROD.INVESTMENTBASICDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL C ON A.ISSUERENTITYID = C.ISSUERENTITYID AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL B ON A.INVENTITYID = B.INVENTITYID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 WHERE NVL(DPD, 0) < 0 OR NVL(DPD_MATURITY, 0) < 0 OR NVL(DPD_DIVOVERDUE, 0) < 0 OR B.DPD_BS_DATE < 0) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.DPD = POS_2, B.DPD_MATURITY = POS_3, B.DPD_DIVOVERDUE = POS_4, B.PARTIALREDUMPTIONDPD = POS_5, B.DPD_BS_DATE = POS_6',79245);
