Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3qggzfnvg3xhz','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN UTILS.DATEADD(''DAY'', :B4 , A.NPIDT) > :B2 THEN ( SELECT DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE DIMASSETCLASS.ASSETCLASSSHORTNAME = ''SUB'' AND DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) WHEN UTILS.DATEADD(''DAY'', :B4 , A.NPIDT) <= :B2 AND UTILS.DATEADD(''DAY'', :B4 + :B5 , A.NPIDT) > :B2 THEN ( SELECT DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE DIMASSETCLASS.ASSETCLASSSHORTNAME = ''DB1'' AND DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) WHEN UTILS.DATEADD(''DAY'', :B4 + :B5 , A.NPIDT) <= :B2 AND UTILS.DATEADD(''DAY'', :B4 + :B5 + :B3 , A.NPIDT) > :B2 THEN ( SELECT DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE DIMASSETCLASS.ASSETCLASSSHORTNAME = ''DB2'' AND DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) WHEN UTILS.DATEADD(''DAY'', (:B5 + :B4 + :B3 ), A.NPIDT) <= :B2 THEN ( SELECT DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE DIMASSETCLASS.ASSETCLASSSHORTNAME = ''DB3'' AND DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) END) AS FINALASSETCLASSALT_KEY FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A WHERE NVL(A.FLGDEG, ''N'') = ''Y'' AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALASSETCLASSALT_KEY = SRC.FINALASSETCLASSALT_KEY',79245);
