Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('90zzukuc375v4','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID, ''ALWYS_NPA'', ''Y'', ''NPA DUE TO Settlement marking '' AS POS_4, CASE WHEN STATUSDATE IS NOT NULL THEN STATUSDATE ELSE :B2 END AS POS_5, 2 FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL B ON A.REFISSUERID = B.ISSUERID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 JOIN RBL_MISDB_PROD.EXCEPTIONFINALSTATUSTYPE C ON C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 AND C.ACID = B.ISSUERID AND C.STATUSTYPE IN ( ''Settlement'' ) AND C.SOURCEALT_KEY = 7 WHERE A.FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ASSET_NORM = ''ALWYS_NPA'', A.FLGDEG = ''Y'', A.DEGREASON = POS_4, A.NPIDT = POS_5, A.FINALASSETCLASSALT_KEY = 2',79245);
