Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('awy5p1wtudw37','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL B USING (SELECT B.ROWID ROW_ID, (CASE WHEN B.PARTIALREDUMPTIONDUEDATE IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', B.PARTIALREDUMPTIONDUEDATE, :B2 ) + 1 ELSE 0 END) AS PARTIALREDUMPTIONDPD FROM CURDAT_RBL_MISDB_PROD.INVESTMENTBASICDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL C ON A.ISSUERENTITYID = C.ISSUERENTITYID AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL B ON A.INVENTITYID = B.INVENTITYID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 JOIN RBL_MISDB_PROD.DIMINSTRUMENTTYPE INS ON INS.EFFECTIVEFROMTIMEKEY <= :B1 AND INS.EFFECTIVETOTIMEKEY >= :B1 AND INS.INSTRUMENTTYPEALT_KEY = A.INSTRTYPEALT_KEY WHERE B.PARTIALREDUMPTIONDUEDATE IS NOT NULL AND PARTIALREDUMPTIONSETTLEDY_N = ''N'' AND NVL(INS.INSTRUMENTTYPESUBGROUP, '' '') IN ( ''BONDS'',''Preference Shares'',''CP'',''CD'',''PTC'' ) ) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET PARTIALREDUMPTIONDPD = SRC.PARTIALREDUMPTIONDPD',79245);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('a1krdg7j74n7v','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID, ''Y'', CONCAT(''NPA DUE TO Linkage By Issuerid='', D.ACID) AS POS_3, CASE WHEN C.STATUSDATE IS NOT NULL THEN C.STATUSDATE ELSE :B2 END AS POS_4 FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL B ON A.REFISSUERID = B.ISSUERID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 JOIN GTT_HISTORYDATA1 C ON B.UCIFID = C.UCIFID AND C.STATUSTYPE = ''Settlement'' LEFT JOIN GTT_HISTORYDATA2 D ON C.UCIFID = D.UCIFID WHERE A.FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGDEG = ''Y'', A.DEGREASON = POS_3, A.NPIDT = POS_4',79245);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('944y8u5fnj1d7','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET DPD_DIVOVERDUE = 0, DPD_MATURITY = 0, DPD = 0, FLGDEG = ''N'', FLGUPG = ''N'', DEGREASON = NULL, UPGDATE = NULL, PARTIALREDUMPTIONDPD = 0, DPD_BS_DATE = 0',79245);
