Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('amc1b3646yamv','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID, CONCAT(CONCAT(DEGREASON, '',NPA DUE TO Linkage By Invid=''), D.ACID) AS POS_2, CASE WHEN C.STATUSDATE < A.NPIDT THEN C.STATUSDATE ELSE A.NPIDT END AS POS_3 FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL B ON A.REFISSUERID = B.ISSUERID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 JOIN GTT_HISTORYDATA1 C ON B.UCIFID = C.UCIFID AND C.STATUSTYPE IN ( ''TWO'',''WO'',''WriteOff'' ) LEFT JOIN GTT_HISTORYDATA2 D ON C.UCIFID = D.UCIFID WHERE A.FINALASSETCLASSALT_KEY > 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DEGREASON = POS_2, A.NPIDT = POS_3',79245);
