Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0k9pmpsczr4nv','INSERT INTO GTT_HISTORYDATA ( SELECT DISTINCT A.ACID , A.STATUSTYPE , A.STATUSDATE , MAX(A.EFFECTIVEFROMTIMEKEY) EFFECTIVEFROMTIMEKEY FROM RBL_MISDB_PROD.EXCEPTIONFINALSTATUSTYPE A LEFT JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL B ON A.ACID = B.ISSUERID AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 WHERE B.ISSUERID IS NULL AND A.STATUSTYPE = ''Settlement'' AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 GROUP BY A.ACID,A.STATUSTYPE,A.STATUSDATE UNION SELECT DISTINCT A.ACID , A.STATUSTYPE , A.STATUSDATE , MAX(A.EFFECTIVEFROMTIMEKEY) EFFECTIVEFROMTIMEKEY FROM RBL_MISDB_PROD.EXCEPTIONFINALSTATUSTYPE A LEFT JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL B ON A.ACID = B.REFINVID AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 WHERE B.REFINVID IS NULL AND A.STATUSTYPE IN ( ''TWO'',''WO'',''WriteOff'' ) AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 GROUP BY A.ACID,A.STATUSTYPE,A.STATUSDATE )',79245);
