Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('1g2ghtfzczv9b','SELECT A.CUSTOMERID , A.CUSTOMERNAME , B.ASSETCLASSNAME ASSETCLASS , UTILS.CONVERT_TO_VARCHAR2(A.NPADATE,10,P_STYLE=>103) NPADATE , A.ADDITIONALPROVISION , A.SECURITYVALUE , D.MOCTYPENAME MOCSOURCE , C.PARAMETERNAME MOCTYPE , A.MOCREASON , UTILS.CONVERT_TO_VARCHAR2(A.MOCDATE,10,P_STYLE=>103) MOCDATE , A.MOCBY , A.CREATEDBY , A.DATECREATED , A.APPROVEDBYFIRSTLEVEL LEVEL1APPROVEDBY , A.DATEAPPROVEDFIRSTLEVEL LEVEL1APPROVEDDATE , A.APPROVEDBY LEVEL2APPROVEDBY , A.DATEAPPROVED LEVEL2APPROVEDDATE FROM CUSTOMERLEVELMOC_MOD A LEFT JOIN DIMASSETCLASS B ON A.ASSETCLASSALT_KEY = B.ASSETCLASSALT_KEY LEFT JOIN DIMMOCTYPE D ON A.MOCSOURCEALTKEY = D.MOCTYPEALT_KEY LEFT JOIN ( SELECT EFFECTIVEFROMTIMEKEY , EFFECTIVETOTIMEKEY , PARAMETERALT_KEY , PARAMETERNAME , ''MOCType'' TABLENAME FROM DIMPARAMETER WHERE DIMPARAMETERNAME = ''MOCType'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 ) C ON C.PARAMETERALT_KEY = A.MOCTYPEALT_KEY WHERE A.CUSTOMERID = :B2 AND A.AUTHORISATIONSTATUS IN ( ''A'' ) AND A.EFFECTIVEFROMTIMEKEY = :B1 ',80470);
