Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('g8jsyxvmzsry7','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL B USING (SELECT B.ROWID ROW_ID, CASE WHEN NVL(DPD_DIVOVERDUE, 0) >= NVL(DPD_MATURITY, 0) AND NVL(DPD_DIVOVERDUE, 0) >= NVL(PARTIALREDUMPTIONDPD, 0) AND NVL(DPD_DIVOVERDUE, 0) >= NVL(DPD_BS_DATE, 0) THEN NVL(DPD_DIVOVERDUE, 0) WHEN NVL(DPD_MATURITY, 0) >= NVL(DPD_DIVOVERDUE, 0) AND NVL(DPD_MATURITY, 0) >= NVL(PARTIALREDUMPTIONDPD, 0) AND NVL(DPD_MATURITY, 0) >= NVL(DPD_BS_DATE, 0) THEN NVL(DPD_MATURITY, 0) WHEN NVL(DPD_BS_DATE, 0) >= NVL(DPD_DIVOVERDUE, 0) AND NVL(DPD_BS_DATE, 0) >= NVL(PARTIALREDUMPTIONDPD, 0) AND NVL(DPD_BS_DATE, 0) >= NVL(DPD_MATURITY, 0) THEN NVL(DPD_BS_DATE, 0) ELSE NVL(PARTIALREDUMPTIONDPD, 0) END AS DPD FROM CURDAT_RBL_MISDB_PROD.INVESTMENTBASICDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL C ON A.ISSUERENTITYID = C.ISSUERENTITYID AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL B ON A.INVENTITYID = B.INVENTITYID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 JOIN RBL_MISDB_PROD.DIMINSTRUMENTTYPE INS ON INS.EFFECTIVEFROMTIMEKEY <= :B1 AND INS.EFFECTIVETOTIMEKEY >= :B1 AND INS.INSTRUMENTTYPEALT_KEY = A.INSTRTYPEALT_KEY ) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET DPD = SRC.DPD',79245);
