Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('12unhb9vg4aca','INSERT INTO MD_ADDITIONAL_PROPERTIES ( CONNECTION_ID_FK, REF_ID_FK, REF_TYPE, PROPERTY_ORDER, PROP_KEY, "VALUE" ) ( SELECT C.SVRID_FK, C.COLID_GEN, ''MD_COLUMNS'' , NULL, ''INCREMENT'', INCREMENT_VALUE FROM STAGE_SS2K5_COLUMNS C, STAGE_SS2K5_IDENTITY_COLUMNS I , STAGE_SS2K5_TABLES TABST WHERE TABST.SVRID_FK = :B1 AND TABST.OBJID_GEN = C.ID_GEN_FK AND C.ID_GEN_FK IS NOT NULL AND C.ID_GEN_FK != 0 AND C.SVRID_FK = :B1 AND I.SVRID_FK = :B1 AND C.DBID_GEN_FK = I.DBID_GEN_FK AND I.COLUMN_ID = C.COLUMN_ID AND I.OBJECT_ID = C.OBJECT_ID AND SEED_VALUE IS NOT NULL AND INCREMENT_VALUE IS NOT NULL AND EXISTS ( SELECT 1 FROM MD_TABLES T WHERE T.ID=C.ID_GEN_FK ) )',85233);
