Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('78xu9z93vxs46','SELECT R_C1.COLID_GEN MYCOLID, R_C1.ID_GEN_FK MYID, R_C1. "NAME" MYNAME, BASE_TYPE.BASE_NAME MYBASENAME, CASE WHEN ( ( R_C1. "PRECISION" = 0 ) OR ( R_C1. "PRECISION" IS NULL ) ) THEN SS2K5ALLPLATFORM.GETPRECISION(BASE_TYPE.BASE_NAME,R_C1. "MAX_LENGTH",R_C1. "SCALE") ELSE SS2K5ALLPLATFORM.GETPRECISION(BASE_TYPE.BASE_NAME,R_C1. "PRECISION",R_C1. "SCALE") END MYPRECISION, SS2K5ALLPLATFORM.GETNEWSCALE(BASE_TYPE.BASE_NAME, CASE WHEN ( ( R_C1. "PRECISION" = 0 ) OR ( R_C1. "PRECISION" IS NULL ) ) THEN R_C1. "MAX_LENGTH" ELSE R_C1. "PRECISION" END,R_C1. "SCALE") MYSCALE , CASE WHEN R_C1.IS_NULLABLE=1 THEN ''Y'' ELSE ''N'' END MYNULLABLE, DC.DEFINITION MYDEFINITION, P.VALUE COMMENTS FROM STAGE_SS2K5_COLUMNS R_C1 , STAGE_SS2K5_TABLES TABST, (SELECT (SELECT TT.NAME FROM STAGE_SS2K5_TYPES TT WHERE TT.USER_TYPE_ID = T.SYSTEM_TYPE_ID AND TT.SVRID_FK = :B1 AND TT.DBID_GEN_FK =T.DBID_GEN_FK ) BASE_NAME, T.USER_TYPE_ID T_USER_TYPE_ID, T.DBID_GEN_FK T_DBID_GEN_FK FROM STAGE_SS2K5_TYPES T WHERE T.SVRID_FK = :B1 ) BASE_TYPE, (SELECT * FROM STAGE_SS2K5_DT_CONSTRAINTS X WHERE X.OBJECT_ID != 0 AND X.OBJECT_ID IS NOT NULL AND X.SVRID_FK =:B1 ) DC, STAGE_SS2K5_SYSPROPERTIES P WHERE TABST.OBJID_GEN = R_C1.ID_GEN_FK AND BASE_TYPE.T_USER_TYPE_ID = R_C1.USER_TYPE_ID AND DC.OBJECT_ID (+) = R_C1.DEFAULT_OBJECT_ID AND ( ( DC.DBID_GEN_FK =R_C1.DBID_GEN_FK ) OR ( DC.DBID_GEN_FK IS NULL ) ) AND TABST.SVRID_FK = :B1 AND TABST.DBID_GEN_FK =R_C1.DBID_GEN_FK AND BASE_TYPE.T_DBID_GEN_FK =R_C1.DBID_GEN_FK AND R_C1.SVRID_FK = :B1 AND R_C1.ID_GEN_FK = :B2 AND P.CLASS(+) = 1 AND P.SVRID_FK(+) = :B1 AND P.MAJOR_ID(+) = R_C1.OBJECT_ID AND P.MINOR_ID(+) = R_C1.COLUMN_ID AND P.DBID_GEN_FK(+) = R_C1.DBID_GEN_FK ORDER BY R_C1.COLUMN_ID',85233);
