Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2np1as0v23g5n','SELECT I.OBJECT_ID_GEN , I. "OBJECT_ID" MYTABLEID, I. "INDEX_ID" MYINDEXID, I. "NAME" MYINDEXNAME, I. "IS_UNIQUE" MYISUNIQUE, O. "NAME" MYTABLENAME, LT.OBJID_GEN MYGENTABLEID, P.VALUE COMMENTS, I.DBID_GEN_FK DBIDGENFK FROM STAGE_SS2K5_INDEXES I, STAGE_SS2K5_OBJECTS O, STAGE_SS2K5_TABLES LT, STAGE_SS2K5_SYSPROPERTIES P WHERE O.TYPE IN (''U'', ''V'', ''U '', ''V '') AND O. "OBJECT_ID" = I. "OBJECT_ID" AND I.NAME NOT LIKE ''_WA_Sys%'' AND I.IS_PRIMARY_KEY = 0 AND EXISTS (SELECT 1 FROM MD_TABLES MDT WHERE MDT.ID=LT.OBJID_GEN ) AND LT.OBJECT_ID = O.OBJECT_ID AND I.SVRID_FK = :B1 AND O.SVRID_FK = :B1 AND LT.SVRID_FK = :B1 AND I.DBID_GEN_FK = O.DBID_GEN_FK AND O.DBID_GEN_FK = LT.DBID_GEN_FK AND P.CLASS(+) = 7 AND P.SVRID_FK(+) = :B1 AND P.MAJOR_ID(+) = I.OBJECT_ID AND P.MINOR_ID(+) = I.INDEX_ID AND P.DBID_GEN_FK(+) = I.DBID_GEN_FK AND LT.NAME NOT IN (''sysdiagrams'')',85233);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7tp2ykd001srd','INSERT INTO MD_TRIGGERS ( "ID", TABLE_OR_VIEW_ID_FK, TRIGGER_ON_FLAG, TRIGGER_NAME, NATIVE_SQL, "LANGUAGE", COMMENTS ) (SELECT A.OBJID_GEN, ( CASE WHEN (V.TYPE = ''V'') THEN V.OBJID_GEN ELSE (SELECT T.OBJID_GEN FROM STAGE_SS2K5_TABLES T WHERE T.OBJECT_ID = A.PARENT_OBJECT_ID AND T.SVRID_FK = :B1 AND T.DBID_GEN_FK = A.DBID_GEN_FK ) END), CASE WHEN (V.TYPE = ''V'') THEN ''V'' ELSE ''T'' END, A. "NAME", B.DEFINITION, ''MSTSQL'', P.VALUE COMMENTS FROM STAGE_SS2K5_OBJECTS A, STAGE_SS2K5_SQL_MODULES B, STAGE_SS2K5_OBJECTS V, STAGE_SS2K5_SYSPROPERTIES P WHERE A. "TYPE" =''TR'' AND V.OBJECT_ID = A.PARENT_OBJECT_ID AND A. "OBJECT_ID" = B. "OBJECT_ID" AND A.IS_MS_SHIPPED=0 AND ((EXISTS (SELECT 1 FROM MD_VIEWS V WHERE V.ID = V.OBJID_GEN )) OR (EXISTS (SELECT 1 FROM MD_TABLES TT, STAGE_SS2K5_TABLES TS WHERE TT.ID = TS.OBJID_GEN AND TS.OBJECT_ID = V.OBJECT_ID AND A.DBID_GEN_FK = TS.DBID_GEN_FK AND TS.SVRID_FK = :B1 AND TS.NAME NOT IN (''sysdiagrams'') ) ) ) AND A.SVRID_FK = :B1 AND B.SVRID_FK = :B1 AND V.SVRID_FK = :B1 AND A.DBID_GEN_FK = B.DBID_GEN_FK AND V.DBID_GEN_FK = B.DBID_GEN_FK AND P.CLASS(+) = 1 AND P.SVRID_FK(+) = :B1 AND P.MAJOR_ID(+) = A.OBJECT_ID AND P.MINOR_ID(+) = 0 AND P.DBID_GEN_FK(+) = A.DBID_GEN_FK ) ',85233);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('6jdrnzc98sta0','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL B USING (SELECT B.ROWID ROW_ID, CONCAT(CONCAT(DEGREASON, CASE WHEN DPD_DIVOVERDUE >= 91 THEN '','' ELSE '' '' END), ''DEGRADE BY Partial Redumption Due Date'') AS DEGREASON FROM CURDAT_RBL_MISDB_PROD.INVESTMENTBASICDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL C ON A.ISSUERENTITYID = C.ISSUERENTITYID AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL B ON A.INVENTITYID = B.INVENTITYID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 WHERE B.INTEREST_DIVIDENDDUEDATE IS NOT NULL AND NVL(B.FINALASSETCLASSALT_KEY, 1) = 1 AND ( NVL(PARTIALREDUMPTIONDPD, 0) >= 91 ) AND FLGDEG = ''Y'') SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.DEGREASON = SRC.DEGREASON',79245);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('205tfa8wnq5xp','MERGE INTO RBL_MISDB_PROD.CALYPSOINVMOC_CHANGEDETAILS A USING (SELECT A.ROWID ROW_ID, :B1 FROM RBL_MISDB_PROD.CALYPSOINVMOC_CHANGEDETAILS A WHERE EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 AND A.MOCTYPE = ''AUTO'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET EFFECTIVETOTIMEKEY = V_TIMEKEY',79245);
