Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bdyu7qmyunzwj','MERGE INTO RBL_MISDB_PROD.EXCEPTIONFINALSTATUSTYPE C USING (SELECT C.ROWID ROW_ID, :B1 FROM ( SELECT REFINVID FROM GTT_ADHOC_UCICID_STD A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL B ON A.UCICID = B.UCIFID JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL C ON B.ISSUERID = C.REFISSUERID GROUP BY REFINVID ) A JOIN RBL_MISDB_PROD.EXCEPTIONFINALSTATUSTYPE C ON A.REFINVID = C.ACID AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 AND C.STATUSTYPE IN ( ''TWO'',''WO'' ) AND SOURCEALT_KEY = 7 ) SRC ON ( C.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET C.EFFECTIVETOTIMEKEY = V_TIMEKEY ',79245);
