Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fprjyn91ssrky','SELECT MIGRATION_REPORT.GETCAPTURESTATUS(MD_TRIGGERS.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_TRIGGERS.ID,:B2 ) CONVERTSTATUS, MIGRATION_REPORT.GETGENERATESTATUS(MD_TRIGGERS.ID,:B2 ) GENERATESTATUS FROM MD_TRIGGERS, MD_TABLES,MD_SCHEMAS,MD_CATALOGS WHERE MD_TRIGGERS.TABLE_OR_VIEW_ID_FK=MD_TABLES.ID AND MD_TABLES.SCHEMA_ID_FK=MD_SCHEMAS.ID AND MD_SCHEMAS.CATALOG_ID_FK= MD_CATALOGS.ID AND MD_CATALOGS.CONNECTION_ID_FK=:B1 UNION ALL SELECT MIGRATION_REPORT.GETCAPTURESTATUS(MD_TRIGGERS.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_TRIGGERS.ID,:B2 ) CONVERTSTATUS, MIGRATION_REPORT.GETGENERATESTATUS(MD_TRIGGERS.ID,:B2 ) GENERATESTATUS FROM MD_TRIGGERS, MD_VIEWS,MD_SCHEMAS,MD_CATALOGS WHERE MD_TRIGGERS.TABLE_OR_VIEW_ID_FK=MD_VIEWS.ID AND MD_VIEWS.SCHEMA_ID_FK=MD_SCHEMAS.ID AND MD_SCHEMAS.CATALOG_ID_FK= MD_CATALOGS.ID AND MD_CATALOGS.CONNECTION_ID_FK=:B1 ',85024);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cfhckjfrq8vhf','SELECT ALLOBJS.OBJID CAPTURED_ID, ALLOBJS.OBJNAME CAPTURED_NAME, MD.NEW_IDENTIFIER CONVERTED_NAME, ALLOBJS.OBJTYPE CAPTURED_TYPE, DECODE(MD.DERIVED_TYPE,''MD_INDEXES'', SUBSTR(MD.DERIVED_TYPE,4, LENGTH(MD.DERIVED_TYPE)-5),SUBSTR(MD.DERIVED_TYPE,4, LENGTH(MD.DERIVED_TYPE)-4)) CONVERTED_TYPE, ALLOBJS.CAPTURESTATUS CAPTURE_STATUS, ALLOBJS.CONVERTSTATUS CONVERT_STATUS, ALLOBJS.GENERATESTATUS GENERATE_STATUS, DECODE(MLOG.LOGTEXT,NULL,'' '',MLOG.LOGTEXT) LOGTEXT FROM ( SELECT MD_SCHEMAS.ID OBJID,MD_SCHEMAS.NAME OBJNAME,''SCHEMA'' OBJTYPE, MIGRATION_REPORT.GETCAPTURESTATUS(MD_SCHEMAS.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_SCHEMAS.ID,:B2 ) CONVERTSTATUS, MIGRATION_REPORT.GETGENERATESTATUS(MD_SCHEMAS.ID,:B2 ) GENERATESTATUS FROM MD_SCHEMAS,MD_CATALOGS WHERE MD_SCHEMAS.CATALOG_ID_FK= MD_CATALOGS.ID AND MD_CATALOGS.CONNECTION_ID_FK=:B1 UNION ALL SELECT MD_TABLES.ID OBJID,MD_TABLES.TABLE_NAME OBJNAME,''TABLE'' OBJTYPE, MIGRATION_REPORT.GETCAPTURESTATUS(MD_TABLES.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_TABLES.ID,:B2 ) CONVERTSTATUS, MIGRATION_REPORT.GETGENERATESTATUS(MD_TABLES.ID,:B2 ) GENERATESTATUS FROM MD_TABLES,MD_SCHEMAS,MD_CATALOGS WHERE MD_TABLES.SCHEMA_ID_FK=MD_SCHEMAS.ID AND MD_SCHEMAS.CATALOG_ID_FK= MD_CATALOGS.ID AND MD_CATALOGS.CONNECTION_ID_FK=:B1 UNION ALL SELECT MD_VIEWS.ID OBJID,MD_VIEWS.VIEW_NAME OBJNAME,''View'' OBJTYPE, MIGRATION_REPORT.GETCAPTURESTATUS(MD_VIEWS.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_VIEWS.ID,:B2 ) CONVERTSTATUS, MIGRATION_REPORT.GETGENERATESTATUS(MD_VIEWS.ID,:B2 ) GENERATESTATUS FROM MD_VIEWS,MD_SCHEMAS,MD_CATALOGS WHERE MD_VIEWS.SCHEMA_ID_FK=MD_SCHEMAS.ID AND MD_SCHEMAS.CATALOG_ID_FK= MD_CATALOGS.ID AND MD_CATALOGS.CONNECTION_ID_FK=:B1 UNION ALL SELECT MD_STORED_PROGRAMS.ID OBJID,MD_STORED_PROGRAMS.NAME OBJNAME,''STORED_PROGRAM'' OBJTYPE, MIGRATION_REPORT.GETCAPTURESTATUS(MD_STORED_PROGRAMS.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_STORED_PROGRAMS.ID,:B2 ) CONVERTSTATUS, MIGRATION_REPORT.GETGENERATESTATUS(MD_STORED_PROGRAMS.ID,:B2 ) GENERATESTATUS FROM MD_STORED_PROGRAMS,MD_SCHEMAS,MD_CATALOGS WHERE MD_STORED_PROGRAMS.SCHEMA_ID_FK=MD_SCHEMAS.ID AND MD_SCHEMAS.CATALOG_ID_FK= MD_CATALOGS.ID AND MD_CATALOGS.CONNECTION_ID_FK=:B1 UNION ALL SELECT MD_INDEXES.ID OBJID,MD_INDEXES.INDEX_NAME OBJNAME,''INDEX'' OBJTYPE, MIGRATION_REPORT.GETCAPTURESTATUS(MD_INDEXES.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_INDEXES.ID,:B2 ) CONVERTSTATUS, MIGRATION_REPORT.GETGENERATESTATUS(MD_INDEXES.ID,:B2 ) GENERATESTATUS FROM MD_INDEXES, MD_TABLES,MD_SCHEMAS,MD_CATALOGS WHERE MD_INDEXES.TABLE_ID_FK= MD_TABLES.ID AND MD_TABLES.SCHEMA_ID_FK=MD_SCHEMAS.ID AND MD_SCHEMAS.CATALOG_ID_FK= MD_CATALOGS.ID AND MD_CATALOGS.CONNECTION_ID_FK=:B1 UNION ALL SELECT MD_CONSTRAINTS.ID OBJID,MD_CONSTRAINTS.NAME OBJNAME,''CONSTRAINT'' OBJTYPE, MIGRATION_REPORT.GETCAPTURESTATUS(MD_CONSTRAINTS.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_CONSTRAINTS.ID,:B2 ) CONVERTSTATUS, MIGRATION_REPORT.GETGENERATESTATUS(MD_CONSTRAINTS.ID,:B2 ) GENERATESTATUS FROM MD_CONSTRAINTS, MD_TABLES,MD_SCHEMAS,MD_CATALOGS WHERE MD_CONSTRAINTS.TABLE_ID_FK= MD_TABLES.ID AND MD_TABLES.SCHEMA_ID_FK=MD_SCHEMAS.ID AND MD_SCHEMAS.CATALOG_ID_FK= MD_CATALOGS.ID AND MD_CATALOGS.CONNECTION_ID_FK=:B1 UNION ALL SELECT MD_TRIGGERS.ID OBJID,MD_TRIGGERS.TRIGGER_NAME OBJNAME,''TRIGGER'' OBJTYPE, MIGRATION_REPORT.GETCAPTURESTATUS(MD_TRIGGERS.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_TRIGGERS.ID,:B2 ) CONVERTSTATUS, MIGRATION_REPORT.GETGENERATESTATUS(MD_TRIGGERS.ID,:B2 ) GENERATESTATUS FROM MD_TRIGGERS, MD_TABLES,MD_SCHEMAS,MD_CATALOGS WHERE MD_TRIGGERS.TABLE_OR_VIEW_ID_FK=MD_TABLES.ID AND MD_TABLES.SCHEMA_ID_FK=MD_SCHEMAS.ID AND MD_SCHEMAS.CATALOG_ID_FK= MD_CATALOGS.ID AND MD_CATALOGS.CONNECTION_ID_FK=:B1 UNION ALL SELECT MD_TRIGGERS.ID OBJID,MD_TRIGGERS.TRIGGER_NAME OBJNAME,''TRIGGER'' OBJTYPE, MIGRATION_REPORT.GETCAPTURESTATUS(MD_TRIGGERS.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_TRIGGERS.ID,:B',85024);
