Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2ay7xbbf1y8g5','SELECT (SELECT COUNT(1) FROM MD_TABLES MDT2 WHERE MDT2.ID=RT.OBJID_GEN ) ONEIFRTCAPTURED, FK.NAME FK_NAME, FKC.CONSTRAINT_OBJECT_ID FKC_CONSTRAINT_OBJECT_ID, LC.NAME LC_NAME, (SELECT S.NAME FROM STAGE_SS2K5_SCHEMAS S WHERE S.SCHEMA_ID = RT.SCHEMA_ID AND S.SVRID_FK = :B2 AND S.DBID_GEN_FK = FK.DBID_GEN_FK AND S.DBID_GEN_FK = :B1 ) SCHEMANAME, RT.NAME REFTABLENAME, RC.NAME REFCOLUMNNAME, FKC.CONSTRAINT_COLUMN_ID FKC_CONSTRAINT_COLUMN_ID , LC.COLID_GEN LC_COLID_GEN, RC.COLID_GEN RC_COLID_GEN, LT.OBJID_GEN LT_OBJID_GEN, RT.OBJID_GEN RT_OBJID_GEN FROM STAGE_SS2K5_FN_KEYS FK, STAGE_SS2K5_FN_KEY_COLUMNS FKC, STAGE_SS2K5_COLUMNS LC, STAGE_SS2K5_COLUMNS RC, STAGE_SS2K5_TABLES RT, STAGE_SS2K5_TABLES LT WHERE FK.OBJECT_ID = :B3 AND FK.OBJECT_ID = FKC.CONSTRAINT_OBJECT_ID AND LC.OBJECT_ID = FKC.PARENT_OBJECT_ID AND LC.COLUMN_ID = FKC.PARENT_COLUMN_ID AND RC.OBJECT_ID = FKC.REFERENCED_OBJECT_ID AND RC.COLUMN_ID = FKC.REFERENCED_COLUMN_ID AND FKC.REFERENCED_OBJECT_ID = RT.OBJECT_ID AND FKC.PARENT_OBJECT_ID = LT.OBJECT_ID AND FK.SVRID_FK = :B2 AND FKC.SVRID_FK = :B2 AND LC.SVRID_FK = :B2 AND RC.SVRID_FK = :B2 AND RT.SVRID_FK = :B2 AND LT.SVRID_FK = :B2 AND FKC.DBID_GEN_FK = FK.DBID_GEN_FK AND LC.DBID_GEN_FK = FK.DBID_GEN_FK AND RC.DBID_GEN_FK = FK.DBID_GEN_FK AND RT.DBID_GEN_FK = FK.DBID_GEN_FK AND LT.DBID_GEN_FK = FK.DBID_GEN_FK AND FK.DBID_GEN_FK = :B1 AND EXISTS (SELECT 1 FROM MD_TABLES MDT WHERE MDT.ID=LT.OBJID_GEN ) ORDER BY FKC.CONSTRAINT_COLUMN_ID ',85233);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bj5cgv7u76uc1','INSERT INTO MD_ADDITIONAL_PROPERTIES ( CONNECTION_ID_FK, REF_ID_FK, REF_TYPE, PROPERTY_ORDER, PROP_KEY, "VALUE" ) (SELECT C.SVRID_FK, C.COLID_GEN, ''MD_COLUMNS'' , NULL, :B2 , ''Y'' FROM STAGE_SS2K5_COLUMNS C, STAGE_SS2K5_DT_CONSTRAINTS DC WHERE C.SVRID_FK = :B1 AND DC.SVRID_FK = :B1 AND DC.DBID_GEN_FK = C.DBID_GEN_FK AND C.DEFAULT_OBJECT_ID = DC.OBJECT_ID AND SS2K5ALLPLATFORM.AMINEWID(DC.DEFINITION) = 1 AND EXISTS ( SELECT 1 FROM MD_TABLES WHERE ID=C.ID_GEN_FK ) )',85233);
