Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7g37rp6t0826j','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID, UTILS.DATEADD(''DAY'', NVL(91, 0), UTILS.DATEADD(''DAY'', -NVL(DPD, 0), :B2 )) AS NPIDT FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A WHERE NVL(A.FLGDEG, ''N'') = ''Y'' AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND DEGREASON NOT LIKE ''%NPA due to overdue Balance Sheet Date%'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET NPIDT = SRC.NPIDT',79245);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('f22cvs070cucu','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID, ''ALWYS_NPA'', CONCAT(A.DEGREASON, '',NPA DUE TO Settlement marking '') AS POS_3, CASE WHEN STATUSDATE < A.NPIDT THEN STATUSDATE ELSE A.NPIDT END AS POS_4 FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL B ON A.REFISSUERID = B.ISSUERID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 JOIN RBL_MISDB_PROD.EXCEPTIONFINALSTATUSTYPE C ON C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 AND C.ACID = B.ISSUERID AND C.STATUSTYPE IN ( ''Settlement'' ) AND C.SOURCEALT_KEY = 7 WHERE A.FINALASSETCLASSALT_KEY > 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ASSET_NORM = ''ALWYS_NPA'', A.DEGREASON = POS_3, A.NPIDT = POS_4',79245);
