Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('02v16fkvk8nu4','MERGE INTO RBL_MISDB_PROD.ADVACBASICDETAIL O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVACBASICDETAIL O JOIN RBL_TEMPDB.TEMPADVACBASICDETAIL T ON O.ACCOUNTENTITYID = T.ACCOUNTENTITYID AND O.SOURCEALT_KEY = T.SOURCEALT_KEY AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.BRANCHCODE, 0) <> NVL(T.BRANCHCODE, 0) OR NVL(O.GLALT_KEY, 0) <> NVL(T.GLALT_KEY, 0) OR NVL(O.PRODUCTALT_KEY, 0) <> NVL(T.PRODUCTALT_KEY, 0) OR NVL(O.GLPRODUCTALT_KEY, 0) <> NVL(T.GLPRODUCTALT_KEY, 0) OR NVL(O.FACILITYTYPE, 0) <> NVL(T.FACILITYTYPE, 0) OR NVL(O.SUBSECTORALT_KEY, 0) <> NVL(T.SUBSECTORALT_KEY, 0) OR NVL(O.ACTIVITYALT_KEY, 0) <> NVL(T.ACTIVITYALT_KEY, 0) OR NVL(O.INDUSTRYALT_KEY, 0) <> NVL(T.INDUSTRYALT_KEY, 0) OR NVL(O.SCHEMEALT_KEY, 0) <> NVL(T.SCHEMEALT_KEY, 0) OR NVL(O.DISTRICTALT_KEY, 0) <> NVL(T.DISTRICTALT_KEY, 0) OR NVL(O.AREAALT_KEY, 0) <> NVL(T.AREAALT_KEY, 0) OR NVL(O.VILLAGEALT_KEY, 0) <> NVL(T.VILLAGEALT_KEY, 0) OR NVL(O.STATEALT_KEY, 0) <> NVL(T.STATEALT_KEY, 0) OR NVL(O.CURRENCYALT_KEY, 0) <> NVL(T.CURRENCYALT_KEY, 0) OR NVL(O.ORIGINALSANCTIONAUTHALT_KEY, 0) <> NVL(T.ORIGINALSANCTIONAUTHALT_KEY, 0) OR NVL(O.ORIGINALLIMITREFNO, 0) <> NVL(T.ORIGINALLIMITREFNO, 0) OR NVL(O.ORIGINALLIMIT, 0) <> NVL(T.ORIGINALLIMIT, 0) OR NVL(O.ORIGINALLIMITDT, ''1990-01-01'') <> NVL(T.ORIGINALLIMITDT, ''1990-01-01'') OR NVL(O.DTOFFIRSTDISB, ''1990-01-01'') <> NVL(T.DTOFFIRSTDISB, ''1990-01-01'') OR NVL(O.ADJDT, ''1990-01-01'') <> NVL(T.ADJDT, ''1990-01-01'') OR NVL(O.MARGINTYPE, 0) <> NVL(T.MARGINTYPE, 0) OR NVL(O.CURRENTLIMITREFNO, 0) <> NVL(T.CURRENTLIMITREFNO, 0) OR NVL(O.ACCOUNTNAME, 0) <> NVL(T.ACCOUNTNAME, 0) OR NVL(O.LASTDISBDT, ''1990-01-01'') <> NVL(T.LASTDISBDT, ''1990-01-01'') OR NVL(O.AC_LADDT, ''1990-01-01'') <> NVL(T.AC_LADDT, ''1990-01-01'') OR NVL(O.AC_DOCUMENTDT, ''1990-01-01'') <> NVL(T.AC_DOCUMENTDT, ''1990-01-01'') OR NVL(O.CURRENTLIMIT, 0) <> NVL(T.CURRENTLIMIT, 0) OR NVL(O.INTTTYPEALT_KEY, 0) <> NVL(T.INTTTYPEALT_KEY, 0) OR NVL(O.CURRENTLIMITDT, ''1990-01-01'') <> NVL(T.CURRENTLIMITDT, ''1990-01-01'') OR NVL(O.AC_DUEDT, ''1990-01-01'') <> NVL(T.AC_DUEDT, ''1990-01-01'') OR NVL(O.DRAWINGPOWERALT_KEY, 0) <> NVL(T.DRAWINGPOWERALT_KEY, 0) OR NVL(O.REFCUSTOMERID, ''AA'') <> NVL(T.REFCUSTOMERID, ''AA'') OR NVL(O.FINCALEBASEDINDUSTRYALT_KEY, 0) <> NVL(T.FINCALEBASEDINDUSTRYALT_KEY, 0) OR NVL(O.ISLAD, 0) <> NVL(T.ISLAD, 0) OR NVL(O.ISLAD, 0) <> NVL(T.ISLAD, 0) OR NVL(O.SEGMENTCODE, 0) <> NVL(T.SEGMENTCODE, 0) OR NVL(O.REFERENCEPERIOD, 0) <> NVL(T.REFERENCEPERIOD, 0) OR NVL(O.FLGSECURED, 0) <> NVL(T.FLGSECURED, 0) )) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, O.DATEMODIFIED = POS_3, O.MODIFIEDBY = ''SSISUSER''',79642);
