Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bm95uyv5w7jzz','MERGE INTO RBL_MISDB_PROD.ADVACFINANCIALDETAIL O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVACFINANCIALDETAIL O JOIN RBL_TEMPDB.TEMPADVACFINANCIALDETAIL T ON O.ACCOUNTENTITYID = T.ACCOUNTENTITYID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.AC_LASTREVIEWDUEDT, ''1990-01-01'') <> NVL(T.AC_LASTREVIEWDUEDT, ''1990-01-01'') OR NVL(O.AC_REVIEWTYPEALT_KEY, 0) <> NVL(T.AC_REVIEWTYPEALT_KEY, 0) OR NVL(O.AC_REVIEWDT, ''1990-01-01'') <> NVL(T.AC_REVIEWDT, ''1990-01-01'') OR NVL(O.AC_REVIEWAUTHALT_KEY, 0) <> NVL(T.AC_REVIEWAUTHALT_KEY, 0) OR NVL(O.AC_NEXTREVIEWDUEDT, ''1990-01-01'') <> NVL(T.AC_NEXTREVIEWDUEDT, ''1990-01-01'') OR NVL(O.DRAWINGPOWER, 0) <> NVL(T.DRAWINGPOWER, 0) OR NVL(O.INTTRATE, 0) <> NVL(T.INTTRATE, 0) OR NVL(O.UNADJSUBSIDY, 0) <> NVL(T.UNADJSUBSIDY, 0) OR NVL(O.LASTINTTREALISEDT, ''1990-01-01'') <> NVL(T.LASTINTTREALISEDT, ''1990-01-01'') OR NVL(O.LIMITDISBURSED, 0) <> NVL(T.LIMITDISBURSED, 0) OR NVL(O.CROPDURATION, 0) <> NVL(T.CROPDURATION, 0) OR NVL(O.REFCUSTOMERID, ''AA'') <> NVL(T.REFCUSTOMERID, ''AA'') )) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, O.DATEMODIFIED = POS_3, O.MODIFIEDBY = ''SSISUSER''',79644);
