Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('6apz2njzf8qw4','MERGE INTO GTT_CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, ( SELECT DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE DIMASSETCLASS.ASSETCLASSSHORTNAME = ''LOS'' AND DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 FETCH FIRST 1 ROWS ONLY ) AS SYSASSETCLASSALT_KEY FROM GTT_CUSTOMERCAL A WHERE ( NVL(A.SPLCATG1ALT_KEY, 0) = 870 OR NVL(A.SPLCATG2ALT_KEY, 0) = 870 OR NVL(A.SPLCATG3ALT_KEY, 0) = 870 OR NVL(A.SPLCATG4ALT_KEY, 0) = 870 ) AND NVL(A.FLGDEG, ''N'') = ''Y'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SYSASSETCLASSALT_KEY = SRC.SYSASSETCLASSALT_KEY',79251);
