Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0q00qpba5bfmf','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, B.SYSASSETCLASSALT_KEY FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( NVL(B.FLGDEG, ''N'') = ''Y'' AND NVL(B.FLGPROCESSING, ''N'') = ''N'' ) AND ( NVL(A.ASSET_NORM, ''NORMAL'') = ''NORMAL'' AND NVL(A.FLGDEG, ''N'') = ''Y'' )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALASSETCLASSALT_KEY = SRC.SYSASSETCLASSALT_KEY',79251);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('f3uyxvz4q9h38','MERGE INTO GTT_CUSTOMERCAL B USING (SELECT B.ROWID ROW_ID, NULL FROM GTT_CUSTOMERWISEBALANCE A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( NVL(B.FLGDEG, ''N'') = ''Y'' AND NVL(B.FLGPROCESSING, ''N'') = ''N'' ) AND SYSASSETCLASSALT_KEY IN ( SELECT ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE ASSETCLASSSHORTNAME = ''LOS'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 ) ) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET DBTDT = NULL',79251);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4pzzc70y06z21','INSERT INTO RBL_MISDB_PROD.ADVACFINANCIALDETAIL ( ENTITYKEY, ACCOUNTENTITYID, AC_LASTREVIEWDUEDT, AC_REVIEWTYPEALT_KEY, AC_REVIEWDT, AC_REVIEWAUTHALT_KEY, AC_NEXTREVIEWDUEDT, DRAWINGPOWER, INTTRATE, NPADT, BOOKDEBTS, UNDRAWNAMT, UNADJSUBSIDY, LASTINTTREALISEDT, MOCSTATUS, MOCREASON, LIMITDISBURSED, REFCUSTOMERID, REFSYSTEMACID, AUTHORISATIONSTATUS, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, CREATEDBY, DATECREATED, MODIFIEDBY, DATEMODIFIED, APPROVEDBY, DATEAPPROVED, D2KTIMESTAMP, MOCDATE, MOCTYPEALT_KEY, CROPDURATION, AC_REVIEWAUTHLEVELALT_KEY , ACCOUNTBLKCODE2 ) ( SELECT ENTITYKEY , ACCOUNTENTITYID , AC_LASTREVIEWDUEDT , AC_REVIEWTYPEALT_KEY , AC_REVIEWDT , AC_REVIEWAUTHALT_KEY , AC_NEXTREVIEWDUEDT , DRAWINGPOWER , INTTRATE , NPADT , BOOKDEBTS , UNDRAWNAMT , UNADJSUBSIDY , LASTINTTREALISEDT , MOCSTATUS , MOCREASON , LIMITDISBURSED , REFCUSTOMERID , REFSYSTEMACID , AUTHORISATIONSTATUS , EFFECTIVEFROMTIMEKEY , EFFECTIVETOTIMEKEY , CREATEDBY , DATECREATED , MODIFIEDBY , DATEMODIFIED , APPROVEDBY , DATEAPPROVED , SYSDATE D2KTIMESTAMP , MOCDATE , MOCTYPEALT_KEY , CROPDURATION , AC_REVIEWAUTHLEVELALT_KEY , ACCOUNTBLKCODE2 FROM RBL_TEMPDB.TEMPADVACFINANCIALDETAIL T WHERE NVL(T.ISCHANGED, ''U'') IN ( ''N'',''C'' ) )',79644);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('6wts5dh71pngg','MERGE INTO RBL_TEMPDB.TEMPADVACFINANCIALDETAIL T USING (SELECT T.ROWID ROW_ID, BAL.NPADT FROM RBL_TEMPDB.TEMPADVACFINANCIALDETAIL T JOIN RBL_MISDB_PROD.ADVACFINANCIALDETAIL BAL ON ( BAL.EFFECTIVETOTIMEKEY = 49999 ) AND T.ACCOUNTENTITYID = BAL.ACCOUNTENTITYID WHERE ( NVL(T.NPADT, ''1900-01-01'') <> NVL(BAL.NPADT, ''1900-01-01'') )) SRC ON ( T.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET T.NPADT = SRC.NPADT',79644);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('280m7j020ng9x','MERGE INTO RBL_MISDB_PROD.ADVACFINANCIALDETAIL AA USING (SELECT AA.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVACFINANCIALDETAIL AA WHERE AA.EFFECTIVETOTIMEKEY = 49999 AND NOT EXISTS ( SELECT 1 FROM RBL_TEMPDB.TEMPADVACFINANCIALDETAIL BB WHERE AA.ACCOUNTENTITYID = BB.ACCOUNTENTITYID AND BB.EFFECTIVETOTIMEKEY = 49999 )) SRC ON ( AA.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, DATEMODIFIED = POS_3, MODIFIEDBY = ''SSISUSER''',79644);
