Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bqszmk3tpg928','MERGE INTO GTT_CUSTOMERCAL B USING (SELECT B.ROWID ROW_ID, NULL DBTDT, NULL LOSSDT, NULL DEGDATE FROM GTT_CUSTOMERWISEBALANCE A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( NVL(B.FLGDEG, ''N'') = ''Y'' AND NVL(B.FLGPROCESSING, ''N'') = ''N'' )) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.DBTDT = NULL, B.LOSSDT = NULL, B.DEGDATE = NULL',79251);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gjhu31c846jc1','MERGE INTO GTT_CUSTOMERCAL B USING (SELECT B.ROWID ROW_ID, (CASE WHEN UTILS.DATEADD(''DAY'', :B2 , B.SYSNPA_DT) > :B1 THEN ( SELECT DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE DIMASSETCLASS.ASSETCLASSSHORTNAME = ''SUB'' AND DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B5 AND DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B5 ) WHEN UTILS.DATEADD(''DAY'', :B2 , B.SYSNPA_DT) <= :B1 AND UTILS.DATEADD(''DAY'', :B2 + :B4 , B.SYSNPA_DT) > :B1 THEN ( SELECT DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE DIMASSETCLASS.ASSETCLASSSHORTNAME = ''DB1'' AND DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B5 AND DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B5 ) WHEN UTILS.DATEADD(''DAY'', :B2 + :B4 , B.SYSNPA_DT) <= :B1 AND UTILS.DATEADD(''DAY'', :B2 + :B4 + :B3 , B.SYSNPA_DT) > :B1 THEN ( SELECT DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE DIMASSETCLASS.ASSETCLASSSHORTNAME = ''DB2'' AND DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B5 AND DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B5 ) WHEN UTILS.DATEADD(''DAY'', (:B4 + :B2 + :B3 ), B.SYSNPA_DT) <= :B1 THEN ( SELECT DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE DIMASSETCLASS.ASSETCLASSSHORTNAME = ''DB3'' AND DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B5 AND DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B5 ) END) AS POS_2, (CASE WHEN UTILS.DATEADD(''DAY'', :B2 , B.SYSNPA_DT) <= :B1 AND UTILS.DATEADD(''DAY'', :B2 + :B4 , B.SYSNPA_DT) > :B1 THEN UTILS.DATEADD(''DAY'', :B2 , B.SYSNPA_DT) WHEN UTILS.DATEADD(''DAY'', :B2 + :B4 , B.SYSNPA_DT) <= :B1 AND UTILS.DATEADD(''DAY'', :B2 + :B4 + :B3 , B.SYSNPA_DT) > :B1 THEN UTILS.DATEADD(''DAY'', :B2 , B.SYSNPA_DT) WHEN UTILS.DATEADD(''DAY'', (:B4 + :B2 + :B3 ), B.SYSNPA_DT) <= :B1 THEN UTILS.DATEADD(''DAY'', (:B2 ), B.SYSNPA_DT) ELSE TO_DATE(DBTDT,''YYYY-MM-DD'') END) AS POS_3, :B1 FROM GTT_CUSTOMERWISEBALANCE A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( NVL(B.FLGDEG, ''N'') = ''Y'' AND B.FLGPROCESSING = ''N'' )) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.SYSASSETCLASSALT_KEY = POS_2, B.DBTDT = POS_3, B.DEGDATE = V_PROCESSDATE',79251);
