Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3ww7jbg3dbpqs','MERGE INTO RBL_TEMPDB.TEMPADVACFINANCIALDETAIL TEMP USING (SELECT TEMP.ROWID ROW_ID, ACCT.ENTITYKEY FROM RBL_TEMPDB.TEMPADVACFINANCIALDETAIL TEMP JOIN ( SELECT "TEMPADVACFINANCIALDETAIL".ACCOUNTENTITYID , (:B1 + ROW_NUMBER() OVER ( ORDER BY ( SELECT 1 FROM DUAL ) )) ENTITYKEY FROM RBL_TEMPDB.TEMPADVACFINANCIALDETAIL WHERE "TEMPADVACFINANCIALDETAIL".ENTITYKEY = 0 OR "TEMPADVACFINANCIALDETAIL".ENTITYKEY IS NULL ) ACCT ON TEMP.ACCOUNTENTITYID = ACCT.ACCOUNTENTITYID WHERE TEMP.ISCHANGED IN ( ''N'',''C'' ) ) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.ENTITYKEY = SRC.ENTITYKEY',79644);
