Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8c2puk78ympqd','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL B USING (SELECT B.ROWID ROW_ID, CONCAT(CONCAT(DEGREASON, CASE WHEN DPD_BS_DATE >= 541 THEN (CASE WHEN DEGREASON IS NOT NULL THEN '','' ELSE '' '' END) ELSE '' '' END), ''NPA due to overdue Balance Sheet Date'') AS DEGREASON FROM CURDAT_RBL_MISDB_PROD.INVESTMENTBASICDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL C ON A.ISSUERENTITYID = C.ISSUERENTITYID AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL B ON A.INVENTITYID = B.INVENTITYID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 WHERE B.BALANCESHEETDATE IS NOT NULL AND NVL(B.FINALASSETCLASSALT_KEY, 1) = 1 AND ( NVL(DPD_BS_DATE, 0) >= 541 ) AND FLGDEG = ''Y'') SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.DEGREASON = SRC.DEGREASON',79245);
