Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bhut80bv4vz9v','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID, :B2 FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A WHERE NVL(A.FLGDEG, ''N'') = ''Y'' AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND A.DEGREASON = ''DEGRADE BY MTMValue Less Than 1 Rs.'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET NPIDT = V_PROCESSDATE',79245);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bwam6rmk9h1w5','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID, ''Y'', CONCAT(''NPA DUE TO Linkage By Invid='', D.ACID) AS POS_3, CASE WHEN C.STATUSDATE IS NOT NULL THEN C.STATUSDATE ELSE :B2 END AS POS_4 FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL B ON A.REFISSUERID = B.ISSUERID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 JOIN GTT_HISTORYDATA1 C ON B.UCIFID = C.UCIFID AND C.STATUSTYPE IN ( ''TWO'',''WO'',''WriteOff'' ) LEFT JOIN GTT_HISTORYDATA2 D ON C.UCIFID = D.UCIFID WHERE A.FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGDEG = ''Y'', A.DEGREASON = POS_3, A.NPIDT = POS_4',79245);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0aa6zg4qspsc6','UPDATE RBL_MISDB_PROD.BANDAUDITSTATUS SET COMPLETEDCOUNT = COMPLETEDCOUNT + 1 WHERE BANDNAME = ''ASSET CLASSIFICATION''',79245);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2xa37mrjpjk0y','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID, ''ALWYS_NPA'', ''Y'', ''NPA DUE TO WriteOff Marking '' AS POS_4, CASE WHEN C.STATUSDATE IS NOT NULL THEN C.STATUSDATE ELSE :B2 END AS POS_5, 2 FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A JOIN RBL_MISDB_PROD.EXCEPTIONFINALSTATUSTYPE C ON C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 AND C.ACID = A.REFINVID AND C.STATUSTYPE IN ( ''TWO'',''WO'',''WriteOff'' ) AND C.SOURCEALT_KEY = 7 WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND A.FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ASSET_NORM = ''ALWYS_NPA'', A.FLGDEG = ''Y'', A.DEGREASON = POS_4, A.NPIDT = POS_5, A.FINALASSETCLASSALT_KEY = 2',79245);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cywvy65kpcffk','MERGE INTO CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN UTILS.DATEADD(''DAY'', :B4 , A.NPIDT) > :B2 THEN ( SELECT DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE DIMASSETCLASS.ASSETCLASSSHORTNAME = ''SUB'' AND DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) WHEN UTILS.DATEADD(''DAY'', :B4 , A.NPIDT) <= :B2 AND UTILS.DATEADD(''DAY'', :B4 + :B5 , A.NPIDT) > :B2 THEN ( SELECT DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE DIMASSETCLASS.ASSETCLASSSHORTNAME = ''DB1'' AND DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) WHEN UTILS.DATEADD(''DAY'', :B4 + :B5 , A.NPIDT) <= :B2 AND UTILS.DATEADD(''DAY'', :B4 + :B5 + :B3 , A.NPIDT) > :B2 THEN ( SELECT DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE DIMASSETCLASS.ASSETCLASSSHORTNAME = ''DB2'' AND DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) WHEN UTILS.DATEADD(''DAY'', (:B5 + :B4 + :B3 ), A.NPIDT) <= :B2 THEN ( SELECT DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE DIMASSETCLASS.ASSETCLASSSHORTNAME = ''DB3'' AND DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) END) AS FINALASSETCLASSALT_KEY FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A WHERE NVL(A.FLGDEG, ''N'') <> ''Y'' AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND FINALASSETCLASSALT_KEY > 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALASSETCLASSALT_KEY = SRC.FINALASSETCLASSALT_KEY',79247);
