Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cuwd7vvr4pu89','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, (A.NETBALANCE * A.ADDLPROVISIONPER) / 100 AS ADDLPROVISION FROM GTT_ACCOUNTCAL A WHERE NVL(A.ADDLPROVISIONPER, 0) <> 0) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ADDLPROVISION = SRC.ADDLPROVISION',79260);
