Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4pqtwry0zz1qs','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, 0 FROM GTT_ACCOUNTCAL A JOIN RBL_MISDB_PROD.DIMASSETCLASS B ON B.ASSETCLASSALT_KEY = NVL(A.FINALASSETCLASSALT_KEY, 1) AND ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) WHERE B.ASSETCLASSGROUP = ''NPA'' AND NVL(WRITEOFFAMOUNT, 0) > 0) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.NETBALANCE = 0',79260);
