Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2trcqxxva6q4n','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL B USING (SELECT B.ROWID ROW_ID, (CASE WHEN B.INTEREST_DIVIDENDDUEDATE IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', B.INTEREST_DIVIDENDDUEDATE, :B2 ) + 1 ELSE 0 END) AS DPD_DIVOVERDUE FROM CURDAT_RBL_MISDB_PROD.INVESTMENTBASICDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL C ON A.ISSUERENTITYID = C.ISSUERENTITYID AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL B ON A.INVENTITYID = B.INVENTITYID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 JOIN RBL_MISDB_PROD.DIMINSTRUMENTTYPE INS ON INS.EFFECTIVEFROMTIMEKEY <= :B1 AND INS.EFFECTIVETOTIMEKEY >= :B1 AND INS.INSTRUMENTTYPEALT_KEY = A.INSTRTYPEALT_KEY WHERE B.INTEREST_DIVIDENDDUEDATE IS NOT NULL AND NVL(INS.INSTRUMENTTYPESUBGROUP, '' '') IN ( ''BONDS'',''Preference Shares'',''CP'',''CD'',''PTC'' ) ) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET DPD_DIVOVERDUE = SRC.DPD_DIVOVERDUE',79245);
