Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('a0k15jjggzgcn','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL B USING (SELECT B.ROWID ROW_ID, ''PERCOLATION BY'' || '' '' || UCIFID AS DEGREASON FROM CURDAT_RBL_MISDB_PROD.INVESTMENTBASICDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL C ON A.ISSUERENTITYID = C.ISSUERENTITYID AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL B ON A.INVENTITYID = B.INVENTITYID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 WHERE NVL(B.FINALASSETCLASSALT_KEY, 1) > 1 AND DEGREASON IS NULL) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.DEGREASON = SRC.DEGREASON',79245);
