Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('awpatuyxfhanp','MERGE INTO GTT_ACCOUNTCAL B USING (SELECT B.ROWID ROW_ID, CASE WHEN A.ASSET_NORM <> ''ALWYS_STD'' THEN A.SYSASSETCLASSALT_KEY ELSE ( SELECT DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE DIMASSETCLASS.ASSETCLASSSHORTNAME = ''STD'' AND DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) END AS FINALASSETCLASSALT_KEY FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.SOURCESYSTEMCUSTOMERID = B.SOURCESYSTEMCUSTOMERID AND ( NVL(A.FLGPROCESSING, ''N'') = ''N'' ) WHERE A.SYSASSETCLASSALT_KEY <> B.FINALASSETCLASSALT_KEY AND B.REFCUSTOMERID IS NULL) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.FINALASSETCLASSALT_KEY = SRC.FINALASSETCLASSALT_KEY',79250);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8xx41n4w9a1fv','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, B.PERC_FINALASSETCLASS_ALTKEY, B.PERC_FINALNPADT, (CASE WHEN B.DEGRADEREASON LIKE ''%'' || A.NPA_REASON || ''%'' THEN A.NPA_REASON ELSE CONCAT(CONCAT(A.NPA_REASON, '',''), B.DEGRADEREASON) END) AS POS_4, B.DEGRADEREASON FROM GTT_ACCOUNTCAL A JOIN ( SELECT DISTINCT COBORROWERCAL.CUSTOMERACID , COBORROWERCAL.PERC_FINALASSETCLASS_ALTKEY , COBORROWERCAL.PERC_FINALNPADT , COBORROWERCAL.DEGRADEREASON FROM MAIN_PRO.COBORROWERCAL ) B ON A.CUSTOMERACID = B.CUSTOMERACID WHERE A.ASSET_NORM NOT IN ( ''AlWYS_STD'' ) AND B.PERC_FINALASSETCLASS_ALTKEY > 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALASSETCLASSALT_KEY = SRC.PERC_FINALASSETCLASS_ALTKEY, A.FINALNPADT = SRC.PERC_FINALNPADT, A.NPA_REASON = POS_4, A.DEGREASON = SRC.DEGRADEREASON',79250);
