Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3ca36hd4pn4px','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, P.PROVISIONALT_KEY FROM GTT_ACCOUNTCAL A JOIN RBL_MISDB_PROD.DIMSOURCEDB B ON A.SOURCEALT_KEY = B.SOURCEALT_KEY AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 JOIN RBL_MISDB_PROD.DIMASSETCLASS C ON C.ASSETCLASSALT_KEY = NVL(A.FINALASSETCLASSALT_KEY, 1) AND ( C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 ) JOIN RBL_MISDB_PROD.DIMPROVISION_SEG P ON ( P.EFFECTIVEFROMTIMEKEY <= :B1 AND P.EFFECTIVETOTIMEKEY >= :B1 ) AND P.SEGMENT = ''CREDIT CARD'' AND PROVISIONRULE = ''K/W/E/U'' AND A.ACCOUNTBLKCODE2 IN ( ''K'',''W'',''E'',''U'' ) AND P.PROVISIONSHORTNAMEENUM = C.ASSETCLASSSHORTNAMEENUM AND A.DPD_MAX BETWEEN LOWERDPD AND UPPERDPD WHERE B.SOURCENAME = ''VisionPLUS'' AND C.ASSETCLASSGROUP = ''NPA'' AND C.ASSETCLASSSHORTNAMEENUM = ''SUB'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.PROVISIONALT_KEY = SRC.PROVISIONALT_KEY',79259);
