Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('ayj5n97ykc8xv','MERGE INTO CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN NVL(B.ASSETCLASSSHORTNAMEENUM, ''STD'') = ''LOS'' THEN POS ELSE (NVL(A.POS, 0) * NVL(C.PROVISIONUNSECURED, 0) / 100) END) AS TOTALPROVISON FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A JOIN RBL_MISDB_PROD.DIMASSETCLASS B ON B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 AND NVL(A.FINALASSETCLASSALT_KEY, 1) = B.ASSETCLASSALT_KEY JOIN RBL_MISDB_PROD.DIMPROVISION_SEGSTD C ON C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 AND NVL(A.PROVISIONALT_KEY, 1) = C.PROVISIONALT_KEY WHERE FINALASSETCLASSALT_KEY = 1 AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.TOTALPROVISON = SRC.TOTALPROVISON',79248);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4p3sasv13tm11','UPDATE CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL SET TOTALPROVISON = TOTALPROVISON + (BOOKVALUEINR * (NVL(ADDLPROVISIONPER, 0) / 100)) WHERE EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 AND NVL(ADDLPROVISIONPER, 0) > 0',79248);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4zpsma6fsj6t2','MERGE INTO CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A USING (SELECT A.ROWID ROW_ID, 0 FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A WHERE ( A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.PROVISIONALT_KEY = 0',79248);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bq2nwh33vvdgy','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID, 0 FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL B ON A.REFISSUERID = B.ISSUERID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 JOIN RBL_MISDB_PROD.EXCEPTIONFINALSTATUSTYPE C ON C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 AND C.ACID = A.REFINVID AND C.STATUSTYPE IN ( ''TWO'',''WO'',''WriteOff'' ) AND C.SOURCEALT_KEY = 7 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.TOTALPROVISON = 0',79248);
