Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('a9wdp88hq6aqu','MERGE INTO MAIN_PRO.COBORROWERCAL B USING (SELECT B.ROWID ROW_ID, A.FINALASSETCLASS_ALTKEY, A.FINALNPADT, CONCAT(B.DEGRADEREASON, '' Co Borrower NPA '' || A.NPA_UCIC_ID || '' UCIC Of Main'') AS POS_4 FROM MAIN_PRO.COBORROWERCAL A JOIN MAIN_PRO.COBORROWERCAL B ON B.MAINCUSTID = A.CUSTOMERID AND A.CUSTOMERTYPE IN ( ''Coborrower'',''CO_OBLIGANT'' ) AND A.FINALASSETCLASS_ALTKEY > 1 AND B.FINALASSETCLASS_ALTKEY = 1 ) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.FINALASSETCLASS_ALTKEY = SRC.FINALASSETCLASS_ALTKEY, B.FINALNPADT = SRC.FINALNPADT, B.DEGRADEREASON = POS_4',79250);
