Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('71m4y3765zwvr','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, B.DEGREASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.SOURCESYSTEMCUSTOMERID = B.SOURCESYSTEMCUSTOMERID WHERE A.DEGREASON LIKE ''PERCOLATION BY OTHER ACCOUNT'' AND A.FLGDEG = ''N'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DEGREASON = SRC.DEGREASON',79250);
