Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('024wtmd7spf37','MERGE INTO GTT_TEMPTABLE_UCFIC1 A USING (SELECT A.ROWID ROW_ID, B.PERCTYPE FROM GTT_TEMPTABLE_UCFIC1 A JOIN CTE_PERC B ON A.UCIF_ID = B.UCIF_ID AND A.SYSASSETCLASSALT_KEY = B.SYSASSETCLASSALT_KEY ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.PERCTYPE = SRC.PERCTYPE',79250);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gh0jg79ar6yr1','MERGE INTO GTT_ACCOUNTCAL B USING (SELECT B.ROWID ROW_ID, A.SYSNPA_DT FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.SOURCESYSTEMCUSTOMERID = B.SOURCESYSTEMCUSTOMERID WHERE NVL(B.ASSET_NORM, ''NORMAL'') <> ''ALWYS_STD'' AND ( NVL(A.FLGPROCESSING, ''N'') = ''N'' ) AND NVL(A.SYSNPA_DT, '' '') <> NVL(B.FINALNPADT, '' '') AND NVL(A.FLGDEG, ''N'') = ''N'' AND A.REFCUSTOMERID <> ''0'') SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.FINALNPADT = SRC.SYSNPA_DT',79250);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('c6q3j655yzzs3','MERGE INTO GTT_CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, B.PERC_FINALASSETCLASS_ALTKEY, B.PERC_FINALNPADT , CONCAT(CONCAT(B.DEGRADEREASON, '' Percolated by Cohort No''), B.COHORT_NO) AS POS_4 FROM GTT_CUSTOMERCAL A JOIN MAIN_PRO.COBORROWERCAL B ON A.UCIF_ID = B.UCIC WHERE A.ASSET_NORM NOT IN ( ''AlWYS_STD'' ) AND B.PERC_FINALASSETCLASS_ALTKEY > 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SYSASSETCLASSALT_KEY = SRC.PERC_FINALASSETCLASS_ALTKEY, A.SYSNPA_DT = SRC.PERC_FINALNPADT, A.DEGREASON = POS_4',79250);
