Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bwu4jyptn1tsy','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN A.FINALASSETCLASSALT_KEY = 2 THEN :B2 WHEN A.FINALASSETCLASSALT_KEY IN ( 3,4 ) AND A.SECAPP = ''S'' THEN :B2 ELSE A.PROVISIONALT_KEY END) AS PROVISIONALT_KEY FROM GTT_ACCOUNTCAL A JOIN RBL_MISDB_PROD.DIMASSETCLASS C ON C.ASSETCLASSALT_KEY = A.FINALASSETCLASSALT_KEY AND C.ASSETCLASSSHORTNAME IN ( ''SUB'',''DB1'',''DB2'' ) WHERE A.PRINCOUTSTD <= 100 AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.PROVISIONALT_KEY = SRC.PROVISIONALT_KEY',79259);
