Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7h6q49nbcwmhs','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, SEG.PROVISIONALT_KEY FROM GTT_ACCOUNTCAL A JOIN RBL_MISDB_PROD.DIMSOURCEDB B ON A.SOURCEALT_KEY = B.SOURCEALT_KEY AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 JOIN RBL_MISDB_PROD.DIMASSETCLASS C ON C.ASSETCLASSALT_KEY = NVL(A.FINALASSETCLASSALT_KEY, 1) AND ( C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 ) JOIN RBL_MISDB_PROD.DIMPROVISION_SEG SEG ON ( SEG.EFFECTIVEFROMTIMEKEY <= :B1 AND SEG.EFFECTIVETOTIMEKEY >= :B1 ) AND SEG.SEGMENT = CASE WHEN A.SECAPP = ''U'' THEN ''UNSECURED'' END JOIN GTT_AC_NPA_QTR_NO NP ON NP.ACCOUNTENTITYID = A.ACCOUNTENTITYID AND NP.NPA_QTR_NO BETWEEN SEG.LOWERDPD AND SEG.UPPERDPD WHERE ASSETCLASSSHORTNAMEENUM = ''SUB'' AND SEG.SEGMENT = ''UNSECURED'' AND C.ASSETCLASSGROUP = ''NPA'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.PROVISIONALT_KEY = SRC.PROVISIONALT_KEY',79259);
