Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('c0nb6prmyczth','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN NVL(B.ASSETCLASSSHORTNAMEENUM, ''STD'') = ''LOS'' THEN BOOKVALUEINR ELSE (NVL(A.BOOKVALUEINR, 0) * NVL(C.PROVISIONUNSECURED, 0) / 100) END) AS TOTALPROVISON FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A JOIN RBL_MISDB_PROD.DIMASSETCLASS B ON B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 AND NVL(A.FINALASSETCLASSALT_KEY, 1) = B.ASSETCLASSALT_KEY JOIN RBL_MISDB_PROD.DIMPROVISION_SEGSTD C ON C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 AND NVL(A.PROVISIONALT_KEY, 1) = C.PROVISIONALT_KEY WHERE FINALASSETCLASSALT_KEY = 1 AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.TOTALPROVISON = SRC.TOTALPROVISON',79248);
