Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4scw31yu8d2tf','MERGE INTO CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL D USING (SELECT D.ROWID ROW_ID, A.ASSETCLASSALT_KEY, A.NPA_DATE, CASE WHEN A.ASSETCLASSALT_KEY > 1 THEN ''NPA DUE TO MOC'' ELSE NULL END AS POS_4 FROM RBL_MISDB_PROD.CALYPSODERVMOC_CHANGEDETAILS A JOIN CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL D ON A.ACCOUNTENTITYID = D.DERIVATIVEENTITYID AND D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND A.ACCOUNTENTITYID IS NOT NULL ) SRC ON ( D.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET D.FINALASSETCLASSALT_KEY = SRC.ASSETCLASSALT_KEY, D.NPIDT = SRC.NPA_DATE, D.DEGREASON = POS_4',79247);
