Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('30q42smsvk2aa','INSERT INTO CTE_PERC SELECT * FROM ( SELECT UCIF_ID , MAX(NVL(SYSASSETCLASSALT_KEY, 1)) SYSASSETCLASSALT_KEY , MIN(SYSNPA_DT) SYSNPA_DT , ''ADV'' PERCTYPE FROM GTT_CUSTOMERCAL A WHERE ( UCIF_ID IS NOT NULL AND UCIF_ID <> ''0'' ) AND NVL(SYSASSETCLASSALT_KEY, 1) <> 1 GROUP BY UCIF_ID UNION SELECT UCIFID UCIF_ID , MAX(NVL(FINALASSETCLASSALT_KEY, 1)) SYSASSETCLASSALT_KEY , MIN(NPIDT) SYSNPA_DT , ''INV'' PERCTYPE FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTBASICDETAIL B ON A.INVENTITYID = B.INVENTITYID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL C ON C.ISSUERENTITYID = B.ISSUERENTITYID AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 WHERE NVL(FINALASSETCLASSALT_KEY, 1) <> 1 GROUP BY UCIFID UNION SELECT UCIC_ID , MAX(NVL(FINALASSETCLASSALT_KEY, 1)) SYSASSETCLASSALT_KEY , MIN(NPIDT) SYSNPA_DT , ''DER'' PERCTYPE FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND NVL(FINALASSETCLASSALT_KEY, 1) <> 1 GROUP BY UCIC_ID ) A ',79250);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('95frtmtp4x8qx','MERGE INTO CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A USING (SELECT A.ROWID ROW_ID, B.SYSASSETCLASSALT_KEY, SYSNPA_DT, CASE WHEN A.FINALASSETCLASSALT_KEY = 1 AND B.SYSASSETCLASSALT_KEY > 1 THEN CASE WHEN B.PERCTYPE = ''ADV'' THEN ''PERCOLATION BY LOAN AC UCIFID '' || B.UCIF_ID WHEN B.PERCTYPE = ''INV'' THEN ''PERCOLATION BY INVESTMENT UCIFID '' || B.UCIF_ID ELSE A.DEGREASON END ELSE A.DEGREASON END AS POS_4 FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A JOIN GTT_TEMPTABLE_UCFIC1 B ON A.UCIC_ID = B.UCIF_ID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALASSETCLASSALT_KEY = SRC.SYSASSETCLASSALT_KEY, A.NPIDT = SYSNPA_DT, A.DEGREASON = POS_4',79250);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fby7u36tm2u60','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID FROM GTT_ACCOUNTCAL A WHERE ASSET_NORM = ''ALWYS_STD'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALASSETCLASSALT_KEY = 1, A.FINALNPADT = NULL, A.DEGREASON = NULL',79250);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('67kjj0vqxcdtv','INSERT INTO GTT_AC_NPA_QTR_NO ( SELECT ACCOUNTENTITYID , CASE WHEN FINALNPADT BETWEEN UTILS.DATEADD(''DD'', 1, :B4 ) AND :B5 THEN 1 WHEN FINALNPADT BETWEEN UTILS.DATEADD(''DD'', 1, :B2 ) AND :B4 THEN 2 WHEN FINALNPADT BETWEEN UTILS.DATEADD(''DD'', 1, :B3 ) AND :B2 THEN 3 ELSE 4 END NPA_QTR_NO , SEG.ACBUREVISEDSEGMENTCODE FROM GTT_ACCOUNTCAL A LEFT JOIN RBL_MISDB_PROD.DIMACBUSEGMENT SEG ON SEG.ACBUSEGMENTCODE = A.ACTSEGMENTCODE AND ( SEG.EFFECTIVEFROMTIMEKEY <= :B1 AND SEG.EFFECTIVETOTIMEKEY >= :B1 ) WHERE FINALASSETCLASSALT_KEY > 1 )',79259);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7w3t7h6fv5q1u','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN C.ASSETCLASSSHORTNAME = ''SUB'' THEN :B6 WHEN C.ASSETCLASSSHORTNAME = ''DB1'' THEN :B5 WHEN C.ASSETCLASSSHORTNAME = ''DB2'' THEN :B4 WHEN C.ASSETCLASSSHORTNAME = ''DB3'' THEN :B3 WHEN C.ASSETCLASSSHORTNAME = ''LOS'' THEN :B2 ELSE 0 END) AS PROVISIONALT_KEY FROM GTT_ACCOUNTCAL A JOIN RBL_MISDB_PROD.DIMASSETCLASS C ON C.ASSETCLASSALT_KEY = NVL(A.FINALASSETCLASSALT_KEY, 1) AND ( C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 ) WHERE C.ASSETCLASSGROUP = ''NPA'' AND ( SECAPP = ''S'' OR ASSETCLASSSHORTNAME = ''LOS'' )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.PROVISIONALT_KEY = SRC.PROVISIONALT_KEY',79259);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fmnbutwpudx32','MERGE INTO RBL_TEMPDB.TEMPADVACBALANCEDETAIL TEMP USING (SELECT TEMP.ROWID ROW_ID, ACCT.ENTITYKEY FROM RBL_TEMPDB.TEMPADVACBALANCEDETAIL TEMP JOIN ( SELECT "TEMPADVACBALANCEDETAIL".ACCOUNTENTITYID , (:B1 + ROW_NUMBER() OVER ( ORDER BY ( SELECT 1 FROM DUAL ) )) ENTITYKEY FROM RBL_TEMPDB.TEMPADVACBALANCEDETAIL WHERE "TEMPADVACBALANCEDETAIL".ENTITYKEY = 0 OR "TEMPADVACBALANCEDETAIL".ENTITYKEY IS NULL ) ACCT ON TEMP.ACCOUNTENTITYID = ACCT.ACCOUNTENTITYID WHERE TEMP.ISCHANGED IN ( ''N'',''C'' ) ) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.ENTITYKEY = SRC.ENTITYKEY',79640);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('anqh9cr0sn96q','SELECT CONSTRAINT_ID, TABLE_ID_FK, REFTABLE_ID_FK, COL_ID_FK FROM ( SELECT ROW_NUMBER() OVER (PARTITION BY A.COL_ID_FK ORDER BY A.CONSTRAINT_ID) RN, A.CONSTRAINT_ID, A.TABLE_ID_FK, A.REFTABLE_ID_FK, A.COL_ID_FK FROM ( ( SELECT MC.ID CONSTRAINT_ID, MC.TABLE_ID_FK TABLE_ID_FK, MC.REFTABLE_ID_FK REFTABLE_ID_FK, LISTAGG(MCD.COLUMN_ID_FK, '','') WITHIN GROUP (ORDER BY MC.ID) COL_ID_FK, COUNT(*) FROM MD_CONSTRAINTS MC, MD_CONSTRAINT_DETAILS MCD, MGV_ALL_CONSTRAINTS_DETAILS MACD WHERE MC.CONSTRAINT_TYPE = ''FOREIGN KEY'' AND MC.ID = MACD.OBJID AND MCD.CONSTRAINT_ID_FK = MC.ID AND MC.TABLE_ID_FK = MACD.MAINOBJID AND MACD.CONNID = :B1 GROUP BY MC.ID, MC.TABLE_ID_FK, MC.REFTABLE_ID_FK ORDER BY CONSTRAINT_ID ) A ) ) WHERE RN > 1',85018);
