Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('40yjv1p4zt5uf','INSERT INTO GTT_TEMPMINASSETCLASS ( SELECT UCIC_ID , MAX(NVL(FINALASSETCLASSALT_KEY, 1)) FINALASSETCLASSALT_KEY , MIN(NPIDT) NPIDT FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND NVL(FINALASSETCLASSALT_KEY, 1) > 1 GROUP BY UCIC_ID )',79247);
