Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('17tcf0tmfvj5g','MERGE INTO CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN DUEDATE IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', DUEDATE, :B2 ) ELSE 0 END) AS DPD_DIVOVERDUE FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DPD_DIVOVERDUE = SRC.DPD_DIVOVERDUE',79247);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('1znu6rnrcb2bc','SELECT PROVISIONALT_KEY FROM RBL_MISDB_PROD.DIMPROVISION_SEG WHERE SEGMENT = ''IRAC'' AND PROVISIONNAME = ''Doubtful-III'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 ',79247);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3vfgumuhbkaqp','MERGE INTO CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A USING (SELECT A.ROWID ROW_ID FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DPD_DIVOVERDUE = 0, A.DPD = 0, A.FLGDEG = ''N'', A.FLGUPG = ''N'', A.DEGREASON = NULL, A.UPGDATE = NULL',79247);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gm6d9c7h5rqpf','MERGE INTO CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A USING (SELECT A.ROWID ROW_ID, UTILS.DATEADD(''DAY'', NVL(90, 0), UTILS.DATEADD(''DAY'', -NVL(DPD, 0), :B2 )) AS NPIDT FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND NVL(A.FLGDEG, ''N'') = ''Y'' AND A.DEGREASON IS NULL) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.NPIDT = SRC.NPIDT',79247);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2vtpghd2r3ut6','MERGE INTO GTT_ACCOUNTCAL B USING (SELECT B.ROWID ROW_ID, ''PERCOLATION BY OTHER ACCOUNT'' AS DEGREASON FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.SOURCESYSTEMCUSTOMERID = B.SOURCESYSTEMCUSTOMERID WHERE A.FLGDEG = ''Y'' AND B.DEGREASON IS NULL AND B.ASSET_NORM <> ''ALWYS_STD'' AND ( NVL(A.FLGPROCESSING, ''N'') = ''N'' )) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.DEGREASON = SRC.DEGREASON',79250);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5fn0jmxc2d1bt','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(B.SYSASSETCLASSALT_KEY, 1) AS POS_2, B.SYSNPA_DT FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID AND A.SOURCESYSTEMCUSTOMERID = B.SOURCESYSTEMCUSTOMERID WHERE NVL(B.SYSASSETCLASSALT_KEY, 1) <> 1 AND B.REFCUSTOMERID <> ''0'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALASSETCLASSALT_KEY = POS_2, A.FINALNPADT = SRC.SYSNPA_DT',79250);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4q858txf66jdu','MERGE INTO GTT_CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, B.PERC_FINALASSETCLASS_ALTKEY, B.PERC_FINALNPADT , CONCAT(CONCAT(B.DEGRADEREASON ,'' Percolated by Cohort No'' ), B.COHORT_NO) AS POS_4 FROM GTT_CUSTOMERCAL A JOIN MAIN_PRO.COBORROWERCAL B ON A.REFCUSTOMERID = B.CUSTOMERID WHERE A.ASSET_NORM NOT IN ( ''AlWYS_STD'' ) AND B.PERC_FINALASSETCLASS_ALTKEY > 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SYSASSETCLASSALT_KEY = SRC.PERC_FINALASSETCLASS_ALTKEY, A.SYSNPA_DT = SRC.PERC_FINALNPADT, A.DEGREASON = POS_4',79250);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('9bpua955kthun','MERGE INTO GTT_ACCOUNTCAL B USING (SELECT B.ROWID ROW_ID, NULL FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.SOURCESYSTEMCUSTOMERID = B.SOURCESYSTEMCUSTOMERID WHERE A.FLGDEG = ''Y'' AND B.DEGREASON IS NULL AND B.ASSET_NORM <> ''ALWYS_STD'' AND ( NVL(A.FLGPROCESSING, ''N'') = ''N'' )) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.DEGREASON = NULL',79250);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0zhxu7p8tpd5j','UPDATE GTT_CUSTOMERCAL SET SYSNPA_DT = :B1 WHERE NVL(SYSNPA_DT, ''1900-01-01'') > :B1 ',79250);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('1bn1t6y6zzuw4','INSERT INTO TT_MAXASSETCLASS ( SELECT COHORT_NO , MAX(FINALASSETCLASS_ALTKEY) FINALASSETCLASS_ALTKEY , MIN(FINALNPADT) FINALNPADT FROM MAIN_PRO.COBORROWERCAL WHERE FINALASSETCLASS_ALTKEY > 1 GROUP BY COHORT_NO )',79250);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('18dbdvgu8qwcr','MERGE INTO RBL_MISDB_PROD.ADVACBALANCEDETAIL O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVACBALANCEDETAIL O JOIN RBL_TEMPDB.TEMPADVACBALANCEDETAIL T ON O.ACCOUNTENTITYID = T.ACCOUNTENTITYID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.BALANCEINCURRENCY, 0) <> NVL(T.BALANCEINCURRENCY, 0) OR NVL(O.BALANCE, 0) <> NVL(T.BALANCE, 0) OR NVL(O.SIGNBALANCE, 0) <> NVL(T.SIGNBALANCE, 0) OR NVL(O.LASTCRDT, ''1990-01-01'') <> NVL(T.LASTCRDT, ''1990-01-01'') OR NVL(O.PS_BALANCE, 0) <> NVL(T.PS_BALANCE, 0) OR NVL(O.NPS_BALANCE, 0) <> NVL(T.NPS_BALANCE, 0) OR NVL(O.OVERDUE, 0) <> NVL(T.OVERDUE, 0) OR NVL(O.REFCUSTOMERID, ''AA'') <> NVL(T.REFCUSTOMERID, ''AA'') OR NVL(O.PS_NPS_FLAG, ''AA'') <> NVL(T.PS_NPS_FLAG, ''AA'') OR NVL(O.OVERDUESINCEDT, ''1990-01-01'') <> NVL(T.OVERDUESINCEDT, ''1990-01-01'') OR NVL(O.INTREVERSEAMT, 0) <> NVL(T.INTREVERSEAMT, 0) OR NVL(O.UNAPPLIEDINTAMOUNT, 0) <> NVL(T.UNAPPLIEDINTAMOUNT, 0) OR NVL(O.UPGRADEDATE, ''1990-01-01'') <> NVL(T.UPGRADEDATE, ''1990-01-01'') OR NVL(O.OVERDUEPRINCIPAL, 0) <> NVL(T.OVERDUEPRINCIPAL, 0) OR NVL(O.NOTIONALINTTAMT, 0) <> NVL(T.NOTIONALINTTAMT, 0) OR NVL(O.PRINCIPALBALANCE, 0) <> NVL(T.PRINCIPALBALANCE, 0) OR NVL(O.OVERDUEINTEREST, 0) <> NVL(T.OVERDUEINTEREST, 0) OR NVL(O.ADVANCERECOVERY, 0) <> NVL(T.ADVANCERECOVERY, 0) OR NVL(O.DFVAMT, 0) <> NVL(T.DFVAMT, 0) OR NVL(O.INTERESTRECEIVABLE, 0) <> NVL(T.INTERESTRECEIVABLE, 0) OR NVL(O.OVERDUEPRINCIPALDT, ''1990-01-01'') <> NVL(T.OVERDUEPRINCIPALDT, ''1990-01-01'') OR NVL(O.OVERDUEINTDT, ''1990-01-01'') <> NVL(T.OVERDUEINTDT, ''1990-01-01'') OR NVL(O.OVEROTHERDUE, 0) <> NVL(T.OVEROTHERDUE, 0) OR NVL(O.OVERDUEOTHERDT, ''1990-01-01'') <> NVL(T.OVERDUEOTHERDT, ''1990-01-01'') OR NVL(O.SOURCENPADATE, ''1990-01-01'') <> NVL(T.SOURCENPADATE, ''1990-01-01'') OR NVL(O.SOURCEASSETCLASS, '' '') <> NVL(T.SOURCEASSETCLASS, '' '') )) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, O.DATEMODIFIED = POS_3, O.MODIFIEDBY = ''SSISUSER''',79640);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7jhtujhj1bspw','MERGE INTO RBL_TEMPDB.TEMPADVACBALANCEDETAIL A USING (SELECT A.ROWID ROW_ID, ''N'' FROM RBL_TEMPDB.TEMPADVACBALANCEDETAIL A WHERE NOT EXISTS ( SELECT 1 FROM RBL_MISDB_PROD.ADVACBALANCEDETAIL B WHERE B.EFFECTIVETOTIMEKEY = 49999 AND B.ACCOUNTENTITYID = A.ACCOUNTENTITYID )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ISCHANGED = ''N''',79640);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7rcu3tahu3cbw','MERGE INTO RBL_TEMPDB.TEMPADVACBALANCEDETAIL A USING (SELECT A.ROWID ROW_ID, ''C'' FROM RBL_TEMPDB.TEMPADVACBALANCEDETAIL A JOIN RBL_MISDB_PROD.ADVACBALANCEDETAIL B ON B.ACCOUNTENTITYID = A.ACCOUNTENTITYID WHERE B.EFFECTIVETOTIMEKEY = :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ISCHANGED = ''C''',79640);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('6gw9amvv5j9vy','MERGE INTO RBL_TEMPDB.TEMPADVACBALANCEDETAIL T USING (SELECT T.ROWID ROW_ID, BAL.ASSETCLASSALT_KEY, BAL.TOTALPROV FROM RBL_TEMPDB.TEMPADVACBALANCEDETAIL T JOIN RBL_MISDB_PROD.ADVACBALANCEDETAIL BAL ON ( BAL.EFFECTIVETOTIMEKEY = 49999 ) AND T.ACCOUNTENTITYID = BAL.ACCOUNTENTITYID WHERE ( NVL(T.ASSETCLASSALT_KEY, 0) <> NVL(BAL.ASSETCLASSALT_KEY, 0) OR NVL(T.TOTALPROV, 0) <> NVL(BAL.TOTALPROV, 0) )) SRC ON ( T.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET T.ASSETCLASSALT_KEY = SRC.ASSETCLASSALT_KEY, T.TOTALPROV = SRC.TOTALPROV',79640);
