Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4f6r7rpqzbdxz','MERGE INTO CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A USING (SELECT A.ROWID ROW_ID, ''Y'', ''DEGRADE BY Derivative Overdue'' AS POS_3 FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND DPD >= 90) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGDEG = ''Y'', A.DEGREASON = POS_3',79247);
