Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3mmg0v0ubpd6r','MERGE INTO CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A USING (SELECT A.ROWID ROW_ID, 1, NULL FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A WHERE NVL(FINALASSETCLASSALT_KEY, 0) = 0 AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALASSETCLASSALT_KEY = 1, A.NPIDT = NULL',79247);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cq5kjdha84fas','MERGE INTO CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A USING (SELECT A.ROWID ROW_ID FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.UPGDATE = NULL, A.FLGDEG = ''N'', A.NPIDT = NULL, A.DBTDATE = NULL, A.FLGUPG = ''N''',79247);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cjcb26zv4w4up','MERGE INTO CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL D USING (SELECT D.ROWID ROW_ID, A.ASSETCLASSALT_KEY, A.NPA_DATE, CASE WHEN A.ASSETCLASSALT_KEY > 1 THEN ''NPA DUE TO MOC'' ELSE NULL END AS POS_4 FROM RBL_MISDB_PROD.CALYPSODERVMOC_CHANGEDETAILS A JOIN CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL D ON A.CUSTOMERID = D.CUSTOMERID AND D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND A.CUSTOMERID IS NOT NULL ) SRC ON ( D.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET D.FINALASSETCLASSALT_KEY = SRC.ASSETCLASSALT_KEY, D.NPIDT = SRC.NPA_DATE, D.DEGREASON = POS_4',79247);
