Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0d1t8w89ayh03','INSERT INTO GTT_CTE_BB ( SELECT A.UCIFENTITYID FROM GTT_CTE_AA A JOIN GTT_ACCOUNTCAL B ON A.UCIFENTITYID = B.UCIFENTITYID LEFT JOIN MAIN_PRO.BUYOUTUPLOADDETAILSCAL C ON B.CUSTOMERACID = C.CUSTOMERACID WHERE C.CUSTOMERACID IS NULL AND ( B.FLGDEG = ''Y'' OR ( NVL(B.DPD_INTSERVICE, 0) >= B.REFPERIODINTSERVICE ) OR ( NVL(B.DPD_OVERDRAWN, 0) >= B.REFPERIODOVERDRAWN ) OR ( NVL(B.DPD_NOCREDIT, 0) >= B.REFPERIODNOCREDIT ) OR ( NVL(B.DPD_OVERDUE, 0) >= B.REFPERIODOVERDUE ) OR ( NVL(B.DPD_STOCKSTMT, 0) >= B.REFPERIODSTKSTATEMENT ) OR ( NVL(B.DPD_RENEWAL, 0) >= B.REFPERIODREVIEW ) ) GROUP BY A.UCIFENTITYID )',79250);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fu6qcd4u8a75t','MERGE INTO MAIN_PRO.BUYOUTUPLOADDETAILSCAL B USING (SELECT B.ROWID ROW_ID, ''NPA_OTHERS'' FROM GTT_ACCOUNTCAL A JOIN GTT_CTE_BB AA ON A.UCIFENTITYID = A.UCIFENTITYID JOIN MAIN_PRO.BUYOUTUPLOADDETAILSCAL B ON B.ACCOUNTENTITYID = A.ACCOUNTENTITYID ) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.NPA_FLAG = ''NPA_OTHERS''',79250);
