Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('6pzthfz0bwb0m','MERGE INTO MAIN_PRO.COBORROWERCAL A USING (SELECT A.ROWID ROW_ID, B.FINALASSETCLASSALT_KEY, B.INITIALASSETCLASSALT_KEY, B.ASSET_NORM, B.FINALNPADT, B.INITIALNPADT, B.ACCOUNTENTITYID, B.CUSTOMERENTITYID, B.UCIFENTITYID, B.DEGREASON FROM MAIN_PRO.COBORROWERCAL A JOIN GTT_ACCOUNTCAL B ON A.CUSTOMERACID = B.CUSTOMERACID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALASSETCLASS_ALTKEY = SRC.FINALASSETCLASSALT_KEY, A.INITIALASSETCLASS_ALTKEY = SRC.INITIALASSETCLASSALT_KEY, A.ASSET_NORM = SRC.ASSET_NORM, A.FINALNPADT = SRC.FINALNPADT, A.INITIALNPADT = SRC.INITIALNPADT, A.ACCOUNTENTITYID = SRC.ACCOUNTENTITYID, A.CUSTOMERENTITYID = SRC.CUSTOMERENTITYID, A.UCIFENTITYID = SRC.UCIFENTITYID, A.DEGRADEREASON = SRC.DEGREASON',79250);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('g9rwhphb51tr8','INSERT INTO RBL_MISDB_PROD.ADVACBALANCEDETAIL ( ENTITYKEY, ACCOUNTENTITYID, ASSETCLASSALT_KEY, BALANCEINCURRENCY, BALANCE, SIGNBALANCE, LASTCRDT, OVERDUE, TOTALPROV, REFCUSTOMERID, REFSYSTEMACID, AUTHORISATIONSTATUS, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, OVERDUESINCEDT, MOCSTATUS, MOCDATE, MOCTYPEALT_KEY, OLD_OVERDUESINCEDT, OLD_OVERDUE, ORG_TOTALPROV, INTREVERSEAMT, UNAPPLIEDINTAMOUNT, PS_BALANCE, NPS_BALANCE, DATECREATED, MODIFIEDBY, DATEMODIFIED, APPROVEDBY, DATEAPPROVED, CREATEDBY, UPGRADEDATE, OVERDUEPRINCIPAL, NOTIONALINTTAMT, PRINCIPALBALANCE, OVERDUEINTEREST, ADVANCERECOVERY, PS_NPS_FLAG, DFVAMT, INTERESTRECEIVABLE, OVERDUEPRINCIPALDT, OVERDUEINTDT, OVEROTHERDUE, OVERDUEOTHERDT, SOURCEASSETCLASS, SOURCENPADATE ) ( SELECT ENTITYKEY , ACCOUNTENTITYID , ASSETCLASSALT_KEY , BALANCEINCURRENCY , BALANCE , SIGNBALANCE , LASTCRDT , OVERDUE , TOTALPROV , REFCUSTOMERID , REFSYSTEMACID , AUTHORISATIONSTATUS , EFFECTIVEFROMTIMEKEY , EFFECTIVETOTIMEKEY , OVERDUESINCEDT , MOCSTATUS , MOCDATE , MOCTYPEALT_KEY , OLD_OVERDUESINCEDT , OLD_OVERDUE , ORG_TOTALPROV , INTREVERSEAMT , UNAPPLIEDINTAMOUNT , PS_BALANCE , NPS_BALANCE , DATECREATED , MODIFIEDBY , DATEMODIFIED , APPROVEDBY , DATEAPPROVED , CREATEDBY , UPGRADEDATE , OVERDUEPRINCIPAL , NOTIONALINTTAMT , PRINCIPALBALANCE , OVERDUEINTEREST , ADVANCERECOVERY , PS_NPS_FLAG , DFVAMT , INTERESTRECEIVABLE , OVERDUEPRINCIPALDT , OVERDUEINTDT , OVEROTHERDUE , OVERDUEOTHERDT , SOURCEASSETCLASS , SOURCENPADATE FROM RBL_TEMPDB.TEMPADVACBALANCEDETAIL T WHERE NVL(T.ISCHANGED, ''U'') IN ( ''N'',''C'' ) )',79640);
