Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('c9t31j4ddqvaf','MERGE INTO RBL_TEMPDB.TEMPADVACBASICDETAIL TEMP USING (SELECT TEMP.ROWID ROW_ID, ACCT.AC_KEY FROM RBL_TEMPDB.TEMPADVACBASICDETAIL TEMP JOIN ( SELECT "TEMPADVACBASICDETAIL".CUSTOMERACID , (:B1 + ROW_NUMBER() OVER ( ORDER BY ( SELECT 1 FROM DUAL ) )) AC_KEY FROM RBL_TEMPDB.TEMPADVACBASICDETAIL WHERE "TEMPADVACBASICDETAIL".AC_KEY = 0 OR "TEMPADVACBASICDETAIL".AC_KEY IS NULL ) ACCT ON TEMP.CUSTOMERACID = ACCT.CUSTOMERACID WHERE TEMP.ISCHANGED IN ( ''N'',''C'' ) ) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.AC_KEY = SRC.AC_KEY',79642);
