Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('143k76n9kkaqd','MERGE INTO GTT_ACCOUNTCAL B USING (SELECT B.ROWID ROW_ID, CASE WHEN A.ASSET_NORM <> ''ALWYS_STD'' THEN A.SYSASSETCLASSALT_KEY ELSE ( SELECT DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE DIMASSETCLASS.ASSETCLASSSHORTNAME = ''STD'' AND DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) END AS FINALASSETCLASSALT_KEY FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID AND ( NVL(A.FLGPROCESSING, ''N'') = ''N'' ) AND A.REFCUSTOMERID IS NOT NULL ) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.FINALASSETCLASSALT_KEY = SRC.FINALASSETCLASSALT_KEY',79250);
