Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7qh3d2b6mwsy0','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID, D.SYSASSETCLASSALT_KEY, D.SYSNPA_DT, CASE WHEN A.FINALASSETCLASSALT_KEY = 1 AND D.SYSASSETCLASSALT_KEY > 1 THEN CASE WHEN D.PERCTYPE = ''ADV'' THEN ''PERCOLATION BY LOAN AC UCIFID '' || D.UCIF_ID WHEN D.PERCTYPE = ''DER'' THEN ''PERCOLATION BY DERIVATIVE UCIFID '' || D.UCIF_ID ELSE A.DEGREASON END ELSE A.DEGREASON END AS POS_4 FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTBASICDETAIL B ON A.INVENTITYID = B.INVENTITYID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL C ON C.ISSUERENTITYID = B.ISSUERENTITYID AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 JOIN GTT_TEMPTABLE_UCFIC1 D ON D.UCIF_ID = C.UCIFID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALASSETCLASSALT_KEY = SRC.SYSASSETCLASSALT_KEY, A.NPIDT = SRC.SYSNPA_DT, A.DEGREASON = POS_4',79250);
