Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('635ufw725ajwp','INSERT INTO RBL_MISDB_PROD.ADVACBASICDETAIL ( AC_KEY, BRANCHCODE, ACCOUNTENTITYID, CUSTOMERENTITYID, SYSTEMACID, CUSTOMERACID, GLALT_KEY, PRODUCTALT_KEY, GLPRODUCTALT_KEY, FACILITYTYPE, SECTORALT_KEY, SUBSECTORALT_KEY, ACTIVITYALT_KEY, INDUSTRYALT_KEY, SCHEMEALT_KEY, DISTRICTALT_KEY, AREAALT_KEY, VILLAGEALT_KEY, STATEALT_KEY, CURRENCYALT_KEY, ORIGINALSANCTIONAUTHALT_KEY, ORIGINALLIMITREFNO, ORIGINALLIMIT, ORIGINALLIMITDT, DTOFFIRSTDISB, FLAGRELIEFWAVIER, UNDERLINEACTIVITYALT_KEY, MICROCREDIT, SEGMENTCODE, SCRCRERROR, ADJDT, ADJREASONALT_KEY, MARGINTYPE, PREF_INTTRATE, CURRENTLIMITREFNO, GUARANTEECOVERALT_KEY, ACCOUNTNAME, ASSETCLASS, JOINTACCOUNT, LASTDISBDT, SCRCRERRORBACKUP, ACCOUNTOPENDATE, AC_LADDT, AC_DOCUMENTDT, CURRENTLIMIT, INTTTYPEALT_KEY, INTTRATELOADFACTOR, MARGIN, CURRENTLIMITDT, AC_DUEDT, DRAWINGPOWERALT_KEY, REFCUSTOMERID, AUTHORISATIONSTATUS, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, CREATEDBY, DATECREATED, MODIFIEDBY, DATEMODIFIED, APPROVEDBY, DATEAPPROVED, D2KTIMESTAMP, MOCSTATUS, MOCDATE, MOCTYPEALT_KEY, ISLAD, FINCALEBASEDINDUSTRYALT_KEY, ACCATEGORYALT_KEY, ORIGINALSANCTIONAUTHLEVELALT_KEY, ACTYPEALT_KEY, SCRCRERRORSEQ, BSRUNID, ADDITIONALPROV, ACLATTESTDEVELOPMENT, SOURCEALT_KEY, LOANSERIES, LOANREFNO, SECURITIZATIONCODE, FULL_DISB, ORIGINALBRANCHCODE, PROJECTCOST, FLGSECURED, REFERENCEPERIOD ) ( SELECT AC_KEY , BRANCHCODE , ACCOUNTENTITYID , CUSTOMERENTITYID , SYSTEMACID , CUSTOMERACID , GLALT_KEY , PRODUCTALT_KEY , GLPRODUCTALT_KEY , FACILITYTYPE , SECTORALT_KEY , SUBSECTORALT_KEY , ACTIVITYALT_KEY , INDUSTRYALT_KEY , SCHEMEALT_KEY , DISTRICTALT_KEY , AREAALT_KEY , VILLAGEALT_KEY , STATEALT_KEY , CURRENCYALT_KEY , ORIGINALSANCTIONAUTHALT_KEY , ORIGINALLIMITREFNO , ORIGINALLIMIT , ORIGINALLIMITDT , DTOFFIRSTDISB , FLAGRELIEFWAVIER , UNDERLINEACTIVITYALT_KEY , MICROCREDIT , SEGMENTCODE , SCRCRERROR , ADJDT , ADJREASONALT_KEY , MARGINTYPE , PREF_INTTRATE , CURRENTLIMITREFNO , GUARANTEECOVERALT_KEY , ACCOUNTNAME , ASSETCLASS , JOINTACCOUNT , LASTDISBDT , SCRCRERRORBACKUP , ACCOUNTOPENDATE , AC_LADDT , AC_DOCUMENTDT , CURRENTLIMIT , INTTTYPEALT_KEY , INTTRATELOADFACTOR , MARGIN , CURRENTLIMITDT , AC_DUEDT , DRAWINGPOWERALT_KEY , REFCUSTOMERID , AUTHORISATIONSTATUS , EFFECTIVEFROMTIMEKEY , EFFECTIVETOTIMEKEY , CREATEDBY , DATECREATED , MODIFIEDBY , DATEMODIFIED , APPROVEDBY , DATEAPPROVED , SYSDATE D2KTIMESTAMP , MOCSTATUS , MOCDATE , MOCTYPEALT_KEY , ISLAD , FINCALEBASEDINDUSTRYALT_KEY , ACCATEGORYALT_KEY , ORIGINALSANCTIONAUTHLEVELALT_KEY , ACTYPEALT_KEY , SCRCRERRORSEQ , BSRUNID , ADDITIONALPROV , ACLATTESTDEVELOPMENT , SOURCEALT_KEY , LOANSERIES , LOANREFNO , SECURITIZATIONCODE , FULL_DISB , ORIGINALBRANCHCODE , PROJECTCOST , FLGSECURED , REFERENCEPERIOD FROM RBL_TEMPDB.TEMPADVACBASICDETAIL T WHERE NVL(T.ISCHANGED, ''U'') IN ( ''N'',''C'' ) )',79642);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8hf5szpmkp1bp','MERGE INTO RBL_TEMPDB.TEMPADVACBASICDETAIL A USING (SELECT A.ROWID ROW_ID, ''N'' FROM RBL_TEMPDB.TEMPADVACBASICDETAIL A WHERE NOT EXISTS ( SELECT 1 FROM RBL_MISDB_PROD.ADVACBASICDETAIL B WHERE B.EFFECTIVETOTIMEKEY = 49999 AND B.ACCOUNTENTITYID = A.ACCOUNTENTITYID AND A.SOURCEALT_KEY = B.SOURCEALT_KEY )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ISCHANGED = ''N''',79642);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('1265zg53d5155','MERGE INTO RBL_MISDB_PROD.ADVACBASICDETAIL AA USING (SELECT AA.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVACBASICDETAIL AA WHERE AA.EFFECTIVETOTIMEKEY = 49999 AND NOT EXISTS ( SELECT 1 FROM RBL_TEMPDB.TEMPADVACBASICDETAIL BB WHERE AA.ACCOUNTENTITYID = BB.ACCOUNTENTITYID AND AA.SOURCEALT_KEY = BB.SOURCEALT_KEY AND BB.EFFECTIVETOTIMEKEY = 49999 )) SRC ON ( AA.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, DATEMODIFIED = POS_3, MODIFIEDBY = ''SSISUSER''',79642);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('1mv370j3ttcyq','MERGE INTO RBL_TEMPDB.TEMPADVACBASICDETAIL A USING (SELECT A.ROWID ROW_ID, ''C'' FROM RBL_TEMPDB.TEMPADVACBASICDETAIL A JOIN RBL_MISDB_PROD.ADVACBASICDETAIL B ON B.ACCOUNTENTITYID = A.ACCOUNTENTITYID AND A.SOURCEALT_KEY = B.SOURCEALT_KEY WHERE B.EFFECTIVETOTIMEKEY = :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ISCHANGED = ''C''',79642);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('371pzummyhst5','INSERT INTO GTT_BILL_OVERDUE ( SELECT ACCOUNTENTITYID , BILLENTITYID , BALANCE , CASE WHEN NVL(BILLDUEDT, ''1900-01-01'') > NVL(BILLEXTENDEDDUEDT, ''1900-01-01'') THEN BILLDUEDT ELSE BILLEXTENDEDDUEDT END BILLDUEDT FROM CURDAT_RBL_MISDB_PROD.ADVFACBILLDETAIL WHERE EFFECTIVEFROMTIMEKEY <= :B2 AND EFFECTIVETOTIMEKEY >= :B2 AND BILLNATUREALT_KEY <> 9 AND NVL(BALANCE, 0) > 0 AND (CASE WHEN NVL(BILLDUEDT, ''1900-01-01'') > NVL(BILLEXTENDEDDUEDT, ''1900-01-01'') THEN BILLDUEDT ELSE BILLEXTENDEDDUEDT END) <= :B1 )',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('g9pk7txrhth96','DELETE MAIN_PRO.ACCOUNTCAL A WHERE ROWID IN ( SELECT A.ROWID FROM MAIN_PRO.ACCOUNTCAL A LEFT JOIN CURDAT_RBL_MISDB_PROD.ADVFACCREDITCARDDETAIL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 WHERE A.SOURCEALT_KEY = 6 AND B.ACCOUNTENTITYID IS NULL )',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cvhfsctqvfjrs','INSERT INTO MAIN_PRO.ADVACRESTRUCTURECAL ( ACCOUNTENTITYID, ASSETCLASSALT_KEYONINVOCATION, PRERESTRUCTUREASSETCLASSALT_KEY, PRERESTRUCTURENPA_DATE, PROVPERONRESTRUCURE, RESTRUCTURETYPEALT_KEY, COVID_OTR_CATGALT_KEY, RESTRUCTUREDT, SP_EXPIRYDATE, RESTRUCTUREPOS, DPD_ASONRESTRUCTURE, RESTRUCTUREFAILUREDATE, DPD_BREACH_DATE, ZERODPD_DATE, SP_EXPIRYEXTENDEDDATE, RES_POS_TO_CURRENTPOS_PER, CURRENTDPD, TOTALDPD, VDPD, ADDLPROVPER, PROVRELEASEPER, UPGRADEDATE, SURVPERIODENDDATE, PREDEGPROVPER, NONFINDPD, INITIALASSETCLASSALT_KEY, FINALASSETCLASSALT_KEY, RESTRUCTUREPROVISION, SECUREDPROVISION, UNSECUREDPROVISION, FLGDEG, FLGUPG, DEGDATE, RESTRUCTURESTAGE, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, INVESTMENTGRADE, POS_10PERPAIDDATE, FLGMORAT, PRERESTRUCTURENPA_PROV, RESTRUCTUREFACILITYTYPEALT_KEY ) ( SELECT A.ACCOUNTENTITYID , ASSETCLASSALT_KEYONINVOCATION , PRERESTRUCTUREASSETCLASSALT_KEY , PRERESTRUCTURENPA_DATE , PROVPERONRESTRUCURE , RESTRUCTURETYPEALT_KEY , COVID_OTR_CATGALT_KEY , RESTRUCTUREDT , UTILS.DATEADD(''YY'', 1, (CASE WHEN NVL(PRINCREPAYSTARTDATE, ''1900-01-01'') >= NVL(INTTREPAYSTARTDATE, ''1900-01-01'') THEN PRINCREPAYSTARTDATE ELSE INTTREPAYSTARTDATE END)) SP_EXPIRYDATE , CASE WHEN NVL(RESTRUCTUREPOS, 0) <= 0 THEN 0 ELSE NVL(RESTRUCTUREPOS, 0) END RESTRUCTUREPOS , DPD_ASONRESTRUCTURE , NULL RESTRUCTUREFAILUREDATE , DPD_BREACH_DATE , ZERODPD_DATE , NULL SP_EXPIRYEXTENDEDDATE , 0 RES_POS_TO_CURRENTPOS_PER , 0 CURRENTDPD , 0 TOTALDPD , 0 VDPD , 0 ADDLPROVPER , 0 PROVRELEASEPER , UPGRADEDATE , SURVPERIODENDDATE , PREDEGPROVPER , 0 NONFINDPD , 1 INITIALASSETCLASSALT_KEY , 1 FINALASSETCLASSALT_KEY , 0 RESTRUCTUREPROVISION , 0 SECUREDPROVISION , 0 UNSECUREDPROVISION , ''N'' FLGDEG , ''N'' FLGUPG , NULL DEGDATE , RESTRUCTURESTAGE , :B1 EFFECTIVEFROMTIMEKEY , :B1 EFFECTIVETOTIMEKEY , INVESTMENTGRADE , POS_10PERPAIDDATE , FLGMORAT , PRERESTRUCTURENPA_PROV , RESTRUCTUREFACILITYTYPEALT_KEY FROM RBL_MISDB_PROD.ADVACRESTRUCTUREDETAIL A JOIN MAIN_PRO.ACCOUNTCAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 )',81256);
