Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4d5ufsqp55d8z','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, CASE WHEN A.POS_10PERPAIDDATE > SP_EXPIRYDATE THEN A.POS_10PERPAIDDATE ELSE SP_EXPIRYDATE END AS SP_EXPIRYDATE FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN CURDAT_RBL_MISDB_PROD.ADVACRESTRUCTUREDETAIL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID AND ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = B.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' AND D.PARAMETERSHORTNAMEENUM = ''PRUDENTIAL'' WHERE A.POS_10PERPAIDDATE IS NOT NULL) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SP_EXPIRYDATE = SRC.SP_EXPIRYDATE',81256);
