Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('g0pxdzzn86xg6','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, B.LASTCRDATE FROM MAIN_PRO.ACCOUNTCAL A JOIN MAIN_PRO.LASTCREDITDTACCOUNTCAL B ON ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) AND A.CUSTOMERACID = B.CUSTOMERACID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.LASTCRDATE = SRC.LASTCRDATE',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('f9t6y7d7br67n','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''ALWYS_NPA'', ''NPA DUE TO Sarfaesi Account'' AS POS_3, ''Y'' FROM MAIN_PRO.ACCOUNTCAL A JOIN RBL_MISDB_PROD.EXCEPTIONFINALSTATUSTYPE B ON A.CUSTOMERACID = B.ACID WHERE ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) AND B.STATUSTYPE = ( SELECT PARAMETERSHORTNAMEENUM FROM RBL_MISDB_PROD.DIMPARAMETER WHERE DIMPARAMETERNAME = ''UploadFLagType'' AND PARAMETERSHORTNAMEENUM = ''SARFAESI'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 ) AND FINALASSETCLASSALT_KEY > 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ASSET_NORM = ''ALWYS_NPA'', A.NPA_REASON = POS_3, A.SARFAESI = ''Y''',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('g7fp2bb6aqm96','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''ALWYS_STD'' FROM MAIN_PRO.ACCOUNTCAL A JOIN CURDAT_RBL_MISDB_PROD.ADVACBASICDETAIL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID WHERE ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) AND ASSETCLASS = ''1'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ASSET_NORM = ''ALWYS_STD''',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('df3ttqk90j5h2','INSERT INTO GTT_TEMPDERECOGNISEDINTEREST ( ACCOUNTENTITYID, DERECOGNISEDINTEREST1 ) ( SELECT A.ACCOUNTENTITYID , SUM(NVL(DERECOGNISEDINTEREST1, 0)) DERECOGNISEDINTEREST1 FROM CURDAT_RBL_MISDB_PROD.ADVFACBILLDETAIL A WHERE ( A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 ) AND NVL(DERECOGNISEDINTEREST1, 0) > 0 GROUP BY A.ACCOUNTENTITYID UNION SELECT A.ACCOUNTENTITYID , SUM(NVL(DERECOGNISEDINTEREST1, 0)) DERECOGNISEDINTEREST1 FROM CURDAT_RBL_MISDB_PROD.ADVFACPCDETAIL A WHERE ( A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 ) AND NVL(DERECOGNISEDINTEREST1, 0) > 0 GROUP BY A.ACCOUNTENTITYID UNION ALL SELECT B.ACCOUNTENTITYID , SUM(NVL(B.DERECOGNISEDINTEREST1, 0)) DERECOGNISEDINTEREST1 FROM CURDAT_RBL_MISDB_PROD.ADVFACCCDETAIL B WHERE ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) AND NVL(DERECOGNISEDINTEREST1, 0) > 0 GROUP BY B.ACCOUNTENTITYID UNION ALL SELECT C.ACCOUNTENTITYID , SUM(NVL(C.DERECOGNISEDINTEREST1, 0)) DERECOGNISEDINTEREST1 FROM CURDAT_RBL_MISDB_PROD.ADVFACDLDETAIL C WHERE ( C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 ) AND NVL(DERECOGNISEDINTEREST1, 0) > 0 GROUP BY C.ACCOUNTENTITYID )',81256);
