Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('csqk8qn7crpjt','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(B.SYSASSETCLASSALT_KEY, 1) AS FINALASSETCLASSALT_KEY FROM MAIN_PRO.ACCOUNTCAL A JOIN MAIN_PRO.CUSTOMERCAL B ON A.UCIFENTITYID = B.UCIFENTITYID AND ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALASSETCLASSALT_KEY = SRC.FINALASSETCLASSALT_KEY',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fnu1y5q6b29nx','INSERT INTO GTT_MOC_DATA ( SELECT UCIFENTITYID , MAX(ASSETCLASSALT_KEY) SYSASSETCLASSALT_KEY , MIN(NPA_DATE) SYSNPA_DT , ''Manual'' MOCTYPE , A.EFFECTIVEFROMTIMEKEY FROM RBL_MISDB_PROD.MOC_CHANGEDETAILS A JOIN MAIN_PRO.ACCOUNTCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID WHERE A.EFFECTIVEFROMTIMEKEY <= :B2 AND A.EFFECTIVETOTIMEKEY >= :B2 AND ( MOC_EXPIREDATE >= :B1 ) AND MOCTYPE_FLAG = ''CUST'' AND A.MOCTYPE = ''Manual'' GROUP BY UCIFENTITYID,A.EFFECTIVEFROMTIMEKEY )',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('9x58crfyysgkr','INSERT INTO MAIN_PRO.PROCESSMONITOR ( USERID, DESCRIPTION, MODE_, STARTTIME, ENDTIME, TIMEKEY, SETID ) ( SELECT USER , ''UPDATE AddlProvisionAmount  AT Account level'' , ''RUNNING'' , SYSDATE , NULL , :B2 , :B1 FROM DUAL )',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8uhvawgf0pxx8','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, B.SYSNPA_DT FROM MAIN_PRO.ACCOUNTCAL A JOIN MAIN_PRO.CUSTOMERCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALNPADT = SRC.SYSNPA_DT',81256);
