Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bgxr9kj1044aj','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''N'', NULL FROM MAIN_PRO.ACCOUNTCAL A JOIN RBL_MISDB_PROD.DIMPRODUCT C ON A.PRODUCTALT_KEY = C.PRODUCTALT_KEY JOIN CURDAT_RBL_MISDB_PROD.ADVACBASICDETAIL ABD ON ( ABD.EFFECTIVEFROMTIMEKEY <= :B1 AND ABD.EFFECTIVETOTIMEKEY >= :B1 ) AND ABD.ACCOUNTENTITYID = A.ACCOUNTENTITYID WHERE A.FACILITYTYPE IN ( ''CC'',''OD'' ) AND ( UTILS.DATEADD(''DAY'', 89, A.DEBITSINCEDT) > :B2 AND A.DEBITSINCEDT IS NOT NULL AND ASSET_NORM <> ''ALWYS_STD'' ) AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 AND INTTSERVICED = ''N'' AND ABD.REFERENCEPERIOD = 91) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.INTTSERVICED = ''N'', A.INTNOTSERVICEDDT = NULL',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('dpzcfr7w17644','MERGE INTO MAIN_PRO.CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, DA.ASSETCLASSALT_KEY, B.NPA_DATE, ''ALWYS_NPA'', B.REASON, ''NPA DUE TO Adhoc'' AS POS_6, B.DATECREATED FROM MAIN_PRO.CUSTOMERCAL A JOIN RBL_MISDB_PROD.ADHOCACL_CHANGEDETAILS B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID JOIN RBL_MISDB_PROD.DIMASSETCLASS DA ON DA.ASSETCLASSALT_KEY = B.ASSETCLASSALT_KEY AND DA.ASSETCLASSSHORTNAME <> ''STD'' AND DA.EFFECTIVEFROMTIMEKEY <= :B1 AND DA.EFFECTIVETOTIMEKEY >= :B1 WHERE B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SYSASSETCLASSALT_KEY = SRC.ASSETCLASSALT_KEY, A.SYSNPA_DT = SRC.NPA_DATE, A.ASSET_NORM = ''ALWYS_NPA'', A.MOCREASON = SRC.REASON, A.DEGREASON = POS_6, A.MOC_DT = SRC.DATECREATED',81256);
