Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3cvz993mubm5s','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, C.COVERGOVGUR FROM MAIN_PRO.ACCOUNTCAL A JOIN ( SELECT A.ACCOUNTENTITYID , SUM(NVL(NVL(CLAIMCOVERAMT, 0) + NVL(CLAIMRECEIVEDAMT, 0), 0)) COVERGOVGUR FROM CURDAT_RBL_MISDB_PROD.ADVFACBILLDETAIL A JOIN MAIN_PRO.ACCOUNTCAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID WHERE ( A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 ) GROUP BY A.ACCOUNTENTITYID ) C ON A.ACCOUNTENTITYID = C.ACCOUNTENTITYID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.COVERGOVGUR = SRC.COVERGOVGUR',81256);
