Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('dd56fqp9r0vgq','MERGE INTO MAIN_PRO.CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, ''ALWYS_STD'' FROM MAIN_PRO.CUSTOMERCAL A LEFT JOIN RBL_MISDB_PROD.DIMCONSTITUTION DCO ON DCO.EFFECTIVEFROMTIMEKEY <= :B1 AND DCO.EFFECTIVETOTIMEKEY >= :B1 AND A.CONSTITUTIONALT_KEY = DCO.CONSTITUTIONALT_KEY LEFT JOIN RBL_MISDB_PROD.DIMSPLCATEGORY DAS1 ON DAS1.EFFECTIVEFROMTIMEKEY <= :B1 AND DAS1.EFFECTIVETOTIMEKEY >= :B1 AND A.SPLCATG1ALT_KEY = DAS1.SPLCATALT_KEY LEFT JOIN RBL_MISDB_PROD.DIMSPLCATEGORY DAS2 ON DAS2.EFFECTIVEFROMTIMEKEY <= :B1 AND DAS2.EFFECTIVETOTIMEKEY >= :B1 AND A.SPLCATG2ALT_KEY = DAS2.SPLCATALT_KEY LEFT JOIN RBL_MISDB_PROD.DIMSPLCATEGORY DAS3 ON DAS3.EFFECTIVEFROMTIMEKEY <= :B1 AND DAS3.EFFECTIVETOTIMEKEY >= :B1 AND A.SPLCATG3ALT_KEY = DAS3.SPLCATALT_KEY LEFT JOIN RBL_MISDB_PROD.DIMSPLCATEGORY DAS4 ON DAS4.EFFECTIVEFROMTIMEKEY <= :B1 AND DAS4.EFFECTIVETOTIMEKEY >= :B1 AND A.SPLCATG4ALT_KEY = DAS4.SPLCATALT_KEY WHERE ( ( NVL(DCO.ASSETCLASS, ''NORMAL'') = ''ALWYS_STD'' ) OR ( NVL(DAS1.ASSETCLASS, ''NORMAL'') = ''ALWYS_STD'' ) OR ( NVL(DAS2.ASSETCLASS, ''NORMAL'') = ''ALWYS_STD'' ) OR ( NVL(DAS3.ASSETCLASS, ''NORMAL'') = ''ALWYS_STD'' OR NVL(DAS4.ASSETCLASS, ''NORMAL'') = ''ALWYS_STD'' ) )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ASSET_NORM = ''ALWYS_STD''',81256);
