Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gp1wxt6pydvby','MERGE INTO MAIN_PRO.ACCOUNTCAL ACL USING (SELECT ACL.ROWID ROW_ID, ''ALWYS_NPA'', ''NPA DUE TO '' || STATUSTYPE AS POS_3, CASE WHEN STATUSDATE < FINALNPADT THEN STATUSDATE ELSE FINALNPADT END AS POS_4 FROM MAIN_PRO.ACCOUNTCAL ACL JOIN RBL_MISDB_PROD.EXCEPTIONFINALSTATUSTYPE B ON ACL.CUSTOMERACID = B.ACID AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 WHERE B.STATUSTYPE IN ( ''Settlement'',''Litigation'' ) AND FINALASSETCLASSALT_KEY > 1) SRC ON ( ACL.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET ACL.ASSET_NORM = ''ALWYS_NPA'', ACL.NPA_REASON = POS_3, ACL.FINALNPADT = POS_4',81256);
