Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('1xdk8u7ag40rk','MERGE INTO MAIN_PRO.ACCOUNTCAL ACL USING (SELECT ACL.ROWID ROW_ID, ''ALWYS_STD'' FROM MAIN_PRO.ACCOUNTCAL ACL LEFT JOIN RBL_MISDB_PROD.DIMSCHEME DSE ON DSE.EFFECTIVEFROMTIMEKEY <= :B1 AND DSE.EFFECTIVETOTIMEKEY >= :B1 AND ACL.SCHEMEALT_KEY = DSE.SCHEMEALT_KEY LEFT JOIN RBL_MISDB_PROD.DIMACSPLCATEGORY DAS1 ON DAS1.EFFECTIVEFROMTIMEKEY <= :B1 AND DAS1.EFFECTIVETOTIMEKEY >= :B1 AND NVL(ACL.SPLCATG1ALT_KEY, 0) = DAS1.SPLCATALT_KEY AND NVL(DAS1.ASSETCLASS, ''NORMAL'') = ''ALWYS_STD'' LEFT JOIN RBL_MISDB_PROD.DIMACSPLCATEGORY DAS2 ON DAS2.EFFECTIVEFROMTIMEKEY <= :B1 AND DAS2.EFFECTIVETOTIMEKEY >= :B1 AND NVL(ACL.SPLCATG2ALT_KEY, 0) = DAS2.SPLCATALT_KEY AND NVL(DAS2.ASSETCLASS, ''NORMAL'') = ''ALWYS_STD'' LEFT JOIN RBL_MISDB_PROD.DIMACSPLCATEGORY DAS3 ON DAS3.EFFECTIVEFROMTIMEKEY <= :B1 AND DAS3.EFFECTIVETOTIMEKEY >= :B1 AND NVL(ACL.SPLCATG3ALT_KEY, 0) = DAS3.SPLCATALT_KEY AND NVL(DAS3.ASSETCLASS, ''NORMAL'') = ''ALWYS_STD'' LEFT JOIN RBL_MISDB_PROD.DIMACSPLCATEGORY DAS4 ON DAS4.EFFECTIVEFROMTIMEKEY <= :B1 AND DAS4.EFFECTIVETOTIMEKEY >= :B1 AND NVL(ACL.SPLCATG4ALT_KEY, 0) = DAS4.SPLCATALT_KEY AND NVL(DAS4.ASSETCLASS, ''NORMAL'') = ''ALWYS_STD'' LEFT JOIN RBL_MISDB_PROD.DIMPRODUCT P ON P.PRODUCTALT_KEY = ACL.PRODUCTALT_KEY AND P.EFFECTIVEFROMTIMEKEY <= :B1 AND P.EFFECTIVETOTIMEKEY >= :B1 WHERE ( ( NVL(DSE.ASSETCLASS, ''NORMAL'') = ''ALWYS_STD'' ) OR ( NVL(DAS1.ASSETCLASS, ''NORMAL'') = ''ALWYS_STD'' ) OR ( NVL(DAS2.ASSETCLASS, ''NORMAL'') = ''ALWYS_STD'' ) OR ( NVL(DAS3.ASSETCLASS, ''NORMAL'') = ''ALWYS_STD'' ) OR ( NVL(DAS4.ASSETCLASS, ''NORMAL'') = ''ALWYS_STD'' ) ) OR ( NVL(P.ASSETCLASS, ''NORMAL'') = ''ALWYS_STD'' )) SRC ON ( ACL.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET ACL.ASSET_NORM = ''ALWYS_STD''',81256);
