Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('318bkca2uwqx8','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, C.PRODUCTCODE FROM MAIN_PRO.ACCOUNTCAL A JOIN CURDAT_RBL_MISDB_PROD.ADVACBASICDETAIL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID JOIN RBL_MISDB_PROD.DIMPRODUCT C ON B.PRODUCTALT_KEY = C.PRODUCTALT_KEY WHERE ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) AND ( C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.PRODUCTCODE = SRC.PRODUCTCODE',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('85h8yghb26xng','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''N'', UTILS.DATEADD(''DAY'', -89, :B2 ) AS POS_3 FROM MAIN_PRO.ACCOUNTCAL A JOIN RBL_MISDB_PROD.DIMPRODUCT C ON A.PRODUCTALT_KEY = C.PRODUCTALT_KEY JOIN CURDAT_RBL_MISDB_PROD.ADVACBASICDETAIL ABD ON ( ABD.EFFECTIVEFROMTIMEKEY <= :B1 AND ABD.EFFECTIVETOTIMEKEY >= :B1 ) AND ABD.ACCOUNTENTITYID = A.ACCOUNTENTITYID WHERE NVL(A.BALANCE, 0) > 0 AND NVL(A.CURQTRCREDIT, 0) < NVL(A.CURQTRINT, 0) AND A.FACILITYTYPE IN ( ''CC'',''OD'' ) AND ( ASSET_NORM <> ''ALWYS_STD'' ) AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 AND ABD.REFERENCEPERIOD = 91) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.INTTSERVICED = ''N'', A.INTNOTSERVICEDDT = POS_3',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('d77hr8tdcm676','INSERT INTO MAIN_PRO.CONTEXCSSINCEDTACCOUNTCAL ( CUSTOMERACID, ACCOUNTENTITYID, SANCTIONAMT, SANCTIONDT, BALANCE, DRAWINGPOWER, CONTEXCSSINCEDT, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY ) ( SELECT A.CUSTOMERACID , A.ACCOUNTENTITYID , CURRENTLIMIT SANCTIONAMT , CURRENTLIMITDT SANCTIONDT , C.BALANCE , DRAWINGPOWER , CONTEXCSSINCEDT , 26418 EFFECTIVEFROMTIMEKEY , 49999 FROM RBL_TEMPDB.TEMPADVACBASICDETAIL A JOIN RBL_TEMPDB.TEMPADVFACCCDETAIL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID JOIN RBL_TEMPDB.TEMPADVACBALANCEDETAIL C ON C.ACCOUNTENTITYID = A.ACCOUNTENTITYID JOIN RBL_TEMPDB.TEMPADVACBALANCEDETAIL D ON D.ACCOUNTENTITYID = A.ACCOUNTENTITYID JOIN RBL_TEMPDB.TEMPADVACFINANCIALDETAIL E ON E.ACCOUNTENTITYID = A.ACCOUNTENTITYID WHERE CONTEXCSSINCEDT IS NOT NULL AND A.PRODUCTALT_KEY = 358 )',81256);
