Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7znjw6v7tb52n','INSERT INTO GTT_CCOD_90DAYS_INTT_CR_AMT ( SELECT A.CUSTOMERACID , SUM(CASE WHEN TXNTYPE = ''DEBIT'' THEN TXNAMOUNT ELSE 0 END) INTERESTAMT , SUM(CASE WHEN TXNTYPE = ''CREDIT'' THEN TXNAMOUNT ELSE 0 END) CREDITAMT FROM CURDAT_RBL_MISDB_PROD.ACDAILYTXNDETAIL A JOIN CURDAT_RBL_MISDB_PROD.ADVACBASICDETAIL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 AND B.FACILITYTYPE IN ( ''CC'',''OD'' ) WHERE TXNDATE BETWEEN UTILS.DATEADD(''DD'', -89, :B2 ) AND :B2 GROUP BY A.CUSTOMERACID )',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('dc47042a3ngmm','INSERT INTO GTT_PC_OVERDUE ( SELECT ACCOUNTENTITYID , PCREFNO , BALANCE , CASE WHEN NVL(PCDUEDT, ''1900-01-01'') > NVL(PCEXTENDEDDUEDT, ''1900-01-01'') THEN PCDUEDT ELSE PCEXTENDEDDUEDT END PCOVERDUEDUEDT FROM CURDAT_RBL_MISDB_PROD.ADVFACPCDETAIL WHERE EFFECTIVEFROMTIMEKEY <= :B2 AND EFFECTIVETOTIMEKEY >= :B2 AND NVL(BALANCE, 0) > 0 AND (CASE WHEN NVL(PCDUEDT, ''1900-01-01'') > NVL(PCEXTENDEDDUEDT, ''1900-01-01'') THEN PCDUEDT ELSE PCEXTENDEDDUEDT END) <= :B1 )',81256);
