Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('a0fphkwuwdafs','MERGE INTO RBL_MISDB_PROD.MOC_CHANGEDETAILS A USING (SELECT A.ROWID ROW_ID, :B1 FROM RBL_MISDB_PROD.MOC_CHANGEDETAILS A WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND A.MOCTYPE = ''AUTO'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.EFFECTIVETOTIMEKEY = V_TIMEKEY',81256);
