Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gqzjub2bh0d7j','INSERT INTO RBL_MISDB_PROD.ADVACOTHERDETAIL ( ENTITYKEY, ACCOUNTENTITYID, GOVGURAMT, SPLCATG1ALT_KEY, SPLCATG2ALT_KEY, REFINANCEAGENCYALT_KEY, REFINANCEAMOUNT, BANKALT_KEY, TRANSFERAMT, PROJECTID, CONSORTIUMID, REFSYSTEMACID, AUTHORISATIONSTATUS, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, CREATEDBY, DATECREATED, MODIFIEDBY, DATEMODIFIED, APPROVEDBY, DATEAPPROVED, D2KTIMESTAMP, MOCSTATUS, MOCDATE, SPLCATG3ALT_KEY, SPLCATG4ALT_KEY, MOCTYPEALT_KEY, GOVGUREXPDT, SPLFLAG ) ( SELECT ENTITYKEY , ACCOUNTENTITYID , GOVGURAMT , SPLCATG1ALT_KEY , SPLCATG2ALT_KEY , REFINANCEAGENCYALT_KEY , REFINANCEAMOUNT , BANKALT_KEY , TRANSFERAMT , PROJECTID , CONSORTIUMID , REFSYSTEMACID , AUTHORISATIONSTATUS , EFFECTIVEFROMTIMEKEY , EFFECTIVETOTIMEKEY , CREATEDBY , DATECREATED , MODIFIEDBY , DATEMODIFIED , APPROVEDBY , DATEAPPROVED , SYSDATE D2KTIMESTAMP , MOCSTATUS , MOCDATE , SPLCATG3ALT_KEY , SPLCATG4ALT_KEY , MOCTYPEALT_KEY , GOVGUREXPDT , NULL SPLFLAG FROM RBL_TEMPDB.TEMPADVACOTHERDETAIL T WHERE NVL(T.ISCHANGED, ''U'') IN ( ''N'',''C'' ) )',79647);
