Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('dk2kbhwqbr42f','INSERT INTO MAIN_PRO.ACCOUNTCAL ( ACCOUNTENTITYID, CUSTOMERACID, FLGDEG, FLGDIRTYROW, FLGINMONTH, FLGSMA, FLGPNPA, FLGUPG, FLGFITL, FLGABINITIO, REFPERIODOVERDUEUPG, REFPERIODOVERDRAWNUPG, REFPERIODNOCREDITUPG, REFPERIODINTSERVICEUPG, REFPERIODSTKSTATEMENTUPG, REFPERIODREVIEWUPG, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, ASSET_NORM, SPLCATG1ALT_KEY, SPLCATG2ALT_KEY, SPLCATG3ALT_KEY, SPLCATG4ALT_KEY, BALANCE, BALANCEINCRNCY, NETBALANCE, CURRENCYALT_KEY, SOURCEALT_KEY, SECAPP, PROVCOVERGOVGUR, BANKPROVSECURED, BANKPROVUNSECURED, BANKTOTALPROVISION, RBIPROVSECURED, RBIPROVUNSECURED, RBITOTALPROVISION, APPGOVGUR, USEDRV, COMPUTEDCLAIM, PROVPERSECURED, PROVPERUNSECURED, REFPERIODOVERDUE, REFPERIODOVERDRAWN, REFPERIODNOCREDIT, REFPERIODINTSERVICE, REFPERIODSTKSTATEMENT, REFPERIODREVIEW, INITIALASSETCLASSALT_KEY, FINALASSETCLASSALT_KEY, REFCUSTOMERID, SOURCESYSTEMCUSTOMERID, CUSTOMERENTITYID, BRANCHCODE, PRODUCTALT_KEY, CURRENTLIMIT, CURRENTLIMITDT, SCHEMEALT_KEY, SUBSECTORALT_KEY, FACILITYTYPE, INTTRATE, ACOPENDT, FIRSTDTOFDISB, PRVASSETCLASSALT_KEY, FLGSECURED, UCIF_ID, UCIFENTITYID, ACTSEGMENTCODE, ISCHANGED ) ( SELECT ACCOUNTENTITYID ACCOUNTENTITYID , CUSTOMERACID CUSTOMERACID , ''N'' FLGDEG , ''N'' FLGDIRTYROW , ''N'' FLGINMONTH , ''N'' FLGSMA , ''N'' FLGPNPA , ''N'' FLGUPG , ''N'' FLGFITL , ''N'' FLGABINITIO , ( SELECT UTILS.CONVERT_TO_NUMBER(REFVALUE,10,0) FROM MAIN_PRO.REFPERIOD WHERE BUSINESSRULE = ''REFPERIODOVERDUEUPG'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 FETCH FIRST 1 ROWS ONLY ) REFPERIODOVERDUEUPG , ( SELECT UTILS.CONVERT_TO_NUMBER(REFVALUE,10,0) FROM MAIN_PRO.REFPERIOD WHERE BUSINESSRULE = ''REFPERIODOVERDRAWNUPG'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 FETCH FIRST 1 ROWS ONLY ) REFPERIODOVERDRAWNUPG , ( SELECT UTILS.CONVERT_TO_NUMBER(REFVALUE,10,0) FROM MAIN_PRO.REFPERIOD WHERE BUSINESSRULE = ''REFPERIODNOCREDITUPG'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 FETCH FIRST 1 ROWS ONLY ) REFPERIODNOCREDITUPG , ( SELECT UTILS.CONVERT_TO_NUMBER(REFVALUE,10,0) FROM MAIN_PRO.REFPERIOD WHERE BUSINESSRULE = ''REFPERIODINTSERVICEUPG'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 FETCH FIRST 1 ROWS ONLY ) REFPERIODINTSERVICEUPG , ( SELECT UTILS.CONVERT_TO_NUMBER(REFVALUE,10,0) FROM MAIN_PRO.REFPERIOD WHERE BUSINESSRULE = ''REFPERIODSTKSTATEMENTUPG'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 FETCH FIRST 1 ROWS ONLY ) REFPERIODSTKSTATEMENTUPG , ( SELECT UTILS.CONVERT_TO_NUMBER(REFVALUE,10,0) FROM MAIN_PRO.REFPERIOD WHERE BUSINESSRULE = ''REFPERIODREVIEWUPG'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 FETCH FIRST 1 ROWS ONLY ) REFPERIODREVIEWUPG , :B1 EFFECTIVEFROMTIMEKEY , :B1 EFFECTIVETOTIMEKEY , ''NORMAL'' ASSET_NORM , 0 SPLCATG1ALT_KEY , 0 SPLCATG2ALT_KEY , 0 SPLCATG3ALT_KEY , 0 SPLCATG4ALT_KEY , 0.00 BALANCE , 0.00 BALANCEINCRNCY , 0.00 NETBALANCE , 62 CURRENCYALT_KEY , ABD.SOURCEALT_KEY SOURCEALT_KEY , ABD.FLGSECURED SECAPP , 0.00 PROVCOVERGOVGUR , 0.00 BANKPROVSECURED , 0.00 BANKPROVUNSECURED , 0.00 BANKTOTALPROVISION , 0.00 RBIPROVSECURED , 0.00 RBIPROVUNSECURED , 0.00 RBITOTALPROVISION , 0.00 APPGOVGUR , 0.00 USEDRV , 0.00 COMPUTEDCLAIM , 0.00 PROVPERSECURED , 0.00 PROVPERUNSECURED , ( SELECT REFVALUE FROM MAIN_PRO.REFPERIOD WHERE BUSINESSRULE = ''REFPERIODOVERDUE'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 FETCH FIRST 1 ROWS ONLY ) REFPERIODOVERDUE , ( SELECT REFVALUE FROM MAIN_PRO.REFPERIOD WHERE BUSINESSRULE = ''REFPERIODOVERDRAWN'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 FETCH FIRST 1 ROWS ONLY ) REFPERIODOVERDRAWN , ( SELECT REFVALUE FROM MAIN_PRO.REFPERIOD WHERE BUSINESSRULE = ''REFPERIODNOCREDIT'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 FETCH FIRST 1 ROWS ONLY ) REFPERIODNOCREDIT , ( SELECT REFVALUE FROM MAIN_PRO.REFPERIOD WHERE BUSINESSRULE = ''REFPERIODINTSERVICE'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 FETCH FIRST 1 ROWS ONLY ) REFPERIODINTSER',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('6zhwnhxsww3hc','UPDATE MAIN_PRO.PUI_CAL SET FINNALDCCO_DATE = CASE WHEN NVL(ORIGINALDCCO, ''1900-01-01'') > NVL(CIODCCO, ''1900-01-01'') AND NVL(ORIGINALDCCO, ''1900-01-01'') > NVL(FRESHORIGINALDCCO, ''1900-01-01'') THEN ORIGINALDCCO WHEN NVL(CIODCCO, ''1900-01-01'') > NVL(ORIGINALDCCO, ''1900-01-01'') AND NVL(CIODCCO, ''1900-01-01'') > NVL(FRESHORIGINALDCCO, ''1900-01-01'') THEN CIODCCO WHEN NVL(FRESHORIGINALDCCO, ''1900-01-01'') > NVL(CIODCCO, ''1900-01-01'') AND NVL(FRESHORIGINALDCCO, ''1900-01-01'') > NVL(ORIGINALDCCO, ''1900-01-01'') THEN FRESHORIGINALDCCO ELSE ''1900-01-01'' END',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('89h0dzdw1n2h1','MERGE INTO MAIN_PRO.CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, ''ALWYS_NPA'', ''NPA DUE TO '' || STATUSTYPE AS POS_3, 2, CASE WHEN STATUSDATE IS NOT NULL THEN STATUSDATE ELSE :B2 END AS POS_5 FROM MAIN_PRO.CUSTOMERCAL A JOIN RBL_MISDB_PROD.EXCEPTIONFINALSTATUSTYPE B ON A.REFCUSTOMERID = B.CUSTOMERID AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 WHERE B.STATUSTYPE IN ( ''Settlement'',''Litigation'' ) AND SYSASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ASSET_NORM = ''ALWYS_NPA'', A.DEGREASON = POS_3, A.SYSASSETCLASSALT_KEY = 2, A.SYSNPA_DT = POS_5',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8mpwt32sm7bxx','INSERT INTO GTT_STOCK ( SELECT ACCOUNTENTITYID , MIN(VALUATIONDT) STKSMTDT , ''S'' TYPE FROM ( SELECT ADVSEC.ACCOUNTENTITYID , SECURITYSHORTNAMEENUM , NVL(MAX(SECDTL.VALUATIONDATE) , ''9999-01-01'') VALUATIONDT FROM CURDAT_RBL_MISDB_PROD.ADVSECURITYVALUEDETAIL SECDTL JOIN CURDAT_RBL_MISDB_PROD.ADVSECURITYDETAIL ADVSEC ON ADVSEC.SECURITYENTITYID = SECDTL.SECURITYENTITYID JOIN RBL_MISDB_PROD.DIMSECURITY SEC ON SECDTL.EFFECTIVEFROMTIMEKEY <= :B1 AND SECDTL.EFFECTIVETOTIMEKEY >= :B1 AND SEC.EFFECTIVEFROMTIMEKEY <= :B1 AND SEC.EFFECTIVETOTIMEKEY >= :B1 AND ADVSEC.SECURITYALT_KEY = SEC.SECURITYALT_KEY AND ADVSEC.EFFECTIVEFROMTIMEKEY <= :B1 AND ADVSEC.EFFECTIVETOTIMEKEY >= :B1 WHERE SECURITYSHORTNAMEENUM IN ( ''HYP-STOCK'',''HYP-BDEBT'' ) AND ADVSEC.SECURITYTYPE = ''P'' AND VALUATIONDATE IS NOT NULL GROUP BY ADVSEC.ACCOUNTENTITYID,SECURITYSHORTNAMEENUM ) ST GROUP BY ACCOUNTENTITYID )',81256);
