Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('c1g31zm5hbtw8','MERGE INTO MAIN_PRO.CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, CASE WHEN B.SYSASSETCLASSALT_KEY = 1 THEN ''ALWYS_STD'' ELSE ''ALWYS_NPA'' END AS POS_2, B.MOCTYPE , NVL(B.SYSNPA_DT, A.SYSNPA_DT) AS POS_4 FROM MAIN_PRO.CUSTOMERCAL A JOIN GTT_MOC_DATA B ON A.UCIFENTITYID = B.UCIFENTITYID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ASSET_NORM = POS_2, A.MOCTYPE = SRC.MOCTYPE, A.SYSNPA_DT = POS_4',81256);
