Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0jgxmj6qk2zfr','INSERT INTO MAIN_PRO.CUSTOMERCAL ( EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, BRANCHCODE, CUSTOMERENTITYID, REFCUSTOMERID, CUSTOMERNAME, CONSTITUTIONALT_KEY, FLGDEG, FLGUPG, FLGMOC, FLGSMA, FLGPROCESSING, FLGEROSION, FLGPNPA, FLGPERCOLATION, FLGINMONTH, FLGDIRTYROW, SRCNPA_DT, SYSNPA_DT, SPLCATG1ALT_KEY, SPLCATG2ALT_KEY, SPLCATG3ALT_KEY, SPLCATG4ALT_KEY, SOURCESYSTEMCUSTOMERID, ASSET_NORM, UCIF_ID, UCIFENTITYID, SOURCEALT_KEY, ISCHANGED ) ( SELECT :B3 EFFECTIVEFROMTIMEKEY , :B3 EFFECTIVETOTIMEKEY , PARENTBRANCHCODE BRANCHCODE , CBD.CUSTOMERENTITYID , CBD.CUSTOMERID , CBD.CUSTOMERNAME , CBD.CONSTITUTIONALT_KEY , ''N'' FLGDEG , ''N'' FLGUPG , ''N'' FLGMOC , ''N'' FLGSMA , ''N'' FLGPROCESSING , ''N'' FLGEROSION , ''N'' FLGPNPA , ''N'' FLGPERCOLATION , ''N'' FLGINMONTH , ''N'' FLGDIRTYROW , NULL SRCNPA_DT , NULL SYSNPA_DT , 0 SPLCATG1ALT_KEY , 0 SPLCATG2ALT_KEY , 0 SPLCATG3ALT_KEY , 0 SPLCATG4ALT_KEY , CBD.CUSTOMERID SOURCESYSTEMCUSTOMERID , ''NORMAL'' ASSET_NORM , UCIF_ID , UCIFENTITYID , CBD.SOURCESYSTEMALT_KEY , ''N'' ISCHANGED FROM CURDAT_RBL_MISDB_PROD.CUSTOMERBASICDETAIL CBD JOIN CURDAT_RBL_MISDB_PROD.ADVACBASICDETAIL ABD ON CBD.CUSTOMERENTITYID = ABD.CUSTOMERENTITYID AND UCIFENTITYID IN ( 260712,43236654,11405002 ) WHERE ( CBD.EFFECTIVEFROMTIMEKEY <= :B3 AND CBD.EFFECTIVETOTIMEKEY >= :B3 ) AND ( ABD.EFFECTIVEFROMTIMEKEY <= :B3 AND ABD.EFFECTIVETOTIMEKEY >= :B3 ) AND (CASE WHEN :B2 IS NULL AND :B1 = ''N'' THEN ''0'' WHEN :B2 IS NULL AND :B1 = ''Y'' THEN CBD.MOCSTATUS WHEN :B2 IS NOT NULL AND :B1 = ''N'' THEN CBD.CUSTOMERID END) IN ( CASE WHEN :B2 IS NULL AND :B1 = ''N'' THEN ''0'' WHEN :B2 IS NULL AND :B1 = ''Y'' THEN ''Y'' WHEN :B2 IS NOT NULL AND :B1 = ''N'' THEN ( SELECT ACFD.REFCUSTOMERID FROM CURDAT_RBL_MISDB_PROD.ADVCUSTFINANCIALDETAIL ACFD WHERE ACFD.EFFECTIVEFROMTIMEKEY <= :B3 AND ACFD.EFFECTIVETOTIMEKEY >= :B3 AND BRANCHCODE = :B2 GROUP BY ACFD.REFCUSTOMERID ) END ) GROUP BY PARENTBRANCHCODE,CBD.CUSTOMERENTITYID,CBD.CUSTOMERID,CBD.CUSTOMERNAME,CBD.CONSTITUTIONALT_KEY,CBD.UCIF_ID,CBD.UCIFENTITYID,CBD.SOURCESYSTEMALT_KEY )',81256);
