Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('99m1n89ddb045','MERGE INTO MAIN_PRO.CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, B.FINALASSETCLASSALT_KEY, B.FINALNPADT, B.NPA_REASON, B.ASSET_NORM FROM MAIN_PRO.CUSTOMERCAL A JOIN MAIN_PRO.ACCOUNTCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID WHERE B.WEAKACCOUNT = ''Y'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SYSASSETCLASSALT_KEY = SRC.FINALASSETCLASSALT_KEY, A.SYSNPA_DT = SRC.FINALNPADT, A.DEGREASON = SRC.NPA_REASON, A.ASSET_NORM = SRC.ASSET_NORM',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('51srrzcu698h5','MERGE INTO MAIN_PRO.ACCOUNTCAL ACL USING (SELECT ACL.ROWID ROW_ID, ''ALWYS_NPA'' FROM MAIN_PRO.ACCOUNTCAL ACL LEFT JOIN RBL_MISDB_PROD.DIMSCHEME DSE ON DSE.EFFECTIVEFROMTIMEKEY <= :B1 AND DSE.EFFECTIVETOTIMEKEY >= :B1 AND ACL.SCHEMEALT_KEY = DSE.SCHEMEALT_KEY LEFT JOIN RBL_MISDB_PROD.DIMACSPLCATEGORY DAS1 ON DAS1.EFFECTIVEFROMTIMEKEY <= :B1 AND DAS1.EFFECTIVETOTIMEKEY >= :B1 AND NVL(ACL.SPLCATG1ALT_KEY, 0) = DAS1.SPLCATALT_KEY AND NVL(DAS1.ASSETCLASS, ''NORMAL'') = ''ALWYS_NPA'' LEFT JOIN RBL_MISDB_PROD.DIMACSPLCATEGORY DAS2 ON DAS2.EFFECTIVEFROMTIMEKEY <= :B1 AND DAS2.EFFECTIVETOTIMEKEY >= :B1 AND NVL(ACL.SPLCATG2ALT_KEY, 0) = DAS2.SPLCATALT_KEY AND NVL(DAS2.ASSETCLASS, ''NORMAL'') = ''ALWYS_NPA'' LEFT JOIN RBL_MISDB_PROD.DIMACSPLCATEGORY DAS3 ON DAS3.EFFECTIVEFROMTIMEKEY <= :B1 AND DAS3.EFFECTIVETOTIMEKEY >= :B1 AND NVL(ACL.SPLCATG3ALT_KEY, 0) = DAS3.SPLCATALT_KEY AND NVL(DAS3.ASSETCLASS, ''NORMAL'') = ''ALWYS_NPA'' LEFT JOIN RBL_MISDB_PROD.DIMACSPLCATEGORY DAS4 ON DAS4.EFFECTIVEFROMTIMEKEY <= :B1 AND DAS4.EFFECTIVETOTIMEKEY >= :B1 AND NVL(ACL.SPLCATG4ALT_KEY, 0) = DAS4.SPLCATALT_KEY AND NVL(DAS4.ASSETCLASS, ''NORMAL'') = ''ALWYS_NPA'' WHERE ( ( NVL(DSE.ASSETCLASS, ''NORMAL'') = ''ALWYS_NPA'' ) OR ( NVL(DAS1.ASSETCLASS, ''NORMAL'') = ''ALWYS_NPA'' ) OR ( NVL(DAS2.ASSETCLASS, ''NORMAL'') = ''ALWYS_NPA'' ) OR ( NVL(DAS3.ASSETCLASS, ''NORMAL'') = ''ALWYS_NPA'' ) OR ( NVL(DAS4.ASSETCLASS, ''NORMAL'') = ''ALWYS_NPA'' ) )) SRC ON ( ACL.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET ACL.ASSET_NORM = ''ALWYS_NPA''',81256);
