Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fz47xjux18qcs','MERGE INTO MAIN_PRO.CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, NVL(C.CUST_ASSETCLASSALT_KEY, 1) AS POS_2, NVL(C.CUST_ASSETCLASSALT_KEY, 1) AS POS_3, NVL(C.NPADT, NULL) AS POS_4, NVL(C.NPADT, NULL) AS POS_5, NVL(C.DBTDT, NULL) AS POS_6, NVL(C.LOSDT, NULL) AS POS_7 FROM MAIN_PRO.CUSTOMERCAL A LEFT JOIN CURDAT_RBL_MISDB_PROD.ADVCUSTNPADETAIL C ON C.CUSTOMERENTITYID = A.CUSTOMERENTITYID AND ( C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 ) ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SRCASSETCLASSALT_KEY = POS_2, A.SYSASSETCLASSALT_KEY = POS_3, A.SRCNPA_DT = POS_4, A.SYSNPA_DT = POS_5, A.DBTDT = POS_6, A.LOSSDT = POS_7',81256);
