Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('50amkkrb264fc','MERGE INTO MAIN_PRO.CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, B.FINALASSETCLASSALT_KEY, B.FINALNPADT, B.ASSET_NORM FROM MAIN_PRO.CUSTOMERCAL A JOIN MAIN_PRO.ACCOUNTCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID JOIN GTT_UPDATETEMPASSETCLASSASSETNORM C ON A.CUSTOMERENTITYID = C.CUSTOMERENTITYID WHERE A.SYSASSETCLASSALT_KEY <> B.FINALASSETCLASSALT_KEY) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SYSASSETCLASSALT_KEY = SRC.FINALASSETCLASSALT_KEY, A.SYSNPA_DT = SRC.FINALNPADT, A.ASSET_NORM = SRC.ASSET_NORM',81256);
