Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('ft9ucsk7v588x','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''ALWYS_NPA'', 860, 2, CASE WHEN FINALNPADT IS NULL THEN :B2 ELSE FINALNPADT END AS POS_5, ''NPA DUE TO Written-Off Account'' AS POS_6 FROM MAIN_PRO.ACCOUNTCAL A JOIN CURDAT_RBL_MISDB_PROD.ADVACOTHERDETAIL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID AND ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) WHERE 860 IN ( NVL(B.SPLCATG1ALT_KEY, 0),NVL(B.SPLCATG2ALT_KEY, 0),NVL(B.SPLCATG3ALT_KEY, 0),NVL(B.SPLCATG4ALT_KEY, 0) ) AND FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ASSET_NORM = ''ALWYS_NPA'', A.SPLCATG4ALT_KEY = 860, A.FINALASSETCLASSALT_KEY = 2, A.FINALNPADT = POS_5, A.NPA_REASON = POS_6',81256);
