Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('33rhkshk54zy6','INSERT INTO GTT_TEMPTABLEPANCARD(PANNO,SYSASSETCLASSALT_KEY,SYSNPA_DT) ( SELECT PANNO , MAX(NVL(SYSASSETCLASSALT_KEY, 1)) SYSASSETCLASSALT_KEY , MIN(SYSNPA_DT) SYSNPA_DT FROM MAIN_PRO.CUSTOMERCAL A JOIN RBL_MISDB_PROD.DIMSOURCEDB B ON B.SOURCEALT_KEY = A.SOURCEALT_KEY AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 WHERE PANNO IS NOT NULL AND NVL(SYSASSETCLASSALT_KEY, 1) <> 1 GROUP BY PANNO )',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3ar25fgtf6szf','MERGE INTO RBL_MISDB_PROD.ADVACOTHERDETAIL O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVACOTHERDETAIL O JOIN RBL_TEMPDB.TEMPADVACOTHERDETAIL T ON O.ACCOUNTENTITYID = T.ACCOUNTENTITYID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.GOVGURAMT, 0) <> NVL(T.GOVGURAMT, 0) OR NVL(O.SPLCATG1ALT_KEY, 0) <> NVL(T.SPLCATG1ALT_KEY, 0) OR NVL(O.SPLCATG2ALT_KEY, 0) <> NVL(T.SPLCATG2ALT_KEY, 0) OR NVL(O.REFINANCEAGENCYALT_KEY, 0) <> NVL(T.REFINANCEAGENCYALT_KEY, 0) OR NVL(O.REFINANCEAMOUNT, 0) <> NVL(T.REFINANCEAMOUNT, 0) OR NVL(O.BANKALT_KEY, 0) <> NVL(T.BANKALT_KEY, 0) OR NVL(O.TRANSFERAMT, 0) <> NVL(T.TRANSFERAMT, 0) OR NVL(O.PROJECTID, 0) <> NVL(T.PROJECTID, 0) OR NVL(O.CONSORTIUMID, 0) <> NVL(T.CONSORTIUMID, 0) OR NVL(O.REFSYSTEMACID, 0) <> NVL(T.REFSYSTEMACID, 0) OR NVL(O.MOCSTATUS, 0) <> NVL(T.MOCSTATUS, 0) OR NVL(O.MOCDATE, ''1990-01-01'') <> NVL(T.MOCDATE, ''1990-01-01'') OR NVL(O.SPLCATG3ALT_KEY, 0) <> NVL(T.SPLCATG3ALT_KEY, 0) OR NVL(O.SPLCATG4ALT_KEY, 0) <> NVL(T.SPLCATG4ALT_KEY, 0) OR NVL(O.MOCTYPEALT_KEY, 0) <> NVL(T.MOCTYPEALT_KEY, 0) OR NVL(O.GOVGUREXPDT, ''1990-01-01'') <> NVL(T.GOVGUREXPDT, ''1990-01-01'') )) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, O.DATEMODIFIED = POS_3, O.MODIFIEDBY = ''SSISUSER''',79647);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2wx9f50vrpur0','MERGE INTO RBL_MISDB_PROD.ADVACOTHERDETAIL AA USING (SELECT AA.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVACOTHERDETAIL AA WHERE AA.EFFECTIVETOTIMEKEY = 49999 AND NOT EXISTS ( SELECT 1 FROM RBL_TEMPDB.TEMPADVACOTHERDETAIL BB WHERE AA.ACCOUNTENTITYID = BB.ACCOUNTENTITYID AND BB.EFFECTIVETOTIMEKEY = 49999 )) SRC ON ( AA.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, DATEMODIFIED = POS_3, MODIFIEDBY = ''SSISUSER''',79647);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('a2pu227923kdx','MERGE INTO MAIN_PRO.ACCOUNTCAL ACL USING (SELECT ACL.ROWID ROW_ID, ''ALWYS_NPA'', 2, CASE WHEN STATUSDATE IS NOT NULL THEN STATUSDATE ELSE :B2 END AS POS_4, ''NPA DUE TO WRITEOFF MARKING'' AS POS_5, B.AMOUNT FROM MAIN_PRO.ACCOUNTCAL ACL JOIN RBL_MISDB_PROD.EXCEPTIONFINALSTATUSTYPE B ON ACL.CUSTOMERACID = B.ACID AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 WHERE B.STATUSTYPE IN ( ''TWO'',''WO'' ) AND FINALASSETCLASSALT_KEY = 1) SRC ON ( ACL.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET ACL.ASSET_NORM = ''ALWYS_NPA'', ACL.FINALASSETCLASSALT_KEY = 2, ACL.FINALNPADT = POS_4, ACL.NPA_REASON = POS_5, ACL.WRITEOFFAMOUNT = SRC.AMOUNT',81256);
