Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7h7r6pcdp4t0m','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''N'', OVERDUEINTDT FROM MAIN_PRO.ACCOUNTCAL A JOIN RBL_MISDB_PROD.DIMPRODUCT C ON A.PRODUCTALT_KEY = C.PRODUCTALT_KEY JOIN CURDAT_RBL_MISDB_PROD.ADVACBASICDETAIL ABD ON ( ABD.EFFECTIVEFROMTIMEKEY <= :B1 AND ABD.EFFECTIVETOTIMEKEY >= :B1 ) AND ABD.ACCOUNTENTITYID = A.ACCOUNTENTITYID JOIN CURDAT_RBL_MISDB_PROD.ADVACBALANCEDETAIL BAL ON ( BAL.EFFECTIVEFROMTIMEKEY <= :B1 AND BAL.EFFECTIVETOTIMEKEY >= :B1 ) AND BAL.ACCOUNTENTITYID = A.ACCOUNTENTITYID WHERE A.FACILITYTYPE IN ( ''CC'',''OD'' ) AND ( UTILS.DATEADD(''DAY'', 90, A.DEBITSINCEDT) > :B2 AND A.DEBITSINCEDT IS NOT NULL AND ASSET_NORM <> ''ALWYS_STD'' ) AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 AND ABD.REFERENCEPERIOD IN ( 366,181 ) AND C.AGRISCHEME = ''Y'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.INTTSERVICED = ''N'', A.INTNOTSERVICEDDT = OVERDUEINTDT',81256);
