Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('89b6875gmc5z2','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, B.BALANCE, CASE WHEN NVL(DEBITSINCEDT, ''1900-01-01'') > NVL(LASTCRDT, ''1900-01-01'') THEN NULL ELSE (CASE WHEN FACILITYTYPE IN ( ''DL'',''TL'',''BP'',''BD'',''PC'' ) THEN NULL ELSE B.LASTCRDT END) END AS POS_3, B.LASTCRDT, B.MOCTYPEALT_KEY, B.MOCSTATUS, B.MOCDATE, B.OVERDUESINCEDT, B.OVERDUE, B.OVERDUEPRINCIPAL, B.OVERDUEINTEREST, B.PRINCIPALBALANCE, B.ADVANCERECOVERY, B.NOTIONALINTTAMT, B.DFVAMT, B.OVERDUEPRINCIPALDT, B.OVERDUEINTDT, B.OVEROTHERDUE, B.OVERDUEOTHERDT FROM MAIN_PRO.ACCOUNTCAL A JOIN CURDAT_RBL_MISDB_PROD.ADVACBALANCEDETAIL B ON ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) AND A.ACCOUNTENTITYID = B.ACCOUNTENTITYID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.BALANCE = SRC.BALANCE, A.LASTCRDATE = POS_3, A.CREDITSINCEDT = SRC.LASTCRDT, A.COMMONMOCTYPEALT_KEY = SRC.MOCTYPEALT_KEY, A.FLGMOC = SRC.MOCSTATUS, A.MOC_DT = SRC.MOCDATE, A.OVERDUESINCEDT = SRC.OVERDUESINCEDT, A.OVERDUEAMT = SRC.OVERDUE, A.PRINCOVERDUE = SRC.OVERDUEPRINCIPAL, A.INTOVERDUE = SRC.OVERDUEINTEREST, A.PRINCOUTSTD = SRC.PRINCIPALBALANCE, A.ADVANCERECOVERY = SRC.ADVANCERECOVERY, A.NOTIONALINTTAMT = SRC.NOTIONALINTTAMT, A.DFVAMT = SRC.DFVAMT, A.PRINCOVERDUESINCEDT = SRC.OVERDUEPRINCIPALDT, A.INTOVERDUESINCEDT = SRC.OVERDUEINTDT, A.OTHEROVERDUE = SRC.OVEROTHERDUE, A.OTHEROVERDUESINCEDT = SRC.OVERDUEOTHERDT',81256);
