Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cvpj3y49uxxcm','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(C.FINALASSETCLASSALT_KEY, 1) AS POS_2, NVL(C.FINALASSETCLASSALT_KEY, 1) AS POS_3, C.FINALNPADT FROM MAIN_PRO.ACCOUNTCAL A JOIN MAIN_PRO.ACCOUNTCAL_HIST C ON C.ACCOUNTENTITYID = A.ACCOUNTENTITYID AND ( C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 ) ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.INITIALASSETCLASSALT_KEY = POS_2, A.PRVASSETCLASSALT_KEY = POS_3, A.INITIALNPADT = SRC.FINALNPADT',81256);
