Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('13nhb20tt6d2r','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, B.SOURCEASSETCLASS, C.ASSETCLASSMAPPINGALT_KEY FROM MAIN_PRO.ACCOUNTCAL A JOIN CURDAT_RBL_MISDB_PROD.ADVACBALANCEDETAIL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVEFROMTIMEKEY > :B1 LEFT JOIN RBL_MISDB_PROD.DIMASSETCLASSMAPPING C ON C.SRCSYSCLASSCODE = A.ACCOUNTSTATUS AND A.SOURCEALT_KEY = C.SOURCEALT_KEY AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVEFROMTIMEKEY > :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ACCOUNTSTATUS = SRC.SOURCEASSETCLASS, A.BANKASSETCLASS = SRC.ASSETCLASSMAPPINGALT_KEY',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7quw55trdwxad','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, B.BILLDUEDT, B.INTERESTOVERDUEDATE, B.OVERDUESINCEDT, NVL(B.BALANCE, 0) AS POS_5, NVL(B.BALANCE, 0) - NVL(B.OVERDUEINTEREST, 0) AS POS_6, NVL(B.OVERDUEINTEREST, 0) AS POS_7 FROM MAIN_PRO.ACCOUNTCAL A JOIN GTT_BILL_OVERDUE_SCF_FINAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.PRINCOVERDUESINCEDT = SRC.BILLDUEDT, A.INTOVERDUESINCEDT = SRC.INTERESTOVERDUEDATE, A.OVERDUESINCEDT = SRC.OVERDUESINCEDT, A.OVERDUEAMT = POS_5, A.PRINCOVERDUE = POS_6, A.INTOVERDUE = POS_7',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fj59htzt5s19z','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''ALWYS_NPA'', 2, CASE WHEN FINALNPADT IS NULL THEN :B2 ELSE FINALNPADT END AS POS_4, ''NPA DUE TO SARFAESI  Account'' AS POS_5 FROM MAIN_PRO.ACCOUNTCAL A JOIN RBL_MISDB_PROD.EXCEPTIONFINALSTATUSTYPE B ON A.CUSTOMERACID = B.ACID WHERE ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) AND B.STATUSTYPE = ( SELECT PARAMETERSHORTNAMEENUM FROM RBL_MISDB_PROD.DIMPARAMETER WHERE DIMPARAMETERNAME = ''UploadFLagType'' AND PARAMETERSHORTNAMEENUM = ''SARFAESI'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 ) AND FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ASSET_NORM = ''ALWYS_NPA'', A.FINALASSETCLASSALT_KEY = 2, A.FINALNPADT = POS_4, A.NPA_REASON = POS_5',81256);
