Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3c561wbruv1vb','INSERT INTO TT_TEMPDERECOGNISEDINTEREST_36 ( ACCOUNTENTITYID, DERECOGNISEDINTEREST2 ) ( SELECT A.ACCOUNTENTITYID , SUM(NVL(DERECOGNISEDINTEREST2, 0)) DERECOGNISEDINTEREST2 FROM CURDAT_RBL_MISDB_PROD.ADVFACBILLDETAIL A WHERE ( A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 ) AND NVL(DERECOGNISEDINTEREST2, 0) > 0 GROUP BY A.ACCOUNTENTITYID UNION SELECT A.ACCOUNTENTITYID , SUM(NVL(DERECOGNISEDINTEREST2, 0)) DERECOGNISEDINTEREST2 FROM CURDAT_RBL_MISDB_PROD.ADVFACPCDETAIL A WHERE ( A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 ) AND NVL(DERECOGNISEDINTEREST2, 0) > 0 GROUP BY A.ACCOUNTENTITYID UNION ALL SELECT B.ACCOUNTENTITYID , SUM(NVL(B.DERECOGNISEDINTEREST2, 0)) DERECOGNISEDINTEREST2 FROM CURDAT_RBL_MISDB_PROD.ADVFACCCDETAIL B WHERE ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) AND NVL(DERECOGNISEDINTEREST2, 0) > 0 GROUP BY B.ACCOUNTENTITYID UNION ALL SELECT C.ACCOUNTENTITYID , SUM(NVL(C.DERECOGNISEDINTEREST2, 0)) DERECOGNISEDINTEREST2 FROM CURDAT_RBL_MISDB_PROD.ADVFACDLDETAIL C WHERE ( C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 ) AND NVL(DERECOGNISEDINTEREST2, 0) > 0 GROUP BY C.ACCOUNTENTITYID )',81256);
