Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('6d28u0jmvyfpv','INSERT INTO MAIN_PRO.PUI_CAL ( CUSTOMERENTITYID, ACCOUNTENTITYID, PROJECTCATEGORYALT_KEY, PROJECTSUBCATEGORYALT_KEY, DELAYREASONCHANGEINOWNERSHIP, PROJECTAUTHORITYALT_KEY, ORIGINALDCCO, ORIGINALPROJECTCOST, ORIGINALDEBT, DEBT_EQUITYRATIO, CHANGEINPROJECTSCOPE, FRESHORIGINALDCCO, REVISEDDCCO, COURTCASEARBITRATION, CIOREFERENCEDATE, CIODCCO, TAKEOUTFINANCE, ASSETCLASSSELLERBOOKALT_KEY, NPADATESELLERBOOK, RESTRUCTURING, INITIALEXTENSION, BEYONCONTROLOFPROMOTERS, DELAYREASONOTHER, FLG_UPG, FLG_DEG, DEFAULT_REASON, PROJCATEGORY, NPA_DATE, PUI_PROVPER, RESTRUCTUREDATE, ACTUALDCCO, ACTUALDCCO_DATE, UPGRADEDATE, FINALASSETCLASSALT_KEY, DPD_MAX, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, REVISEDDEBT, COSTOVERRUN, COSTOVERRUNPER, REVISEDPROJECTCOST, PROJECTOWNERSHIPALT_KEY ) ( SELECT A.CUSTOMERENTITYID , B.ACCOUNTENTITYID , B.PROJECTCATEGORYALT_KEY , B.PROJECTSUBCATEGORYALT_KEY , C.CHANGEINOWNERSHIP , B.PROJECTAUTHORITYALT_KEY , B.ORIGINALDCCO , B.ORIGINALPROJECTCOST , B.ORIGINALDEBT , B.DEBT_EQUITYRATIO , C.CHANGEINPROJECTSCOPE , C.FRESHORIGINALDCCO , C.REVISEDDCCO , C.COURTCASEARBITRATION , C.CIOREFERENCEDATE , C.CIODCCO , C.TAKEOUTFINANCE , C.ASSETCLASSSELLERBOOKALT_KEY , C.NPADATESELLERBOOK , C.RESTRUCTURING , INITIALEXTENSTION , EXTNREASON_BCP , NULL DELAYREASONOTHER , ''N'' FLG_UPG , ''N'' FLG_DEG , UTILS.CONVERT_TO_VARCHAR2('' '',50) DEFAULT_REASON , D.PARAMETERSHORTNAMEENUM PROJCATEGORY , UTILS.CONVERT_TO_VARCHAR2('''',200) NPA_DATE , 0.00 PUI_PROVPER , UTILS.CONVERT_TO_VARCHAR2('''',200) RESTRUCTUREDATE , ACTUALDCCO_ACHIEVED , ACTUALDCCO_DATE , UTILS.CONVERT_TO_VARCHAR2('''',200) UPGRADEDATE , A.FINALASSETCLASSALT_KEY , A.DPD_MAX , :B1 EFFECTIVEFROMTIMEKEY , :B1 EFFECTIVETOTIMEKEY , REVISEDDEBT , COSTOVERRUN , UTILS.CONVERT_TO_NUMBER((UTILS.CONVERT_TO_NUMBER((UTILS.CONVERT_TO_NUMBER((NVL(C.REVISEDPROJECTCOST, 0.00) - NVL(B.ORIGINALPROJECTCOST, 0.00)),22,2) / NVL(B.ORIGINALPROJECTCOST, 1)),20,2)) * 100,5,2) COSTOVERRUNPER , REVISEDPROJECTCOST , PROJECTOWNERSHIPALT_KEY FROM MAIN_PRO.ACCOUNTCAL A JOIN RBL_MISDB_PROD.ADVACPUIDETAILMAIN B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID AND ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) JOIN RBL_MISDB_PROD.ADVACPUIDETAILSUB C ON A.ACCOUNTENTITYID = C.ACCOUNTENTITYID AND ( C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 ) JOIN RBL_MISDB_PROD.DIMPARAMETER D ON PARAMETERALT_KEY = B.PROJECTCATEGORYALT_KEY AND ( D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 ) AND DIMPARAMETERNAME = ''ProjectCategory'' )',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('21azu4uv6pqg5','MERGE INTO RBL_TEMPDB.TEMPADVACOTHERFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID, ''C'' FROM RBL_TEMPDB.TEMPADVACOTHERFINANCIALDETAIL A JOIN RBL_MISDB_PROD.ADVACOTHERFINANCIALDETAIL B ON B.ACCOUNTENTITYID = A.ACCOUNTENTITYID WHERE B.EFFECTIVETOTIMEKEY = :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ISCHANGED = ''C''',79645);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8q47xv2sptjuw','MERGE INTO RBL_MISDB_PROD.ADVACOTHERFINANCIALDETAIL O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVACOTHERFINANCIALDETAIL O JOIN RBL_TEMPDB.TEMPADVACOTHERFINANCIALDETAIL T ON O.ACCOUNTENTITYID = T.ACCOUNTENTITYID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.INTEREST_DUE, 0) <> NVL(T.INTEREST_DUE, 0) OR NVL(O.OTHER_DUES, 0) <> NVL(T.OTHER_DUES, 0) OR NVL(O.PENAL_DUE, 0) <> NVL(T.PENAL_DUE, 0) OR NVL(O.INT_RECEIVABLE_ADV, 0) <> NVL(T.INT_RECEIVABLE_ADV, 0) OR NVL(O.PENAL_INT_RECEIVABLE, 0) <> NVL(T.PENAL_INT_RECEIVABLE, 0) OR NVL(O.ACCRUED_INTEREST, 0) <> NVL(T.ACCRUED_INTEREST, 0) )) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, O.DATEMODIFIED = POS_3, O.MODIFIEDBY = ''SSISUSER''',79645);
