Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('94kb50m3yn0q7','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, C.COVERGOVGUR FROM MAIN_PRO.ACCOUNTCAL A JOIN ( SELECT A.ACCOUNTENTITYID , SUM(NVL(NVL(CLAIMCOVERAMT, 0) + NVL(CLAIMRECEIVEDAMT, 0), 0)) COVERGOVGUR FROM CURDAT_RBL_MISDB_PROD.ADVFACPCDETAIL A JOIN MAIN_PRO.ACCOUNTCAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID WHERE ( A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 ) GROUP BY A.ACCOUNTENTITYID ) C ON A.ACCOUNTENTITYID = C.ACCOUNTENTITYID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.COVERGOVGUR = SRC.COVERGOVGUR',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('1fsq9bcpvkr08','INSERT INTO MAIN_PRO.BUYOUTUPLOADDETAILSCAL ( DATEOFDATA, REPORTDATE, CUSTOMERACID, ACCOUNTENTITYID, SCHEMECODE, NPA_CLASSSELLER, NPA_DATESELLER, DPD_SELLER, PEAKDPD, PEAKDPD_DATE, AUTHORISATIONSTATUS, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY ) ( SELECT A.DATEOFDATA , A.REPORTDATE , A.CUSTOMERACID , B.ACCOUNTENTITYID , A.SCHEMECODE , A.NPA_CLASSSELLER , A.NPA_DATESELLER , A.DPD_SELLER , A.PEAKDPD , A.PEAKDPD_DATE , A.AUTHORISATIONSTATUS , :B1 EFFECTIVEFROMTIMEKEY , 49999 EFFECTIVETOTIMEKEY FROM RBL_MISDB_PROD.BUYOUTUPLOADDETAILS A JOIN MAIN_PRO.ACCOUNTCAL B ON A.CUSTOMERACID = B.CUSTOMERACID WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 )',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bczcfq4z789xr','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, DA.ASSETCLASSALT_KEY, NULL, ''ALWYS_STD'', B.REASON, ''STD DUE TO Adhoc'' AS POS_6, B.DATECREATED FROM MAIN_PRO.ACCOUNTCAL A JOIN RBL_MISDB_PROD.ADHOCACL_CHANGEDETAILS B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID JOIN RBL_MISDB_PROD.DIMASSETCLASS DA ON DA.ASSETCLASSALT_KEY = B.ASSETCLASSALT_KEY AND DA.ASSETCLASSSHORTNAME = ''STD'' AND DA.EFFECTIVEFROMTIMEKEY <= :B1 AND DA.EFFECTIVETOTIMEKEY >= :B1 WHERE B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALASSETCLASSALT_KEY = SRC.ASSETCLASSALT_KEY, A.FINALNPADT = NULL, A.ASSET_NORM = ''ALWYS_STD'', A.MOCREASON = SRC.REASON, A.DEGREASON = POS_6, A.MOC_DT = SRC.DATECREATED',81256);
