Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('9rn6pamz28dtx','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''ALWYS_NPA'', 2, CASE WHEN REPOSSESSIONDATE IS NULL THEN :B2 ELSE REPOSSESSIONDATE END AS POS_4, ''NPA DUE TO Repossessed Account'' AS POS_5, ''Y'' FROM MAIN_PRO.ACCOUNTCAL A JOIN RBL_MISDB_PROD.EXCEPTIONFINALSTATUSTYPE B ON A.CUSTOMERACID = B.ACID WHERE ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) AND B.STATUSTYPE = ( SELECT PARAMETERSHORTNAMEENUM FROM RBL_MISDB_PROD.DIMPARAMETER WHERE DIMPARAMETERNAME = ''UploadFLagType'' AND PARAMETERSHORTNAMEENUM = ''Repossesed'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 ) AND FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ASSET_NORM = ''ALWYS_NPA'', A.FINALASSETCLASSALT_KEY = 2, A.FINALNPADT = POS_4, A.NPA_REASON = POS_5, A.REPOSSESSION = ''Y''',81256);
