Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8gfjpstydztwz','MERGE INTO MAIN_PRO.CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, NVL(C.SYSASSETCLASSALT_KEY, 1) AS POS_2, NVL(C.SYSASSETCLASSALT_KEY, 1) AS POS_3, NVL(C.SYSNPA_DT, NULL) AS POS_4, NVL(C.SYSNPA_DT, NULL) AS POS_5, NVL(C.DBTDT, NULL) AS POS_6, NVL(C.LOSSDT, NULL) AS POS_7 FROM MAIN_PRO.CUSTOMERCAL A LEFT JOIN MAIN_PRO.CUSTOMERCAL_HIST C ON C.CUSTOMERENTITYID = A.CUSTOMERENTITYID AND ( C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 ) ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SRCASSETCLASSALT_KEY = POS_2, A.SYSASSETCLASSALT_KEY = POS_3, A.SRCNPA_DT = POS_4, A.SYSNPA_DT = POS_5, A.DBTDT = POS_6, A.LOSSDT = POS_7',81256);
