Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('07vz1xc6udf6s','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''ALWYS_NPA'' FROM MAIN_PRO.ACCOUNTCAL A JOIN MAIN_PRO.ADVACRESTRUCTURECAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = B.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' WHERE D.PARAMETERSHORTNAMEENUM = ''PRUDENTIAL'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ASSET_NORM = ''ALWYS_NPA''',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gcusfn0f7tg9w','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, B.PCOVERDUEDUEDT, B.PCOVERDUE FROM MAIN_PRO.ACCOUNTCAL A JOIN GTT_PC_OVERDUE_FINAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.OVERDUESINCEDT = SRC.PCOVERDUEDUEDT, A.OVERDUEAMT = SRC.PCOVERDUE',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('dxzwwnu9q25um','MERGE INTO MAIN_PRO.CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, ''ALWYS_NPA'' FROM MAIN_PRO.CUSTOMERCAL A LEFT JOIN RBL_MISDB_PROD.DIMCONSTITUTION DCO ON ( DCO.EFFECTIVEFROMTIMEKEY <= :B1 AND DCO.EFFECTIVETOTIMEKEY >= :B1 ) AND A.CONSTITUTIONALT_KEY = DCO.CONSTITUTIONALT_KEY LEFT JOIN RBL_MISDB_PROD.DIMSPLCATEGORY DAS1 ON ( DAS1.EFFECTIVEFROMTIMEKEY <= :B1 AND DAS1.EFFECTIVETOTIMEKEY >= :B1 ) AND A.SPLCATG1ALT_KEY = DAS1.SPLCATALT_KEY LEFT JOIN RBL_MISDB_PROD.DIMSPLCATEGORY DAS2 ON ( DAS2.EFFECTIVEFROMTIMEKEY <= :B1 AND DAS2.EFFECTIVETOTIMEKEY >= :B1 ) AND A.SPLCATG2ALT_KEY = DAS2.SPLCATALT_KEY LEFT JOIN RBL_MISDB_PROD.DIMSPLCATEGORY DAS3 ON ( DAS3.EFFECTIVEFROMTIMEKEY <= :B1 AND DAS3.EFFECTIVETOTIMEKEY >= :B1 ) AND A.SPLCATG3ALT_KEY = DAS3.SPLCATALT_KEY LEFT JOIN RBL_MISDB_PROD.DIMSPLCATEGORY DAS4 ON ( DAS4.EFFECTIVEFROMTIMEKEY <= :B1 AND DAS4.EFFECTIVETOTIMEKEY >= :B1 ) AND A.SPLCATG4ALT_KEY = DAS4.SPLCATALT_KEY WHERE ( ( NVL(DCO.ASSETCLASS, ''NORMAL'') = ''ALWYS_NPA'' ) OR ( NVL(DAS1.ASSETCLASS, ''NORMAL'') = ''ALWYS_NPA'' ) OR ( NVL(DAS2.ASSETCLASS, ''NORMAL'') = ''ALWYS_NPA'' ) OR ( NVL(DAS3.ASSETCLASS, ''NORMAL'') = ''ALWYS_NPA'' OR NVL(DAS4.ASSETCLASS, ''NORMAL'') = ''ALWYS_NPA'' ) )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ASSET_NORM = ''ALWYS_NPA''',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('a4up168x1k899','MERGE INTO MAIN_PRO.ACCOUNTCAL C USING (SELECT C.ROWID ROW_ID, ''CONDI_STD'' FROM MAIN_PRO.ACCOUNTCAL C JOIN RBL_MISDB_PROD.DIMPRODUCT DP ON C.PRODUCTALT_KEY = DP.PRODUCTALT_KEY AND DP.PRODUCTGROUP = ''FDSEC'' AND DP.EFFECTIVEFROMTIMEKEY <= :B1 AND DP.EFFECTIVETOTIMEKEY >= :B1 AND C.INITIALASSETCLASSALT_KEY > 1 ) SRC ON ( C.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET C.ASSET_NORM = ''CONDI_STD''',81256);
