Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cp8c9c1htw0ky','MERGE INTO MAIN_PRO.ACCOUNTCAL ABD USING (SELECT ABD.ROWID ROW_ID, ''ALWYS_NPA'' FROM MAIN_PRO.ACCOUNTCAL ABD JOIN MAIN_PRO.CUSTOMERCAL CBD ON ABD.CUSTOMERENTITYID = CBD.CUSTOMERENTITYID WHERE CBD.ASSET_NORM = ''ALWYS_NPA'' AND ABD.ASSET_NORM <> ''ALWYS_STD'') SRC ON ( ABD.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET ABD.ASSET_NORM = ''ALWYS_NPA''',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('b5t4vvv33jc5a','MERGE INTO MAIN_PRO.CUSTOMERCAL C USING (SELECT C.ROWID ROW_ID, CASE WHEN NPA_DATESELLER IS NOT NULL AND C.SYSASSETCLASSALT_KEY = 1 THEN 2 ELSE C.SYSASSETCLASSALT_KEY END AS POS_2, CASE WHEN NPA_DATESELLER IS NOT NULL AND C.SYSASSETCLASSALT_KEY = 1 THEN NVL(NPA_DATESELLER, B.DATEOFDATA) ELSE (CASE WHEN NPA_DATESELLER IS NOT NULL AND NVL(NPA_DATESELLER, B.DATEOFDATA) < SYSNPA_DT THEN NPA_DATESELLER ELSE SYSNPA_DT END) END AS POS_3, CASE WHEN NPA_DATESELLER IS NOT NULL THEN ''ALWYS_NPA'' ELSE A.ASSET_NORM END AS POS_4, CASE WHEN NPA_DATESELLER IS NOT NULL THEN ''NPA with Seller'' ELSE C.DEGREASON END AS POS_5 FROM MAIN_PRO.ACCOUNTCAL A JOIN MAIN_PRO.BUYOUTUPLOADDETAILSCAL B ON A.CUSTOMERACID = B.CUSTOMERACID JOIN MAIN_PRO.CUSTOMERCAL C ON A.CUSTOMERENTITYID = C.CUSTOMERENTITYID ) SRC ON ( C.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET SYSASSETCLASSALT_KEY = POS_2, C.SYSNPA_DT = POS_3, ASSET_NORM = POS_4, C.DEGREASON = POS_5',81256);
