Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2n54f1bzpxzp5','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, UTILS.DATEADD(''YY'', 1, RESTRUCTUREDT) AS SP_EXPIRYDATE FROM MAIN_PRO.ADVACRESTRUCTURECAL A WHERE SP_EXPIRYDATE IS NULL) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SP_EXPIRYDATE = SRC.SP_EXPIRYDATE',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('f93pk4cwazvm5','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''CONDI_STD'' FROM MAIN_PRO.ACCOUNTCAL A JOIN RBL_MISDB_PROD.DIMPRODUCT DP ON A.PRODUCTALT_KEY = DP.PRODUCTALT_KEY AND DP.PRODUCTGROUP = ''FDSEC'' AND DP.EFFECTIVEFROMTIMEKEY <= :B1 AND DP.EFFECTIVETOTIMEKEY >= :B1 LEFT JOIN ( SELECT C.ACCOUNTENTITYID , SUM(NVL(CURRENTVALUE, 0)) CURRENTVALUE FROM MAIN_PRO.ACCOUNTCAL C LEFT JOIN CURDAT_RBL_MISDB_PROD.ADVSECURITYDETAIL ADVSEC ON ADVSEC.ACCOUNTENTITYID = C.ACCOUNTENTITYID AND ADVSEC.EFFECTIVEFROMTIMEKEY <= :B1 AND ADVSEC.EFFECTIVETOTIMEKEY >= :B1 LEFT JOIN CURDAT_RBL_MISDB_PROD.ADVSECURITYVALUEDETAIL B ON ADVSEC.SECURITYENTITYID = B.SECURITYENTITYID AND B.SECURITYENTITYID = ADVSEC.SECURITYENTITYID AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 JOIN RBL_MISDB_PROD.DIMPRODUCT DP ON C.PRODUCTALT_KEY = DP.PRODUCTALT_KEY AND DP.PRODUCTGROUP = ''FDSEC'' AND DP.EFFECTIVEFROMTIMEKEY <= :B1 AND DP.EFFECTIVETOTIMEKEY >= :B1 AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 GROUP BY C.ACCOUNTENTITYID ) E ON A.ACCOUNTENTITYID = E.ACCOUNTENTITYID WHERE NVL(A.BALANCE, 0) > 0 AND NVL(A.BALANCE, 0) > NVL(E.CURRENTVALUE, 0)) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ASSET_NORM = ''CONDI_STD'' ',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('34cxwp8c0gzhn','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, CASE WHEN NVL(PRINCOUTSTD, 0) <= 0 THEN 0 ELSE NVL(PRINCOUTSTD, 0) END AS POS_2, BALANCE , CASE WHEN B.FINALASSETCLASSALT_KEY = 1 THEN SP.PROVISIONSECURED ELSE B.FINALPROVISIONPER END AS POS_4, CASE WHEN A.UPGRADEDATE IS NOT NULL THEN UTILS.DATEADD(''YY'', 1, A.UPGRADEDATE) ELSE NULL END AS POS_5, B.DPD_MAX FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN MAIN_PRO.ACCOUNTCAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID LEFT JOIN RBL_MISDB_PROD.DIMPROVISION_SEGSTD SP ON SP.EFFECTIVEFROMTIMEKEY <= :B1 AND SP.EFFECTIVEFROMTIMEKEY >= :B1 AND SP.PROVISIONALT_KEY = B.PROVISIONALT_KEY LEFT JOIN RBL_MISDB_PROD.DIMPROVISION_SEG NP ON NP.EFFECTIVEFROMTIMEKEY <= :B1 AND NP.EFFECTIVEFROMTIMEKEY >= :B1 AND NP.PROVISIONALT_KEY = B.PROVISIONALT_KEY WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.CURRENTPOS = POS_2, A.CURRENTTOS = BALANCE, A.APPLIEDNORMALPROVPER = POS_4, A.SURVPERIODENDDATE = POS_5, A.CURRENTDPD = SRC.DPD_MAX',81256);
