Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('g4qvt5hsmzqn8','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, STOCKSTMTDT FROM MAIN_PRO.ACCOUNTCAL A JOIN CURDAT_RBL_MISDB_PROD.ADVFACCCDETAIL SD ON A.ACCOUNTENTITYID = SD.ACCOUNTENTITYID WHERE A.FACILITYTYPE = ''CC'' AND SD.EFFECTIVEFROMTIMEKEY <= :B1 AND SD.EFFECTIVETOTIMEKEY >= :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.STOCKSTDT = STOCKSTMTDT',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5aj06ds7p1h80','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''Y'' FROM MAIN_PRO.ACCOUNTCAL A JOIN RBL_MISDB_PROD.EXCEPTIONFINALSTATUSTYPE B ON A.CUSTOMERACID = B.ACID WHERE ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) AND B.STATUSTYPE = ( SELECT PARAMETERSHORTNAMEENUM FROM RBL_MISDB_PROD.DIMPARAMETER WHERE DIMPARAMETERNAME = ''UploadFLagType'' AND PARAMETERSHORTNAMEENUM = ''Repossesed'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.REPOSSESSION = ''Y''',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bgzzgxyp3ax8a','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, CASE WHEN (NVL(RESTRUCTUREPOS, 0)) > 0 THEN CASE WHEN ((NVL(RESTRUCTUREPOS, 0) - NVL(A.CURRENTPOS, 0.00)) * 100) / (NVL(RESTRUCTUREPOS, 0)) > 100 OR ((NVL(RESTRUCTUREPOS, 0) - NVL(A.CURRENTPOS, 0.00)) * 100) / (NVL(RESTRUCTUREPOS, 0)) < 0 THEN 0 ELSE UTILS.CONVERT_TO_NUMBER(UTILS.ROUND_(((NVL(RESTRUCTUREPOS, 0) - NVL(A.CURRENTPOS, 0.00)) * 100) / (NVL(RESTRUCTUREPOS, 0)), 2),5,2) END ELSE 0 END AS RES_POS_TO_CURRENTPOS_PER FROM MAIN_PRO.ADVACRESTRUCTURECAL A ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.RES_POS_TO_CURRENTPOS_PER = SRC.RES_POS_TO_CURRENTPOS_PER',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3c9ubs780p7qu','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID FROM MAIN_PRO.ACCOUNTCAL A JOIN MAIN_PRO.BUYOUTUPLOADDETAILSCAL B ON A.CUSTOMERACID = B.CUSTOMERACID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET OVERDUESINCEDT = NULL, PRINCOVERDUESINCEDT = NULL, INTOVERDUESINCEDT = NULL, OTHEROVERDUESINCEDT = NULL',81256);
