Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8ggcnr0bbr02y','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''ALWYS_NPA'' FROM MAIN_PRO.ACCOUNTCAL A JOIN RBL_MISDB_PROD.MANUAL_NPA B ON A.CUSTOMERACID = B.ACCOUNT_NO WHERE VALID_UPTO >= :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ASSET_NORM = ''ALWYS_NPA''',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cxzddur5x30u2','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''ALWYS_NPA'', ''NPA DUE TO Repossessed Account'' AS POS_3, ''Y'' FROM MAIN_PRO.ACCOUNTCAL A JOIN RBL_MISDB_PROD.EXCEPTIONFINALSTATUSTYPE B ON A.CUSTOMERACID = B.ACID WHERE ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) AND B.STATUSTYPE = ( SELECT PARAMETERSHORTNAMEENUM FROM RBL_MISDB_PROD.DIMPARAMETER WHERE DIMPARAMETERNAME = ''UploadFLagType'' AND PARAMETERSHORTNAMEENUM = ''Repossesed'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 ) AND FINALASSETCLASSALT_KEY > 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ASSET_NORM = ''ALWYS_NPA'', A.NPA_REASON = POS_3, A.REPOSSESSION = ''Y''',81256);
