Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cpyg0nbtjv460','INSERT INTO MAIN_PRO.INVALIDPANAADHAR ( DATEOFDATA, CUSTOMERID, SOURCESYSTEMCUSTOMERID, CUSTOMERNAME, SOURCESYSTEMNAME, PANNO, AADHARCARD, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY ) ( SELECT :B2 , A.REFCUSTOMERID , A.SOURCESYSTEMCUSTOMERID , A.CUSTOMERNAME , NULL SOURCESYSTEMNAME , B.PAN , NULL , :B1 , :B1 FROM MAIN_PRO.CUSTOMERCAL A JOIN CURDAT_RBL_MISDB_PROD.ADVCUSTRELATIONSHIP B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID WHERE ( REGEXP_LIKE(B.PAN, ''%[A-Z][A-Z][A-Z][A-Z][A-Z][0-9][0-9][0-9][0-9][A-Z]%'') ) AND ( B.PAN IS NOT NULL ) AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 UNION SELECT :B2 , A.REFCUSTOMERID , A.SOURCESYSTEMCUSTOMERID , A.CUSTOMERNAME , NULL SOURCESYSTEMNAME , B.PAN , NULL , :B1 , :B1 FROM MAIN_PRO.CUSTOMERCAL A JOIN CURDAT_RBL_MISDB_PROD.ADVCUSTRELATIONSHIP B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID WHERE ( B.PAN LIKE ''%FORMO%'' OR B.PAN LIKE ''%FORPM%'' OR B.PAN LIKE ''%FORMF%'' ) AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 )',81256);
