Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('ckkvr6uc82gqb','MERGE INTO RBL_TEMPDB.TEMPADVACRELATIONS A USING (SELECT A.ROWID ROW_ID, ''C'' FROM RBL_TEMPDB.TEMPADVACRELATIONS A JOIN RBL_MISDB_PROD.ADVACRELATIONS B ON B.CUSTOMERENTITYID = A.CUSTOMERENTITYID AND B.RELATIONENTITYID = A.RELATIONENTITYID WHERE B.EFFECTIVETOTIMEKEY = :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ISCHANGED = ''C''',79649);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bq4c27yz3v1h8','MERGE INTO RBL_MISDB_PROD.ADVACRELATIONS O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVACRELATIONS O JOIN RBL_TEMPDB.TEMPADVACRELATIONS T ON O.CUSTOMERENTITYID = T.CUSTOMERENTITYID AND O.RELATIONENTITYID = T.RELATIONENTITYID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.RELATIONENTITYID, 0) <> NVL(T.RELATIONENTITYID, 0) OR NVL(O.CUSTOMERENTITYID, 0) <> NVL(T.CUSTOMERENTITYID, 0) OR NVL(O.RELATIONTYPEALT_KEY, 0) <> NVL(T.RELATIONTYPEALT_KEY, 0) OR NVL(O.RELATIONSRNO, 0) <> NVL(T.RELATIONSRNO, 0) OR NVL(O.GUARANTEEVALUE, 0) <> NVL(T.GUARANTEEVALUE, 0) OR NVL(O.REFCUSTOMERID, 0) <> NVL(T.REFCUSTOMERID, 0) )) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, O.DATEMODIFIED = POS_3, O.MODIFIEDBY = ''SSISUSER''',79649);
