Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5u20yuwxvvnsa','MERGE INTO MAIN_PRO.CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, B.FINALASSETCLASSALT_KEY, B.FINALNPADT, B.NPA_REASON, B.ASSET_NORM FROM MAIN_PRO.CUSTOMERCAL A JOIN MAIN_PRO.ACCOUNTCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID WHERE B.REPOSSESSION = ''Y'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SYSASSETCLASSALT_KEY = SRC.FINALASSETCLASSALT_KEY, A.SYSNPA_DT = SRC.FINALNPADT, A.DEGREASON = SRC.NPA_REASON, A.ASSET_NORM = SRC.ASSET_NORM',81256);
