Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('czuqc8sxhx69v','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, DA.ASSETCLASSALT_KEY, B.NPA_DATE, ''ALWYS_NPA'', B.REASON, ''NPA DUE TO Adhoc'' AS POS_6, B.DATECREATED FROM MAIN_PRO.ACCOUNTCAL A JOIN RBL_MISDB_PROD.ADHOCACL_CHANGEDETAILS B ON A.UCIFENTITYID = B.UCIFENTITYID AND NVL(A.UCIFENTITYID, 0) <> 0 JOIN RBL_MISDB_PROD.DIMASSETCLASS DA ON DA.ASSETCLASSALT_KEY = B.ASSETCLASSALT_KEY AND DA.ASSETCLASSSHORTNAME <> ''STD'' AND DA.EFFECTIVEFROMTIMEKEY <= :B1 AND DA.EFFECTIVETOTIMEKEY >= :B1 WHERE B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALASSETCLASSALT_KEY = SRC.ASSETCLASSALT_KEY, A.FINALNPADT = SRC.NPA_DATE, A.ASSET_NORM = ''ALWYS_NPA'', A.MOCREASON = SRC.REASON, A.DEGREASON = POS_6, A.MOC_DT = SRC.DATECREATED',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3qr0qn1d6kd0r','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(NVL(CLAIMCOVERAMT, 0) + NVL(CLAIMRECEIVEDAMT, 0), 0) AS COVERGOVGUR FROM MAIN_PRO.ACCOUNTCAL A JOIN CURDAT_RBL_MISDB_PROD.ADVFACDLDETAIL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID WHERE NVL(NVL(CLAIMCOVERAMT, 0) + NVL(CLAIMRECEIVEDAMT, 0), 0) > 0 AND ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.COVERGOVGUR = SRC.COVERGOVGUR',81256);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('07g1fg6dk17rz','MERGE INTO MAIN_PRO.ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''ALWYS_NPA'', 2, CASE WHEN FINALNPADT IS NULL THEN :B2 ELSE FINALNPADT END AS POS_4, ''NPA DUE TO Inherent Weakness Account'' AS POS_5, ''Y'' FROM MAIN_PRO.ACCOUNTCAL A JOIN RBL_MISDB_PROD.EXCEPTIONFINALSTATUSTYPE B ON A.CUSTOMERACID = B.ACID WHERE ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) AND B.STATUSTYPE = ( SELECT PARAMETERSHORTNAMEENUM FROM RBL_MISDB_PROD.DIMPARAMETER WHERE DIMPARAMETERNAME = ''UploadFLagType'' AND PARAMETERSHORTNAMEENUM = ''Inherent Weakness'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 ) AND FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ASSET_NORM = ''ALWYS_NPA'', A.FINALASSETCLASSALT_KEY = 2, A.FINALNPADT = POS_4, A.NPA_REASON = POS_5, A.WEAKACCOUNT = ''Y''',81256);
