Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('az2mffa0mf8w8','MERGE INTO MAIN_PRO.CUSTOMERCAL C USING (SELECT C.ROWID ROW_ID, ''ALWYS_NPA'', 870, 6 , CASE WHEN C.SYSNPA_DT IS NOT NULL AND C.SYSNPA_DT < NVL(B.STATUSDATE, :B2 ) THEN C.SYSNPA_DT ELSE NVL(B.STATUSDATE, :B2 ) END AS POS_5, ''NPA DUE TO FRAUD MARKING'' AS POS_6 FROM MAIN_PRO.CUSTOMERCAL C JOIN RBL_MISDB_PROD.EXCEPTIONFINALSTATUSTYPE B ON C.REFCUSTOMERID = B.CUSTOMERID WHERE ( B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) AND B.STATUSTYPE = ( SELECT PARAMETERSHORTNAMEENUM FROM RBL_MISDB_PROD.DIMPARAMETER WHERE DIMPARAMETERNAME = ''UploadFLagType'' AND PARAMETERSHORTNAMEENUM = ''Fraud Committed'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 )) SRC ON ( C.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET C.ASSET_NORM = ''ALWYS_NPA'', C.SPLCATG4ALT_KEY = 870, C.SYSASSETCLASSALT_KEY = 6, C.SYSNPA_DT = POS_5, C.DEGREASON = POS_6',81256);
