Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('1172vm0g8ju1z','MERGE INTO MAIN_PRO.CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, DA.ASSETCLASSALT_KEY, NULL SYSNPA_DT, NULL DBTDT, ''ALWYS_STD'' ASSET_NORM , B.REASON, ''STD DUE TO Adhoc'' AS POS_7, B.DATECREATED FROM MAIN_PRO.CUSTOMERCAL A JOIN RBL_MISDB_PROD.ADHOCACL_CHANGEDETAILS B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID JOIN RBL_MISDB_PROD.DIMASSETCLASS DA ON DA.ASSETCLASSALT_KEY = B.ASSETCLASSALT_KEY AND DA.ASSETCLASSSHORTNAME = ''STD'' AND DA.EFFECTIVEFROMTIMEKEY <= :B1 AND DA.EFFECTIVETOTIMEKEY >= :B1 WHERE B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SYSASSETCLASSALT_KEY = SRC.ASSETCLASSALT_KEY, A.SYSNPA_DT = NULL, A.DBTDT = NULL, A.ASSET_NORM = ''ALWYS_STD'', A.MOCREASON = SRC.REASON, A.DEGREASON = POS_7, A.MOC_DT = SRC.DATECREATED',81256);
