Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8w2krhqq1nh5j','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL B USING (SELECT B.ROWID ROW_ID, A.DPD_MAXNONFIN FROM ( SELECT ACCOUNTENTITYID , MAX(DPD) DPD_MAXNONFIN FROM ( ( SELECT ACCOUNTENTITYID , DPD_STOCKSTMT DPD FROM GTT_ACCOUNTCAL WHERE NVL(DPD_STOCKSTMT, 0) > 0 UNION ALL SELECT ACCOUNTENTITYID , DPD_RENEWAL DPD FROM GTT_ACCOUNTCAL WHERE NVL(DPD_RENEWAL, 0) > 0 ) ) GROUP BY ACCOUNTENTITYID ) A JOIN MAIN_PRO.ADVACRESTRUCTURECAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID ) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.DPD_MAXNONFIN = SRC.DPD_MAXNONFIN ',79240);
