Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5j5sats0ujzts','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN A.INTNOTSERVICEDDT IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.INTNOTSERVICEDDT, :B1 ) ELSE 0 END) AS POS_2, CASE WHEN ( DEBITSINCEDT IS NULL OR UTILS.DATEDIFF(''DAY'', DEBITSINCEDT, :B1 ) > 90 ) THEN (CASE WHEN A.LASTCRDATE IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.LASTCRDATE, :B1 ) ELSE 0 END) ELSE 0 END AS POS_3, (CASE WHEN A.CONTIEXCESSDT IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.CONTIEXCESSDT, :B1 ) + 1 ELSE 0 END) AS POS_4, (CASE WHEN A.OVERDUESINCEDT IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.OVERDUESINCEDT, :B1 ) ELSE 0 END) AS POS_5, (CASE WHEN A.REVIEWDUEDT IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.REVIEWDUEDT, :B1 ) ELSE 0 END) AS POS_6, (CASE WHEN A.STOCKSTDT IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.STOCKSTDT, :B1 ) ELSE 0 END) AS POS_7 FROM GTT_ACCOUNTCAL A ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DPD_INTSERVICE = POS_2, A.DPD_NOCREDIT = POS_3, A.DPD_OVERDRAWN = POS_4, A.DPD_OVERDUE = POS_5, A.DPD_RENEWAL = POS_6, A.DPD_STOCKSTMT = POS_7',79240);
