Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('36c0jun53ksnr','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, NVL(RESTRUCTUREPROVISION, 0) + NVL(A.CURRENTPOS, 0) * NVL((FINALPROVPER), 0) / 100 AS RESTRUCTUREPROVISION FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN GTT_ACCOUNTCAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' AND NVL(D.PARAMETERSHORTNAMEENUM, '' '') = ''MSME_OLD'' ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.RESTRUCTUREPROVISION = SRC.RESTRUCTUREPROVISION',79268);
