Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('9kfu8jfhzuqbp','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTUREFACILITYTYPEALT_KEY AND D.DIMPARAMETERNAME = ''RestructureFacility'' AND D.PARAMETERSHORTNAMEENUM = ''FITL'' ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ADDLPROVPER = 0, A.PROVRELEASEPER = 0, A.FINALPROVPER = 0',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3wvufqssc4mk4','UPDATE GTT_ACCOUNTCAL SET BANKTOTALPROVISION = 0 WHERE NVL(BANKTOTALPROVISION, 0) < 0',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7buwfxy0aqtj1','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, 5 FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN CURDAT_RBL_MISDB_PROD.ADVACRESTRUCTUREDETAIL B ON B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 AND A.ACCOUNTENTITYID = B.ACCOUNTENTITYID JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' AND D.PARAMETERSHORTNAMEENUM IN ( ''IRAC'',''OTHER'' ) WHERE FINALASSETCLASSALT_KEY = 1 AND A.SURVPERIODENDDATE IS NOT NULL AND A.SURVPERIODENDDATE >= :B2 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ADDLPROVPER = 5',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('9f6u74g85n02z','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''Link By AccountId'' || '' '' || B.CUSTOMERACID AS NPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_TEMPTABLE_PERCOLATIONFRE B ON A.REFCUSTOMERID = B.REFCUSTOMERID JOIN RBL_MISDB_PROD.DIMPRODUCT P ON P.EFFECTIVEFROMTIMEKEY <= :B1 AND P.EFFECTIVETOTIMEKEY >= :B1 AND ( P.PRODUCTALT_KEY = A.PRODUCTALT_KEY ) WHERE A.FINALASSETCLASSALT_KEY > 1 AND ( NVL(A.DPD_MAX, 0) < 90 OR P.AGRISCHEME = ''Y'' AND A.DPD_MAX < 366 ) AND ( A.FLGDEG = ''N'' )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.NPA_REASON = SRC.NPA_REASON',79258);
