Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8d7sqn11609kw','MERGE INTO GTT_ACCOUNTCAL B USING (SELECT B.ROWID ROW_ID, ''PERCOLATION BY AADHAR CARD '' || '' '' || A.AADHARCARDNO AS NPA_REASON FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE B.FINALASSETCLASSALT_KEY > 1 AND B.NPA_REASON IS NULL AND A.DEGREASON LIKE ''%PERCOLATION BY AADHAR CARD%'') SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.NPA_REASON = SRC.NPA_REASON',79258);
