Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('f4gm1dt7qzpx7','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, CASE WHEN NVL(B.ASSETCLASSSHORTNAMEENUM, ''STD'') = ''LOS'' THEN 0 ELSE NVL(A.USEDRV, 0) END AS POS_2, (CASE WHEN NVL(B.ASSETCLASSSHORTNAMEENUM, ''STD'') = ''LOS'' THEN 0 ELSE (NVL(A.USEDRV, 0) * CASE WHEN C.PROVISIONNAME = ''Corporate Common'' THEN NVL(A.PROVPERSECURED, 0) ELSE NVL(C.PROVISIONSECURED, 0) / 100 END) END) AS POS_3, (CASE WHEN NVL(B.ASSETCLASSSHORTNAMEENUM, ''STD'') = ''LOS'' THEN 0 ELSE (NVL(A.USEDRV, 0) * CASE WHEN C.PROVISIONNAME = ''Corporate Common'' THEN NVL(A.PROVPERSECURED, 0) ELSE NVL(C.PROVISIONSECURED, 0) / 100 END) END) AS POS_4, (CASE WHEN NVL(B.ASSETCLASSSHORTNAMEENUM, ''STD'') = ''LOS'' THEN 0 ELSE (NVL(A.USEDRV, 0) * C.RBIPROVISIONSECURED / 100) END) AS POS_5 FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL D ON A.CUSTOMERENTITYID = D.CUSTOMERENTITYID JOIN RBL_MISDB_PROD.DIMASSETCLASS B ON B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 AND NVL(A.FINALASSETCLASSALT_KEY, 1) = B.ASSETCLASSALT_KEY JOIN RBL_MISDB_PROD.DIMPROVISION_SEGSTD C ON C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 AND NVL(A.PROVISIONALT_KEY, 13) = C.PROVISIONALT_KEY WHERE NVL(D.FLGPROCESSING, ''N'') = ''N'' AND A.BALANCE > 0 AND FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SECUREDAMT = POS_2, A.PROVSECURED = POS_3, A.BANKPROVSECURED = POS_4, A.RBIPROVSECURED = POS_5',79265);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0h2sqz3hqpzz9','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID,D.SYSASSETCLASSALT_KEY,D.SYSNPA_DT FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A INNER JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTBASICDETAIL B ON A.INVENTITYID =B.INVENTITYID AND A.EFFECTIVEFROMTIMEKEY =:B1 AND A.EFFECTIVETOTIMEKEY =:B1 AND B.EFFECTIVEFROMTIMEKEY =:B1 AND B.EFFECTIVETOTIMEKEY =:B1 INNER JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL C ON C.ISSUERENTITYID=B.ISSUERENTITYID AND C.EFFECTIVEFROMTIMEKEY =:B1 AND C.EFFECTIVETOTIMEKEY =:B1 INNER JOIN GTT_TEMPTABLE_UCFIC1 D ON D.UCIF_ID =C.UCIFID )SRC ON (A.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET A.FINALASSETCLASSALT_KEY=SRC.SYSASSETCLASSALT_KEY ,A.NPIDT=SRC.SYSNPA_DT ,A.DEGREASON=CASE WHEN A.FINALASSETCLASSALT_KEY >1 AND SRC.SYSASSETCLASSALT_KEY =1 THEN NULL ELSE A.DEGREASON END',86182);
