Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fm0kyvpadrrsh','MERGE INTO GTT_CUSTOMERCAL C USING (SELECT A.ROWID ROW_ID FROM MAIN_PRO.PUI_CAL A INNER JOIN GTT_CUSTOMERCAL C ON C.CUSTOMERENTITYID =A.CUSTOMERENTITYID WHERE A.FLG_UPG =''N'' AND C.FLGUPG =''U'' )SRC ON (C.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET C.FLGUPG= ''N''',86182);
