Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7jp5auvtjq526','INSERT INTO GTT_PANUPDATEUPGRADE( SELECT A.PANNO,A.TOTALCOUNTMAX,B.TOTALCOUNT FROM ( SELECT COUNT(1) TOTALCOUNTMAX,PANNO FROM GTT_CUSTOMERCAL WHERE PANNO IS NOT NULL GROUP BY PANNO ) A INNER JOIN ( SELECT COUNT(1) TOTALCOUNT,PANNO FROM GTT_CUSTOMERCAL WHERE PANNO IS NOT NULL AND FLGUPG=''U'' GROUP BY PANNO ) B ON A.PANNO=B.PANNO AND A.TOTALCOUNTMAX <> B.TOTALCOUNT)',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7z41cgrf71k8v','MERGE INTO MAIN_PRO.PUI_CAL A USING (SELECT A.ROWID ROW_ID, B.FINALASSETCLASSALT_KEY FROM MAIN_PRO.PUI_CAL A JOIN GTT_ACCOUNTCAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALASSETCLASSALT_KEY = SRC.FINALASSETCLASSALT_KEY',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4q85qmtdad9q6','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, B.FINALASSETCLASSALT_KEY, B.INITIALASSETCLASSALT_KEY, CASE WHEN B.FINALASSETCLASSALT_KEY = 1 THEN SP.PROVISIONSECURED ELSE NP.PROVISIONSECURED END AS POS_4, B.FINALNPADT, A.RESTRUCTURESTAGE || (CASE WHEN B.FINALASSETCLASSALT_KEY > 1 AND SUBSTR(RESTRUCTURESTAGE, -3, 3) = ''STD'' THEN ''-NPA'' WHEN B.FINALASSETCLASSALT_KEY = 1 AND SUBSTR(RESTRUCTURESTAGE, -3, 3) = ''NPA'' THEN ''-STD'' ELSE '' '' END) AS POS_6, CASE WHEN B.UPGDATE IS NOT NULL THEN B.UPGDATE ELSE A.UPGRADEDATE END AS POS_7, CASE WHEN B.UPGDATE IS NOT NULL THEN UTILS.DATEADD(''YY'', 1, B.UPGDATE) ELSE TO_DATE(A.SURVPERIODENDDATE,''YYYY-MM-DD'') END AS POS_8 FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN GTT_ACCOUNTCAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID LEFT JOIN RBL_MISDB_PROD.DIMPROVISION_SEGSTD SP ON SP.EFFECTIVEFROMTIMEKEY <= :B1 AND SP.EFFECTIVETOTIMEKEY >= :B1 AND SP.PROVISIONALT_KEY = B.PROVISIONALT_KEY LEFT JOIN RBL_MISDB_PROD.DIMPROVISION_SEG NP ON NP.EFFECTIVEFROMTIMEKEY <= :B1 AND NP.EFFECTIVETOTIMEKEY >= :B1 AND NP.PROVISIONALT_KEY = B.PROVISIONALT_KEY WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALASSETCLASSALT_KEY = SRC.FINALASSETCLASSALT_KEY, A.INITIALASSETCLASSALT_KEY = SRC.INITIALASSETCLASSALT_KEY, A.APPLIEDNORMALPROVPER = POS_4, A.FINALNPADT = SRC.FINALNPADT, A.RESTRUCTURESTAGE = POS_6, A.UPGRADEDATE = POS_7, A.SURVPERIODENDDATE = POS_8',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4jxjg0agh7814','MERGE INTO GTT_CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, B.TOTALPROVISION, B.BANKTOTPROVISION, B.RBITOTPROVISION FROM GTT_CUSTOMERCAL A JOIN GTT_TOTALPROVCUST B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.TOTPROVISION = SRC.TOTALPROVISION, A.BANKTOTPROVISION = SRC.BANKTOTPROVISION, A.RBITOTPROVISION = SRC.RBITOTPROVISION',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5x9r9nrfax431','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(A.NPA_REASON, '' '') || '', DEGRADE BY DEBIT BALANCE '' AS NPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID JOIN RBL_MISDB_PROD.DIMPRODUCT C ON A.PRODUCTALT_KEY = C.PRODUCTALT_KEY AND ( C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 ) WHERE ( B.FLGPROCESSING = ''N'' ) AND ( NVL(FINALASSETCLASSALT_KEY, 1) <> 1 AND A.DPD_OVERDUE > 0 ) AND A.DEBITSINCEDT IS NOT NULL) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.NPA_REASON = SRC.NPA_REASON',79258);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('30rn93qmvv5n8','INSERT INTO GTT_TEMPTABLE_PERCOLATION SELECT A.REFCUSTOMERID REFCUSTOMERID , A.CUSTOMERACID CUSTOMERACID , A.NPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 AND A.NPA_REASON IS NOT NULL AND A.FINALASSETCLASSALT_KEY > 1 AND ( A.FLGDEG = ''N'' ) ORDER BY A.REFCUSTOMERID',79258);
