Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5ddqyux5wa28p','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''PERCOLATION BY UCIC_ID'' || B.UCIF_ID AS NPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.UCIFENTITYID = B.UCIFENTITYID WHERE NVL(FINALASSETCLASSALT_KEY, 1) <> 1 AND ( B.FLGPROCESSING = ''N'' ) AND A.NPA_REASON IS NULL AND B.UCIFENTITYID > 0) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.NPA_REASON = SRC.NPA_REASON',79258);
