Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fag2gdafqc4c9','INSERT INTO GTT_TEMPTABLE_PERCOLATIONWRI SELECT A.REFCUSTOMERID REFCUSTOMERID , A.CUSTOMERACID CUSTOMERACID , A.NPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 AND A.FINALASSETCLASSALT_KEY > 1 AND ( A.FLGDEG = ''N'' ) AND A.WRITEOFFAMOUNT > 0 AND A.NPA_REASON LIKE ''ALWYS_NPA Due To Writeoff Amount'' ORDER BY A.REFCUSTOMERID',79258);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gfsd9a11ur353','MERGE INTO GTT_DPD A USING (SELECT A.ROWID ROW_ID, (CASE WHEN ( NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(A.DPD_INTSERVICE, 0) WHEN ( NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(A.DPD_NOCREDIT, 0) WHEN ( NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(A.DPD_OVERDRAWN, 0) WHEN ( NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(A.DPD_RENEWAL, 0) WHEN ( NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(A.DPD_OVERDUE, 0) ELSE NVL(A.DPD_STOCKSTMT, 0) END) AS DPD_MAX FROM GTT_DPD A WHERE NVL(A.DPD_OVERDRAWN, 0) > 0 OR NVL(A.DPD_OVERDUE, 0) > 0) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DPD_MAX = SRC.DPD_MAX',79255);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5f23f808y59zh','DELETE FROM GTT_SMACLASS',79255);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('307mv9q5tmy1g','INSERT INTO GTT_TEMPTABLE_SMACLASS ( SELECT A.CUSTOMERENTITYID , MAX(CASE WHEN SMA_CLASS = ''SMA_0'' THEN 1 WHEN SMA_CLASS = ''SMA_1'' THEN 2 WHEN SMA_CLASS = ''SMA_2'' THEN 3 ELSE 0 END) MAXSMA_CLASS , MIN(A.SMA_DT) SMA_DT FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID AND B.FLGSMA = ''Y'' GROUP BY A.CUSTOMERENTITYID )',79255);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('53w2jwwy6tur8','UPDATE GTT_DPD SET DPD_OVERDUE = 0 WHERE NVL(DPD_OVERDUE, 0) < 0',79255);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('9x4g7kjxaw4j6','MERGE INTO GTT_CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, ''U'' FROM GTT_CUSTOMERCAL A JOIN GTT_TEMPTABLE B ON A.UCIF_ID = B.UCIF_ID JOIN RBL_MISDB_PROD.DIMASSETCLASS C ON C.ASSETCLASSALT_KEY = A.SYSASSETCLASSALT_KEY AND ( C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 ) WHERE ( NOT ( NVL(A.ASSET_NORM, ''NORMAL'') = ''ALWYS_NPA'' ) AND C.ASSETCLASSGROUP = ''NPA'' AND NOT ( NVL(A.FLGDEG, ''N'') = ''Y'' ) ) AND ( NVL(A.FLGPROCESSING, ''N'') = ''N'' )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGUPG = ''U''',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('aqpbtygjvppus','INSERT INTO GTT_TEMPTABLEREFCUSTOMERID ( SELECT A.REFCUSTOMERID , TOTALCOUNT FROM ( SELECT A.REFCUSTOMERID , COUNT(1) TOTALCOUNT FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( A.FLGPROCESSING = ''N'' ) AND A.UCIF_ID IS NULL AND A.REFCUSTOMERID IS NOT NULL GROUP BY A.REFCUSTOMERID ) A JOIN ( SELECT A.REFCUSTOMERID , COUNT(1) TOTALDPD_MAXCOUNT FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( B.DPD_INTSERVICE <= B.REFPERIODINTSERVICEUPG AND B.DPD_NOCREDIT <= B.REFPERIODNOCREDITUPG AND B.DPD_OVERDRAWN <= B.REFPERIODOVERDRAWNUPG AND B.DPD_OVERDUE <= B.REFPERIODOVERDUEUPG AND B.DPD_RENEWAL <= B.REFPERIODREVIEWUPG AND B.DPD_STOCKSTMT <= B.REFPERIODSTKSTATEMENTUPG ) AND B.INITIALASSETCLASSALT_KEY NOT IN ( 1 ) AND ( A.FLGPROCESSING = ''N'' ) AND B.ASSET_NORM NOT IN ( ''ALWYS_NPA'',''ALWYS_STD'' ) AND NVL(A.MOCSTATUSMARK, ''N'') = ''N'' AND A.UCIF_ID IS NULL AND A.REFCUSTOMERID IS NOT NULL GROUP BY A.REFCUSTOMERID ) B ON A.REFCUSTOMERID = B.REFCUSTOMERID AND A.TOTALCOUNT = B.TOTALDPD_MAXCOUNT )',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('9dhp29rumsqua','MERGE INTO GTT_TEMPTABLE_UCFIC1 A USING (SELECT A.ROWID ROW_ID,B.PERCTYPE FROM GTT_TEMPTABLE_UCFIC1 A INNER JOIN GTT_CTE_PERC B ON A.UCIF_ID =B.UCIF_ID AND A.SYSASSETCLASSALT_KEY =B.SYSASSETCLASSALT_KEY )SRC ON (A.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET A.PERCTYPE=SRC.PERCTYPE',86182);
