Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('a7ucj3nuuuuhp','UPDATE MAIN_PRO.ACLRUNNINGPROCESSSTATUS SET COMPLETED = ''Y'', ERRORDATE = NULL, ERRORDESCRIPTION = NULL, COUNT = NVL(COUNT, 0) + 1 WHERE RUNNINGPROCESSNAME = ''UpdateUsedRV''',79263);
