Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8rvkvzuhyu8qz','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN NVL(C.ASSETCLASSSHORTNAMEENUM, ''STD'') = ''LOS'' THEN 0 WHEN NVL(A.APPRRV, 0) >= A.NETBALANCE THEN A.NETBALANCE ELSE NVL(A.APPRRV, 0) END) AS USEDRV FROM GTT_ACCOUNTCAL A JOIN RBL_MISDB_PROD.DIMASSETCLASS C ON C.ASSETCLASSALT_KEY = NVL(A.FINALASSETCLASSALT_KEY, 1) AND ( C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 ) ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.USEDRV = SRC.USEDRV',79263);
