Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fq1gc5qtms1cc','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(A.DEGREASON, '' '') || '', DEGRADE BY CONTI EXCESS'' AS DEGREASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( B.FLGPROCESSING = ''N'' ) AND ( A.FLGDEG = ''Y'' AND A.DPD_OVERDRAWN >= A.REFPERIODOVERDRAWN )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DEGREASON = SRC.DEGREASON',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3h4r2fjub041p','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, B.FLGDEG FROM GTT_ACCOUNTCAL A JOIN MAIN_PRO.ADVACRESTRUCTURECAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID WHERE B.FLGDEG = ''Y'' AND A.FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGDEG= SRC.FLGDEG',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5cdxks6x9g3bq','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(A.NPA_REASON, '' '') || '' Degarde Account due to ALWYS_NPA and balance >=0'' AS NPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID WHERE A.ASSET_NORM = ''ALWYS_NPA'' AND NVL(FINALASSETCLASSALT_KEY, 1) <> 1 AND ( B.FLGPROCESSING = ''N'' )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.NPA_REASON = SRC.NPA_REASON',79258);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8bpvs4x2cc3p9','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(A.NPA_REASON, '' '') || '' DEGRADE BY INT NOT SERVICED'' AS NPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID WHERE ( B.FLGPROCESSING = ''N'' ) AND ( NVL(FINALASSETCLASSALT_KEY, 1) <> 1 AND ( A.DPD_INTSERVICE > 0 ) )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.NPA_REASON = SRC.NPA_REASON',79258);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('9kndb6u1kkc7n','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(A.NPA_REASON, '' '') || '', DEGRADE BY STOCK STATEMENT'' AS NPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID WHERE ( B.FLGPROCESSING = ''N'' ) AND ( NVL(FINALASSETCLASSALT_KEY, 1) <> 1 AND A.DPD_STOCKSTMT > 0 )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.NPA_REASON = SRC.NPA_REASON',79258);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gvts17yvycvw8','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''Link By W/o AccountId'' || '' '' || B.CUSTOMERACID AS NPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_TEMPTABLE_PERCOLATIONWRI B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE A.FINALASSETCLASSALT_KEY > 1 AND A.NPA_REASON NOT LIKE ''ALWYS_NPA Due To Writeoff Amount'' AND ( A.FLGDEG = ''N'' )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.NPA_REASON = SRC.NPA_REASON',79258);
