Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('axknbsmhjta16','MERGE INTO GTT_ACCOUNTCAL B USING (SELECT B.ROWID ROW_ID, 0 FROM GTT_TEMPTABLE2_MAXDPD A JOIN GTT_ACCOUNTCAL B ON A.CUSTOMERACID = B.CUSTOMERACID JOIN GTT_CUSTOMERCAL C ON C.SOURCESYSTEMCUSTOMERID = B.SOURCESYSTEMCUSTOMERID WHERE ( NVL(C.FLGPROCESSING, ''N'') = ''N'' )) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.REFPERIODMAX = 0',79243);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('g6j5yffjgczka','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, B.REFERENCEPERIOD FROM GTT_ACCOUNTCAL A JOIN CURDAT_RBL_MISDB_PROD.ADVACBASICDETAIL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.REFPERIODOVERDUE = SRC.REFERENCEPERIOD, A.REFPERIODOVERDRAWN = SRC.REFERENCEPERIOD, A.REFPERIODNOCREDIT = SRC.REFERENCEPERIOD, A.REFPERIODINTSERVICE = SRC.REFERENCEPERIOD',79239);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('b15n9akmu1fnf','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, CASE WHEN NVL(B.ASSETCLASSSHORTNAMEENUM, ''STD'') = ''LOS'' THEN 0 ELSE NVL(A.USEDRV, 0) END AS POS_2, (CASE WHEN NVL(B.ASSETCLASSSHORTNAMEENUM, ''STD'') = ''LOS'' THEN 0 ELSE (NVL(A.USEDRV, 0) * CASE WHEN C.PROVISIONNAME = ''Corporate Common'' THEN NVL(A.PROVPERSECURED, 0) ELSE NVL(C.PROVISIONSECURED, 0) / 100 END) END) AS POS_3, (CASE WHEN NVL(B.ASSETCLASSSHORTNAMEENUM, ''STD'') = ''LOS'' THEN 0 ELSE (NVL(A.USEDRV, 0) * CASE WHEN C.PROVISIONNAME = ''Corporate Common'' THEN NVL(A.PROVPERSECURED, 0) ELSE NVL(C.PROVISIONSECURED, 0) / 100 END) END) AS POS_4, (CASE WHEN NVL(B.ASSETCLASSSHORTNAMEENUM, ''STD'') = ''LOS'' THEN 0 ELSE (NVL(A.USEDRV, 0) * C.RBIPROVISIONSECURED / 100) END) AS POS_5 FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL D ON A.CUSTOMERENTITYID = D.CUSTOMERENTITYID JOIN RBL_MISDB_PROD.DIMASSETCLASS B ON B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 AND NVL(A.FINALASSETCLASSALT_KEY, 1) = B.ASSETCLASSALT_KEY JOIN RBL_MISDB_PROD.DIMPROVISION_SEG C ON C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 AND NVL(A.PROVISIONALT_KEY, 1) = C.PROVISIONALT_KEY WHERE NVL(D.FLGPROCESSING, ''N'') = ''N'' AND A.BALANCE > 0 AND FINALASSETCLASSALT_KEY > 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SECUREDAMT = POS_2, A.PROVSECURED = POS_3, A.BANKPROVSECURED = POS_4, A.RBIPROVSECURED = POS_5',79265);
