Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('by8w25k8cm4kv','MERGE INTO ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID,B.FLGUPG FLGUPG_B,C.FLGUPG FLGUPG_C,D.PARAMETERSHORTNAMEENUM FROM MAIN_PRO.ADVACRESTRUCTURECAL A INNER JOIN GTT_ACCOUNTCAL B ON A.ACCOUNTENTITYID=B.ACCOUNTENTITYID INNER JOIN GTT_CUSTOMERCAL C ON C.CUSTOMERENTITYID =B.CUSTOMERENTITYID INNER JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <=:B1 AND D.EFFECTIVETOTIMEKEY>=:B1 AND D.PARAMETERALT_KEY=A.RESTRUCTURETYPEALT_KEY WHERE D.DIMPARAMETERNAME=''TypeofRestructuring'' AND PARAMETERSHORTNAMEENUM IN(''IRAC'',''OTHER'',''MSME_OLD'',''MSME_COVID'',''MSME_COVID_RF2'',''PRUDENTIAL'') AND C.FLGUPG =''U'' )SRC ON (A.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET A.FLGUPG= CASE WHEN SRC.PARAMETERSHORTNAMEENUM IN(''MSME_OLD'',''MSME_COVID'',''MSME_COVID_RF2'') THEN (CASE WHEN (CASE WHEN NVL(SP_EXPIRYDATE,''1900-01-01'')>=NVL(SP_EXPIRYEXTENDEDDATE,''1900-01-01'') THEN SP_EXPIRYDATE ELSE SP_EXPIRYEXTENDEDDATE END)>=:B2 THEN ''N'' ELSE SRC.FLGUPG_C END ) WHEN SRC.PARAMETERSHORTNAMEENUM IN(''PRUDENTIAL'') THEN ''N'' WHEN SRC.PARAMETERSHORTNAMEENUM IN(''IRAC'',''OTHER'') THEN (CASE WHEN DPD_BREACH_DATE IS NOT NULL OR SP_EXPIRYDATE>=:B2 THEN ''N'' ELSE SRC.FLGUPG_C END ) ELSE SRC.FLGUPG_B END',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('6mdk2ukm2u5tk','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY JOIN GTT_ACCOUNTCAL AC ON A.ACCOUNTENTITYID = AC.ACCOUNTENTITYID AND AC.FLGDEG = ''Y'' WHERE D.DIMPARAMETERNAME = ''TypeofRestructuring'' AND PARAMETERSHORTNAMEENUM IN ( ''MSME_OLD'',''MSME_COVID'',''MSME_COVID_RF2'' ) AND A.FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGDEG= ''Y''',79242);
