Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('c71vh3gkd3nu3','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, UTILS.DATEADD(''YY'', 1, ZERODPD_DATE) AS SP_EXPIRYEXTENDEDDATE FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN GTT_ACCOUNTCAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' WHERE ZERODPD_DATE IS NOT NULL AND SP_EXPIRYEXTENDEDDATE IS NULL AND D.PARAMETERSHORTNAMEENUM IN ( ''MSME_OLD'',''MSME_COVID'',''MSME_COVID_RF2'' ) ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SP_EXPIRYEXTENDEDDATE = SRC.SP_EXPIRYEXTENDEDDATE',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('6bzd1m4v4nprx','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(A.DEGREASON, '' '') || '', DEGRADE BY OVERDUE'' AS DEGREASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( B.FLGPROCESSING = ''N'' ) AND ( A.FLGDEG = ''Y'' AND A.DPD_OVERDUE >= A.REFPERIODOVERDUE ) AND NVL(A.DEGREASON, '' '') NOT LIKE ''%NPA Due to Virtual DPD%'' AND NVL(A.DEGREASON, '' '') NOT LIKE ''%NPA with Seller%'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DEGREASON = SRC.DEGREASON',79242);
