Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('282ng4hxvsr0b','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN ( NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN ''RefPeriodIntService'' WHEN ( NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN ''RefPeriodNoCredit'' WHEN ( NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN ''RefPeriodOverDrawn'' WHEN ( NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN ''RefPeriodReview'' WHEN ( NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN ''RefPeriodOverdue'' ELSE ''RefPeriodStkStatement'' END) AS DPD_FINMAXTYPE FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL C ON C.SOURCESYSTEMCUSTOMERID = A.SOURCESYSTEMCUSTOMERID WHERE ( NVL(C.FLGPROCESSING, ''N'') = ''N'' ) AND ( NVL(A.DPD_INTSERVICE, 0) > 0 OR NVL(A.DPD_OVERDRAWN, 0) > 0 OR NVL(A.DPD_OVERDUE, 0) > 0 OR NVL(A.DPD_RENEWAL, 0) > 0 OR NVL(A.DPD_STOCKSTMT, 0) > 0 OR NVL(DPD_NOCREDIT, 0) > 0 )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DPD_FINMAXTYPE = SRC.DPD_FINMAXTYPE',79243);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5x1zbtuustbqy','MERGE INTO GTT_ACCOUNTCAL B USING (SELECT B.ROWID ROW_ID, A.REFPERIOD FROM GTT_TEMPTABLE2_MAXDPD A JOIN GTT_ACCOUNTCAL B ON A.CUSTOMERACID = B.CUSTOMERACID JOIN GTT_CUSTOMERCAL C ON C.SOURCESYSTEMCUSTOMERID = B.SOURCESYSTEMCUSTOMERID WHERE ( NVL(C.FLGPROCESSING, ''N'') = ''N'' )) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.REFPERIODMAX = SRC.REFPERIOD',79243);
