Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5z2h01xkm3qax','MERGE INTO GTT_CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID,B.SYSASSETCLASSALT_KEY,B.SYSNPA_DT FROM GTT_CUSTOMERCAL A INNER JOIN GTT_TEMPTABLE_UCFIC1 B ON A.UCIF_ID =B.UCIF_ID )SRC ON (A.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET A.SYSASSETCLASSALT_KEY=SRC.SYSASSETCLASSALT_KEY ,A.SYSNPA_DT=SRC.SYSNPA_DT ,A.DEGREASON=CASE WHEN A.SYSASSETCLASSALT_KEY >1 AND SRC.SYSASSETCLASSALT_KEY =1 THEN NULL ELSE A.DEGREASON END',86182);
