Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8pyp06c7vwmr3','MERGE INTO GTT_CUSTOMERCAL C USING(SELECT C.ROWID ROW_ID FROM MAIN_PRO.ADVACRESTRUCTURECAL A INNER JOIN GTT_ACCOUNTCAL B ON A.ACCOUNTENTITYID=B.ACCOUNTENTITYID INNER JOIN GTT_CUSTOMERCAL C ON C.CUSTOMERENTITYID =B.CUSTOMERENTITYID INNER JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <=:B1 AND D.EFFECTIVETOTIMEKEY>=:B1 AND D.PARAMETERALT_KEY=A.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME=''TypeofRestructuring'' WHERE A.FLGUPG =''N'' AND C.FLGUPG =''U'' AND PARAMETERSHORTNAMEENUM IN(''IRAC'',''OTHER'',''MSME_OLD'',''MSME_COVID'',''MSME_COVID_RF2'',''PRUDENTIAL'') )SRC ON (C.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET C.FLGUPG= ''N'' ,C.DEGREASON='',DEGRADEY BY RESTRUCTURE''',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2wjfmx7pvbfwz','MERGE INTO GTT_CUSTOMERCAL B USING(SELECT A.ROWID ROW_ID FROM GTT_PANUPDATEUPGRADE A INNER JOIN GTT_CUSTOMERCAL B ON A.PANNO=B.PANNO WHERE B.FLGUPG=''U'' )SRC ON (B.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET B.FLGUPG=''N'' ',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('35cxkuj3gj6qa','INSERT INTO GTT_TEMPTABLE ( SELECT A.UCIF_ID , TOTALCOUNT FROM ( SELECT A.UCIF_ID ,COUNT(1) TOTALCOUNT FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.UCIF_ID = B.UCIF_ID WHERE ( A.FLGPROCESSING = ''N'' ) AND A.UCIF_ID IS NOT NULL AND B.ASSET_NORM NOT IN (''ALWYS_STD'') GROUP BY A.UCIF_ID UNION ALL SELECT B.UCIFID,COUNT(1) TOTALCOUNT FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A INNER JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL B ON A.REFISSUERID=B.ISSUERID AND A.EFFECTIVEFROMTIMEKEY<=:B1 AND A.EFFECTIVETOTIMEKEY>=:B1 AND B.EFFECTIVEFROMTIMEKEY<=:B1 AND B.EFFECTIVETOTIMEKEY>=:B1 AND A.ASSET_NORM NOT IN (''ALWYS_STD'') GROUP BY B.UCIFID UNION ALL SELECT A.UCIC_ID,COUNT(1) TOTALCOUNT FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A WHERE A.EFFECTIVEFROMTIMEKEY<=:B1 AND A.EFFECTIVETOTIMEKEY>=:B1 GROUP BY A.UCIC_ID ) A JOIN ( SELECT A.UCIF_ID , COUNT(1) TOTALDPD_MAXCOUNT FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.UCIF_ID = B.UCIF_ID WHERE ( B.DPD_INTSERVICE <= B.REFPERIODINTSERVICEUPG AND B.DPD_NOCREDIT <= B.REFPERIODNOCREDITUPG AND B.DPD_OVERDRAWN <= B.REFPERIODOVERDRAWNUPG AND B.DPD_OVERDUE <= B.REFPERIODOVERDUEUPG AND B.DPD_RENEWAL <= B.REFPERIODREVIEWUPG AND B.DPD_STOCKSTMT <= B.REFPERIODSTKSTATEMENTUPG ) AND B.INITIALASSETCLASSALT_KEY NOT IN ( 1 ) AND ( A.FLGPROCESSING = ''N'' ) AND B.ASSET_NORM NOT IN ( ''ALWYS_NPA'',''ALWYS_STD'' ) AND NVL(A.MOCSTATUSMARK, ''N'') = ''N'' AND A.UCIF_ID IS NOT NULL AND NVL(B.UNSERVIEDINT,0)=0 AND NVL(B.ACCOUNTSTATUS,''N'')<>''Z'' AND ( (FACILITYTYPE IN(''CC'',''OD'') AND NVL(INTOVERDUE,0)=0) OR (NVL(FACILITYTYPE,'''') NOT IN(''CC'',''OD''))) UNION ALL SELECT B.UCIFID,COUNT(1) TOTALDPD_MAXCOUNT FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A INNER JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL B ON A.REFISSUERID=B.ISSUERID AND A.EFFECTIVEFROMTIMEKEY<=:B1 AND A.EFFECTIVETOTIMEKEY>=:B1 AND B.EFFECTIVEFROMTIMEKEY<=:B1 AND B.EFFECTIVETOTIMEKEY>=:B1 WHERE ((NVL(A.DPD_DIVOVERDUE,0)<=0) AND (NVL(A.PARTIALREDUMPTIONDPD,0)<=0) AND NVL(DPD_BS_DATE,0)<:B2 AND NVL(FINALASSETCLASSALT_KEY,1)<>1 AND A.ASSET_NORM NOT IN (''ALWYS_STD'')) GROUP BY B.UCIFID UNION ALL SELECT A.UCIC_ID,COUNT(1) TOTALDPD_MAXCOUNT FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A WHERE A.EFFECTIVEFROMTIMEKEY<=:B1 AND A.EFFECTIVETOTIMEKEY>=:B1 AND ( NVL(A.DPD,0)<=0 AND NVL(FINALASSETCLASSALT_KEY,1)<>1) GROUP BY A.UCIC_ID ) B ON A.UCIF_ID = B.UCIF_ID AND A.TOTALCOUNT = B.TOTALDPD_MAXCOUNT )',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('1tkpu44yt5p0s','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''Y'', CASE WHEN NVL(B.DPD_SELLER, 0) >= A.REFPERIODOVERDUE THEN ''NPA Due to Virtual DPD'' END AS POS_3 FROM GTT_ACCOUNTCAL A JOIN MAIN_PRO.BUYOUTUPLOADDETAILSCAL B ON A.CUSTOMERACID = B.CUSTOMERACID WHERE NVL(A.DPD_OVERDUE, 0) >= A.REFPERIODOVERDUE AND A.FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGDEG = ''Y'', A.DEGREASON = POS_3',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3x8zbmh9a70ta','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, :B2 FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN GTT_ACCOUNTCAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' WHERE DPD_BREACH_DATE IS NULL AND D.PARAMETERSHORTNAMEENUM IN ( ''MSME_OLD'',''MSME_COVID'',''MSME_COVID_RF2'' ) AND ( NVL(DPD_MAXNONFIN, 0) >= 90 OR NVL(DPD_MAXFIN, 0) > 30 )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DPD_BREACH_DATE = V_PROCESSDATE, A.ZERODPD_DATE = NULL, A.SP_EXPIRYEXTENDEDDATE = NULL',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('34qyfscrxy62a','MERGE INTO MAIN_PRO.BUYOUTUPLOADDETAILSCAL B USING (SELECT B.ROWID ROW_ID, CASE WHEN NVL(A.DPD_OVERDUE, 0) >= A.REFPERIODOVERDUE THEN ''NPA_VDPD'' WHEN B.NPA_CLASSSELLER = ''Y'' THEN ''NPA_SELLER'' ELSE B.NPA_FLAG END AS NPA_FLAG FROM GTT_ACCOUNTCAL A JOIN MAIN_PRO.BUYOUTUPLOADDETAILSCAL B ON A.CUSTOMERACID = B.CUSTOMERACID WHERE NVL(A.DPD_OVERDUE, 0) >= A.REFPERIODOVERDUE AND A.FINALASSETCLASSALT_KEY = 1) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.NPA_FLAG = SRC.NPA_FLAG',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('6rvyvvp0hc072','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN ( NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(A.DPD_INTSERVICE, 0) WHEN ( NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(A.DPD_NOCREDIT, 0) WHEN ( NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(A.DPD_OVERDRAWN, 0) WHEN ( NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(A.DPD_RENEWAL, 0) WHEN ( NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(A.DPD_OVERDUE, 0) ELSE NVL(A.DPD_STOCKSTMT, 0) END) AS DPD_MAX FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL C ON C.SOURCESYSTEMCUSTOMERID = A.SOURCESYSTEMCUSTOMERID WHERE ( NVL(C.FLGPROCESSING, ''N'') = ''N'' ) AND ( NVL(A.DPD_INTSERVICE, 0) > 0 OR NVL(A.DPD_OVERDRAWN, 0) > 0 OR NVL(A.DPD_OVERDUE, 0) > 0 OR NVL(A.DPD_RENEWAL, 0) > 0 OR NVL(A.DPD_STOCKSTMT, 0) > 0 OR NVL(DPD_NOCREDIT, 0) > 0 )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DPD_MAX = SRC.DPD_MAX',79243);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gg1mc9t9vu40c','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, 0 FROM GTT_ACCOUNTCAL A ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DPD_MAX = 0',79243);
