Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('6237v1uhsnnpd','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(A.REFPERIODOVERDUE, 0) AS REFPERIODMAX FROM GTT_ACCOUNTCAL A WHERE NVL(FLGDEG, ''N'') = ''Y'' AND NVL(INITIALASSETCLASSALT_KEY, 1) = 1 AND BALANCE > 0 AND NVL(REFPERIODMAX, 0) = 0 AND NVL(DPD_MAX, 0) < NVL(REFPERIODOVERDUE, 0) AND FACILITYTYPE IN ( ''TL'',''DL'',''BP'',''BD'',''PC'' ) ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.REFPERIODMAX = SRC.REFPERIODMAX',79243);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('01x5h262d4zcn','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, B.GOVGUR FROM GTT_ACCOUNTCAL A JOIN GTT_TEMPTABLEAPPGOVGUR B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID WHERE A.FACILITYTYPE IN ( ''BP'',''BD'' ) ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.APPGOVGUR = SRC.GOVGUR',79261);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('39z34c30thd76','UPDATE MAIN_PRO.ACLRUNNINGPROCESSSTATUS SET COMPLETED = ''N'', ERRORDATE = SYSDATE, ERRORDESCRIPTION = :B1 , COUNT = NVL(COUNT, 0) + 1 WHERE RUNNINGPROCESSNAME = ''GovtGuarAppropriation''',79261);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gk9skt4a99w69','INSERT INTO GTT_TEMPTABLEAPPGOVGUR ( SELECT A.ACCOUNTENTITYID , (CASE WHEN SUM(A.NETBALANCE) OVER ( PARTITION BY A.CUSTOMERENTITYID ) > 0 THEN (A.GOVTGTYAMT * (A.NETBALANCE / SUM(A.NETBALANCE) OVER ( PARTITION BY A.CUSTOMERENTITYID ))) END) GOVGUR FROM GTT_ACCOUNTCAL A WHERE A.FACILITYTYPE IN ( ''BP'',''BD'' ) AND NVL(A.GOVTGTYAMT, 0) > 0 )',79261);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('c2grd409kkzkx','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, GOVTGTYAMT FROM GTT_ACCOUNTCAL A WHERE NOT ( A.FACILITYTYPE IN ( ''BP'',''BD'' ) )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.APPGOVGUR = GOVTGTYAMT',79261);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('b08sc1dfd9f4n','UPDATE MAIN_PRO.ACLRUNNINGPROCESSSTATUS SET COMPLETED = ''Y'', ERRORDATE = NULL, ERRORDESCRIPTION = NULL, COUNT = NVL(COUNT, 0) + 1 WHERE RUNNINGPROCESSNAME = ''GovtGuarAppropriation''',79261);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3d4j3fj13psmu','UPDATE MAIN_PRO.ACLRUNNINGPROCESSSTATUS SET COMPLETED = ''N'', ERRORDATE = SYSDATE, ERRORDESCRIPTION = :B1 , COUNT = NVL(COUNT, 0) + 1 WHERE RUNNINGPROCESSNAME = ''SecurityAppropriation''',79262);
