Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('f5gv6d66hv6j2','INSERT INTO SECURITYDETAILS ( REFCUSTOMERID, TOTALSECURITY, TIMEKEY ) ( SELECT REFCUSTOMERID , SUM(NVL(CURNTQTRRV, 0)) TOTALSECURITY , :B1 TIMEKEY FROM GTT_CUSTOMERCAL WHERE NVL(CURNTQTRRV, 0) > 0 GROUP BY REFCUSTOMERID )',79262);
