Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bw6sz6yps68y1','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A WHERE NVL(A.FLGUPG,''U'')=''U'' AND A.EFFECTIVEFROMTIMEKEY<=:B1 AND A.EFFECTIVETOTIMEKEY>=:B1 )SRC ON(A.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET A.UPGDATE=:B2 ,A.DEGREASON=NULL ,A.ASSETCLASS_ALTKEY=1 ,A.FINALASSETCLASSALT_KEY=1 ,A.FLGDEG=''N'' ,A.NPIDT=NULL ,A.FLGUPG=''U''',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('ad2gtfrcwqdq4','UPDATE GTT_ACCOUNTCAL SET FLGUPG=''N''',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('6gzaq58u9mwhb','MERGE INTO MAIN_PRO.COBORROWERCAL B USING (SELECT B.ROWID ROW_ID FROM MAIN_PRO.COBORROWERCAL A INNER JOIN MAIN_PRO.COBORROWERCAL B ON B.MAINCUSTID=A.CUSTOMERID AND A.CUSTOMERTYPE IN (''Coborrower'',''CO_OBLIGANT'') AND (NVL(A.FLGUPG,''N'')=''U'' OR A.PERC_FINALASSETCLASS_ALTKEY=1) AND B.INITIALASSETCLASS_ALTKEY=1 AND B.PERC_FINALASSETCLASS_ALTKEY>1 AND B.DEGRADEREASON LIKE ''%Co Borrower NPA%'' )SRC ON (B.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET B.FINALASSETCLASS_ALTKEY=1, B.FINALNPADT=NULL, B.DEGRADEREASON=NULL',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4bgmgmtgqpjmx','MERGE INTO CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A USING (SELECT A.ROWID ROW_ID,''U'' FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A INNER JOIN GTT_TEMPTABLE B ON A.UCIC_ID=B.UCIF_ID INNER JOIN RBL_MISDB_PROD.DIMASSETCLASS C ON C.ASSETCLASSALT_KEY=A.FINALASSETCLASSALT_KEY AND (C.EFFECTIVEFROMTIMEKEY<=:B1 AND C.EFFECTIVETOTIMEKEY>=:B1 ) WHERE C.ASSETCLASSGROUP =''NPA'' AND NOT(NVL(A.FLGDEG,''N'')=''Y'') )SRC ON (A.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET A.FLGUPG=''U''',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('27xmzxx6btjm2','MERGE INTO GTT_ACCOUNTCAL B USING (SELECT A.ROWID ROW_ID FROM GTT_CUSTOMERCAL A INNER JOIN GTT_ACCOUNTCAL B ON A.REFCUSTOMERID=B.REFCUSTOMERID WHERE NVL(A.FLGUPG,''U'')=''U'' AND (NVL(A.FLGPROCESSING,''N'')=''N'') )SRC ON (B.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET B.UPGDATE=:B1 ,B.DEGREASON=NULL ,B.FINALASSETCLASSALT_KEY=1 ,B.FLGDEG=''N'' ,B.FINALNPADT=NULL ,B.FLGUPG=''U''',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('9xkjtuqtu2ud8','UPDATE CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A SET ASSETCLASS_ALTKEY=FINALASSETCLASSALT_KEY WHERE A.EFFECTIVEFROMTIMEKEY=:B1 AND A.EFFECTIVETOTIMEKEY=:B1 AND FINALASSETCLASSALT_KEY=1 AND INITIALASSETALT_KEY > 1',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cqmybjbqtqsmw','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, :B2 FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN GTT_ACCOUNTCAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' WHERE DPD_BREACH_DATE IS NULL AND D.PARAMETERSHORTNAMEENUM IN ( ''PRUDENTIAL'',''IRAC'',''OTHER'' ) AND ( ( FACILITYTYPE NOT IN ( ''CC'',''OD'' ) AND NVL(DPD_MAXFIN, 0) > 0 ) OR ( ( FACILITYTYPE IN ( ''CC'',''OD'' ) AND ( NVL(DPD_MAXFIN, 0) >= 30 OR NVL(DPD_MAXNONFIN, 0) >= 90 ) ) ) )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DPD_BREACH_DATE = V_PROCESSDATE, A.ZERODPD_DATE = NULL, A.SP_EXPIRYEXTENDEDDATE = NULL',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('6uwjztxcj6gp5','MERGE INTO MAIN_PRO.PUI_CAL A USING (SELECT A.ROWID ROW_ID, ''Y'', :B1 FROM MAIN_PRO.PUI_CAL A WHERE ( BEYONCONTROLOFPROMOTERS = ''Y'' OR COURTCASEARBITRATION = ''Y'' ) AND REVISEDDCCO <= UTILS.DATEADD(''YY'', (CASE WHEN PROJCATEGORY = ''Infra'' THEN 2 ELSE 1 END), FINNALDCCO_DATE)) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET RESTRUCTURING = ''Y'', RESTRUCTUREDATE = V_PROCESSDATE',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fc8gvz1z2qtd2','MERGE INTO GTT_CUSTOMERCAL B USING (SELECT B.ROWID ROW_ID, ''Y'' FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE A.FLGDEG = ''Y'' AND ( B.FLGPROCESSING = ''N'' )) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.FLGDEG = ''Y''',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3qdpru81t1w2g','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, B.DEGREASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.SOURCESYSTEMCUSTOMERID = B.SOURCESYSTEMCUSTOMERID WHERE ( B.FLGPROCESSING = ''N'' ) AND ( A.FLGDEG = ''N'' ) AND B.DEGREASON IS NOT NULL AND A.FINALASSETCLASSALT_KEY > 1 AND A.DEGREASON IS NULL) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DEGREASON = SRC.DEGREASON',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('578j74q984cwv','INSERT INTO GTT_TEMPTABLE_MAXDPD ( SELECT A.CUSTOMERACID , CASE WHEN NVL(A.DPD_INTSERVICE, 0) >= NVL(A.REFPERIODINTSERVICE, 0) THEN A.DPD_INTSERVICE ELSE 0 END DPD_INTSERVICE , CASE WHEN NVL(A.DPD_NOCREDIT, 0) >= NVL(A.REFPERIODNOCREDIT, 0) THEN A.DPD_NOCREDIT ELSE 0 END DPD_NOCREDIT , CASE WHEN NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.REFPERIODOVERDRAWN, 0) THEN A.DPD_OVERDRAWN ELSE 0 END DPD_OVERDRAWN , CASE WHEN NVL(A.DPD_OVERDUE, 0) >= NVL(A.REFPERIODOVERDUE, 0) THEN A.DPD_OVERDUE ELSE 0 END DPD_OVERDUE , CASE WHEN NVL(A.DPD_RENEWAL, 0) >= NVL(A.REFPERIODREVIEW, 0) THEN A.DPD_RENEWAL ELSE 0 END DPD_RENEWAL , CASE WHEN NVL(A.DPD_STOCKSTMT, 0) >= NVL(A.REFPERIODSTKSTATEMENT, 0) THEN A.DPD_STOCKSTMT ELSE 0 END DPD_STOCKSTMT FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.SOURCESYSTEMCUSTOMERID = B.SOURCESYSTEMCUSTOMERID WHERE ( NVL(DPD_INTSERVICE, 0) >= NVL(REFPERIODINTSERVICE, 0) OR NVL(DPD_NOCREDIT, 0) >= NVL(REFPERIODNOCREDIT, 0) OR NVL(DPD_OVERDRAWN, 0) >= NVL(REFPERIODOVERDRAWN, 0) OR NVL(DPD_OVERDUE, 0) >= NVL(REFPERIODOVERDUE, 0) OR NVL(DPD_RENEWAL, 0) >= NVL(REFPERIODREVIEW, 0) OR NVL(DPD_STOCKSTMT, 0) >= NVL(REFPERIODSTKSTATEMENT, 0) ) AND ( NVL(B.FLGPROCESSING, ''N'') = ''N'' ) )',79243);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4myupxtdzrkwj','UPDATE GTT_ACCOUNTCAL SET REFPERIODMAX = REFPERIODREVIEW WHERE REFPERIODMAX IS NULL AND DPD_FINMAXTYPE = ''RefPeriodReview''',79243);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2yv61r39ujjrc','MERGE INTO GTT_ACCOUNTCAL D USING (SELECT D.ROWID ROW_ID, ((D.NETBALANCE / A.TOTOSFUNDED) * C.TOTALSECURITY) AS APPRRV FROM ( ( SELECT B.REFCUSTOMERID , SUM(NVL(A.NETBALANCE, 0)) TOTOSFUNDED FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID WHERE A.NETBALANCE > 0 AND A.FLGABINITIO <> ''Y'' AND A.FINALASSETCLASSALT_KEY <> 6 AND A.FLGSECURED = ''D'' GROUP BY B.REFCUSTOMERID ) ) A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID JOIN GTT_SECURITYDETAIL C ON C.REFCUSTOMERID = B.REFCUSTOMERID JOIN GTT_ACCOUNTCAL D ON D.REFCUSTOMERID = B.REFCUSTOMERID WHERE C.TOTALSECURITY > 0 AND D.FLGABINITIO <> ''Y'' AND D.FINALASSETCLASSALT_KEY <> 6 AND D.FLGSECURED = ''D'') SRC ON ( D.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET D.APPRRV = SRC.APPRRV ',79262);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('g7aws26ajn8xs','INSERT INTO GTT_SECURITYDETAIL( SELECT REFCUSTOMERID , SUM(NVL(TOTALSECURITY, 0)) TOTALSECURITY FROM SECURITYDETAILS WHERE TIMEKEY = :B1 GROUP BY REFCUSTOMERID)',79262);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bxxzmud8kghys','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NETBALANCE FROM GTT_ACCOUNTCAL A WHERE A.FLGABINITIO <> ''Y'' AND A.FINALASSETCLASSALT_KEY <> 6 AND A.FLGSECURED = ''S'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.APPRRV = NETBALANCE',79262);
