Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('01mvjvthkq6mk','INSERT INTO GTT_CTE_PERC(UCIF_ID,SYSASSETCLASSALT_KEY,SYSNPA_DT,PERCTYPE) SELECT UCIF_ID,SYSASSETCLASSALT_KEY,SYSNPA_DT,PERCTYPE FROM ( SELECT UCIF_ID,MAX(NVL(SYSASSETCLASSALT_KEY,1)) SYSASSETCLASSALT_KEY ,MIN(SYSNPA_DT) SYSNPA_DT ,''ADV'' PERCTYPE FROM GTT_CUSTOMERCAL A WHERE ( UCIF_ID IS NOT NULL AND UCIF_ID<>''0'' ) AND NVL(SYSASSETCLASSALT_KEY,1)=1 GROUP BY UCIF_ID UNION SELECT UCIFID UCIF_ID,MAX(NVL(FINALASSETCLASSALT_KEY,1)) SYSASSETCLASSALT_KEY ,MIN(NPIDT) SYSNPA_DT ,''INV'' PERCTYPE FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A INNER JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTBASICDETAIL B ON A.INVENTITYID =B.INVENTITYID AND A.EFFECTIVEFROMTIMEKEY =:B1 AND A.EFFECTIVETOTIMEKEY =:B1 AND B.EFFECTIVEFROMTIMEKEY =:B1 AND B.EFFECTIVETOTIMEKEY =:B1 INNER JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL C ON C.ISSUERENTITYID=B.ISSUERENTITYID AND C.EFFECTIVEFROMTIMEKEY =:B1 AND C.EFFECTIVETOTIMEKEY =:B1 WHERE NVL(FINALASSETCLASSALT_KEY,1)=1 GROUP BY UCIFID UNION SELECT UCIC_ID,MAX(NVL(FINALASSETCLASSALT_KEY,1)) SYSASSETCLASSALT_KEY ,MIN(NPIDT) SYSNPA_DT ,''DER'' PERCTYPE FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A WHERE A.EFFECTIVEFROMTIMEKEY =:B1 AND A.EFFECTIVETOTIMEKEY =:B1 AND NVL(FINALASSETCLASSALT_KEY,1)=1 GROUP BY UCIC_ID )A',86182);
