Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7t1ss0d71f12k','MERGE INTO CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A USING(SELECT ROWID ROW_ID FROM CURDAT_RBL_MISDB_PROD.DERIVATIVEDETAIL A WHERE NVL(A.FLGUPG,''U'')=''U'' AND A.EFFECTIVEFROMTIMEKEY<=:B1 AND A.EFFECTIVETOTIMEKEY>=:B1 )SRC ON (A.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET A.UPGDATE=:B2 ,A.DEGREASON=NULL ,A.ASSETCLASS_ALTKEY=1 ,A.FLGDEG=''N'' ,A.NPIDT=NULL ,A.FLGUPG=''U''',86182);
