Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('ccambgn3sh0ha','MERGE INTO MAIN_PRO.PUI_CAL A USING (SELECT A.ROWID ROW_ID, CASE WHEN ( UTILS.DATEDIFF(''DD'', FINNALDCCO_DATE, :B1 ) > :B2 AND REVISEDDCCO IS NULL ) THEN ''Original DCCO/ CIO_DCCO is Crossed'' WHEN ( FINNALDCCO_DATE < :B1 AND REVISEDDCCO IS NOT NULL AND UTILS.DATEDIFF(''DD'', REVISEDDCCO, :B1 ) > 90 ) THEN ''Revised DCCO is crossed'' WHEN ( REVISEDDCCO IS NOT NULL AND COSTOVERRUN = ''Y'' AND ( ( NVL(COSTOVERRUNPER, 0) > 10 ) OR ( NVL(REVISEDDEBT, 0) > NVL(ORIGINALDEBT, 0) ) ) AND ( UTILS.DATEADD(''YY'', (CASE WHEN PROJCATEGORY = ''Infra'' THEN 2 ELSE 1 END), FINNALDCCO_DATE) > REVISEDDCCO AND UTILS.DATEADD(''YY'', (CASE WHEN PROJCATEGORY = ''Infra'' THEN 4 ELSE 2 END), FINNALDCCO_DATE) < REVISEDDCCO ) ) THEN ''Cost Overrun or Revised DE Ratio is more than Permissible Limits'' WHEN ( TAKEOUTFINANCE = ''Y'' AND ASSETCLASSSELLERBOOKALT_KEY > 1 ) THEN ''The account is NPA in sellers book'' END AS DEFAULT_REASON FROM MAIN_PRO.PUI_CAL A WHERE FINALASSETCLASSALT_KEY = 1 AND ACTUALDCCO_DATE IS NULL) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET DEFAULT_REASON = SRC.DEFAULT_REASON',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('1z5qqad007f6p','MERGE INTO MAIN_PRO.PUI_CAL A USING (SELECT A.ROWID ROW_ID, ''Y'', :B1 FROM MAIN_PRO.PUI_CAL A WHERE NVL(DEFAULT_REASON, '' '') <> '' '') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLG_DEG = ''Y'', A.NPA_DATE = V_PROCESSDATE',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('1yp884pbhsuk4','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(A.DEGREASON, '' '') || '', DEGRADE BY NO CREDIT'' AS DEGREASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( B.FLGPROCESSING = ''N'' ) AND ( A.FLGDEG = ''Y'' AND A.DPD_NOCREDIT >= A.REFPERIODNOCREDIT )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DEGREASON = SRC.DEGREASON',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('dpq71w0dc3qxh','INSERT INTO GTT_TEMPTABLE2_MAXDPD ( SELECT A.CUSTOMERACID , CASE WHEN ( NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(REFPERIODINTSERVICE, 0) WHEN ( NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(REFPERIODNOCREDIT, 0) WHEN ( NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(REFPERIODOVERDRAWN, 0) WHEN ( NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(REFPERIODREVIEW, 0) WHEN ( NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(REFPERIODOVERDUE, 0) ELSE NVL(REFPERIODSTKSTATEMENT, 0) END REFPERIOD FROM GTT_TEMPTABLE_MAXDPD A JOIN GTT_ACCOUNTCAL B ON A.CUSTOMERACID = B.CUSTOMERACID JOIN GTT_CUSTOMERCAL C ON C.SOURCESYSTEMCUSTOMERID = B.SOURCESYSTEMCUSTOMERID WHERE ( NVL(C.FLGPROCESSING, ''N'') = ''N'' ) )',79243);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fa80gbm99gjtb','UPDATE MAIN_PRO.ACLRUNNINGPROCESSSTATUS SET COMPLETED = ''N'', ERRORDATE = SYSDATE, ERRORDESCRIPTION = :B1 , COUNT = NVL(COUNT, 0) + 1 WHERE RUNNINGPROCESSNAME = ''MaxDPD_ReferencePeriod_Calculation''',79243);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('aqbrd2av07huw','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, CASE WHEN NVL(ACL.ASSETCLASSSHORTNAMEENUM, ''STD'') = ''STD'' THEN UTILS.ROUND_(NVL(A.COVERGOVGUR, 0) * PROV.PROVISIONSECURED, 0) WHEN NVL(ACL.ASSETCLASSSHORTNAMEENUM, ''STD'') = ''SUB'' THEN UTILS.ROUND_(NVL(A.COVERGOVGUR, 0) * PROV.PROVISIONSECURED, 0) ELSE 0 END AS PROVCOVERGOVGUR FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID JOIN RBL_MISDB_PROD.DIMASSETCLASS ACL ON ACL.EFFECTIVEFROMTIMEKEY <= :B1 AND ACL.EFFECTIVETOTIMEKEY >= :B1 AND NVL(A.FINALASSETCLASSALT_KEY, 1) = ACL.ASSETCLASSALT_KEY JOIN RBL_MISDB_PROD.DIMPROVISION_SEG PROV ON PROV.EFFECTIVEFROMTIMEKEY <= :B1 AND PROV.EFFECTIVETOTIMEKEY >= :B1 AND NVL(A.PROVISIONALT_KEY, 1) = PROV.PROVISIONALT_KEY WHERE NVL(B.FLGPROCESSING, ''N'') = ''N'' AND NVL(A.COVERGOVGUR, 0) > 0) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.PROVCOVERGOVGUR = SRC.PROVCOVERGOVGUR',79266);
