Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2msxn0dy4vvyb','MERGE INTO MAIN_PRO.COBORROWERCAL A USING( SELECT A.ROWID ROW_ID FROM MAIN_PRO.COBORROWERCAL A INNER JOIN GTT_CUSTOMERCAL B ON A.CUSTOMERID=B.REFCUSTOMERID WHERE A.FINALASSETCLASS_ALTKEY>1 AND NVL(A.FLGUPG,''N'')=''N'' )SRC ON (A.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET FLGUPG=''N''',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0b4g6ghzzp9p2','MERGE INTO MAIN_PRO.COBORROWERCAL A USING(SELECT A.ROWID ROW_ID,B.FLGUPG,B.ASSET_NORM FROM MAIN_PRO.COBORROWERCAL A INNER JOIN GTT_CUSTOMERCAL B ON A.CUSTOMERID=B.REFCUSTOMERID WHERE B.FLGUPG=''U'' )SRC ON (A.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET A.FLGUPG=SRC.FLGUPG , A.ASSET_NORM=SRC.ASSET_NORM',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5dzatq1z0ppfy','UPDATE CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A SET FLGDEG=''N'',FLGUPG = ''U'',UPGDATE = :B2 WHERE A.EFFECTIVEFROMTIMEKEY=:B1 AND A.EFFECTIVETOTIMEKEY=:B1 AND FINALASSETCLASSALT_KEY=1 AND INITIALASSETALT_KEY > 1',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('17fsq8mpzzp64','MERGE INTO GTT_ACCOUNTCAL B USING (SELECT B.ROWID ROW_ID, :B1 FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE NVL(A.FLGUPG, ''U'') = ''U'' AND ( NVL(A.FLGPROCESSING, ''N'') = ''N'' )) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.UPGDATE = V_PROCESSDATE, B.DEGREASON = NULL, B.FINALASSETCLASSALT_KEY = 1, B.FLGDEG = ''N'', B.FINALNPADT = NULL, B.FLGUPG = ''U''',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3u2rb8q1xvhgm','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, :B2 FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN GTT_ACCOUNTCAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' WHERE DPD_BREACH_DATE IS NOT NULL AND D.PARAMETERSHORTNAMEENUM IN ( ''MSME_OLD'',''MSME_COVID'',''MSME_COVID_RF2'' ) AND ( NVL(DPD_MAXNONFIN, 0) < 90 AND NVL(DPD_MAXFIN, 0) <= 30 ) AND ZERODPD_DATE IS NULL AND (CASE WHEN NVL(SP_EXPIRYDATE, ''1900-01-01'') >= NVL(SP_EXPIRYEXTENDEDDATE, ''1900-01-01'') THEN SP_EXPIRYDATE ELSE SP_EXPIRYEXTENDEDDATE END) > :B2 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ZERODPD_DATE = V_PROCESSDATE, A.DPD_BREACH_DATE = NULL',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0waak1wkpsaw6','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(A.DEGREASON, '' '') || '', DEGRADE BY STOCK STATEMENT'' AS DEGREASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( B.FLGPROCESSING = ''N'' ) AND ( A.FLGDEG = ''Y'' AND A.DPD_STOCKSTMT >= A.REFPERIODSTKSTATEMENT )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DEGREASON = SRC.DEGREASON',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3xj4v73z5bz5j','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN NVL(A.DPD_INTSERVICE, 0) >= A.REFPERIODINTSERVICE THEN ''Y'' WHEN NVL(A.DPD_OVERDRAWN, 0) >= A.REFPERIODOVERDRAWN THEN ''Y'' WHEN NVL(A.DPD_NOCREDIT, 0) >= A.REFPERIODNOCREDIT THEN ''Y'' WHEN NVL(A.DPD_OVERDUE, 0) >= A.REFPERIODOVERDUE THEN ''Y'' WHEN NVL(A.DPD_STOCKSTMT, 0) >= A.REFPERIODSTKSTATEMENT THEN ''Y'' WHEN NVL(A.DPD_RENEWAL, 0) >= A.REFPERIODREVIEW THEN ''Y'' ELSE ''N'' END) AS FLGDEG FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( A.FINALASSETCLASSALT_KEY IN ( SELECT ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE ASSETCLASSSHORTNAMEENUM IN ( ''STD'' ) AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 ) ) AND ( NVL(A.ASSET_NORM, ''NORMAL'') <> ''ALWYS_STD'' ) AND ( B.FLGPROCESSING = ''N'' ) AND NVL(INMONTHMARK, ''N'') = ''Y'' AND NVL(B.FLGMOC, ''N'') = ''N'' AND NVL(A.BALANCE, 0) > 0) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGDEG = SRC.FLGDEG',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4h6d1ptn25vka','INSERT INTO GTT_RESTR_NPA ( SELECT UCIFENTITYID , MIN(CASE WHEN NVL(A.FINALNPADT, ''2099-12-31'') > NVL(B.DEGDATE, ''2099-12-31'') THEN B.DEGDATE ELSE A.FINALNPADT END) FINALNPADT FROM GTT_ACCOUNTCAL A JOIN MAIN_PRO.ADVACRESTRUCTURECAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = B.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' WHERE ( A.FINALASSETCLASSALT_KEY > 1 OR A.FLGDEG = ''Y'' ) GROUP BY UCIFENTITYID )',79244);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5jkfhmp241uk8','INSERT INTO GTT_TEMPTABLEDPD ( SELECT A.CUSTOMERACID , CASE WHEN NVL(A.DPD_INTSERVICE, 0) >= NVL(A.REFPERIODINTSERVICE, 0) THEN A.DPD_INTSERVICE ELSE 0 END DPD_INTSERVICE , CASE WHEN NVL(A.DPD_NOCREDIT, 0) >= NVL(A.REFPERIODNOCREDIT, 0) THEN A.DPD_NOCREDIT ELSE 0 END DPD_NOCREDIT , CASE WHEN NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.REFPERIODOVERDRAWN, 0) THEN A.DPD_OVERDRAWN ELSE 0 END DPD_OVERDRAWN , CASE WHEN NVL(A.DPD_OVERDUE, 0) >= NVL(A.REFPERIODOVERDUE, 0) THEN A.DPD_OVERDUE ELSE 0 END DPD_OVERDUE , CASE WHEN NVL(A.DPD_RENEWAL, 0) >= NVL(A.REFPERIODREVIEW, 0) THEN A.DPD_RENEWAL ELSE 0 END DPD_RENEWAL , CASE WHEN NVL(A.DPD_STOCKSTMT, 0) >= NVL(A.REFPERIODSTKSTATEMENT, 0) THEN A.DPD_STOCKSTMT ELSE 0 END DPD_STOCKSTMT FROM GTT_ACCOUNTCAL A WHERE ( NVL(DPD_INTSERVICE, 0) >= NVL(REFPERIODINTSERVICE, 0) OR NVL(DPD_NOCREDIT, 0) >= NVL(REFPERIODNOCREDIT, 0) OR NVL(DPD_OVERDRAWN, 0) >= NVL(REFPERIODOVERDRAWN, 0) OR NVL(DPD_OVERDUE, 0) >= NVL(REFPERIODOVERDUE, 0) OR NVL(DPD_RENEWAL, 0) >= NVL(REFPERIODREVIEW, 0) OR NVL(DPD_STOCKSTMT, 0) >= NVL(REFPERIODSTKSTATEMENT, 0) ) )',79244);
