Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('c4pgafq224y64','INSERT INTO GTT_TEMPTABLE_SMA ( SELECT A.CUSTOMERACID , CASE WHEN NVL(A.DPD_INTSERVICE, 0) >= NVL(A.REFPERIODINTSERVICE, 0) THEN A.DPD_INTSERVICE ELSE 0 END DPD_INTSERVICE , CASE WHEN NVL(A.DPD_NOCREDIT, 0) >= NVL(A.REFPERIODNOCREDIT, 0) THEN A.DPD_NOCREDIT ELSE 0 END DPD_NOCREDIT , CASE WHEN NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.REFPERIODOVERDRAWN, 0) THEN A.DPD_OVERDRAWN ELSE 0 END DPD_OVERDRAWN , CASE WHEN NVL(A.DPD_OVERDUE, 0) >= NVL(A.REFPERIODOVERDUE, 0) THEN A.DPD_OVERDUE ELSE 0 END DPD_OVERDUE , CASE WHEN NVL(A.DPD_RENEWAL, 0) >= NVL(A.REFPERIODREVIEW, 0) THEN A.DPD_RENEWAL ELSE 0 END DPD_RENEWAL , CASE WHEN NVL(A.DPD_STOCKSTMT, 0) >= NVL(A.REFPERIODSTKSTATEMENT, 0) THEN A.DPD_STOCKSTMT ELSE 0 END DPD_STOCKSTMT FROM GTT_DPD A WHERE ( NVL(DPD_INTSERVICE, 0) >= NVL(REFPERIODINTSERVICE, 0) OR NVL(DPD_NOCREDIT, 0) >= NVL(REFPERIODNOCREDIT, 0) OR NVL(DPD_OVERDRAWN, 0) >= NVL(REFPERIODOVERDRAWN, 0) OR NVL(DPD_OVERDUE, 0) >= NVL(REFPERIODOVERDUE, 0) OR NVL(DPD_RENEWAL, 0) >= NVL(REFPERIODREVIEW, 0) OR NVL(DPD_STOCKSTMT, 0) >= NVL(REFPERIODSTKSTATEMENT, 0) ) )',79255);
