Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fv0qnd36yamzt','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(A.DEGREASON, '' '') || ''DEGRADE BY INT NOT SERVICED'' AS DEGREASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( B.FLGPROCESSING = ''N'' ) AND ( A.FLGDEG = ''Y'' AND ( A.DPD_INTSERVICE >= A.REFPERIODINTSERVICE ) )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DEGREASON = SRC.DEGREASON',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('a4qwk9h2dr6xg','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, :B2 FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN GTT_ACCOUNTCAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' WHERE DPD_BREACH_DATE IS NULL AND D.PARAMETERSHORTNAMEENUM IN ( ''COVID_OTR_RF'',''COVID_OTR_RF_2'' ) AND ( ( FACILITYTYPE NOT IN ( ''CC'',''OD'' ) AND NVL(DPD_MAXFIN, 0) > 30 ) OR ( FACILITYTYPE IN ( ''CC'',''OD'' ) AND NVL(B.DPD_OVERDRAWN, 0) > 60 ) )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DPD_BREACH_DATE = V_PROCESSDATE, A.ZERODPD_DATE = NULL, A.SP_EXPIRYEXTENDEDDATE = NULL',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('c7ptc8cbgsm4x','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, ''Y'' , CASE WHEN RES_POS_TO_CURRENTPOS_PER <= 30 THEN ''Restructured slippage'' ELSE '' '' END AS POS_3 FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' JOIN RBL_MISDB_PROD.DIMPARAMETER E ON E.EFFECTIVEFROMTIMEKEY <= :B1 AND E.EFFECTIVETOTIMEKEY >= :B1 AND E.PARAMETERALT_KEY = A.COVID_OTR_CATGALT_KEY AND E.DIMPARAMETERNAME = ''Covid - OTR Category'' JOIN GTT_ACCOUNTCAL AC ON A.ACCOUNTENTITYID = AC.ACCOUNTENTITYID WHERE D.PARAMETERSHORTNAMEENUM IN ( ''COVID_OTR_RF'',''OVID_OTR_RF_2'' ) AND A.FINALASSETCLASSALT_KEY = 1 AND ( ( E.PARAMETERSHORTNAMEENUM = ''PERSONAL'' AND AC.FLGDEG = ''Y'' ) OR ( E.PARAMETERSHORTNAMEENUM = ''OTHER'' AND DPD_BREACH_DATE IS NOT NULL AND SP_EXPIRYDATE > :B2 ) )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGDEG = ''Y'', A.DEGREASON = POS_3',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('a2254adpw7su9','INSERT INTO GTT_TEMPTABLENPA ( SELECT A.CUSTOMERACID , CASE WHEN ( NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_INTSERVICE, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(A.DPD_INTSERVICE, 0) WHEN ( NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_NOCREDIT, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(A.DPD_NOCREDIT, 0) WHEN ( NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_OVERDRAWN, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(A.DPD_OVERDRAWN, 0) WHEN ( NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_OVERDUE, 0) AND NVL(A.DPD_RENEWAL, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(A.DPD_RENEWAL, 0) WHEN ( NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_NOCREDIT, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_INTSERVICE, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_OVERDRAWN, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_RENEWAL, 0) AND NVL(A.DPD_OVERDUE, 0) >= NVL(A.DPD_STOCKSTMT, 0) ) THEN NVL(A.DPD_OVERDUE, 0) ELSE NVL(A.DPD_STOCKSTMT, 0) END REFPERIODNPA FROM GTT_TEMPTABLEDPD A JOIN GTT_ACCOUNTCAL B ON A.CUSTOMERACID = B.CUSTOMERACID )',79244);
