Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('1pcrp2dcwk84c','MERGE INTO GTT_CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, B.FLG_DEG, B.NPA_DATE, NVL(DEGREASON, '' '') || '','' || B.DEFAULT_REASON AS POS_4 FROM GTT_CUSTOMERCAL A JOIN MAIN_PRO.PUI_CAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID WHERE B.FLG_DEG = ''Y'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGDEG = SRC.FLG_DEG, A.SYSNPA_DT = SRC.NPA_DATE, DEGREASON = POS_4',79244);
