Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0yg0sxxk51fz6','MERGE INTO MAIN_PRO.ACCOUNT_MOVEMENT_HISTORY AA USING (SELECT AA.ROWID ROW_ID, :B3 , UTILS.DATEADD(''DD'', -1, :B2 ) AS POS_3 FROM MAIN_PRO.ACCOUNT_MOVEMENT_HISTORY AA WHERE AA.EFFECTIVETOTIMEKEY = 49999 AND AA.EFFECTIVEFROMTIMEKEY < :B1 AND EXISTS ( SELECT 1 FROM GTT_ACCOUNT_MOVEMENT_HISTORY BB WHERE AA.CUSTOMERACID = BB.CUSTOMERACID AND BB.EFFECTIVETOTIMEKEY = 49999 AND AA.MOVEMENTTOSTATUS <> BB.MOVEMENTTOSTATUS )) SRC ON ( AA.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, MOVEMENTTODATE = POS_3',79255);
