Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('9nh4p47w8qkan','MERGE INTO GTT_CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, ''Y'' FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID WHERE B.FLGSMA = ''Y'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGSMA = ''Y''',79255);
