Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7q6zxn1uyj6xf','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN (NVL(A.NETBALANCE, 0) - (NVL(A.SECUREDAMT, 0) + NVL(A.COVERGOVGUR, 0))) > 0 THEN ((NVL(A.NETBALANCE, 0) - (NVL(A.SECUREDAMT, 0) + NVL(A.COVERGOVGUR, 0)))) ELSE 0 END) AS POS_2, (CASE WHEN (NVL(A.NETBALANCE, 0) - (NVL(A.SECUREDAMT, 0) + NVL(A.COVERGOVGUR, 0))) > 0 THEN (((NVL(A.NETBALANCE, 0) - (NVL(A.SECUREDAMT, 0) + NVL(A.COVERGOVGUR, 0)))) * CASE WHEN D.PROVISIONNAME = ''Corporate Common'' THEN NVL(A.PROVPERUNSECURED, 0) ELSE NVL(D.PROVISIONUNSECURED, 0) / 100 END) ELSE 0 END) AS POS_3, (CASE WHEN (NVL(A.NETBALANCE, 0) - (NVL(A.SECUREDAMT, 0) + NVL(A.COVERGOVGUR, 0))) > 0 THEN (((NVL(A.NETBALANCE, 0) - (NVL(A.SECUREDAMT, 0) + NVL(A.COVERGOVGUR, 0)))) * CASE WHEN D.PROVISIONNAME = ''Corporate Common'' THEN NVL(A.PROVPERUNSECURED, 0) ELSE NVL(D.PROVISIONUNSECURED, 0) / 100 END) ELSE 0 END) AS POS_4, (CASE WHEN (NVL(A.NETBALANCE, 0) - (NVL(A.SECUREDAMT, 0) + NVL(A.COVERGOVGUR, 0))) > 0 THEN (((NVL(A.NETBALANCE, 0) - (NVL(A.SECUREDAMT, 0) + NVL(A.COVERGOVGUR, 0)))) * NVL(D.RBIPROVISIONUNSECURED, 0) / 100) ELSE 0 END) AS POS_5 FROM GTT_ACCOUNTCAL A JOIN RBL_MISDB_PROD.DIMPROVISION_SEGSTD D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND NVL(A.PROVISIONALT_KEY, 1) = D.PROVISIONALT_KEY WHERE FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.UNSECUREDAMT = POS_2, A.PROVUNSECURED = POS_3, A.BANKPROVUNSECURED = POS_4, A.RBIPROVUNSECURED = POS_5',79267);
