Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('au88d89v415fx','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(A.DEGREASON, '' '') || '', DEGRADE BY REVIEW DUE DATE'' AS DEGREASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( B.FLGPROCESSING = ''N'' ) AND ( A.FLGDEG = ''Y'' AND A.DPD_RENEWAL >= A.REFPERIODREVIEW )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DEGREASON = SRC.DEGREASON',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('a5stp3dyu5xsv','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, ''Y'' FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY WHERE D.DIMPARAMETERNAME = ''TypeofRestructuring'' AND PARAMETERSHORTNAMEENUM IN ( ''IRAC'',''OTHER'',''PRUDENTIAL'' ) AND FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGDEG= ''Y''',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cxh4md7qdxbm2','MERGE INTO GTT_CUSTOMERCAL B USING (SELECT B.ROWID ROW_ID, ''N'' FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( NVL(B.FLGPROCESSING, ''N'') = ''N'' )) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.FLGDEG = ''N''',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gx4dz8kp6sz05','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''Y'', ''NPA with Seller'' AS POS_3, ''ALWYS_NPA'' FROM GTT_ACCOUNTCAL A JOIN MAIN_PRO.BUYOUTUPLOADDETAILSCAL B ON A.CUSTOMERACID = B.CUSTOMERACID WHERE B.NPA_CLASSSELLER = ''Y'' AND A.FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGDEG = ''Y'', A.DEGREASON = POS_3, A.ASSET_NORM = ''ALWYS_NPA''',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('a2pvdsankqb5q','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''N'' FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( NVL(B.FLGPROCESSING, ''N'') = ''N'' )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGDEG = ''N''',79242);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8u809yxjm8yjz','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, B.SYSNPA_DT FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE NVL(A.ASSET_NORM, ''NORMAL'') <> ''ALWYS_STD'' AND NVL(A.FLGDEG, ''N'') = ''Y'' AND NVL(B.FLGPROCESSING, ''N'') = ''N'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALNPADT = SRC.SYSNPA_DT',79244);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('dtdrwhtxqmj6t','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, ''N'' FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND A.FLGDEG = ''Y'' WHERE D.DIMPARAMETERNAME = ''TypeofRestructuring'' AND PARAMETERSHORTNAMEENUM NOT IN ( ''PRUDENTIAL'',''IRAC'',''OTHER'' ) ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGDEG = ''N''',79244);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('19jr682fzfs2k','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, UTILS.DATEADD(''DAY'', NVL(REFPERIODMAX, 0), UTILS.DATEADD(''DAY'', -NVL(REFPERIODNPA, 0), :B1 )) AS FINALNPADT FROM GTT_ACCOUNTCAL A JOIN GTT_TEMPTABLENPA B ON A.CUSTOMERACID = B.CUSTOMERACID WHERE NVL(A.FLGDEG, ''N'') = ''Y'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALNPADT = SRC.FINALNPADT',79244);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bgyybgj0jhxv2','MERGE INTO GTT_ACCOUNTCAL C USING (SELECT C.ROWID ROW_ID, A.FINALNPADT FROM GTT_RESTR_NPA A JOIN GTT_ACCOUNTCAL C ON C.UCIFENTITYID = A.UCIFENTITYID WHERE C.FINALASSETCLASSALT_KEY > 1 OR C.FLGDEG = ''Y'') SRC ON ( C.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET C.FINALNPADT = SRC.FINALNPADT',79244);
