Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4972uy13kjy7v','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( NVL(B.FLGPROCESSING, ''N'') = ''N'' AND NVL(A.FLGDEG, ''N'') = ''Y'' )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.INITIALNPADT = NULL, A.FINALNPADT = NULL',79244);
