Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('9jhwycbpjufy9','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN DPD.DPD_MAX BETWEEN 1 AND 30 THEN ''SMA_0'' WHEN DPD.DPD_MAX BETWEEN 31 AND 60 THEN ''SMA_1'' WHEN DPD.DPD_MAX BETWEEN 61 AND 90 THEN ''SMA_2'' WHEN DPD.DPD_MAX > 90 THEN ''SMA_2'' ELSE NULL END) AS POS_2, (CASE WHEN A.FACILITYTYPE IN ( ''CC'',''OD'' ) AND NVL(DPD.DPD_INTSERVICE, 0) = NVL(DPD.DPD_MAX, 0) THEN ''DEGRADE BY INT NOT SERVICED'' WHEN A.FACILITYTYPE IN ( ''CC'',''OD'' ) AND NVL(DPD.DPD_NOCREDIT, 0) = NVL(DPD.DPD_MAX, 0) THEN ''DEGRADE BY NO CREDIT'' WHEN A.FACILITYTYPE IN ( ''TL'',''DL'',''BP'',''BD'',''PC'' ) AND NVL(DPD.DPD_OVERDUE, 0) = NVL(DPD.DPD_MAX, 0) THEN ''DEGRADE BY OVERDUE'' WHEN A.FACILITYTYPE IN ( ''CC'',''OD'' ) AND NVL(DPD.DPD_OVERDRAWN, 0) = NVL(DPD.DPD_MAX, 0) AND NVL(DPD.DPD_OVERDRAWN, 0) > 30 THEN ''DEGRADE BY CONTI EXCESS'' WHEN A.FACILITYTYPE IN ( ''CC'',''OD'' ) AND NVL(DPD.DPD_STOCKSTMT, 0) = NVL(DPD.DPD_MAX, 0) THEN ''DEGRADE BY STOCK STATEMENT'' WHEN A.FACILITYTYPE IN ( ''CC'',''OD'' ) AND NVL(DPD.DPD_RENEWAL, 0) = NVL(DPD.DPD_MAX, 0) THEN ''DEGRADE BY REVIEW DUE DATE'' ELSE ''OTHER'' END) AS POS_3, UTILS.DATEADD(''DAY'', -DPD.DPD_MAX + 1, :B2 ) AS POS_4, ''Y'' FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID JOIN CURDAT_RBL_MISDB_PROD.ADVACBASICDETAIL ABD ON A.ACCOUNTENTITYID = ABD.ACCOUNTENTITYID AND ( ABD.EFFECTIVEFROMTIMEKEY <= :B1 AND ABD.EFFECTIVETOTIMEKEY >= :B1 ) JOIN GTT_DPD DPD ON DPD.ACCOUNTENTITYID = A.ACCOUNTENTITYID WHERE NVL(B.FLGPROCESSING, ''N'') = ''N'' AND NVL(FINALASSETCLASSALT_KEY, 1) = 1 AND NVL(A.BALANCE, 0) > 0 AND A.ASSET_NORM <> ''ALWYS_STD'' AND ( NVL(DPD.DPD_OVERDRAWN, 0) >= 0 OR NVL(DPD.DPD_OVERDUE, 0) >= 0 ) AND NVL(DPD.DPD_MAX, 0) > 0) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SMA_CLASS = POS_2, A.SMA_REASON = POS_3, A.SMA_DT = POS_4, A.FLGSMA = ''Y''',79255);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7vjv98zdxn0s8','MERGE INTO MAIN_PRO.CUSTOMER_MOVEMENT_HISTORY AA USING (SELECT AA.ROWID ROW_ID, :B3 , UTILS.DATEADD(''DD'', -1, :B2 ) AS POS_3 FROM MAIN_PRO.CUSTOMER_MOVEMENT_HISTORY AA WHERE AA.EFFECTIVETOTIMEKEY = 49999 AND AA.EFFECTIVEFROMTIMEKEY < :B1 AND EXISTS ( SELECT 1 FROM TT_CUSTOMER_MOVEMENT_HISTOR BB WHERE AA.SOURCESYSTEMCUSTOMERID = BB.SOURCESYSTEMCUSTOMERID AND BB.EFFECTIVETOTIMEKEY = 49999 AND AA.MOVEMENTTOSTATUS <> BB.MOVEMENTTOSTATUS )) SRC ON ( AA.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, MOVEMENTTODATE = POS_3',79255);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('dzxy2qzrthq4m','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, (NVL(A.PROVSECURED, 0) + NVL(A.PROVUNSECURED, 0) + (NVL(A.ADDLPROVISION, 0)) + NVL(A.PROVCOVERGOVGUR, 0) + NVL(A.PROVDFV, 0)) AS POS_2, (NVL(A.BANKPROVSECURED, 0) + NVL(A.BANKPROVUNSECURED, 0) + (NVL(A.ADDLPROVISION, 0)) + NVL(A.PROVCOVERGOVGUR, 0) + NVL(A.PROVDFV, 0)) AS POS_3, (NVL(A.RBIPROVSECURED, 0) + NVL(A.RBIPROVUNSECURED, 0) + (NVL(A.ADDLPROVISION, 0)) + NVL(A.PROVCOVERGOVGUR, 0) + NVL(A.PROVDFV, 0)) AS POS_4 FROM GTT_ACCOUNTCAL A ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.TOTALPROVISION = POS_2, A.BANKTOTALPROVISION = POS_3, A.RBITOTALPROVISION = POS_4',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fmzphzybyza0x','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, 5 FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' AND D.PARAMETERSHORTNAMEENUM IN ( ''PRUDENTIAL'' ) WHERE SURVPERIODENDDATE > :B2 AND FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ADDLPROVPER = 5',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5vfw3ct4xpmjg','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, 15 FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' AND D.PARAMETERSHORTNAMEENUM IN ( ''PRUDENTIAL'' ) WHERE ( ( DPD_BREACH_DATE IS NOT NULL AND SP_EXPIRYDATE >= :B2 ) OR POS_10PERPAIDDATE IS NULL ) AND FINALASSETCLASSALT_KEY > 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ADDLPROVPER = 15',79268);
