Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cyghaz5d79f2q','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, B.PNPA_DT, ''Y'', B.PNPA_CLASS_KEY FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID AND ( NVL(A.ASSET_NORM, ''NORMAL'') <> ''ALWYS_STD'' ) AND B.FLGPNPA = ''Y'' ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.PNPA_DATE = SRC.PNPA_DT, A.FLGPNPA = ''Y'', A.PNPAASSETCLASSALT_KEY = SRC.PNPA_CLASS_KEY',79257);
