Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gpk8jvbgzwmdk','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN ( (A.DPD_INTSERVICE + :B1 ) >= A.REFPERIODINTSERVICE ) THEN ''Y'' WHEN ( (A.DPD_NOCREDIT + :B1 ) >= A.REFPERIODNOCREDIT ) THEN ''Y'' WHEN ( (A.DPD_OVERDUE + :B1 ) >= A.REFPERIODOVERDUE ) THEN ''Y'' WHEN ( (A.DPD_STOCKSTMT + :B1 ) >= A.REFPERIODSTKSTATEMENT ) THEN ''Y'' WHEN ( (A.DPD_RENEWAL + :B1 ) >= A.REFPERIODREVIEW ) THEN ''Y'' WHEN ( (A.DPD_OVERDRAWN + :B1 ) >= A.REFPERIODOVERDRAWN ) THEN ''Y'' ELSE ''N'' END) AS FLGPNPA FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE ( A.FINALASSETCLASSALT_KEY IN ( SELECT ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE ASSETCLASSSHORTNAMEENUM IN ( ''STD'' ) AND EFFECTIVEFROMTIMEKEY <= :B2 AND EFFECTIVETOTIMEKEY >= :B2 ) ) AND ( NVL(A.ASSET_NORM, ''NORMAL'') <> ''ALWYS_STD'' ) AND ( NVL(B.FLGPROCESSING, ''N'') = ''N'' ) AND NVL(A.FLGMOC, ''N'') <> ''Y'' AND NVL(A.BALANCE, 0) > 0) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGPNPA = SRC.FLGPNPA',79257);
