Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8rrvfmj9f6yhf','MERGE INTO GTT_CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, C.FINALNPADT, ''Y'' FROM GTT_CUSTOMERCAL A JOIN ( SELECT A.REFCUSTOMERID , MIN(A.FINALNPADT) FINALNPADT FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE NVL(A.FLGDEG, ''N'') = ''Y'' AND NVL(B.FLGPROCESSING, ''N'') = ''N'' GROUP BY A.REFCUSTOMERID ) C ON A.REFCUSTOMERID = C.REFCUSTOMERID AND ( NVL(A.FLGPROCESSING, ''N'') = ''N'' ) ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SYSNPA_DT = SRC.FINALNPADT, A.FLGDEG = ''Y''',79244);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2ufsbvqbqjzts','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, :B1 FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE A.ASSET_NORM = ''ALWYS_NPA'' AND NVL(A.FLGDEG, ''N'') = ''Y'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALNPADT = V_PROCESSDATE',79244);
