Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0973hym23u00z','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, B.FLG_DEG, B.NPA_DATE, NVL(DEGREASON, '' '') || '','' || B.DEFAULT_REASON AS POS_4 FROM GTT_ACCOUNTCAL A JOIN MAIN_PRO.PUI_CAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID WHERE B.FLG_DEG = ''Y'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGDEG = SRC.FLG_DEG, A.FINALNPADT = SRC.NPA_DATE, A.DEGREASON = POS_4',79244);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('c8xumasn5ryn9','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL B USING (SELECT B.ROWID ROW_ID, (CASE WHEN PRERESTRUCTURENPA_DATE IS NOT NULL THEN PRERESTRUCTURENPA_DATE ELSE B.RESTRUCTUREDT END) AS DEGDATE FROM GTT_ACCOUNTCAL A JOIN MAIN_PRO.ADVACRESTRUCTURECAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID WHERE ( A.FINALASSETCLASSALT_KEY > 1 OR A.FLGDEG = ''Y'' )) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.DEGDATE = SRC.DEGDATE',79244);
