Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('1pakbrwk7ucnv','INSERT INTO GTT_TEMPTABLE_SMACLASSUCIF ( SELECT A.UCIF_ID , MAX(CASE WHEN SMA_CLASS = ''SMA_0'' THEN 1 WHEN SMA_CLASS = ''SMA_1'' THEN 2 WHEN SMA_CLASS = ''SMA_2'' THEN 3 ELSE 0 END) MAXSMA_CLASS , MIN(A.SMA_DT) SMA_DT FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.UCIF_ID = B.UCIF_ID AND B.FLGSMA = ''Y'' GROUP BY A.UCIF_ID )',79255);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('817av54v3hjk3','INSERT INTO TT_CUSTOMER_MOVEMENT_HISTOR ( UCIF_ID, REFCUSTOMERID, SOURCESYSTEMCUSTOMERID, CUSTOMERNAME, SYSASSETCLASSALT_KEY, SYSNPA_DT, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, MOVEMENTFROMSTATUS, MOVEMENTTOSTATUS, TOTOSCUST, MOVEMENTFROMDATE , MOVEMENTTODATE ) ( SELECT UCIF_ID , REFCUSTOMERID , SOURCESYSTEMCUSTOMERID , CUSTOMERNAME , SYSASSETCLASSALT_KEY , SYSNPA_DT , EFFECTIVEFROMTIMEKEY , 49999 EFFECTIVETOTIMEKEY , CUSTMOVEDESCRIPTION MOVEMENTFROMSTATUS , CUSTMOVEDESCRIPTION MOVEMENTTOSTATUS , NVL(TOTOSCUST, 0) TOTOSCUST , :B1 MOVEMENTFROMDATE , ''2086-11-21'' MOVEMENTTODATE FROM GTT_CUSTOMERCAL )',79255);
