Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('dn8ayy32dm28q','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, NVL(B.SECUREDAMT, 0) * NVL((FINALPROVPER), 0) / 100 AS POS_2, NVL(B.UNSECUREDAMT, 0) * NVL((FINALPROVPER), 0) / 100 AS POS_3 FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN GTT_ACCOUNTCAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' AND NVL(D.PARAMETERSHORTNAMEENUM, '' '') <> ''MSME_OLD'' ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SECUREDPROVISION = POS_2, A.UNSECUREDPROVISION = POS_3',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3vs0j61cnqz8x','MERGE INTO MAIN_PRO.PUI_CAL A USING (SELECT A.ROWID ROW_ID, (5 - NVL(P.PROVISIONSECURED, 0)) AS PUI_PROVPER FROM MAIN_PRO.PUI_CAL A JOIN GTT_ACCOUNTCAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID LEFT JOIN RBL_MISDB_PROD.DIMPROVISION_SEGSTD P ON ( P.EFFECTIVEFROMTIMEKEY <= :B1 AND P.EFFECTIVETOTIMEKEY >= :B1 ) AND P.PROVISIONALT_KEY = B.PROVISIONALT_KEY WHERE RESTRUCTURING = ''Y'' AND UTILS.DATEADD(''YY'', 2, A.RESTRUCTUREDATE) >= :B2 AND A.FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.PUI_PROVPER = SRC.PUI_PROVPER',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0qrsvn2d9prsk','MERGE INTO MAIN_PRO.PUI_CAL A USING (SELECT A.ROWID ROW_ID, NVL(B.SECUREDAMT, 0) * NVL((PUI_PROVPER), 0) / 100 AS POS_2, NVL(B.UNSECUREDAMT, 0) * NVL((PUI_PROVPER), 0) / 100 AS POS_3 FROM MAIN_PRO.PUI_CAL A JOIN GTT_ACCOUNTCAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID WHERE NVL(PUI_PROVPER, 0) > 0) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SECUREDPROVISION = POS_2, A.UNSECUREDPROVISION = POS_3',79268);
