Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fp40g23rjbd9p','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''Link By AccountId'' || '' '' || B.CUSTOMERACID AS PNPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_ACCOUNTCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID AND A.FLGPNPA = ''Y'' AND A.FLGPNPA = ''Y'' AND A.PNPA_REASON IS NULL AND B.PNPA_REASON IS NOT NULL AND ( NVL(A.ASSET_NORM, ''NORMAL'') <> ''ALWYS_STD'' ) ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.PNPA_REASON = SRC.PNPA_REASON',79257);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('b2u5fxh9jkf87','INSERT INTO GTT_TEMPTABLEPNPA ( SELECT A.CUSTOMERENTITYID , MIN(A.PNPA_DATE) PNPA_DATE , ( SELECT ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE ASSETCLASSSHORTNAME = ''SUB'' AND EFFECTIVEFROMTIMEKEY <= :B1 AND EFFECTIVETOTIMEKEY >= :B1 ) PNPA_CLASS_KEY FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID WHERE B.FLGPNPA = ''Y'' AND ( B.FLGPROCESSING = ''N'' ) GROUP BY A.CUSTOMERENTITYID )',79257);
