Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('f8qxs24jyy816','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, B.PNPA_DATE, ''Y'', B.PNPA_CLASS_KEY FROM GTT_ACCOUNTCAL A JOIN GTT_CTE_CUSTOMERWISEBALANCEP B ON A.UCIFENTITYID = B.UCIFENTITYID AND ( NVL(A.ASSET_NORM, ''NORMAL'') <> ''ALWYS_STD'' ) ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.PNPA_DATE = SRC.PNPA_DATE, A.FLGPNPA = ''Y'', A.PNPAASSETCLASSALT_KEY = SRC.PNPA_CLASS_KEY',79257);
