Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2m1hza3n53ju3','MERGE INTO GTT_CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN UTILS.DATEADD(''MONTH'', :B3 , A.SYSNPA_DT) > :B4 AND B.ASSETCLASSSHORTNAME NOT IN ( ''DB1'',''DB2'',''DB3'' ) THEN ( SELECT RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSSHORTNAME = ''SUB'' AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) WHEN UTILS.DATEADD(''MONTH'', :B3 , A.SYSNPA_DT) <= :B4 AND UTILS.DATEADD(''MONTH'', :B3 + :B6 , A.SYSNPA_DT) > :B4 AND B.ASSETCLASSSHORTNAME NOT IN ( ''DB2'',''DB3'' ) THEN ( SELECT RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSSHORTNAME = ''DB1'' AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) WHEN UTILS.DATEADD(''MONTH'', :B3 + :B6 , A.SYSNPA_DT) <= :B4 AND UTILS.DATEADD(''MONTH'', :B3 + :B6 + :B5 , A.SYSNPA_DT) > :B4 AND B.ASSETCLASSSHORTNAME NOT IN ( ''DB3'' ) THEN ( SELECT RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSSHORTNAME = ''DB2'' AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) WHEN UTILS.DATEADD(''MONTH'', (:B6 + :B3 + :B5 ), A.SYSNPA_DT) <= :B4 THEN ( SELECT RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSSHORTNAME = ''DB3'' AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) ELSE A.SYSASSETCLASSALT_KEY END) AS POS_2, (CASE WHEN UTILS.DATEADD(''MONTH'', :B3 , A.SYSNPA_DT) <= :B4 AND UTILS.DATEADD(''MONTH'', :B3 + :B6 , A.SYSNPA_DT) > :B4 THEN UTILS.DATEADD(''MONTH'', :B3 , A.SYSNPA_DT) WHEN UTILS.DATEADD(''MONTH'', :B3 + :B6 , A.SYSNPA_DT) <= :B4 AND UTILS.DATEADD(''MONTH'', :B3 + :B6 + :B5 , A.SYSNPA_DT) > :B4 THEN UTILS.DATEADD(''MONTH'', :B3 , A.SYSNPA_DT) WHEN UTILS.DATEADD(''MONTH'', (:B6 + :B3 + :B5 ), A.SYSNPA_DT) <= :B4 THEN UTILS.DATEADD(''MONTH'', (:B3 ), A.SYSNPA_DT) ELSE TO_DATE(DBTDT,''YYYY-MM-DD'') END) AS POS_3 FROM GTT_CUSTOMERCAL A JOIN RBL_MISDB_PROD.DIMASSETCLASS B ON A.SYSASSETCLASSALT_KEY = B.ASSETCLASSALT_KEY AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 WHERE B.ASSETCLASSSHORTNAME NOT IN ( ''STD'',''LOS'' ) AND ( NVL(A.FLGPROCESSING, ''N'') = ''N'' ) AND DBTDT IS NULL AND A.SYSNPA_DT IS NOT NULL AND ( ( :B2 = ''N'' AND NVL(A.FLGEROSION, ''N'') <> ''Y'' ) OR ( :B2 = ''Y'' ) )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SYSASSETCLASSALT_KEY = POS_2, A.DBTDT = POS_3',79252);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('97gburqzn02hz','DELETE FROM GTT_CTE_CUSTOMERWISEBALANCE_EROSION',79252);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8vchyskk2uspb','MERGE INTO GTT_CUSTOMERCAL B USING (SELECT B.ROWID ROW_ID, (CASE WHEN NVL(B.CURNTQTRRV, 0) < (NVL(C.NETBALANCE, 0) * :B4 ) AND D.ASSETCLASSSHORTNAME <> ''LOS'' THEN ( SELECT RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSSHORTNAME = ''LOS'' AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) WHEN NVL(B.CURNTQTRRV, 0) < (NVL(B.PRVQTRRV, 0) * :B3 ) AND ( NVL(C.NETBALANCE, 0) >= NVL(B.CURNTQTRRV, 0) ) AND D.ASSETCLASSSHORTNAME IN ( ''SUB'' ) THEN ( SELECT RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSSHORTNAME = ''DB1'' AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) ELSE B.SYSASSETCLASSALT_KEY END) AS POS_2, CASE WHEN NVL(B.CURNTQTRRV, 0) < (NVL(C.NETBALANCE, 0) * :B4 ) AND D.ASSETCLASSSHORTNAME <> ''LOS'' THEN :B2 ELSE LOSSDT END AS POS_3, CASE WHEN NVL(B.CURNTQTRRV, 0) < (NVL(B.PRVQTRRV, 0) * :B3 ) AND ( NVL(C.NETBALANCE, 0) >= NVL(B.CURNTQTRRV, 0) ) AND D.ASSETCLASSSHORTNAME IN ( ''SUB'' ) THEN :B2 ELSE DBTDT END AS POS_4, CASE WHEN NVL(B.CURNTQTRRV, 0) < (NVL(C.NETBALANCE, 0) * :B4 ) AND D.ASSETCLASSSHORTNAME <> ''LOS'' THEN ''Y'' WHEN NVL(B.CURNTQTRRV, 0) < (NVL(B.PRVQTRRV, 0) * :B3 ) AND ( NVL(C.NETBALANCE, 0) >= NVL(B.CURNTQTRRV, 0) ) AND D.ASSETCLASSSHORTNAME IN ( ''SUB'' ) THEN ''Y'' ELSE ''N'' END AS POS_5, CASE WHEN NVL(B.CURNTQTRRV, 0) < (NVL(C.NETBALANCE, 0) * :B4 ) AND D.ASSETCLASSSHORTNAME <> ''LOS'' THEN :B2 WHEN NVL(B.CURNTQTRRV, 0) < (NVL(B.PRVQTRRV, 0) * :B3 ) AND ( NVL(C.NETBALANCE, 0) >= NVL(B.CURNTQTRRV, 0) ) AND D.ASSETCLASSSHORTNAME IN ( ''SUB'' ) THEN :B2 ELSE B.EROSIONDT END AS POS_6 FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID JOIN GTT_CTE_CUSTOMERWISEBALANCE_EROSION C ON C.REFCUSTOMERID = B.REFCUSTOMERID JOIN RBL_MISDB_PROD.DIMASSETCLASS D ON D.ASSETCLASSALT_KEY = B.SYSASSETCLASSALT_KEY AND ( D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 ) WHERE NVL(A.PRINCOUTSTD, 0) > 0 AND D.ASSETCLASSSHORTNAME <> ''STD'' AND ( NVL(B.FLGPROCESSING, ''N'') = ''N'' )) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.SYSASSETCLASSALT_KEY = POS_2, B.LOSSDT = POS_3, B.DBTDT = POS_4, B.FLGEROSION = POS_5, B.EROSIONDT = POS_6',79252);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4hm3mr3tj8xpw','INSERT INTO MAIN_PRO.CUSTOMER_MOVEMENT_HISTORY ( UCIF_ID, REFCUSTOMERID, SOURCESYSTEMCUSTOMERID, CUSTOMERNAME, SYSASSETCLASSALT_KEY, SYSNPA_DT, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, MOVEMENTFROMSTATUS, MOVEMENTTOSTATUS, TOTOSCUST, MOVEMENTFROMDATE , MOVEMENTTODATE ) ( SELECT A.UCIF_ID , A.REFCUSTOMERID , A.SOURCESYSTEMCUSTOMERID , A.CUSTOMERNAME , A.SYSASSETCLASSALT_KEY , A.SYSNPA_DT , A.EFFECTIVEFROMTIMEKEY , A.EFFECTIVETOTIMEKEY , NVL(B.MOVEMENTTOSTATUS, A.MOVEMENTFROMSTATUS) , A.MOVEMENTTOSTATUS , NVL(A.TOTOSCUST, 0) TOTOSCUST , A.MOVEMENTFROMDATE , A.MOVEMENTTODATE FROM TT_CUSTOMER_MOVEMENT_HISTOR A LEFT JOIN MAIN_PRO.CUSTOMER_MOVEMENT_HISTORY B ON A.SOURCESYSTEMCUSTOMERID = B.SOURCESYSTEMCUSTOMERID AND B.EFFECTIVETOTIMEKEY = 49999 WHERE (CASE WHEN B.SOURCESYSTEMCUSTOMERID IS NULL THEN 1 WHEN B.SOURCESYSTEMCUSTOMERID IS NOT NULL AND A.MOVEMENTFROMSTATUS <> B.MOVEMENTTOSTATUS THEN 1 END) = 1 )',79255);
