Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7t1fbr7juynk7','INSERT INTO MAIN_PRO.ACCOUNT_MOVEMENT_HISTORY ( UCIF_ID, REFCUSTOMERID, SOURCESYSTEMCUSTOMERID, CUSTOMERACID, FINALASSETCLASSALT_KEY, FINALNPADT, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, MOVEMENTFROMSTATUS, MOVEMENTTOSTATUS, TOTOSACC, MOVEMENTFROMDATE , MOVEMENTTODATE ) ( SELECT A.UCIF_ID , A.REFCUSTOMERID , A.SOURCESYSTEMCUSTOMERID , A.CUSTOMERACID , A.FINALASSETCLASSALT_KEY , A.FINALNPADT , A.EFFECTIVEFROMTIMEKEY , A.EFFECTIVETOTIMEKEY , NVL(B.MOVEMENTTOSTATUS, A.MOVEMENTFROMSTATUS) , A.MOVEMENTTOSTATUS , NVL(A.TOTOSACC, 0) TOTOSACC , A.MOVEMENTFROMDATE , A.MOVEMENTTODATE FROM GTT_ACCOUNT_MOVEMENT_HISTORY A LEFT JOIN MAIN_PRO.ACCOUNT_MOVEMENT_HISTORY B ON A.CUSTOMERACID = B.CUSTOMERACID AND B.EFFECTIVETOTIMEKEY = 49999 WHERE (CASE WHEN B.CUSTOMERACID IS NULL THEN 1 WHEN B.CUSTOMERACID IS NOT NULL AND A.MOVEMENTFROMSTATUS <> B.MOVEMENTTOSTATUS THEN 1 END) = 1 )',79255);
