Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('b22z9bjatdnd3','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(TOTALPROVISION, 0) + NVL(RESTRUCTUREPROVISION, 0) AS TOTALPROVISION FROM GTT_ACCOUNTCAL A JOIN MAIN_PRO.ADVACRESTRUCTURECAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.TOTALPROVISION = SRC.TOTALPROVISION',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('aynsrnbkm9pkd','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN A.FINALASSETCLASSALT_KEY = 1 AND NVL(PRERESTRUCTUREASSETCLASSALT_KEY, 0) > 1 THEN NVL(PRERESTRUCTURENPA_PROV, 0) + 10 ELSE 10 END) AS ADDLPROVPER FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' AND D.PARAMETERSHORTNAMEENUM IN ( ''MSME_COVID_RF2'' ) ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ADDLPROVPER = SRC.ADDLPROVPER',79268);
