Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('30q88ga8s1qr3','MERGE INTO GTT_CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, B.PNPA_DATE, ''Y'', B.PNPA_CLASS_KEY FROM GTT_CUSTOMERCAL A JOIN GTT_TEMPTABLEPNPA B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.PNPA_DT = SRC.PNPA_DATE, A.FLGPNPA = ''Y'', A.PNPA_CLASS_KEY = SRC.PNPA_CLASS_KEY',79257);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4k53jgkp0myxz','INSERT INTO GTT_PNPA_REASON_DATE ( SELECT A.ACCOUNTENTITYID , UTILS.DATEADD(''DAY'', -(A.DPD_INTSERVICE + :B1 - NVL(A.REFPERIODINTSERVICE, 0)), :B2 ) PNPA_DATE , ''DEGRADE BY INT NOT SERVICED'' PNPA_REASON FROM GTT_ACCOUNTCAL A WHERE ( A.FLGPNPA = ''Y'' AND ( (A.DPD_INTSERVICE + :B1 ) >= NVL(REFPERIODINTSERVICE, 0) ) ) UNION SELECT A.ACCOUNTENTITYID , UTILS.DATEADD(''DAY'', -(A.DPD_OVERDRAWN + :B1 - NVL(REFPERIODOVERDRAWN, 0)), :B2 ) PNPA_DATE , ''DEGRADE BY CONTI EXCESS'' PNPA_REASON FROM GTT_ACCOUNTCAL A WHERE ( A.FLGPNPA = ''Y'' AND ( (A.DPD_OVERDRAWN + :B1 ) >= NVL(REFPERIODOVERDRAWN, 0) ) ) UNION ALL SELECT A.ACCOUNTENTITYID , UTILS.DATEADD(''DAY'', -(A.DPD_NOCREDIT + :B1 - NVL(REFPERIODNOCREDIT, 0)), :B2 ) PNPA_DATE , ''DEGRADE BY NO CREDIT'' PNPA_REASON FROM GTT_ACCOUNTCAL A WHERE ( A.FLGPNPA = ''Y'' AND (A.DPD_NOCREDIT + :B1 ) >= NVL(REFPERIODNOCREDIT, 0) ) UNION ALL SELECT A.ACCOUNTENTITYID , UTILS.DATEADD(''DAY'', -(A.DPD_OVERDUE + :B1 - NVL(REFPERIODOVERDUE, 0)), :B2 ) PNPA_DATE , ''DEGRADE BY OVERDUE'' PNPA_REASON FROM GTT_ACCOUNTCAL A WHERE ( A.FLGPNPA = ''Y'' AND ( (A.DPD_OVERDUE + :B1 ) >= NVL(REFPERIODOVERDUE, 0) ) ) UNION ALL SELECT A.ACCOUNTENTITYID , UTILS.DATEADD(''DAY'', -(A.DPD_OVERDUE + :B1 - NVL(REFPERIODOVERDUE, 0)), :B2 ) PNPA_DATE , ''DEGRADE BY DEBIT BALANCE'' PNPA_REASON FROM GTT_ACCOUNTCAL A JOIN RBL_MISDB_PROD.DIMPRODUCT C ON A.PRODUCTALT_KEY = C.PRODUCTALT_KEY AND ( C.EFFECTIVEFROMTIMEKEY <= :B3 AND C.EFFECTIVETOTIMEKEY >= :B3 ) WHERE ( A.FLGPNPA = ''Y'' AND ( (A.DPD_OVERDUE + :B1 ) >= NVL(REFPERIODOVERDUE, 0) ) ) AND A.DEBITSINCEDT IS NOT NULL AND NVL(C.SRCSYSPRODUCTCODE, ''N'') = ''SAVING'' UNION ALL SELECT A.ACCOUNTENTITYID , UTILS.DATEADD(''DAY'', -(A.DPD_STOCKSTMT + :B1 - NVL(REFPERIODSTKSTATEMENT, 0)), :B2 ) PNPA_DATE , '' DEGRADE BY STOCK STATEMENT'' PNPA_REASON FROM GTT_ACCOUNTCAL A WHERE ( A.FLGPNPA = ''Y'' AND (A.DPD_STOCKSTMT + :B1 ) >= NVL(REFPERIODSTKSTATEMENT, 0) ) UNION ALL SELECT A.ACCOUNTENTITYID , UTILS.DATEADD(''DAY'', -(A.DPD_RENEWAL + :B1 - NVL(REFPERIODREVIEW, 0)), :B2 ) PNPA_DATE , '' DEGRADE BY REVIEW DUE DATE'' PNPA_REASON FROM GTT_ACCOUNTCAL A WHERE ( A.FLGPNPA = ''Y'' AND (A.DPD_RENEWAL + :B1 ) >= NVL(REFPERIODREVIEW, 0) ) )',79257);
