Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5q1adgqy1h3qy','INSERT INTO GTT_ACCOUNT_MOVEMENT_HISTORY ( UCIF_ID, REFCUSTOMERID, SOURCESYSTEMCUSTOMERID, CUSTOMERACID, FINALASSETCLASSALT_KEY, FINALNPADT, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, MOVEMENTFROMSTATUS, MOVEMENTTOSTATUS, TOTOSACC, MOVEMENTFROMDATE , MOVEMENTTODATE ) ( SELECT UCIF_ID , REFCUSTOMERID , SOURCESYSTEMCUSTOMERID , CUSTOMERACID , FINALASSETCLASSALT_KEY , FINALNPADT , EFFECTIVEFROMTIMEKEY , 49999 EFFECTIVETOTIMEKEY , SMA_CLASS MOVEMENTFROMSTATUS , SMA_CLASS MOVEMENTTOSTATUS , NVL(BALANCE, 0) TOTOSACC , :B1 MOVEMENTFROMDATE , ''2086-11-21'' MOVEMENTTODATE FROM GTT_ACCOUNTCAL )',79255);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fcka4dyffkzj1','INSERT INTO GTT_SMACLASS ( SELECT A.CUSTOMERACID , COALESCE(A.SMA_CLASS,CASE WHEN B.SMA_CLASS_KEY IN (0) THEN ''SMA_0'' WHEN B.SMA_CLASS_KEY IN (1) THEN ''SMA_1'' WHEN B.SMA_CLASS_KEY IN (2) THEN ''SMA_2'' END) AS SMA_CLASS FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID AND A.CUSTOMERENTITYID = B.CUSTOMERENTITYID AND A.FLGSMA = ''Y'' WHERE B.FLGSMA = ''Y'' AND NVL(A.BALANCE, 0) > 0 AND NVL(B.SYSASSETCLASSALT_KEY, 1) = 1 )',79255);
