Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fxrncdavy02q2','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, ADDLPROVPER FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' AND D.PARAMETERSHORTNAMEENUM IN ( ''MSME_COVID'',''MSME_OLD'' ) WHERE ( DPD_BREACH_DATE IS NULL AND SP_EXPIRYDATE < :B2 ) AND FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.PROVRELEASEPER = ADDLPROVPER',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('dtdrwhtxqmj6t','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, ''N'' FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND A.FLGDEG = ''Y'' WHERE D.DIMPARAMETERNAME = ''TypeofRestructuring'' AND PARAMETERSHORTNAMEENUM NOT IN ( ''PRUDENTIAL'',''IRAC'',''OTHER'' ) ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGDEG = ''N''',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bk0p2cgg6fkuw','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, (NVL(ADDLPROVPER, 0) - NVL(PROVRELEASEPER, 0)) - (CASE WHEN ( NVL(D.PARAMETERSHORTNAMEENUM, '' '') = ''PRUDENTIAL'' AND A.FINALASSETCLASSALT_KEY > 1 ) OR ( NVL(D.PARAMETERSHORTNAMEENUM, '' '') IN ( ''MSME_COVID'',''MSME_OLD'',''MSME_COVID_RF2'' ) AND FINALASSETCLASSALT_KEY <> 1 ) THEN 0 ELSE NVL(APPLIEDNORMALPROVPER, 0) END) AS FINALPROVPER FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FINALPROVPER = SRC.FINALPROVPER',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('f0h5j4haz4mgm','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, B.PNPA_DATE, B.PNPA_REASON FROM GTT_ACCOUNTCAL A JOIN ( SELECT ACCOUNTENTITYID , MIN(PNPA_DATE) PNPA_DATE , STRING_AGG(PNPA_REASON, '','') PNPA_REASON FROM GTT_PNPA_REASON_DATE GROUP BY ACCOUNTENTITYID ) B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.PNPA_DATE = SRC.PNPA_DATE, A.PNPA_REASON = SRC.PNPA_REASON ',79257);
