Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3m9m0csfd456a','MERGE INTO GTT_ACCOUNTCAL B USING (SELECT B.ROWID ROW_ID, ''PERCOLATION BY PAN CARD '' || '' '' || A.PANNO AS NPA_REASON FROM GTT_CUSTOMERCAL A JOIN GTT_ACCOUNTCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE B.FINALASSETCLASSALT_KEY > 1 AND B.NPA_REASON IS NULL AND A.DEGREASON LIKE ''%PERCOLATION BY PAN CARD%'') SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.NPA_REASON = SRC.NPA_REASON',79258);
