Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2phh9jta2t56v','MERGE INTO GTT_CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN UTILS.DATEADD(''MONTH'', :B3 , A.SYSNPA_DT) > :B4 AND B.ASSETCLASSSHORTNAME NOT IN ( ''DB1'',''DB2'',''DB3'' ) THEN ( SELECT RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSSHORTNAME = ''SUB'' AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) WHEN UTILS.DATEADD(''MONTH'', :B3 , A.SYSNPA_DT) <= :B4 AND UTILS.DATEADD(''MONTH'', :B3 + :B6 , A.SYSNPA_DT) > :B4 AND B.ASSETCLASSSHORTNAME NOT IN ( ''DB2'',''DB3'' ) THEN ( SELECT RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSSHORTNAME = ''DB1'' AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) WHEN UTILS.DATEADD(''MONTH'', :B6 , A.DBTDT) <= :B4 AND UTILS.DATEADD(''MONTH'', :B6 + :B5 , A.DBTDT) > :B4 AND B.ASSETCLASSSHORTNAME NOT IN ( ''DB3'' ) THEN ( SELECT RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSSHORTNAME = ''DB2'' AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) WHEN UTILS.DATEADD(''MONTH'', (:B6 + :B5 ), A.DBTDT) <= :B4 THEN ( SELECT RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSALT_KEY FROM RBL_MISDB_PROD.DIMASSETCLASS WHERE RBL_MISDB_PROD.DIMASSETCLASS.ASSETCLASSSHORTNAME = ''DB3'' AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVEFROMTIMEKEY <= :B1 AND RBL_MISDB_PROD.DIMASSETCLASS.EFFECTIVETOTIMEKEY >= :B1 ) ELSE A.SYSASSETCLASSALT_KEY END) AS POS_2, (CASE WHEN DBTDT IS NOT NULL AND UTILS.DATEADD(''MONTH'', :B3 , A.SYSNPA_DT) <= :B4 AND UTILS.DATEADD(''MONTH'', :B3 + :B6 , A.SYSNPA_DT) > :B4 THEN UTILS.DATEADD(''MONTH'', :B3 , A.SYSNPA_DT) WHEN DBTDT IS NOT NULL AND UTILS.DATEADD(''MONTH'', :B3 + :B6 , A.SYSNPA_DT) <= :B4 AND UTILS.DATEADD(''MONTH'', :B3 + :B6 + :B5 , A.SYSNPA_DT) > :B4 THEN UTILS.DATEADD(''MONTH'', :B3 , A.SYSNPA_DT) WHEN DBTDT IS NOT NULL AND UTILS.DATEADD(''MONTH'', (:B6 + :B3 + :B5 ), A.SYSNPA_DT) <= :B4 THEN UTILS.DATEADD(''MONTH'', (:B3 ), A.SYSNPA_DT) ELSE TO_DATE(DBTDT,''YYYY-MM-DD'') END) AS POS_3 FROM GTT_CUSTOMERCAL A JOIN RBL_MISDB_PROD.DIMASSETCLASS B ON A.SYSASSETCLASSALT_KEY = B.ASSETCLASSALT_KEY AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 WHERE B.ASSETCLASSSHORTNAME NOT IN ( ''STD'',''LOS'' ) AND ( NVL(A.FLGPROCESSING, ''N'') = ''N'' ) AND DBTDT IS NOT NULL AND A.SYSNPA_DT IS NOT NULL AND ( ( :B2 = ''N'' AND NVL(A.FLGEROSION, ''N'') <> ''Y'' ) OR ( :B2 = ''Y'' ) )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SYSASSETCLASSALT_KEY = POS_2, A.DBTDT = POS_3',79252);
