Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('90y031cjdk5m1','MERGE INTO GTT_CUSTOMERCAL A USING (SELECT A.ROWID ROW_ID, B.MAXSMA_CLASS, B.SMA_DT FROM GTT_CUSTOMERCAL A JOIN GTT_TEMPTABLE_SMACLASSUCIF B ON A.UCIF_ID = B.UCIF_ID WHERE A.FLGSMA = ''Y'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.SMA_CLASS_KEY = SRC.MAXSMA_CLASS, A.SMA_DT = SRC.SMA_DT',79255);
