Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('86szr5zuzqtcp','MERGE INTO MAIN_PRO.ACCOUNT_MOVEMENT_HISTORY AA USING (SELECT AA.ROWID ROW_ID, :B2 , UTILS.DATEADD(''DD'', -1, :B1 ) AS POS_3 FROM MAIN_PRO.ACCOUNT_MOVEMENT_HISTORY AA LEFT JOIN GTT_ACCOUNT_MOVEMENT_HISTORY B ON AA.CUSTOMERACID = B.CUSTOMERACID AND B.EFFECTIVETOTIMEKEY = 49999 WHERE AA.EFFECTIVETOTIMEKEY = 49999 AND B.CUSTOMERACID IS NULL) SRC ON ( AA.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET AA.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, AA.MOVEMENTTODATE = POS_3',79255);
