Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3g7bkq9ur6wqn','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, CASE WHEN E.PARAMETERSHORTNAMEENUM = ''Personal'' THEN CASE WHEN RES_POS_TO_CURRENTPOS_PER <= 30 THEN ADDLPROVPER / 2 ELSE ADDLPROVPER END WHEN E.PARAMETERSHORTNAMEENUM = ''Other'' AND SP_EXPIRYDATE < :B2 THEN CASE WHEN RES_POS_TO_CURRENTPOS_PER <= 30 THEN ADDLPROVPER / 2 ELSE ADDLPROVPER END END AS PROVRELEASEPER FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' AND D.PARAMETERSHORTNAMEENUM IN ( ''COVID_OTR_RF'',''COVID_OTR_RF_2'' ) JOIN RBL_MISDB_PROD.DIMPARAMETER E ON E.EFFECTIVEFROMTIMEKEY <= :B1 AND E.EFFECTIVETOTIMEKEY >= :B1 AND E.PARAMETERALT_KEY = A.COVID_OTR_CATGALT_KEY AND E.DIMPARAMETERNAME = ''Covid - OTR Category'' WHERE FINALASSETCLASSALT_KEY = 1 AND NVL(RES_POS_TO_CURRENTPOS_PER, 0) >= 20) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.PROVRELEASEPER = SRC.PROVRELEASEPER',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('c3qprx5h0bxk6','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(TOTALPROVISION, 0) + (NVL(B.SECUREDPROVISION, 0) + NVL(B.UNSECUREDPROVISION, 0)) AS TOTALPROVISION FROM GTT_ACCOUNTCAL A JOIN MAIN_PRO.PUI_CAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID WHERE NVL(PUI_PROVPER, 0) > 0) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.TOTALPROVISION = SRC.TOTALPROVISION',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0dq3r9g9b24v9','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, NVL(SECUREDPROVISION, 0) + NVL(UNSECUREDPROVISION, 0) AS RESTRUCTUREPROVISION FROM MAIN_PRO.ADVACRESTRUCTURECAL A ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.RESTRUCTUREPROVISION = SRC.RESTRUCTUREPROVISION',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('afnqp13kjxxcm','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, RBITOTALPROVISION, RBIPROVSECURED, RBIPROVUNSECURED, ADDLPROVISION, PROVCOVERGOVGUR, PROVDFV FROM GTT_ACCOUNTCAL A WHERE NVL(A.RBITOTALPROVISION, 0) > NVL(A.BANKTOTALPROVISION, 0)) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.TOTALPROVISION = RBITOTALPROVISION, A.PROVSECURED = RBIPROVSECURED, A.PROVUNSECURED = RBIPROVUNSECURED, A.ADDLPROVISION = ADDLPROVISION, A.PROVCOVERGOVGUR = PROVCOVERGOVGUR, A.PROVDFV = PROVDFV',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('23at2v6dwawhj','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''Link By AccountId'' || '' '' || B.CUSTOMERACID AS NPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_TEMPTABLE_PERCOLATION B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE A.FINALASSETCLASSALT_KEY > 1 AND A.NPA_REASON IS NULL AND ( A.FLGDEG = ''N'' )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.NPA_REASON = SRC.NPA_REASON',79258);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('41vwk103rk6bt','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(A.NPA_REASON, '' '') || '', DEGRADE BY CONTI EXCESS'' AS NPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID WHERE ( B.FLGPROCESSING = ''N'' ) AND ( NVL(FINALASSETCLASSALT_KEY, 1) <> 1 AND A.DPD_OVERDRAWN > 0 )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.NPA_REASON = SRC.NPA_REASON',79258);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('6096zq8cukjs1','INSERT INTO GTT_TEMPTABLE_PERCOLATIONFRE SELECT A.REFCUSTOMERID REFCUSTOMERID , A.CUSTOMERACID CUSTOMERACID , A.NPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.REFCUSTOMERID = B.REFCUSTOMERID WHERE A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 AND A.NPA_REASON IS NOT NULL AND A.FINALASSETCLASSALT_KEY > 1 AND ( A.FLGDEG = ''Y'' ) ORDER BY A.REFCUSTOMERID',79258);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('a3g02ptbhb9td','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(A.NPA_REASON, '' '') || '',NPA Due to overdue  Buyout Portfolio'' AS NPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID WHERE ( B.FLGPROCESSING = ''N'' ) AND ( NVL(FINALASSETCLASSALT_KEY, 1) <> 1 AND A.DPD_OVERDUE > 0 ) AND A.DEGREASON LIKE ''%NPA Due to overdue  Buyout Portfolio%'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.NPA_REASON = SRC.NPA_REASON',79258);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('1xy4pju68tfd4','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(A.NPA_REASON, '' '') || '' Degarde Account due to ALWYS_NPA and balance >=0'' AS NPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.UCIFENTITYID = B.UCIFENTITYID WHERE B.ASSET_NORM = ''ALWYS_NPA'' AND NVL(FINALASSETCLASSALT_KEY, 1) <> 1 AND ( B.FLGPROCESSING = ''N'' ) AND A.NPA_REASON IS NULL AND B.UCIFENTITYID > 0) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.NPA_REASON = SRC.NPA_REASON',79258);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cp4xqq3zz0u9y','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, CASE WHEN :B2 > 26384 THEN (CASE WHEN A.INTNOTSERVICEDDT IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.INTNOTSERVICEDDT, :B1 ) + 2 ELSE 0 END) ELSE (CASE WHEN A.INTNOTSERVICEDDT IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.INTNOTSERVICEDDT, :B1 ) + 1 ELSE 0 END) END AS POS_2, CASE WHEN ( DEBITSINCEDT IS NULL OR UTILS.DATEDIFF(''DAY'', DEBITSINCEDT, :B1 ) > 90 ) THEN (CASE WHEN A.LASTCRDATE IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.LASTCRDATE, :B1 ) + 1 ELSE 0 END) ELSE 0 END AS POS_3, (CASE WHEN A.CONTIEXCESSDT IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.CONTIEXCESSDT, :B1 ) + 1 ELSE 0 END) AS POS_4, CASE WHEN :B2 > 26372 THEN (CASE WHEN A.OVERDUESINCEDT IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.OVERDUESINCEDT, :B1 ) + 1 ELSE 0 END) ELSE (CASE WHEN A.OVERDUESINCEDT IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.OVERDUESINCEDT, :B1 ) + (CASE WHEN SOURCEALT_KEY = 6 THEN 0 ELSE 1 END) ELSE 0 END) END AS POS_5, (CASE WHEN A.REVIEWDUEDT IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.REVIEWDUEDT, :B1 ) + 1 ELSE 0 END) AS POS_6, (CASE WHEN A.STOCKSTDT IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.STOCKSTDT, :B1 ) + 1 ELSE 0 END) AS POS_7 FROM GTT_ACCOUNTCAL A ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DPD_INTSERVICE = POS_2, A.DPD_NOCREDIT = POS_3, A.DPD_OVERDRAWN = POS_4, A.DPD_OVERDUE = POS_5, A.DPD_RENEWAL = POS_6, A.DPD_STOCKSTMT = POS_7',79240);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4ffy8aj0jj0yz','UPDATE GTT_ACCOUNTCAL SET DPD_OVERDRAWN = 0 WHERE NVL(DPD_OVERDRAWN, 0) < 0',79240);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('aj63rp0qywdkh','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN A.PRINCOVERDUESINCEDT IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.PRINCOVERDUESINCEDT, :B1 ) + 1 ELSE 0 END) AS POS_2, (CASE WHEN A.INTOVERDUESINCEDT IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.INTOVERDUESINCEDT, :B1 ) + 1 ELSE 0 END) AS POS_3, (CASE WHEN A.OTHEROVERDUESINCEDT IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.OTHEROVERDUESINCEDT, :B1 ) + 1 ELSE 0 END) AS POS_4 FROM GTT_ACCOUNTCAL A ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DPD_PRINCOVERDUE = POS_2, A.DPD_INTOVERDUESINCE = POS_3, A.DPD_OTHEROVERDUESINCE = POS_4',79240);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2bv3bj8jmcxvq','UPDATE GTT_ACCOUNTCAL SET LASTCRDATE = NULL WHERE ( LASTCRDATE = ''1900-01-01'' OR LASTCRDATE = ''01/01/1900'' )',79240);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5cy05xhg8ax9c','MERGE INTO GTT_ACCOUNTCAL B USING ( SELECT A.ROWID ROW_ID FROM GTT_CUSTOMERCAL A INNER JOIN GTT_ACCOUNTCAL B ON A.REFCUSTOMERID=B.REFCUSTOMERID WHERE NVL(A.FLGUPG,''U'')=''U'' AND (NVL(A.FLGPROCESSING,''N'')=''N'') )SRC ON (B.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET B.UPGDATE=:B1 ,B.DEGREASON=NULL ,B.FINALASSETCLASSALT_KEY=1 ,B.FLGDEG=''N'' ,B.FINALNPADT=NULL ,B.FLGUPG=''U''',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('93c32kxxswwh6','UPDATE GTT_CUSTOMERCAL SET SYSNPA_DT = NULL, DBTDT = NULL, LOSSDT = NULL, EROSIONDT = NULL, FLGEROSION = ''N'', SYSASSETCLASSALT_KEY = 1, FLGDEG = ''N'' WHERE FLGUPG = ''U''',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('dct2xf3vj5n73','UPDATE PRO_RBL_MISDB_PROD.ACLRUNNINGPROCESSSTATUS SET COMPLETED = ''N'', ERRORDATE = SYSDATE, ERRORDESCRIPTION = :B1 , COUNT = NVL(COUNT, 0) + 1 WHERE RUNNINGPROCESSNAME = ''Upgrade_Customer_Account_UCIF_ID''',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('6115vm7phduv7','MERGE INTO CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A USING (SELECT A.ROWID ROW_ID, ''U'' FROM CURDAT_RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL A INNER JOIN CURDAT_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL D ON A.REFISSUERID = D.ISSUERID AND A.EFFECTIVEFROMTIMEKEY <= :B1 AND A.EFFECTIVETOTIMEKEY >= :B1 AND D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 INNER JOIN GTT_TEMPTABLE B ON D.UCIFID=B.UCIF_ID INNER JOIN RBL_MISDB_PROD.DIMASSETCLASS C ON C.ASSETCLASSALT_KEY=A.FINALASSETCLASSALT_KEY AND (C.EFFECTIVEFROMTIMEKEY<=:B1 AND C.EFFECTIVETOTIMEKEY>=:B1 ) WHERE (NOT(NVL(A.ASSET_NORM,''NORMAL'')=''ALWYS_NPA'' ) AND C.ASSETCLASSGROUP =''NPA'' AND NOT(NVL(A.FLGDEG,''N'')=''Y'')) )SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLGUPG = ''U''',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('bm3fh7uw9p7ws','UPDATE GTT_CUSTOMERCAL A SET DEGREASON=NULL WHERE SYSASSETCLASSALT_KEY=1 AND DEGREASON IS NOT NULL',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('ar9wygxbjjhsx','MERGE INTO MAIN_PRO.PUI_CAL A USING (SELECT A.ROWID ROW_ID FROM MAIN_PRO.PUI_CAL A INNER JOIN GTT_ACCOUNTCAL B ON A.ACCOUNTENTITYID=B.ACCOUNTENTITYID WHERE B.FINALASSETCLASSALT_KEY>1 AND B.DPD_MAX=0 AND B.FLGUPG =''U'' )SRC ON (A.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET A.FLG_UPG = (CASE WHEN ACTUALDCCO_DATE IS NOT NULL OR REVISEDDCCO >:B1 OR (REVISEDDCCO IS NULL AND FINNALDCCO_DATE>:B1 ) AND ( (NVL(COSTOVERRUNPER,0)<=10) OR (NVL(REVISEDDEBT,0)<=NVL(ORIGINALDEBT,0)) ) THEN ''U'' WHEN ( TAKEOUTFINANCE=''N'' ) THEN ''U'' END)',86182);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5cg8h8qhzmg3m','UPDATE GTT_ACCOUNTCAL SET TOTALPROVISION = NETBALANCE WHERE NVL(TOTALPROVISION, 0) > NETBALANCE AND NVL(NETBALANCE, 0) > 0',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('ayhcxvzzcn0k0','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN FINALASSETCLASSALT_KEY > 1 THEN 5 WHEN A.FINALASSETCLASSALT_KEY = 1 AND NVL(PRERESTRUCTUREASSETCLASSALT_KEY, 0) > 1 THEN NVL(PRERESTRUCTURENPA_PROV, 0) + 5 WHEN A.FINALASSETCLASSALT_KEY = 1 AND NVL(PRERESTRUCTUREASSETCLASSALT_KEY, 0) = 1 THEN (CASE WHEN FLGMORAT = ''Y'' THEN 15 ELSE 5 END) END) AS ADDLPROVPER FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' AND D.PARAMETERSHORTNAMEENUM IN ( ''MSME_COVID'',''MSME_OLD'' ) ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ADDLPROVPER = SRC.ADDLPROVPER',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('a7tffv474xyg1','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN NVL(PRERESTRUCTUREASSETCLASSALT_KEY, 0) > 1 THEN NVL(PRERESTRUCTURENPA_PROV, 0) ELSE 10 END) AS ADDLPROVPER FROM MAIN_PRO.ADVACRESTRUCTURECAL A JOIN RBL_MISDB_PROD.DIMPARAMETER D ON D.EFFECTIVEFROMTIMEKEY <= :B1 AND D.EFFECTIVETOTIMEKEY >= :B1 AND D.PARAMETERALT_KEY = A.RESTRUCTURETYPEALT_KEY AND D.DIMPARAMETERNAME = ''TypeofRestructuring'' AND D.PARAMETERSHORTNAMEENUM IN ( ''COVID_OTR_RF'',''COVID_OTR_RF_2'' ) WHERE FINALASSETCLASSALT_KEY = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ADDLPROVPER = SRC.ADDLPROVPER',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('ayhhm79uwrc6q','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL A USING (SELECT A.ROWID ROW_ID, ''NPA-STD-NPA-STD'' AS RESTRUCTURESTAGE FROM MAIN_PRO.ADVACRESTRUCTURECAL A WHERE RESTRUCTURESTAGE = ''NPA-STD-NPA-STD-NPA-STD'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.RESTRUCTURESTAGE = SRC.RESTRUCTURESTAGE',79268);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4v44dau4jv037','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(A.NPA_REASON, '' '') || '', DEGRADE BY OVERDUE'' AS NPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID WHERE ( B.FLGPROCESSING = ''N'' ) AND ( NVL(FINALASSETCLASSALT_KEY, 1) <> 1 AND A.DPD_OVERDUE > 0 ) AND NVL(A.DEGREASON, '' '') NOT LIKE ''%NPA Due to overdue  Buyout Portfolio%'' AND NVL(A.DEGREASON, '' '') NOT LIKE ''%NPA with Seller%'') SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.NPA_REASON = SRC.NPA_REASON',79258);
