Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3ahz097aj3c3q','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, ''ALWYS_NPA Due To Writeoff Amount'' AS NPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID WHERE A.ASSET_NORM = ''ALWYS_NPA'' AND NVL(FINALASSETCLASSALT_KEY, 1) <> 1 AND ( B.FLGPROCESSING = ''N'' ) AND A.WRITEOFFAMOUNT > 0) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.NPA_REASON = SRC.NPA_REASON',79258);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4vfqu90x4dxkb','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(A.NPA_REASON, '' '') || '', DEGRADE BY REVIEW DUE DATE'' AS NPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID WHERE ( B.FLGPROCESSING = ''N'' ) AND ( NVL(FINALASSETCLASSALT_KEY, 1) <> 1 AND A.DPD_RENEWAL > 0 )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.NPA_REASON = SRC.NPA_REASON',79258);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gufr4nvrxza0p','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, NVL(A.NPA_REASON, '' '') || '' Degarde Account due to ALWYS_NPA and balance >=0'' AS NPA_REASON FROM GTT_ACCOUNTCAL A JOIN GTT_CUSTOMERCAL B ON A.CUSTOMERENTITYID = B.CUSTOMERENTITYID WHERE B.ASSET_NORM = ''ALWYS_NPA'' AND NVL(FINALASSETCLASSALT_KEY, 1) <> 1 AND ( B.FLGPROCESSING = ''N'' ) AND A.NPA_REASON IS NULL) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.NPA_REASON = SRC.NPA_REASON',79258);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('a55bb7y7vxr8n','MERGE INTO GTT_ACCOUNTCAL A USING (SELECT A.ROWID ROW_ID, (CASE WHEN A.PRINCOVERDUESINCEDT IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.PRINCOVERDUESINCEDT, :B1 ) ELSE 0 END) AS POS_2, (CASE WHEN A.INTOVERDUESINCEDT IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.INTOVERDUESINCEDT, :B1 ) ELSE 0 END) AS POS_3, (CASE WHEN A.OTHEROVERDUESINCEDT IS NOT NULL THEN UTILS.DATEDIFF(''DAY'', A.OTHEROVERDUESINCEDT, :B1 ) ELSE 0 END) AS POS_4 FROM GTT_ACCOUNTCAL A ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.DPD_PRINCOVERDUE = POS_2, A.DPD_INTOVERDUESINCE = POS_3, A.DPD_OTHEROVERDUESINCE = POS_4',79240);
