Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('9uy3vfy3cuptw','MERGE INTO MAIN_PRO.ADVACRESTRUCTURECAL B USING (SELECT B.ROWID ROW_ID, A.DPD_MAXFIN FROM ( SELECT ACCOUNTENTITYID , MAX(DPD) DPD_MAXFIN FROM ( ( SELECT ACCOUNTENTITYID , DPD_INTSERVICE DPD FROM GTT_ACCOUNTCAL WHERE NVL(DPD_INTSERVICE, 0) > 0 UNION ALL SELECT ACCOUNTENTITYID , DPD_NOCREDIT DPD FROM GTT_ACCOUNTCAL WHERE NVL(DPD_NOCREDIT, 0) > 0 UNION ALL SELECT ACCOUNTENTITYID , DPD_OVERDRAWN DPD FROM GTT_ACCOUNTCAL WHERE NVL(DPD_OVERDRAWN, 0) > 0 UNION ALL SELECT ACCOUNTENTITYID , DPD_OVERDUE DPD FROM GTT_ACCOUNTCAL WHERE NVL(DPD_OVERDUE, 0) > 0 ) ) GROUP BY ACCOUNTENTITYID ) A JOIN MAIN_PRO.ADVACRESTRUCTURECAL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID ) SRC ON ( B.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET B.DPD_MAXFIN = SRC.DPD_MAXFIN ',79240);
