Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cmuhznzsvwqy0','INSERT INTO RBL_TEMPDB.TEMPADVFACCCDETAIL ( ACCOUNTENTITYID, ADHOCDT, ADHOCAMT, CONTEXCSSINCEDT , DERECOGNISEDINTEREST1, DERECOGNISEDINTEREST2 , CLAIMTYPE, CLAIMCOVERAMT, CLAIMLODGEDDT, CLAIMLODGEDAMT, CLAIMRECVDT, CLAIMRECEIVEDAMT, CLAIMRATE, REFSYSTEMACID, AUTHORISATIONSTATUS, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, CREATEDBY, DATECREATED, MODIFIEDBY, DATEMODIFIED, APPROVEDBY, DATEAPPROVED, MOCSTATUS, MOCDATE, MOCTYPEALT_KEY, ADHOCEXPIRYDATE , STOCKSTMTDT ) ( SELECT ACBD.ACCOUNTENTITYID ACCOUNTENTITYID , A.ADHOCDATE ADHOCDT , A.ADHOCAMT ADHOCAMT , A.CONTIEXCESSDATE CONTEXCSSINCEDT , NULL DERECOGNISEDINTEREST1 , NULL DERECOGNISEDINTEREST2 , NULL CLAIMTYPE , NULL CLAIMCOVERAMT , NULL CLAIMLODGEDDT , NULL CLAIMLODGEDAMT , NULL CLAIMRECVDT , NULL CLAIMRECEIVEDAMT , NULL CLAIMRATE , ACBD.SYSTEMACID REFSYSTEMACID , NULL AUTHORISATIONSTATUS , :B2 EFFECTIVEFROMTIMEKEY , 49999 EFFECTIVETOTIMEKEY , ''SSISUSER'' CREATEDBY , SYSDATE DATECREATED , NULL MODIFIEDBY , NULL DATEMODIFIED , NULL APPROVEDBY , NULL DATEAPPROVED , NULL MOCSTATUS , NULL MOCDATE , NULL MOCTYPEALT_KEY , NULL ADHOCEXPIRYDATE , A.STOCKSTATEMENTDT FROM RBL_TEMPDB.TEMPADVACBASICDETAIL ACBD JOIN RBL_STGDB.ACCOUNT_ALL_SOURCE_SYSTEM A ON A.CUSTOMERACID = ACBD.CUSTOMERACID LEFT JOIN RBL_MISDB_PROD.DIMGLPRODUCT DGP ON DGP.GLPRODUCTALT_KEY = ACBD.GLPRODUCTALT_KEY AND DGP.EFFECTIVEFROMTIMEKEY <= :B1 AND DGP.EFFECTIVETOTIMEKEY >= :B1 WHERE ACBD.FACILITYTYPE IN ( ''OD'',''CC'',''CCOD'' ) )',86024);
