Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('a271sacpj5vw9','MERGE INTO RBL_TEMPDB.TEMPINVESTMENTFINANCIALDETAIL O USING (SELECT O.ROWID ROW_ID, O.FLGDEG, T.DEGREASON, T.DPD, O.FLGUPG, T.UPGDATE, T.PROVISIONALT_KEY, T.FINALASSETCLASSALT_KEY, T.NPIDT, T.REFISSUERID, T.DPD_MATURITY, T.DPD_DIVOVERDUE FROM RBL_TEMPDB.TEMPINVESTMENTFINANCIALDETAIL O JOIN RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL T ON O.INVENTITYID = T.INVENTITYID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVEFROMTIMEKEY <= :B1 AND T.EFFECTIVETOTIMEKEY >= :B1 ) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.FLGDEG = SRC.FLGDEG, O.DEGREASON = SRC.DEGREASON, O.DPD = SRC.DPD, O.FLGUPG = SRC.FLGUPG, O.UPGDATE = SRC.UPGDATE, O.PROVISIONALT_KEY = SRC.PROVISIONALT_KEY, O.INITIALASSETALT_KEY = SRC.FINALASSETCLASSALT_KEY, O.INITIALNPIDT = SRC.NPIDT, O.REFISSUERID = SRC.REFISSUERID, O.DPD_MATURITY = SRC.DPD_MATURITY, O.DPD_DIVOVERDUE = SRC.DPD_DIVOVERDUE, O.FINALASSETCLASSALT_KEY = SRC.FINALASSETCLASSALT_KEY, O.NPIDT = SRC.NPIDT',86072);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('c12mp6ttnxfdp','INSERT INTO RBL_TEMPDB.TEMPINVESTMENTFINANCIALDETAIL ( TIME_KEY, INVENTITYID, REFISSUERID, REFINVID, HOLDINGNATURE, CURRENCYALT_KEY, CURRENCYCONVRATE, BOOKTYPE, BOOKVALUE, BOOKVALUEINR, MTMVALUE, MTMVALUEINR, ENCUMBEREDMTM, ASSETCLASS_ALTKEY, NPIDT, TOTALPROVISON, AUTHORISATIONSTATUS, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, CREATEDBY, DATECREATED, MODIFIEDBY, DATEMODIFIED, APPROVEDBY, DATEAPPROVED, INTEREST_DIVIDENDDUEDATE, INTEREST_DIVIDENDDUEAMOUNT, LATESTBSDATE, PARTIALREDUMPTIONDUEDATE, PARTIALREDUMPTIONSETTLEDY_N, BALANCESHEETDATE, LISTEDSHARES ) ( SELECT :B1 TIME_KEY , INVENTITYID , A.ISSUERID , A.INVID , HOLDINGNATURE , C.CURRENCYALT_KEY , CURRENCYCONVRATE , BOOKTYPE , BOOKVALUE , BOOKVALUEINR , MTMVALUE , MTMVALUEINR , ENCUMBEREDMTM , B.ASSETCLASSALT_KEY , A.NPADT NPIDT , NULL TOTALPROVISON , NULL AUTHORISATIONSTATUS , :B2 EFFECTIVEFROMTIMEKEY , 49999 EFFECTIVETOTIMEKEY , ''SSISUSER'' CREATEDBY , SYSDATE DATECREATED , NULL MODIFIEDBY , NULL DATEMODIFIED , NULL APPROVEDBY , NULL DATEAPPROVED , INTEREST_DIVIDENDOVERDUEDATE , INTEREST_DIVIDENDOVERDUEAMOUNT , LATESTBSDATE , REDUMPTIONDUEDATE , REDUMPTIONPROCEEDSETTLEDY_N , BALANCESHEETDATE , LISTEDSHARES FROM RBL_STGDB.INVFINANCIAL_SOURCESYSTEM_STG A LEFT JOIN RBL_MISDB_PROD.DIMASSETCLASS B ON A.ASSETCLASS = B.SRCSYSCLASSCODE AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 LEFT JOIN RBL_MISDB_PROD.DIMCURRENCY C ON A.CURRENCYCODE = C.SRCSYSCURRENCYCODE AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 JOIN RBL_TEMPDB.TEMPINVESTMENTBASICDETAIL I ON I.INVID = A.INVID WHERE NVL(HOLDINGNATURE, '' '') = '' '' UNION SELECT :B1 TIME_KEY , INVENTITYID , A.ISSUERID , (A.INVID || ''_'' || UTILS.CONVERT_TO_VARCHAR2(NVL(HOLDINGNATURE, '' ''),10)) INVID , HOLDINGNATURE , C.CURRENCYALT_KEY , CURRENCYCONVRATE , BOOKTYPE , BOOKVALUE , BOOKVALUEINR , MTMVALUE , MTMVALUEINR , ENCUMBEREDMTM , B.ASSETCLASSALT_KEY , A.NPADT NPIDT , NULL TOTALPROVISON , NULL AUTHORISATIONSTATUS , :B2 EFFECTIVEFROMTIMEKEY , 49999 EFFECTIVETOTIMEKEY , ''SSISUSER'' CREATEDBY , SYSDATE DATECREATED , NULL MODIFIEDBY , NULL DATEMODIFIED , NULL APPROVEDBY , NULL DATEAPPROVED , INTEREST_DIVIDENDOVERDUEDATE , INTEREST_DIVIDENDOVERDUEAMOUNT , LATESTBSDATE , REDUMPTIONDUEDATE , REDUMPTIONPROCEEDSETTLEDY_N , BALANCESHEETDATE , LISTEDSHARES FROM RBL_STGDB.INVFINANCIAL_SOURCESYSTEM_STG A LEFT JOIN RBL_MISDB_PROD.DIMASSETCLASS B ON A.ASSETCLASS = B.SRCSYSCLASSCODE AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 LEFT JOIN RBL_MISDB_PROD.DIMCURRENCY C ON A.CURRENCYCODE = C.SRCSYSCURRENCYCODE AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 JOIN RBL_TEMPDB.TEMPINVESTMENTBASICDETAIL I ON I.INVID = (A.INVID || ''_'' || UTILS.CONVERT_TO_VARCHAR2(NVL(HOLDINGNATURE, '' ''),10)) WHERE NVL(HOLDINGNATURE, '' '') <> '' '' )',86072);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cgxng433ydtc3','MERGE INTO RBL_TEMPDB.TEMPADVACBASICDETAIL A USING (SELECT A.ROWID ROW_ID FROM RBL_TEMPDB.TEMPADVACBASICDETAIL A INNER JOIN RBL_MISDB_PROD.DIMPRODUCT B ON A.PRODUCTALT_KEY=B.PRODUCTALT_KEY AND(B.EFFECTIVEFROMTIMEKEY<=:B1 AND B.EFFECTIVETOTIMEKEY>=:B1 ) WHERE B.PRODUCTCODE IN (''SECI1'',''SECI2'',''HLDAI'',''SECO1'',''SECIN'',''SECSR'',''ALSR'',''ALLIB'',''ALII'',''ALBAJ'', ''HLBAJ'',''SECBA'',''ALHDF'',''HLHDF'',''SECHD'',''LAGOI'') )SRC ON (A.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET A.FLGSECURED=''S''',86326);
