Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gukjuvvpsszt1','MERGE INTO RBL_TEMPDB.TEMPINVESTMENTISSUERDETAIL TEMP USING (SELECT TEMP.ROWID ROW_ID, MAIN.ISSUERENTITYID FROM RBL_TEMPDB.TEMPINVESTMENTISSUERDETAIL TEMP JOIN RBL_MISDB_PROD.INVESTMENTISSUERDETAIL MAIN ON TEMP.ISSUERID = MAIN.ISSUERID WHERE MAIN.EFFECTIVETOTIMEKEY = 49999) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.ISSUERENTITYID = SRC.ISSUERENTITYID',86084);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('537x6shb07p13','MERGE INTO RBL_TEMPDB.TEMPINVESTMENTISSUERDETAIL TEMP USING (SELECT TEMP.ROWID ROW_ID, ACCT.ISSUERENTITYID FROM RBL_TEMPDB.TEMPINVESTMENTISSUERDETAIL TEMP JOIN ( SELECT A.ISSUERID , (:B1 + ROW_NUMBER() OVER ( ORDER BY ( SELECT 1 FROM DUAL ) )) ISSUERENTITYID FROM RBL_TEMPDB.TEMPINVESTMENTISSUERDETAIL A WHERE A.ISSUERENTITYID = 0 OR A.ISSUERENTITYID IS NULL ) ACCT ON TEMP.ISSUERID = ACCT.ISSUERID ) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.ISSUERENTITYID = SRC.ISSUERENTITYID',86084);
