Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('07gts6274rk2w','SELECT MOC_STATUS , CURRENTPROCESSINGDATE , SOURCENAME , CUSTOMERACID , CUSTOMERID , CUSTOMERNAME , UCIF_ID , FACILITYTYPE , PANNO , AADHARCARDNO , INITIALNPADT , INITIALASSETCLASSALT_KEY , INITALASSETCLASSNAME , FIRSTDTOFDISB , PRODUCTALT_KEY , PRODUCTNAME , BALANCE , PRINCOUTSTD , PRINCOVERDUE , INTOVERDUE , DRAWINGPOWER , CURRENTLIMIT , CONTIEXCESSDT , STOCKSTDT , DEBITSINCEDT , LASTCRDATE , CURQTRCREDIT , CURQTRINT , INTTSERVICED , INTNOTSERVICEDDT , OVERDUESINCEDT , REVIEWDUEDT , SECURITYVALUE , DFVAMT , GOVTGTYAMT , WRITEOFFAMOUNT , UNADJSUBSIDY , ASSET_NORM , ADDLPROVISION , PRINCOVERDUESINCEDT , INTOVERDUESINCEDT , OTHEROVERDUESINCEDT , UNSERVIEDINT , ADVANCERECOVERY , REPOSSESSION , REPOSSESSIONDATE , RCPENDING , PAYMENTPENDING , WHEELCASE , RFA , ISNONCOOPERATIVE , SARFAESI , SARFAESIDATE , INHERENTWEAKNESS , INHERENTWEAKNESSDATE , FLGFITL , FLGRESTRUCTURE , RESTRUCTUREDATE , FLGUNUSUALBOUNCE , UNUSUALBOUNCEDATE , FLGUNCLEAREDEFFECT , UNCLEAREDEFFECTDATE , COVERGOVGUR , CASE WHEN SUBSTR(DEGREASON, 0, 1) LIKE '', '' THEN TRIM(SUBSTR(REPLACE(DEGREASON, '','', '' & ''), -LENGTH(DEGREASON) - 1, LENGTH(DEGREASON) - 1)) WHEN SUBSTR(DEGREASON, -1, 1) LIKE '', '' THEN TRIM(SUBSTR(REPLACE(DEGREASON, '','', '' & ''), 0, LENGTH(DEGREASON) - 1)) ELSE REPLACE(DEGREASON, '','', '' & '') END DEGREASON , NETBALANCE , APPRRV , SECUREDAMT , UNSECUREDAMT , PROVDFV , PROVSECURED , PROVUNSECURED , PROVCOVERGOVGUR , TOTALPROVISION , BANKTOTALPROVISION , RBITOTALPROVISION , FINALNPADT , DOUBTFULDT , UPGDATE , FINALASSETCLASSALT_KEY , FINALASSETCLASSNAME , CASE WHEN SUBSTR(NPA_REASON, 0, 1) LIKE '', '' THEN TRIM(SUBSTR(REPLACE(NPA_REASON, '','', '' & ''), -LENGTH(NPA_REASON) - 1, LENGTH(NPA_REASON) - 1)) WHEN SUBSTR(NPA_REASON, -1, 1) LIKE '', '' THEN TRIM(SUBSTR(REPLACE(NPA_REASON, '','', '' & ''), 0, LENGTH(NPA_REASON) - 1)) ELSE REPLACE(NPA_REASON, '','', '' & '') END NPA_REASON , FLGDEG , FLGUPG , FINALPROVISIONPER , FLGSMA , SMA_DT , SMA_CLASS , CASE WHEN SUBSTR(SMA_REASON, 0, 1) LIKE '', '' THEN TRIM(SUBSTR(REPLACE(SMA_REASON, '','', '' & ''), -LENGTH(SMA_REASON) - 1, LENGTH(SMA_REASON) - 1)) WHEN SUBSTR(SMA_REASON, -1, 1) LIKE '', '' THEN TRIM(SUBSTR(REPLACE(SMA_REASON, '','', '' & ''), 0, LENGTH(SMA_REASON) - 1)) ELSE REPLACE(TRIM(SMA_REASON), '','', '' & '') END SMA_REASON , FLGPNPA , PNPA_DATE , CASE WHEN SUBSTR(PNPA_REASON, 0, 1) LIKE '', '' THEN TRIM(SUBSTR(REPLACE(PNPA_REASON, '','', '' & ''), -LENGTH(PNPA_REASON) - 1, LENGTH(PNPA_REASON) - 1)) WHEN SUBSTR(PNPA_REASON, -1, 1) LIKE '', '' THEN TRIM(SUBSTR(REPLACE(PNPA_REASON, '','', '' & ''), 0, LENGTH(PNPA_REASON) - 1)) ELSE REPLACE(TRIM(PNPA_REASON), '','', '' & '') END PNPA_REASON , CUSTSMASTATUS , MOC_DT , FLGFRAUD , FRAUDDATE , MAKERID , MAKERDATE , CHECKERID , CHECKERDATE , REVIEWERID , REVIEWERDATE , CASE WHEN SUBSTR(MOCREASON, 0, 1) = '', '' THEN TRIM(SUBSTR(REPLACE(MOCREASON, '','', '' & ''), -LENGTH(MOCREASON) - 1, LENGTH(MOCREASON) - 1)) WHEN SUBSTR(MOCREASON, -1, 1) = '', '' THEN TRIM(SUBSTR(REPLACE(MOCREASON, '','', '' & ''), 0, LENGTH(MOCREASON) - 1)) ELSE REPLACE(TRIM(MOCREASON), '','', '' & '') END MOCREASON , ACBUSEGMENTCODE , ACBUSEGMENTDESCRIPTION FROM GTT_ADHOC_MOC ORDER BY UCIF_ID, CUSTOMERID, CUSTOMERACID ',79355);
