Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2qxmcd8njssvg','MERGE INTO GTT_RBL_SECURITY_CAL A USING (SELECT A.ROWID ROW_ID, B.SECVALUE_FINAL FROM ( SELECT CUSTOMER_ID , SECVALUE_FINAL , COLLATERALID , SECURITYVALUE , ROW_NUMBER() OVER ( PARTITION BY CUSTOMER_ID, COLLATERALID ORDER BY CUSTOMER_ID, COLLATERALID, SECURITYVALUE ) RID FROM GTT_RBL_SECURITY_CAL WHERE COLLATERAL_TYPE = ''Immovable Property'' AND FLG_MULTI_CUST_COLLID = ''Y'' AND VALUATIONEXPIRYDATE > :B1 ) A JOIN GTT_CALC B ON A.CUSTOMER_ID = B.CUSTOMER_ID AND A.COLLATERALID = B.COLLATERALID WHERE A.RID = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET SECVALUE_FINAL = SRC.SECVALUE_FINAL ',86031);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('ff0p66t6p460d','MERGE INTO RBL_TEMPDB.TEMPADVSECURITYDETAIL TEMP USING (SELECT TEMP.ROWID ROW_ID, ACCT.SECURITYENTITYID FROM RBL_TEMPDB.TEMPADVSECURITYDETAIL TEMP JOIN ( SELECT "TEMPADVSECURITYDETAIL".CUSTOMERENTITYID , "TEMPADVSECURITYDETAIL".ACCOUNTENTITYID , "TEMPADVSECURITYDETAIL".COLLATERALID , "TEMPADVSECURITYDETAIL".SECURITYTYPE , (:B1 + ROW_NUMBER() OVER ( ORDER BY ( SELECT 1 FROM DUAL ) )) SECURITYENTITYID FROM RBL_TEMPDB.TEMPADVSECURITYDETAIL WHERE "TEMPADVSECURITYDETAIL".SECURITYENTITYID = 0 OR "TEMPADVSECURITYDETAIL".SECURITYENTITYID IS NULL ) ACCT ON (CASE WHEN TEMP.SECURITYTYPE = ''P'' THEN TEMP.ACCOUNTENTITYID ELSE TEMP.CUSTOMERENTITYID END) = CASE WHEN ACCT.SECURITYTYPE = ''P'' THEN ACCT.ACCOUNTENTITYID ELSE ACCT.CUSTOMERENTITYID END AND TEMP.COLLATERALID = ACCT.COLLATERALID ) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.SECURITYENTITYID = SRC.SECURITYENTITYID',86031);
