Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0qp5kr3uhdppy','SELECT MOC_INITIALISED , QTR_INITIALISED , MASTERFREEZE , PREMOCFREEZE , QTR_FROZEN , PRV_QTR_FROZEN , MOC_FROZEN , :B3 CURRQTRDATE , PREVQTRTIMEKEY , TABLENAME , NVL(( SELECT 1 FROM ( SELECT CUSTOMERID FROM DATAUPLOAD_RBL_MISDB_PROD.MOCACCOUNTDATAUPLOAD_MOD WHERE AUTHORISATIONSTATUS IN ( ''NP'',''MP'',''DP'' ) UNION SELECT CUSTOMERID FROM DATAUPLOAD_RBL_MISDB_PROD.MOCCUSTOMERDATAUPLOAD_MOD WHERE AUTHORISATIONSTATUS IN ( ''NP'',''MP'',''DP'' ) ) T FETCH FIRST 1 ROWS ONLY ), 0) DATAEXIST FROM ( SELECT CASE WHEN NVL(MOC_INITIALISED, ''N'') = ''Y'' THEN ''Y'' ELSE ''N'' END MOC_INITIALISED , CASE WHEN NVL(QTR_INITIALISED, ''N'') = ''Y'' THEN ''Y'' ELSE ''N'' END QTR_INITIALISED , CASE WHEN NVL(BS_MASTERFREEZE, ''N'') = ''Y'' THEN ''Y'' ELSE ''N'' END MASTERFREEZE , CASE WHEN NVL(:B2 , '' '') <> '' '' THEN ''N'' ELSE ''Y'' END PREMOCFREEZE , CASE WHEN NVL(QTR_FROZEN, ''N'') = ''Y'' THEN ''Y'' ELSE ''N'' END QTR_FROZEN , CASE WHEN NVL(MOC_FROZEN, ''N'') = ''Y'' THEN ''Y'' ELSE ''N'' END MOC_FROZEN , ( SELECT CASE WHEN NVL(QTR_FROZEN, '' '') = '' '' THEN ''N'' ELSE ''Y'' END COL FROM RBL_MISDB_PROD.SYSDATAMATRIX WHERE TIMEKEY = ( SELECT MAX(TIMEKEY) FROM RBL_MISDB_PROD.SYSDATAMATRIX WHERE PREV_QTR_KEY = :B1 ) ) PRV_QTR_FROZEN , PREV_QTR_KEY PREVQTRTIMEKEY , ''FreezeData'' TABLENAME FROM RBL_MISDB_PROD.SYSDATAMATRIX WHERE PREV_QTR_KEY = :B1 ) A GROUP BY MOC_INITIALISED,MOC_FROZEN,QTR_INITIALISED,MASTERFREEZE,PREMOCFREEZE,QTR_FROZEN,PRV_QTR_FROZEN,PREVQTRTIMEKEY,TABLENAME ',80930);
