Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fprjyn91ssrky','SELECT MIGRATION_REPORT.GETCAPTURESTATUS(MD_TRIGGERS.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_TRIGGERS.ID,:B2 ) CONVERTSTATUS, MIGRATION_REPORT.GETGENERATESTATUS(MD_TRIGGERS.ID,:B2 ) GENERATESTATUS FROM MD_TRIGGERS, MD_TABLES,MD_SCHEMAS,MD_CATALOGS WHERE MD_TRIGGERS.TABLE_OR_VIEW_ID_FK=MD_TABLES.ID AND MD_TABLES.SCHEMA_ID_FK=MD_SCHEMAS.ID AND MD_SCHEMAS.CATALOG_ID_FK= MD_CATALOGS.ID AND MD_CATALOGS.CONNECTION_ID_FK=:B1 UNION ALL SELECT MIGRATION_REPORT.GETCAPTURESTATUS(MD_TRIGGERS.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_TRIGGERS.ID,:B2 ) CONVERTSTATUS, MIGRATION_REPORT.GETGENERATESTATUS(MD_TRIGGERS.ID,:B2 ) GENERATESTATUS FROM MD_TRIGGERS, MD_VIEWS,MD_SCHEMAS,MD_CATALOGS WHERE MD_TRIGGERS.TABLE_OR_VIEW_ID_FK=MD_VIEWS.ID AND MD_VIEWS.SCHEMA_ID_FK=MD_SCHEMAS.ID AND MD_SCHEMAS.CATALOG_ID_FK= MD_CATALOGS.ID AND MD_CATALOGS.CONNECTION_ID_FK=:B1 ',86678);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cfhckjfrq8vhf','SELECT ALLOBJS.OBJID CAPTURED_ID, ALLOBJS.OBJNAME CAPTURED_NAME, MD.NEW_IDENTIFIER CONVERTED_NAME, ALLOBJS.OBJTYPE CAPTURED_TYPE, DECODE(MD.DERIVED_TYPE,''MD_INDEXES'', SUBSTR(MD.DERIVED_TYPE,4, LENGTH(MD.DERIVED_TYPE)-5),SUBSTR(MD.DERIVED_TYPE,4, LENGTH(MD.DERIVED_TYPE)-4)) CONVERTED_TYPE, ALLOBJS.CAPTURESTATUS CAPTURE_STATUS, ALLOBJS.CONVERTSTATUS CONVERT_STATUS, ALLOBJS.GENERATESTATUS GENERATE_STATUS, DECODE(MLOG.LOGTEXT,NULL,'' '',MLOG.LOGTEXT) LOGTEXT FROM ( SELECT MD_SCHEMAS.ID OBJID,MD_SCHEMAS.NAME OBJNAME,''SCHEMA'' OBJTYPE, MIGRATION_REPORT.GETCAPTURESTATUS(MD_SCHEMAS.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_SCHEMAS.ID,:B2 ) CONVERTSTATUS, MIGRATION_REPORT.GETGENERATESTATUS(MD_SCHEMAS.ID,:B2 ) GENERATESTATUS FROM MD_SCHEMAS,MD_CATALOGS WHERE MD_SCHEMAS.CATALOG_ID_FK= MD_CATALOGS.ID AND MD_CATALOGS.CONNECTION_ID_FK=:B1 UNION ALL SELECT MD_TABLES.ID OBJID,MD_TABLES.TABLE_NAME OBJNAME,''TABLE'' OBJTYPE, MIGRATION_REPORT.GETCAPTURESTATUS(MD_TABLES.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_TABLES.ID,:B2 ) CONVERTSTATUS, MIGRATION_REPORT.GETGENERATESTATUS(MD_TABLES.ID,:B2 ) GENERATESTATUS FROM MD_TABLES,MD_SCHEMAS,MD_CATALOGS WHERE MD_TABLES.SCHEMA_ID_FK=MD_SCHEMAS.ID AND MD_SCHEMAS.CATALOG_ID_FK= MD_CATALOGS.ID AND MD_CATALOGS.CONNECTION_ID_FK=:B1 UNION ALL SELECT MD_VIEWS.ID OBJID,MD_VIEWS.VIEW_NAME OBJNAME,''View'' OBJTYPE, MIGRATION_REPORT.GETCAPTURESTATUS(MD_VIEWS.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_VIEWS.ID,:B2 ) CONVERTSTATUS, MIGRATION_REPORT.GETGENERATESTATUS(MD_VIEWS.ID,:B2 ) GENERATESTATUS FROM MD_VIEWS,MD_SCHEMAS,MD_CATALOGS WHERE MD_VIEWS.SCHEMA_ID_FK=MD_SCHEMAS.ID AND MD_SCHEMAS.CATALOG_ID_FK= MD_CATALOGS.ID AND MD_CATALOGS.CONNECTION_ID_FK=:B1 UNION ALL SELECT MD_STORED_PROGRAMS.ID OBJID,MD_STORED_PROGRAMS.NAME OBJNAME,''STORED_PROGRAM'' OBJTYPE, MIGRATION_REPORT.GETCAPTURESTATUS(MD_STORED_PROGRAMS.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_STORED_PROGRAMS.ID,:B2 ) CONVERTSTATUS, MIGRATION_REPORT.GETGENERATESTATUS(MD_STORED_PROGRAMS.ID,:B2 ) GENERATESTATUS FROM MD_STORED_PROGRAMS,MD_SCHEMAS,MD_CATALOGS WHERE MD_STORED_PROGRAMS.SCHEMA_ID_FK=MD_SCHEMAS.ID AND MD_SCHEMAS.CATALOG_ID_FK= MD_CATALOGS.ID AND MD_CATALOGS.CONNECTION_ID_FK=:B1 UNION ALL SELECT MD_INDEXES.ID OBJID,MD_INDEXES.INDEX_NAME OBJNAME,''INDEX'' OBJTYPE, MIGRATION_REPORT.GETCAPTURESTATUS(MD_INDEXES.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_INDEXES.ID,:B2 ) CONVERTSTATUS, MIGRATION_REPORT.GETGENERATESTATUS(MD_INDEXES.ID,:B2 ) GENERATESTATUS FROM MD_INDEXES, MD_TABLES,MD_SCHEMAS,MD_CATALOGS WHERE MD_INDEXES.TABLE_ID_FK= MD_TABLES.ID AND MD_TABLES.SCHEMA_ID_FK=MD_SCHEMAS.ID AND MD_SCHEMAS.CATALOG_ID_FK= MD_CATALOGS.ID AND MD_CATALOGS.CONNECTION_ID_FK=:B1 UNION ALL SELECT MD_CONSTRAINTS.ID OBJID,MD_CONSTRAINTS.NAME OBJNAME,''CONSTRAINT'' OBJTYPE, MIGRATION_REPORT.GETCAPTURESTATUS(MD_CONSTRAINTS.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_CONSTRAINTS.ID,:B2 ) CONVERTSTATUS, MIGRATION_REPORT.GETGENERATESTATUS(MD_CONSTRAINTS.ID,:B2 ) GENERATESTATUS FROM MD_CONSTRAINTS, MD_TABLES,MD_SCHEMAS,MD_CATALOGS WHERE MD_CONSTRAINTS.TABLE_ID_FK= MD_TABLES.ID AND MD_TABLES.SCHEMA_ID_FK=MD_SCHEMAS.ID AND MD_SCHEMAS.CATALOG_ID_FK= MD_CATALOGS.ID AND MD_CATALOGS.CONNECTION_ID_FK=:B1 UNION ALL SELECT MD_TRIGGERS.ID OBJID,MD_TRIGGERS.TRIGGER_NAME OBJNAME,''TRIGGER'' OBJTYPE, MIGRATION_REPORT.GETCAPTURESTATUS(MD_TRIGGERS.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_TRIGGERS.ID,:B2 ) CONVERTSTATUS, MIGRATION_REPORT.GETGENERATESTATUS(MD_TRIGGERS.ID,:B2 ) GENERATESTATUS FROM MD_TRIGGERS, MD_TABLES,MD_SCHEMAS,MD_CATALOGS WHERE MD_TRIGGERS.TABLE_OR_VIEW_ID_FK=MD_TABLES.ID AND MD_TABLES.SCHEMA_ID_FK=MD_SCHEMAS.ID AND MD_SCHEMAS.CATALOG_ID_FK= MD_CATALOGS.ID AND MD_CATALOGS.CONNECTION_ID_FK=:B1 UNION ALL SELECT MD_TRIGGERS.ID OBJID,MD_TRIGGERS.TRIGGER_NAME OBJNAME,''TRIGGER'' OBJTYPE, MIGRATION_REPORT.GETCAPTURESTATUS(MD_TRIGGERS.ID) CAPTURESTATUS, MIGRATION_REPORT.GETCONVERTSTATUS(MD_TRIGGERS.ID,:B',86678);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('ft632wtht7qua','MERGE INTO GTT_RBL_SECURITY_CAL_STOCK A USING (SELECT A.ROWID ROW_ID, B.APPORTIONED_VALUE FROM ( SELECT CUSTOMER_ID , SECVALUE_FINAL , COLLATERALID , ROW_NUMBER() OVER ( PARTITION BY CUSTOMER_ID, COLLATERALID ORDER BY CUSTOMER_ID, COLLATERALID, SECURITYVALUE ) RID FROM GTT_RBL_SECURITY_CAL_STOCK WHERE ( NVL(CUST_OS, 0) >= 50000000 AND VALUATIONEXPIRYDATE_NEW >= :B1 ) OR ( NVL(CUST_OS, 0) < 50000000 AND VALUATIONEXPIRYDATE_NEW > :B1 ) ) A JOIN ( SELECT CUSTOMER_ID , COLLATERALID , SUM(UTILS.CONVERT_TO_NUMBER(APPORTIONED_VALUE,16,2)) APPORTIONED_VALUE FROM GTT_RBL_SECURITY_CAL_STOCK WHERE VALUATIONEXPIRYDATE_NEW > :B1 GROUP BY CUSTOMER_ID,COLLATERALID ) B ON A.CUSTOMER_ID = B.CUSTOMER_ID AND A.COLLATERALID = B.COLLATERALID AND A.RID = 1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET SECVALUE_FINAL = SRC.APPORTIONED_VALUE ',86031);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('a20077tc53fwk','MERGE INTO GTT_RBL_SECURITY_CAL A USING (SELECT A.ROWID ROW_ID, SECURITYVALUE FROM ( SELECT CUSTOMER_ID , SECVALUE_FINAL , COLLATERALID , SECURITYVALUE , ROW_NUMBER() OVER ( PARTITION BY CUSTOMER_ID, COLLATERALID ORDER BY CUSTOMER_ID, COLLATERALID, SECURITYVALUE ) RID FROM GTT_RBL_SECURITY_CAL WHERE COLLATERAL_TYPE = ''Immovable Property'' AND FLG_MULTI_CUST_COLLID = ''N'' AND VALUATIONEXPIRYDATE > :B1 ) A WHERE A.RID = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET SECVALUE_FINAL = SECURITYVALUE ',86031);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gz6kzs88bdy6u','MERGE INTO GTT_RBL_SECURITY_CAL A USING (SELECT A.ROWID ROW_ID, CASE WHEN COUNTS > 1 THEN ''Y'' ELSE ''N'' END AS FLG_MULTI_CUST_COLLID FROM GTT_RBL_SECURITY_CAL A JOIN ( SELECT GTT_RBL_SECURITY_CAL.COLLATERALID , COUNT(DISTINCT GTT_RBL_SECURITY_CAL.CUSTOMER_ID) COUNTS FROM GTT_RBL_SECURITY_CAL WHERE GTT_RBL_SECURITY_CAL.COLLATERAL_TYPE = ''Immovable Property'' AND GTT_RBL_SECURITY_CAL.VALUATIONEXPIRYDATE > :B1 GROUP BY GTT_RBL_SECURITY_CAL.COLLATERALID ) B ON A.COLLATERALID = B.COLLATERALID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.FLG_MULTI_CUST_COLLID = SRC.FLG_MULTI_CUST_COLLID',86031);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fqdmrsj3wkqxa','INSERT INTO RBL_TEMPDB.TEMPMETAGRIDCUSTOMERMASTER ( DATE_OF_DATA, SOURCE_SYSTEM, UCIC_ID, CUSTOMER_ID, CUSTOMER_NAME, CUSTOMER_CONSTITUTION, GENDER, CUSTOMER_SEGMENT_CODE, PAN_NO, ASSET_CLASS, NPA_DATE, DBT_LOS_DATE, ALWAYS_NPA, AUTHORISATIONSTATUS, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, CREATEDBY, DATECREATED, MODIFIEDBY, DATEMODIFIED, APPROVEDBY, DATEAPPROVED ) ( SELECT DATE_OF_DATA , SOURCE_SYSTEM , UCIC_ID , CUSTOMER_ID , CUSTOMER_NAME , CUSTOMER_CONSTITUTION , GENDER , CUSTOMER_SEGMENT_CODE , PAN_NO , ASSET_CLASS , NPA_DATE , DBT_LOS_DATE , ALWAYS_NPA , NULL AUTHORISATIONSTATUS , :B1 EFFECTIVEFROMTIMEKEY , 49999 EFFECTIVETOTIMEKEY , ''SSISUSER'' CREATEDBY , SYSDATE DATECREATED , NULL MODIFIEDBY , NULL DATEMODIFIED , NULL APPROVEDBY , NULL DATEAPPROVED FROM RBL_STGDB.METAGRID_CUSTOMER_MASTER_STG A )',86138);
