Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3pcd6a0wwvg1h','INSERT INTO RBL_TEMPDB.TEMPACDAILYTXNDETAIL ( BRANCHCODE, CUSTOMERID, CUSTOMERACID, ACCOUNTENTITYID, TXNDATE, TXNTYPE, TXNSUBTYPE, TXNTIME, CURRENCYALT_KEY, CURRENCYCONVRATE, TXNAMOUNT, TXNAMOUNTINCURRENCY, EXTDATE, TXNREFNO, TXNVALUEDATE, MNEMONICCODE, PARTICULAR, AUTHORISATIONSTATUS, CREATEDBY, DATECREATED, MODIFIEDBY, DATEMODIFIED, APPROVEDBY, DATEAPPROVED, REMARK, TRUECREDIT, ISPROCESSED, BALANCE ) ( SELECT NULL BRANCHCODE , ACBD.REFCUSTOMERID CUSTOMERID , TXN.ACCOUNTID CUSTOMERACID , ACBD.ACCOUNTENTITYID ACCOUNTENTITYID , TXN.TXNDATE TXNDATE , CASE WHEN TXN.TXNTYPE = ''D'' THEN ''DEBIT'' WHEN TXN.TXNTYPE = ''C'' THEN ''CREDIT'' END TXNTYPE , CASE WHEN TXN.TXNTYPE = ''D'' AND TXN.TXNSUBTYPE = ''IC'' THEN ''INTEREST'' WHEN TXN.TXNTYPE = ''D'' THEN ''OTHER DEBIT'' ELSE TXN.TXNSUBTYPE END TXNSUBTYPE , NULL TXNTIME , DC.CURRENCYALT_KEY CURRENCYALT_KEY , DCC.CONVRATE CURRENCYCONVRATE , TXN.TXNAMOUNTINR TXNAMOUNT , TXN.TXNAMOUNTINCURRENCY TXNAMOUNTINCURRENCY , :B2 EXTDATE , TXNID TXNREFNO , NULL TXNVALUEDATE , NULL MNEMONICCODE , TXN.TXNPARTICULARS PARTICULAR , NULL AUTHORISATIONSTATUS , ''SSISUSER'' CREATEDBY , SYSDATE DATECREATED , NULL MODIFIEDBY , NULL DATEMODIFIED , NULL APPROVEDBY , NULL DATEAPPROVED , NULL REMARK , NULL TRUECREDIT , NULL ISPROCESSED , NULL BALANCE FROM RBL_STGDB.TXN_SOURCESYSTEM01_STG TXN LEFT JOIN RBL_TEMPDB.TEMPADVACBASICDETAIL ACBD ON ACBD.CUSTOMERACID = TXN.ACCOUNTID LEFT JOIN RBL_MISDB_PROD.DIMCURRENCY DC ON LTRIM(RTRIM(NVL(DC.CURRENCYCODE, '' ''))) = TXN.TXNCURRENCY AND DC.EFFECTIVEFROMTIMEKEY <= :B1 AND DC.EFFECTIVETOTIMEKEY >= :B1 LEFT JOIN RBL_MISDB_PROD.DIMCURCOVRATE DCC ON DCC.CURRENCYCODE = DC.CURRENCYCODE AND DCC.CONVDATE = :B2 AND DCC.EFFECTIVEFROMTIMEKEY <= :B1 AND DCC.EFFECTIVETOTIMEKEY >= :B1 )',85993);
