Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8hn7wyvvzaczm','MERGE INTO GTT_RBL_SECURITY_CAL_STOCK A USING (SELECT A.ROWID ROW_ID, B.BALANCE FROM GTT_RBL_SECURITY_CAL_STOCK A JOIN ( SELECT A.REFCUSTOMERID , SUM(BALANCE) BALANCE FROM RBL_TEMPDB.TEMPADVACBASICDETAIL A JOIN RBL_TEMPDB.TEMPADVACBALANCEDETAIL B ON A.ACCOUNTENTITYID = B.ACCOUNTENTITYID GROUP BY A.REFCUSTOMERID ) B ON A.CUSTOMER_ID = B.REFCUSTOMERID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.CUST_OS = SRC.BALANCE ',86031);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('f28s484dpk7kp','MERGE INTO CTE_PER_DIFF_ADJ A USING (SELECT A.ROWID ROW_ID, CALC_PER + B.CALC_PER_DIFF AS CALC_PER FROM CTE_PER_DIFF_ADJ A JOIN ( SELECT COLLATERALID , 100 - SUM(CALC_PER) CALC_PER_DIFF FROM GTT_CALC GROUP BY COLLATERALID ) B ON A.COLLATERALID = B.COLLATERALID WHERE A.RID = 1) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.CALC_PER = SRC.CALC_PER ',86031);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cuut8sz8pswup','MERGE INTO RBL_TEMPDB.TEMPADVSECURITYDETAIL TEMP USING (SELECT TEMP.ROWID ROW_ID, MAIN.SECURITYENTITYID FROM RBL_TEMPDB.TEMPADVSECURITYDETAIL TEMP JOIN RBL_MISDB_PROD.ADVSECURITYDETAIL MAIN ON (CASE WHEN TEMP.SECURITYTYPE = ''P'' THEN TEMP.ACCOUNTENTITYID ELSE TEMP.CUSTOMERENTITYID END) = CASE WHEN MAIN.SECURITYTYPE = ''P'' THEN MAIN.ACCOUNTENTITYID ELSE MAIN.CUSTOMERENTITYID END AND TEMP.COLLATERALID = MAIN.COLLATERALID WHERE MAIN.EFFECTIVETOTIMEKEY = 49999) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.SECURITYENTITYID = SRC.SECURITYENTITYID',86031);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4krb6ah8293cw','UPDATE GTT_RBL_SECURITY_CAL_STOCK SET VALUATIONEXPIRYDATE_NEW = CASE WHEN STOCK_AUDIT_DATE_NEW IS NULL THEN NULL WHEN UTILS.DATEADD(''YY'', 1, STOCK_AUDIT_DATE_NEW) < VALUATIONEXPIRYDATE_NEW THEN UTILS.DATEADD(''YY'', 1, STOCK_AUDIT_DATE_NEW) ELSE TO_DATE(VALUATIONEXPIRYDATE_NEW,''YYYY-MM-DD'') END WHERE NVL(CUST_OS, 0) >= 50000000',86031);
