Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('59u1wb4f7btw0','MERGE INTO RBL_TEMPDB.TEMPMETAGRIDSECURITY TEMP USING (SELECT TEMP.ROWID ROW_ID, ACCT.METAGRIDENTITYID FROM RBL_TEMPDB.TEMPMETAGRIDSECURITY TEMP JOIN ( SELECT A.ACCOUNT_ID , (:B1 + ROW_NUMBER() OVER ( ORDER BY ( SELECT 1 FROM DUAL ) )) METAGRIDENTITYID FROM RBL_TEMPDB.TEMPMETAGRIDSECURITY A WHERE A.METAGRIDENTITYID = 0 OR A.METAGRIDENTITYID IS NULL ) ACCT ON TEMP.ACCOUNT_ID = ACCT.ACCOUNT_ID ) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.METAGRIDENTITYID = SRC.METAGRIDENTITYID',86136);
