Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('dzqpwvhudxabr','INSERT INTO RBL_TEMPDB.TEMPADVACFINANCIALDETAIL ( ACCOUNTENTITYID, AC_LASTREVIEWDUEDT, AC_REVIEWTYPEALT_KEY, AC_REVIEWDT, AC_REVIEWAUTHALT_KEY, AC_NEXTREVIEWDUEDT, DRAWINGPOWER, INTTRATE , NPADT, BOOKDEBTS, UNDRAWNAMT , UNADJSUBSIDY, LASTINTTREALISEDT, MOCSTATUS, MOCREASON , LIMITDISBURSED , REFCUSTOMERID, REFSYSTEMACID, AUTHORISATIONSTATUS, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, CREATEDBY, DATECREATED, MODIFIEDBY, DATEMODIFIED, APPROVEDBY, DATEAPPROVED, D2KTIMESTAMP, MOCDATE, MOCTYPEALT_KEY, CROPDURATION, AC_REVIEWAUTHLEVELALT_KEY, ACCOUNTBLKCODE2 ) ( SELECT DISTINCT ACBD.ACCOUNTENTITYID ACCOUNTENTITYID , NULL AC_LASTREVIEWDUEDT , 0 AC_REVIEWTYPEALT_KEY , NULL AC_REVIEWDT , 0 AC_REVIEWAUTHALT_KEY , CASE WHEN ( REVIEWFLAG = ''Y'' OR NVL(DS.SOURCESHORTNAMEENUM, '' '') = ''ECBF'' ) THEN LIMITEXPIRYDATE ELSE NULL END AC_NEXTREVIEWDUEDT , A.DRAWINGPOWER + CASE WHEN A.ADHOCEXPIRYDATE >= :B3 THEN NVL(ADHOCAMT, 0) ELSE 0 END DRAWINGPOWER , A.INTTRATE INTTRATE , NULL , NULL BOOKDEBTS , NULL UNDRAWNAMT , NULL UNADJSUBSIDY , NULL LASTINTTREALISEDT , NULL MOCSTATUS , NULL MOCREASON , NULL LIMITDISBURSED , ACBD.REFCUSTOMERID REFCUSTOMERID , ACBD.SYSTEMACID REFSYSTEMACID , NULL AUTHORISATIONSTATUS , :B2 EFFECTIVEFROMTIMEKEY , 49999 EFFECTIVETOTIMEKEY , ''SSISUSER'' CREATEDBY , SYSDATE DATECREATED , NULL MODIFIEDBY , NULL DATEMODIFIED , NULL APPROVEDBY , NULL DATEAPPROVED , NULL D2KTIMESTAMP , NULL MOCDATE , NULL MOCTYPEALT_KEY , NULL CROPDURATION , NULL AC_REVIEWAUTHLEVELALT_KEY , ACCOUNTBLKCODE2 FROM RBL_STGDB.ACCOUNT_ALL_SOURCE_SYSTEM A LEFT JOIN RBL_MISDB_PROD.DIMSOURCEDB DS ON DS.SOURCENAME = A.SOURCESYSTEM AND DS.EFFECTIVEFROMTIMEKEY <= :B1 AND DS.EFFECTIVETOTIMEKEY >= :B1 JOIN RBL_TEMPDB.TEMPADVACBASICDETAIL ACBD ON A.CUSTOMERACID = ACBD.CUSTOMERACID LEFT JOIN RBL_TEMPDB.TEMPADVACBALANCEDETAIL AABD ON AABD.ACCOUNTENTITYID = ACBD.ACCOUNTENTITYID JOIN RBL_MISDB_PROD.DIMPRODUCT P ON P.EFFECTIVEFROMTIMEKEY <= :B1 AND P.EFFECTIVETOTIMEKEY >= :B1 AND ACBD.PRODUCTALT_KEY = P.PRODUCTALT_KEY )',86005);
