Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('53bwmwufthr03','INSERT INTO RBL_TEMPDB.TEMPADVACBALANCEDETAIL ( ACCOUNTENTITYID, ASSETCLASSALT_KEY, BALANCEINCURRENCY, BALANCE, SIGNBALANCE, LASTCRDT, OVERDUE, TOTALPROV , REFCUSTOMERID, REFSYSTEMACID, AUTHORISATIONSTATUS, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, OVERDUESINCEDT, MOCSTATUS, MOCDATE, MOCTYPEALT_KEY, OLD_OVERDUESINCEDT, OLD_OVERDUE, ORG_TOTALPROV, INTREVERSEAMT, PS_BALANCE, NPS_BALANCE, DATECREATED, MODIFIEDBY, DATEMODIFIED, APPROVEDBY, DATEAPPROVED, CREATEDBY, PS_NPS_FLAG, UPGRADEDATE, OVERDUEPRINCIPAL, OVERDUEPRINCIPALDT, OVERDUEINTEREST, OVERDUEINTDT, OVEROTHERDUE, OVERDUEOTHERDT, UNAPPLIEDINTAMOUNT, PRINCIPALBALANCE, SOURCEASSETCLASS, SOURCENPADATE ) ( SELECT ACBD.ACCOUNTENTITYID ACCOUNTENTITYID , 1 , ACC1.BALANCEINACTUALACCURRENCY BALANCEINCURRENCY , CASE WHEN NVL(ACC1.BALANCEOUTSTANDINGINR, 0) <= 0 THEN 0 ELSE NVL(ACC1.BALANCEOUTSTANDINGINR, 0) END BALANCE , ACC1.BALANCEOUTSTANDINGINR SIGNBALANCE , CASE WHEN ACBD.REFERENCEPERIOD IN ( 365,366,180,181 ) THEN NULL ELSE ACC1.LASTCREDITDATE END LASTCRDT , NVL(PRINCIPALOVERDUEAMT, 0) + NVL(INTERESTOVERDUEAMT, 0) + NVL(OTHCHARGESOVERDUEAMT, 0) OVERDUE , NULL TOTALPROV , ACBD.REFCUSTOMERID REFCUSTOMERID , ACBD.SYSTEMACID REFSYSTEMACID , ACBD.AUTHORISATIONSTATUS , :B3 EFFECTIVEFROMTIMEKEY , 49999 EFFECTIVETOTIMEKEY , CASE WHEN ACBD.SOURCEALT_KEY = 6 AND NVL(DPD, 0) > 0 THEN UTILS.DATEADD(''DD'', ((NVL(DPD, 0) - 1) * -1), :B2 ) ELSE TO_DATE(MAIN_PRO.GETMINIMUMDATE(TO_CHAR(PRINCIPALOVERDUESINCEDT),TO_CHAR(INTERESTOVERDUESINCEDT),TO_CHAR(OTHCHANGESOVERDUESINCEDT)),''YYYY-MM-DD'') END OVERDUESINCEDT , ''N'' MOCSTATUS , NULL MOCDATE , NULL MOCTYPEALT_KEY , NULL OLD_OVERDUESINCEDT , NULL OLD_OVERDUE , NULL ORG_TOTALPROV , NULL INTREVERSEAMT , 0 PS_BALANCE , 0 NPS_BALANCE , SYSDATE DATECREATED , NULL MODIFIEDBY , NULL DATEMODIFIED , NULL APPROVEDBY , NULL DATEAPPROVED , ''SSISUSER'' CREATEDBY , NULL PS_NPS_FLAG , NULL UPGRADEDATE , NVL(ACC1.PRINCIPALOVERDUEAMT, 0) OVERDUEPRINCIPAL , PRINCIPALOVERDUESINCEDT OVERDUEPRINCIPALDATE , NVL(ACC1.INTERESTOVERDUEAMT, 0) OVERDUEINTERESET , ACC1.INTERESTOVERDUESINCEDT OVERDUEINTERESETDATE , ACC1.OTHCHARGESOVERDUEAMT , ACC1.OTHCHANGESOVERDUESINCEDT , ACC1.UNAPPLIEDINTERESTAMT , ACC1.POSBALANCE , ACC1.ASSETCLASSCODE SOURCEASSETCLASS , ACC1.NPADATE SOURCENPADATE FROM RBL_STGDB.ACCOUNT_ALL_SOURCE_SYSTEM ACC1 JOIN RBL_TEMPDB.TEMPADVACBASICDETAIL ACBD ON ACC1.CUSTOMERACID = ACBD.CUSTOMERACID LEFT JOIN RBL_MISDB_PROD.DIMASSETCLASSMAPPING DA ON ACC1.ASSETCLASSCODE = DA.SRCSYSCLASSCODE AND ACBD.SOURCEALT_KEY = DA.SOURCEALT_KEY AND DA.EFFECTIVEFROMTIMEKEY <= :B1 AND DA.EFFECTIVETOTIMEKEY >= :B1 )',86001);
