Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('74mmfdhd4xzab','INSERT INTO RBL_TEMPDB.TEMPADVSECURITYVALUEDETAIL ( SECURITYENTITYID, VALUATIONSOURCEALT_KEY, VALUATIONDATE, CURRENTVALUE, VALUATIONEXPIRYDATE, COLLATERALID, AUTHORISATIONSTATUS, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, CREATEDBY, DATECREATED, MODIFIEDBY, DATEMODIFIED, APPROVEDBY, DATEAPPROVED, D2KTIMESTAMP, SECURITYVALUEMAIN ) ( SELECT C.SECURITYENTITYID , NULL VALUATIONSOURCEALT_KEY , A.VALUATIONDATE , A.SECURITYVALUE CURRENTVALUE , A.VALUATIONEXPIRYDATE , A.COLLATERALID , NULL AUTHORISATIONSTATUS , :B2 EFFECTIVEFROMTIMEKEY , 49999 EFFECTIVETOTIMEKEY , ''SSISUSER'' CREATEDBY , SYSDATE DATECREATED , NULL MODIFIEDBY , NULL DATEMODIFIED , NULL APPROVEDBY , NULL DATEAPPROVED , NULL D2KTIMESTAMP , A.SECURITYVALUE SECURITYVALUEMAIN FROM RBL_STGDB.SECURITY_ALL_SOURCE_SYSTEM A JOIN RBL_TEMPDB.TEMPADVACBASICDETAIL B ON A.ACCOUNTID = B.CUSTOMERACID AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 JOIN RBL_TEMPDB.TEMPADVSECURITYDETAIL C ON C.ACCOUNTENTITYID = B.ACCOUNTENTITYID AND A.COLLATERALID = C.COLLATERALID AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 AND C.SECURITYTYPE = ''P'' UNION SELECT C.SECURITYENTITYID , NULL VALUATIONSOURCEALT_KEY , A.VALUATIONDATE , A.SECVALUE_FINAL CURRENTVALUE , A.VALUATIONEXPIRYDATE_NEW , A.COLLATERALID , NULL AUTHORISATIONSTATUS , :B2 EFFECTIVEFROMTIMEKEY , 49999 EFFECTIVETOTIMEKEY , ''SSISUSER'' CREATEDBY , SYSDATE DATECREATED , NULL MODIFIEDBY , NULL DATEMODIFIED , NULL APPROVEDBY , NULL DATEAPPROVED , NULL D2KTIMESTAMP , MAINSECURITYVALUE SECURITYVALUEMAIN FROM RBL_STGDB.FINACLE_COLLATERAL_DATA A JOIN RBL_TEMPDB.TEMPCUSTOMERBASICDETAIL B ON A.CUSTOMER_ID = B.CUSTOMERID AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 JOIN RBL_TEMPDB.TEMPADVSECURITYDETAIL C ON C.CUSTOMERENTITYID = B.CUSTOMERENTITYID AND A.COLLATERALID = C.COLLATERALID AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 AND C.SECURITYTYPE = ''C'' UNION ALL SELECT C.SECURITYENTITYID , NULL VALUATIONSOURCEALT_KEY , A.VALUATIONDATE , A.APPORTIONED_VALUE CURRENTVALUE , A.VALUATIONEXPIRYDATE , A.COLLATERALID , NULL AUTHORISATIONSTATUS , :B2 EFFECTIVEFROMTIMEKEY , 49999 EFFECTIVETOTIMEKEY , ''SSISUSER'' CREATEDBY , SYSDATE DATECREATED , NULL MODIFIEDBY , NULL DATEMODIFIED , NULL APPROVEDBY , NULL DATEAPPROVED , NULL D2KTIMESTAMP , SECURITYVALUE SECURITYVALUEMAIN FROM RBL_STGDB.FINACLE_ODFD_DATA A JOIN RBL_TEMPDB.TEMPADVACBASICDETAIL B ON A.CUSTOMERACID = B.CUSTOMERACID AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 JOIN RBL_TEMPDB.TEMPADVSECURITYDETAIL C ON C.CUSTOMERENTITYID = B.CUSTOMERENTITYID AND A.COLLATERALID = C.COLLATERALID AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 AND B.ACCOUNTENTITYID = C.ACCOUNTENTITYID AND C.SECURITYTYPE = ''P'' )',86039);
