Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2xcddasp29gmu','MERGE INTO RBL_TEMPDB.TEMPADVFACCREDITCARDDETAIL A USING (SELECT A.ROWID ROW_ID, CASE WHEN NVL(B.ACCOUNTBLKCODE2, '' '') IN ( ''K'',''E'',''W'' ) THEN B.ACCOUNTBLKCODE2 WHEN B.ACCOUNTBLKCODE2 = ''D'' AND NVL(A.ACCOUNTBLKCODE2, '' '') IN ( ''K'',''E'',''W'' ) THEN A.ACCOUNTBLKCODE2 WHEN B.ACCOUNTBLKCODE2 = ''D'' AND NVL(A.ACCOUNTBLKCODE2, '' '') NOT IN ( ''K'',''E'',''W'' ) THEN B.ACCOUNTBLKCODE2 ELSE A.ACCOUNTBLKCODE2 END AS ACCOUNTBLKCODE2 FROM RBL_TEMPDB.TEMPADVFACCREDITCARDDETAIL A JOIN RBL_MISDB_PROD.ADVFACCREDITCARDDETAIL B ON B.EFFECTIVETOTIMEKEY = 49999 AND A.ACCOUNTENTITYID = B.ACCOUNTENTITYID ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ACCOUNTBLKCODE2 = SRC.ACCOUNTBLKCODE2',86127);
