Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('ayf6pvqbgvh9j','INSERT INTO RBL_TEMPDB.TEMPADVFACCREDITCARDDETAIL ( ENTITYKEY, ACCOUNTENTITYID, CREDITCARDENTITYID, CORPORATEUCIC_ID, CORPORATECUSTOMERID, LIABILITY, MINIMUMAMOUNTDUE, CD, BUCKET, DPD, REFSYSTEMACID, AUTHORISATIONSTATUS, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, CREATEDBY, DATECREATED, MODIFIEDBY, DATEMODIFIED, APPROVEDBY, DATEAPPROVED, D2KTIMESTAMP, MOCSTATUS, MOCDATE, ISCHANGED, ACCOUNTSTATUS, ACCOUNTBLKCODE2, ACCOUNTBLKCODE1, CHARGEOFFY_N ) ( SELECT DISTINCT NULL ENTITYKEY , B.ACCOUNTENTITYID , NULL CREDITCARDENTITYID , A.CORPORATEUCICID CORPORATEUCIC_ID , A.CORPORATECUSTOMERID CORPORATECUSTOMERID , A.LIABILITY , NULL MINIMUMAMOUNTDUE , A.CD , A.BUCKET , A.DPD , B.SYSTEMACID REFSYSTEMACID , NULL AUTHORISATIONSTATUS , B.EFFECTIVEFROMTIMEKEY EFFECTIVEFROMTIMEKEY , B.EFFECTIVETOTIMEKEY EFFECTIVETOTIMEKEY , B.CREATEDBY CREATEDBY , SYSDATE DATECREATED , NULL MODIFIEDBY , NULL DATEMODIFIED , NULL APPROVEDBY , NULL DATEAPPROVED , NULL D2KTIMESTAMP , NULL MOCSTATUS , NULL MOCDATE , ''U'' ISCHANGED , A.ACCOUNTSTATUS , A.ACCOUNTBLKCODE2 , A.ACCOUNTBLKCODE1 , CHARGEOFFY_N FROM RBL_STGDB.ACCOUNT_SOURCESYSTEM06_STG A JOIN RBL_TEMPDB.TEMPADVACBASICDETAIL B ON A.CUSTOMERACID = B.CUSTOMERACID )',86127);
