Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cahpk3urfnh0u','INSERT INTO RBL_TEMPDB.TEMPADVCUSTNPADETAIL ( CUSTOMERENTITYID, CUST_ASSETCLASSALT_KEY, NPADT, LASTINTTCHARGEDDT, DBTDT, LOSDT, DEFAULTREASON1ALT_KEY, DEFAULTREASON2ALT_KEY, STAFFACCOUNTABILITY, LASTINTBOOKED, REFCUSTOMERID, AUTHORISATIONSTATUS, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, CREATEDBY, DATECREATED, MODIFIEDBY, DATEMODIFIED, APPROVEDBY, DATEAPPROVED, MOCSTATUS, MOCDATE, MOCTYPEALT_KEY , NPA_REASON ) ( SELECT B.CUSTOMERENTITYID , C.ASSETCLASSALT_KEY CUST_ASSETCLASSALT_KEY , AC.NPADATE NPADT , NULL LASTINTTCHARGEDDT , (CASE WHEN C.ASSETCLASSSUBGROUP = ''DOUBTFUL'' THEN A.DBT_LOS_DATE ELSE NULL END) DBTDT , (CASE WHEN C.ASSETCLASSSUBGROUP = ''LOSS'' THEN A.DBT_LOS_DATE ELSE NULL END) LOSDT , NULL DEFAULTREASON1ALT_KEY , NULL DEFAULTREASON2ALT_KEY , NULL STAFFACCOUNTABILITY , NULL LASTINTBOOKED , A.CUSTOMERID REFCUSTOMERID , NULL AUTHORISATIONSTATUS , :B1 EFFECTIVEFROMTIMEKEY , 49999 EFFECTIVETOTIMEKEY , ''SSISUSER'' CREATEDBY , SYSDATE DATECREATED , NULL MODIFIEDBY , NULL DATEMODIFIED , NULL APPROVEDBY , NULL DATEAPPROVED , NULL MOCSTATUS , NULL MOCDATE , NULL MOCTYPEALT_KEY , NULL NPA_REASON FROM RBL_STGDB.CUSTOMER_ALL_SOURCE_SYSTEM A JOIN RBL_TEMPDB.TEMPCUSTOMERBASICDETAIL B ON A.CUSTOMERID = B.CUSTOMERID JOIN ( SELECT CUSTOMERID , ASSETCLASSCODE , MIN(NPADATE) NPADATE FROM RBL_STGDB.ACCOUNT_SOURCESYSTEM01_STG GROUP BY CUSTOMERID,ASSETCLASSCODE ) AC ON A.CUSTOMERID = AC.CUSTOMERID JOIN RBL_MISDB_PROD.DIMASSETCLASSMAPPING C ON ( C.EFFECTIVEFROMTIMEKEY <= 49999 AND C.EFFECTIVETOTIMEKEY >= 49999 ) AND AC.ASSETCLASSCODE = C.SRCSYSCLASSCODE AND NVL(C.ASSETCLASSSHORTNAMEENUM, ''STD'') <> ''STD'' )',86015);
