Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('dajy2pjkcfuja','MERGE INTO RBL_TEMPDB.TEMPINVESTMENTBASICDETAIL TEMP USING (SELECT TEMP.ROWID ROW_ID, MAIN.INVENTITYID FROM RBL_TEMPDB.TEMPINVESTMENTBASICDETAIL TEMP JOIN RBL_MISDB_PROD.INVESTMENTFINANCIALDETAIL MAIN ON TEMP.INVID = (CASE WHEN ( HOLDINGNATURE IS NULL OR MAIN.REFINVID LIKE ''%/_%''ESCAPE ''/'' ) THEN MAIN.REFINVID ELSE (MAIN.REFINVID || ''_'' || UTILS.CONVERT_TO_VARCHAR2(NVL(HOLDINGNATURE, '' ''),10)) END) WHERE MAIN.EFFECTIVETOTIMEKEY = 49999) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.INVENTITYID = SRC.INVENTITYID',86062);
