Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4avcgzq8wwajq','MERGE INTO RBL_TEMPDB.TEMPADVACBASICDETAIL A USING(SELECT A.ROWID ROW_ID FROM RBL_TEMPDB.TEMPADVACBASICDETAIL A INNER JOIN CURDAT_RBL_MISDB_PROD.ADVACRESTRUCTUREDETAIL B ON A.ACCOUNTENTITYID=B.ACCOUNTENTITYID AND B.EFFECTIVETOTIMEKEY=49999 WHERE B.RESTRUCTUREFACILITYTYPEALT_KEY=3 )SRC ON (A.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET A.FLGSECURED=''U'' ',86326);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fhhfb787z1g9s','MERGE INTO RBL_TEMPDB.TEMPADVACBASICDETAIL A USING (SELECT A.ROWID ROW_ID,B.SECUREDSTATUS ,ACBUREVISEDSEGMENTCODE,C.ACBUSEGMENTSHORTNAMEENUM,E.SOURCESHORTNAMEENUM,SEGMENTCODE,D.AGRISCHEME,D.PRODUCTSUBGROUP FROM RBL_TEMPDB.TEMPADVACBASICDETAIL A INNER JOIN RBL_STGDB.ACCOUNT_ALL_SOURCE_SYSTEM B ON A.CUSTOMERACID=B.CUSTOMERACID LEFT JOIN RBL_MISDB_PROD.DIMACBUSEGMENT C ON (C.EFFECTIVEFROMTIMEKEY<=:B1 AND C.EFFECTIVETOTIMEKEY>=:B1 ) AND A.SEGMENTCODE =C.ACBUSEGMENTCODE LEFT JOIN RBL_MISDB_PROD.DIMPRODUCT D ON (D.EFFECTIVEFROMTIMEKEY<=:B1 AND D.EFFECTIVETOTIMEKEY>=:B1 ) AND A.PRODUCTALT_KEY =D.PRODUCTALT_KEY LEFT JOIN RBL_MISDB_PROD.DIMSOURCEDB E ON (E.EFFECTIVEFROMTIMEKEY<=:B1 AND E.EFFECTIVETOTIMEKEY>=:B1 ) AND E.SOURCEALT_KEY=A.SOURCEALT_KEY )SRC ON (A.ROWID=SRC.ROW_ID) WHEN MATCHED THEN UPDATE SET A.FLGSECURED= CASE WHEN SRC.ACBUREVISEDSEGMENTCODE IN(''AGRI-WHOLESALE'',''MC'',''SME'',''CIB'',''SCF'',''FIG'') THEN SRC.SECUREDSTATUS WHEN SRC.ACBUSEGMENTSHORTNAMEENUM =''FI'' OR SRC.SOURCESHORTNAMEENUM=''VisionPlus'' THEN ''U'' WHEN SRC.SEGMENTCODE IN(''1410'',''1411'') AND SRC.AGRISCHEME =''Y'' AND SRC.PRODUCTSUBGROUP=''SECURED'' THEN ''S'' WHEN SRC.PRODUCTSUBGROUP=''SECURED'' OR SRC.SOURCESHORTNAMEENUM=''MIFIN'' THEN ''S'' ELSE ''U'' END ',86326);
