Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8wqa21cjgmk32','INSERT INTO RBL_TEMPDB.TEMPINVESTMENTBASICDETAIL ( BRANCHCODE, INV_KEY, INVID, ISSUERID, ISIN, INSTRTYPEALT_KEY, INSTRNAME, INVESTMENTNATURE, INTERNALRATING, INRATINGDATE, INRATINGEXPIRYDATE, EXRATING, EXRATINGAGENCY, EXRATINGDATE, EXRATINGEXPIRYDATE, SECTOR, INDUSTRY_ALTKEY, LISTEDSTKEXCHANGE, EXPOSURETYPE, SECURITYVALUE, MATURITYDT, RESTRUCTUREDATE, MORTGAGESTATUS, NHBSTATUS, RESIPURPOSE, AUTHORISATIONSTATUS, EFFECTIVEFROMTIMEKEY, EFFECTIVETOTIMEKEY, CREATEDBY, DATECREATED, MODIFIEDBY, DATEMODIFIED, APPROVEDBY, DATEAPPROVED ) ( SELECT A.BRANCHCODE , NULL INV_KEY , (CASE WHEN HOLDINGNATURE IS NULL THEN A.INVID ELSE (A.INVID || ''_'' || UTILS.CONVERT_TO_VARCHAR2(NVL(HOLDINGNATURE, '' ''),10)) END) INVID , A.ISSUERID , ISIN , B.INSTRUMENTTYPEALT_KEY , A.INSTRNAME , A.INVESTMENTNATURE , NULL INTERNALRATING , NULL INRATINGDATE , NULL INRATINGEXPIRYDATE , NULL EXRATING , NULL EXRATINGAGENCY , NULL EXRATINGDATE , NULL EXRATINGEXPIRYDATE , A.SECTOR , C.INDUSTRYALT_KEY , NULL LISTEDSTKEXCHANGE , A.EXPOSURETYPE , A.SECURITYVALUE , A.MATURITYDT , A.RESTRUCTUREDATE , NULL MORTGAGESTATUS , NULL NHBSTATUS , NULL RESIPURPOSE , NULL AUTHORISATIONSTATUS , :B2 EFFECTIVEFROMTIMEKEY , 49999 EFFECTIVETOTIMEKEY , ''SSISUSER'' CREATEDBY , SYSDATE DATECREATED , NULL MODIFIEDBY , NULL DATEMODIFIED , NULL APPROVEDBY , NULL DATEAPPROVED FROM RBL_STGDB.INVBASIC_SOURCESYSTEM_STG A LEFT JOIN RBL_MISDB_PROD.DIMINSTRUMENTTYPE B ON A.INSTRTYPECODE = B.INSTRUMENTTYPESUBGROUP AND B.EFFECTIVEFROMTIMEKEY <= :B1 AND B.EFFECTIVETOTIMEKEY >= :B1 LEFT JOIN RBL_MISDB_PROD.DIMINDUSTRY C ON A.INDUSTRYCODE = C.SRCSYSINDUSTRYCODE AND C.EFFECTIVEFROMTIMEKEY <= :B1 AND C.EFFECTIVETOTIMEKEY >= :B1 LEFT JOIN RBL_STGDB.INVFINANCIAL_SOURCESYSTEM_STG J ON A.INVID = J.INVID JOIN RBL_TEMPDB.TEMPINVESTMENTISSUERDETAIL I ON I.ISSUERID = A.ISSUERID )',86062);
