Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('awvjwur363usk','MERGE INTO RBL_TEMPDB.TEMPINVESTMENTBASICDETAIL TEMP USING (SELECT TEMP.ROWID ROW_ID, ACCT.INVENTITYID FROM RBL_TEMPDB.TEMPINVESTMENTBASICDETAIL TEMP JOIN ( SELECT A.INVID , (:B1 + ROW_NUMBER() OVER ( ORDER BY ( SELECT 1 FROM DUAL ) )) INVENTITYID FROM RBL_TEMPDB.TEMPINVESTMENTBASICDETAIL A WHERE A.INVENTITYID = 0 OR A.INVENTITYID IS NULL ) ACCT ON TEMP.INVID = ACCT.INVID ) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.INVENTITYID = SRC.INVENTITYID',86062);
