Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('g846hrdzup2tv','MERGE INTO RBL_TEMPDB.TEMPINVESTMENTBASICDETAIL TEMP USING (SELECT TEMP.ROWID ROW_ID, A.INVENTITYID FROM RBL_TEMPDB.TEMPINVESTMENTBASICDETAIL TEMP JOIN RBL_STGDB.INVFINANCIAL_SOURCESYSTEM_STG MAIN ON TEMP.INVID = (CASE WHEN ( HOLDINGNATURE IS NULL OR MAIN.INVID LIKE ''%/_%''ESCAPE ''/'' ) THEN MAIN.INVID ELSE (MAIN.INVID || ''_'' || UTILS.CONVERT_TO_VARCHAR2(NVL(HOLDINGNATURE, '' ''),10)) END) JOIN RBL_MISDB_PROD.INVESTMENTBASICDETAIL A ON MAIN.INVID = A.INVID WHERE A.EFFECTIVETOTIMEKEY = 49999 AND TEMP.INVENTITYID IS NULL) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.INVENTITYID = SRC.INVENTITYID',86062);
