Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('27bzaa2cjkums','MERGE INTO RBL_TEMPDB.TEMPADVFACBILLDETAIL TEMP USING (SELECT TEMP.ROWID ROW_ID, ACCT.ENTITYKEY FROM RBL_TEMPDB.TEMPADVFACBILLDETAIL TEMP JOIN ( SELECT "TEMPADVFACBILLDETAIL".ACCOUNTENTITYID , "TEMPADVFACBILLDETAIL".BILLENTITYID , (:B1 + ROW_NUMBER() OVER ( ORDER BY ( SELECT 1 FROM DUAL ) )) ENTITYKEY FROM RBL_TEMPDB.TEMPADVFACBILLDETAIL WHERE "TEMPADVFACBILLDETAIL".ENTITYKEY = 0 OR "TEMPADVFACBILLDETAIL".ENTITYKEY IS NULL ) ACCT ON TEMP.ACCOUNTENTITYID = ACCT.ACCOUNTENTITYID AND ACCT.BILLENTITYID = TEMP.BILLENTITYID WHERE TEMP.ISCHANGED IN ( ''N'',''C'' ) ) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.ENTITYKEY = SRC.ENTITYKEY',79663);
