Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0apkjgpa1pt71','MERGE INTO RBL_MISDB_PROD.ADVFACBILLDETAIL O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVFACBILLDETAIL O JOIN RBL_TEMPDB.TEMPADVFACBILLDETAIL T ON O.ACCOUNTENTITYID = T.ACCOUNTENTITYID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.NPADT, ''1990-01-01'') <> NVL(T.NPADT, ''1990-01-01'') OR NVL(O.OVERDUESINCEDT, ''1990-01-01'') <> NVL(T.OVERDUESINCEDT, ''1990-01-01'') OR NVL(O.OVERDUE, 0) <> NVL(T.OVERDUE, 0) OR NVL(O.BALANCE, 0) <> NVL(T.BALANCE, 0) OR NVL(O.BILLDUEDT, ''1990-01-01'') <> NVL(T.BILLDUEDT, ''1990-01-01'') OR NVL(O.BILLPURDT, ''1990-01-01'') <> NVL(T.BILLPURDT, ''1990-01-01'') OR NVL(O.BILLAMT, 0) <> NVL(T.BILLAMT, 0) OR NVL(O.BILLDT, ''1990-01-01'') <> NVL(T.BILLDT, ''1990-01-01'') OR NVL(O.BILLEXTENDEDDUEDT, ''1990-01-01'') <> NVL(T.BILLEXTENDEDDUEDT, ''1990-01-01'') OR NVL(O.ADVAMOUNT, 0) <> NVL(T.ADVAMOUNT, 0) OR NVL(O.DERECOGNISEDINTEREST2, 0) <> NVL(T.DERECOGNISEDINTEREST2, 0) OR NVL(O.ADJDT, ''1990-01-01'') <> NVL(T.ADJDT, ''1990-01-01'') OR NVL(O.CRYSTALISATIONDT, ''1990-01-01'') <> NVL(T.CRYSTALISATIONDT, ''1990-01-01'') OR NVL(O.OVERDUESINCEDT, ''1990-01-01'') <> NVL(T.OVERDUESINCEDT, ''1990-01-01'') OR NVL(O.BILLREFNO, 0) <> NVL(T.BILLREFNO, 0) OR NVL(O.BILLNO, 0) <> NVL(T.BILLNO, 0) OR NVL(O.LCAMT, 0) <> NVL(T.LCAMT, 0) OR NVL(O.OVERDUE, 0) <> NVL(T.OVERDUE, 0) OR NVL(O.BILLNATUREALT_KEY, 0) <> NVL(T.BILLNATUREALT_KEY, 0) )) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, O.DATEMODIFIED = POS_3, O.MODIFIEDBY = ''SSISUSER''',79663);
