Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('dapr2xvya6ak9','MERGE INTO RBL_MISDB_PROD.REVERSEFEEDCALYPSO O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.REVERSEFEEDCALYPSO O JOIN RBL_TEMPDB.TEMPREVERSEFEEDCALYPSO T ON O.ISSUERID LIKE T.ISSUERID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.BRANCH_CODE, 0) <> NVL(T.BRANCH_CODE, 0) OR NVL(O.UCIC_ID, 0) <> NVL(T.UCIC_ID, 0) OR NVL(O.ISSUERID, 0) NOT LIKE NVL(T.ISSUERID, 0) OR NVL(O.ISSUUERNAME, 0) <> NVL(T.ISSUUERNAME, 0) OR NVL(O.REF_TXN_SYS_CUST_ID, 0) <> NVL(T.REF_TXN_SYS_CUST_ID, 0) OR NVL(O.PAN, 0) <> NVL(T.PAN, 0) OR NVL(O.ISSUER_CATEGORY_CODE, 0) <> NVL(T.ISSUER_CATEGORY_CODE, 0) OR NVL(O.GRPENTITYOFBANK, 0) <> NVL(T.GRPENTITYOFBANK, 0) OR NVL(O.CP_HOLIDAY, 0) <> NVL(T.CP_HOLIDAY, 0) OR NVL(O.CP_EXTERNAL_REF, 0) <> NVL(T.CP_EXTERNAL_REF, 0) OR NVL(O.CP_FINANCIAL, 0) <> NVL(T.CP_FINANCIAL, 0) OR NVL(O.CP_PARENT, 0) <> NVL(T.CP_PARENT, 0) OR NVL(O.CP_COMMENT, 0) <> NVL(T.CP_COMMENT, 0) OR NVL(O.CP_STATUS, 0) <> NVL(T.CP_STATUS, 0) OR NVL(O.COUNTERPARTY_SHORTNAME, 0) <> NVL(T.COUNTERPARTY_SHORTNAME, 0) OR NVL(O.COUNTERPARTY_FULLNAME, 0) <> NVL(T.COUNTERPARTY_FULLNAME, 0) OR NVL(O.COUNTERPARTY_ROLE1, 0) <> NVL(T.COUNTERPARTY_ROLE1, 0) OR NVL(O.COUNTERPARTY_COUNTRY, 0) <> NVL(T.COUNTERPARTY_COUNTRY, 0) OR NVL(O.COUNTERPARTY_ROLE2, 0) <> NVL(T.COUNTERPARTY_ROLE2, 0) OR NVL(O.COUNTERPARTY_ROLE3, 0) <> NVL(T.COUNTERPARTY_ROLE3, 0) OR NVL(O.COUNTERPARTY_ROLE4, 0) <> NVL(T.COUNTERPARTY_ROLE4, 0) OR NVL(O.COUNTERPARTY_ROLE5, 0) <> NVL(T.COUNTERPARTY_ROLE5, 0) OR NVL(O.CIF_ID, 0) <> NVL(T.CIF_ID, 0) OR NVL(O.ENPA_ASSET_CODE, 0) <> NVL(T.ENPA_ASSET_CODE, 0) OR NVL(O.ENPA_DESCRIPTION, 0) <> NVL(T.ENPA_DESCRIPTION, 0) OR NVL(O.ENPA_ASSET_CODE_DATE, 0) <> NVL(T.ENPA_ASSET_CODE_DATE, 0) OR NVL(O.ENPA_D2K_NPA_DATE, 0) <> NVL(T.ENPA_D2K_NPA_DATE, 0) )) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, O.DATEMODIFIED = POS_3, O.MODIFIEDBY = ''SSISUSER''',82681);
