Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fvucdy6515y6d','MERGE INTO RBL_MISDB_PROD.ADVFACCCDETAIL O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVFACCCDETAIL O JOIN RBL_TEMPDB.TEMPADVFACCCDETAIL T ON O.ACCOUNTENTITYID = T.ACCOUNTENTITYID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.ADHOCDT, ''1900-01-01'') <> NVL(T.ADHOCDT, ''1900-01-01'') OR NVL(O.ADHOCAMT, 0) <> NVL(T.ADHOCAMT, 0) OR NVL(O.CONTEXCSSINCEDT, ''1900-01-01'') <> NVL(T.CONTEXCSSINCEDT, ''1900-01-01'') OR NVL(O.DERECOGNISEDINTEREST1, 0) <> NVL(T.DERECOGNISEDINTEREST1, 0) OR NVL(O.DERECOGNISEDINTEREST2, 0) <> NVL(T.DERECOGNISEDINTEREST2, 0) OR NVL(O.CLAIMTYPE, ''AA'') <> NVL(T.CLAIMTYPE, ''AA'') OR NVL(O.CLAIMCOVERAMT, 0) <> NVL(T.CLAIMCOVERAMT, 0) OR NVL(O.CLAIMLODGEDDT, ''1900-01-01'') <> NVL(T.CLAIMLODGEDDT, ''1900-01-01'') OR NVL(O.CLAIMLODGEDAMT, 0) <> NVL(T.CLAIMLODGEDAMT, 0) OR NVL(O.CLAIMRECVDT, ''1900-01-01'') <> NVL(T.CLAIMRECVDT, ''1900-01-01'') OR NVL(O.CLAIMRECEIVEDAMT, 0) <> NVL(T.CLAIMRECEIVEDAMT, 0) OR NVL(O.CLAIMRATE, 0) <> NVL(T.CLAIMRATE, 0) OR NVL(O.REFSYSTEMACID, 0) <> NVL(T.REFSYSTEMACID, 0) OR NVL(O.STOCKSTMTDT, ''1900-01-01'') <> NVL(T.STOCKSTMTDT, ''1900-01-01'') )) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, O.DATEMODIFIED = POS_3, O.MODIFIEDBY = ''SSISUSER''',79666);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('9ca5s2pgu1ruq','MERGE INTO RBL_TEMPDB.TEMPCUSTOMERBASICDETAIL TEMP USING (SELECT TEMP.ROWID ROW_ID, ACCT.CUSTOMER_KEY FROM RBL_TEMPDB.TEMPCUSTOMERBASICDETAIL TEMP JOIN ( SELECT "TEMPCUSTOMERBASICDETAIL".CUSTOMERID , (:B1 + ROW_NUMBER() OVER ( ORDER BY ( SELECT 1 FROM DUAL ) )) CUSTOMER_KEY FROM RBL_TEMPDB.TEMPCUSTOMERBASICDETAIL WHERE "TEMPCUSTOMERBASICDETAIL".CUSTOMER_KEY = 0 OR "TEMPCUSTOMERBASICDETAIL".CUSTOMER_KEY IS NULL ) ACCT ON TEMP.CUSTOMERID = ACCT.CUSTOMERID WHERE TEMP.ISCHANGED IN ( ''N'',''C'' ) ) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.CUSTOMER_KEY = SRC.CUSTOMER_KEY',80413);
