Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('903gq2fzp3dfq','MERGE INTO RBL_MISDB_PROD.CUSTOMERBASICDETAIL AA USING (SELECT AA.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.CUSTOMERBASICDETAIL AA WHERE AA.EFFECTIVETOTIMEKEY = 49999 AND NOT EXISTS ( SELECT 1 FROM RBL_TEMPDB.TEMPCUSTOMERBASICDETAIL BB WHERE AA.CUSTOMERENTITYID = BB.CUSTOMERENTITYID AND BB.EFFECTIVETOTIMEKEY = 49999 )) SRC ON ( AA.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, DATEMODIFIED = POS_3, MODIFIEDBY = ''SSISUSER''',80413);
