Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0u5uturdjdzux','MERGE INTO RBL_MISDB_PROD.ADVFACCREDITCARDDETAIL O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVFACCREDITCARDDETAIL O JOIN RBL_TEMPDB.TEMPADVFACCREDITCARDDETAIL T ON O.ACCOUNTENTITYID = T.ACCOUNTENTITYID AND O.CREDITCARDENTITYID = T.CREDITCARDENTITYID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.CORPORATEUCIC_ID, '' '') <> NVL(T.CORPORATEUCIC_ID, '' '') OR NVL(O.CORPORATECUSTOMERID, '' '') <> NVL(T.CORPORATECUSTOMERID, '' '') OR NVL(O.LIABILITY, 0) <> NVL(T.LIABILITY, 0) OR NVL(O.MINIMUMAMOUNTDUE, 0) <> NVL(T.MINIMUMAMOUNTDUE, 0) OR NVL(O.CD, 0) <> NVL(T.CD, 0) OR NVL(O.BUCKET, 0) <> NVL(T.BUCKET, 0) OR NVL(O.DPD, 0) <> NVL(T.DPD, 0) OR NVL(O.REFSYSTEMACID, '' '') <> NVL(T.REFSYSTEMACID, '' '') OR NVL(O.ACCOUNTSTATUS, '' '') <> NVL(T.ACCOUNTSTATUS, '' '') OR NVL(O.ACCOUNTBLKCODE2, '' '') <> NVL(T.ACCOUNTBLKCODE2, '' '') OR NVL(O.ACCOUNTBLKCODE1, '' '') <> NVL(T.ACCOUNTBLKCODE1, '' '') OR NVL(O.CHARGEOFFY_N, '' '') <> NVL(T.CHARGEOFFY_N, '' '') )) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, O.DATEMODIFIED = POS_3, O.MODIFIEDBY = ''SSISUSER''',79668);
