Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('9wrptx1sjjnp6','MERGE INTO RBL_MISDB_PROD.ADVCUSTCOMMUNICATIONDETAIL AA USING (SELECT AA.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVCUSTCOMMUNICATIONDETAIL AA WHERE AA.EFFECTIVETOTIMEKEY = 49999 AND NOT EXISTS ( SELECT 1 FROM RBL_TEMPDB.TEMPADVCUSTCOMMUNICATIONDETAIL BB WHERE AA.CUSTOMERENTITYID = BB.CUSTOMERENTITYID AND BB.EFFECTIVETOTIMEKEY = 49999 )) SRC ON ( AA.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, DATEMODIFIED = POS_3, MODIFIEDBY = ''SSISUSER''',79655);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('2ydvmq9mnk7h4','MERGE INTO RBL_MISDB_PROD.ADVFACDLDETAIL O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVFACDLDETAIL O JOIN RBL_TEMPDB.TEMPADVFACDLDETAIL T ON O.ACCOUNTENTITYID = T.ACCOUNTENTITYID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.PRINCIPAL, 0) <> NVL(T.PRINCIPAL, 0) OR NVL(O.REPAYMODEALT_KEY, 0) <> NVL(T.REPAYMODEALT_KEY, 0) OR NVL(O.NOOFINSTALL, 0) <> NVL(T.NOOFINSTALL, 0) OR NVL(O.INSTALLAMT, 0) <> NVL(T.INSTALLAMT, 0) OR NVL(O.FSTINSTALLDT, ''1900-01-01'') <> NVL(T.FSTINSTALLDT, ''1900-01-01'') OR NVL(O.LASTINSTALLDT, ''1900-01-01'') <> NVL(T.LASTINSTALLDT, ''1900-01-01'') OR NVL(O.TENURE_MONTHS, 0) <> NVL(T.TENURE_MONTHS, 0) OR NVL(O.MARGINAMT, 0) <> NVL(T.MARGINAMT, 0) OR NVL(O.COMMODITYALT_KEY, 0) <> NVL(T.COMMODITYALT_KEY, 0) OR NVL(O.REPHASEALT_KEY, 0) <> NVL(T.REPHASEALT_KEY, 0) OR NVL(O.REPHASEDT, ''1900-01-01'') <> NVL(T.REPHASEDT, ''1900-01-01'') OR NVL(O.INTSERVICED, 0) <> NVL(T.INTSERVICED, 0) OR NVL(O.SUSPENDEDINTEREST, 0) <> NVL(T.SUSPENDEDINTEREST, 0) OR NVL(O.DERECOGNISEDINTEREST1, 0) <> NVL(T.DERECOGNISEDINTEREST1, 0) OR NVL(O.DERECOGNISEDINTEREST2, 0) <> NVL(T.DERECOGNISEDINTEREST2, 0) OR NVL(O.ADJREASONALT_KEY, 0) <> NVL(T.ADJREASONALT_KEY, 0) OR NVL(O.LCNO, ''AA'') <> NVL(T.LCNO, ''AA'') OR NVL(O.LCAMT, 0) <> NVL(T.LCAMT, 0) OR NVL(O.LCISSUINGBANKALT_KEY, 0) <> NVL(T.LCISSUINGBANKALT_KEY, 0) OR NVL(O.RESETFREQUENCY, 0) <> NVL(T.RESETFREQUENCY, 0) OR NVL(O.RESETDT, ''1900-01-01'') <> NVL(T.RESETDT, ''1900-01-01'') OR NVL(O.MORATORIUM, 0) <> NVL(T.MORATORIUM, 0) OR NVL(O.FIRSTINSTALLDTINT, ''1900-01-01'') <> NVL(T.FIRSTINSTALLDTINT, ''1900-01-01'') OR NVL(O.CONTEXCSSINCEDT, ''1900-01-01'') <> NVL(T.CONTEXCSSINCEDT, ''1900-01-01'') OR NVL(O.LOANPERIOD, 0) <> NVL(T.LOANPERIOD, 0) OR NVL(O.CLAIMTYPE, ''AA'') <> NVL(T.CLAIMTYPE, ''AA'') OR NVL(O.CLAIMCOVERAM