Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cg3kb298kp32q','MERGE INTO RBL_MISDB_PROD.ADVCUSTCOMMUNICATIONDETAIL O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVCUSTCOMMUNICATIONDETAIL O JOIN RBL_TEMPDB.TEMPADVCUSTCOMMUNICATIONDETAIL T ON O.CUSTOMERENTITYID = T.CUSTOMERENTITYID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.CUSTOMERENTITYID, 0) <> NVL(T.CUSTOMERENTITYID, 0) OR NVL(O.RELATIONENTITYID, 0) <> NVL(T.RELATIONENTITYID, 0) OR NVL(O.RELATIONADDENTITYID, 0) <> NVL(T.RELATIONADDENTITYID, 0) OR NVL(O.ADDRESSCATEGORYALT_KEY, 0) <> NVL(T.ADDRESSCATEGORYALT_KEY, 0) OR NVL(O.ADDRESSTYPEALT_KEY, 0) <> NVL(T.ADDRESSTYPEALT_KEY, 0) OR NVL(O.ADD1, 0) <> NVL(T.ADD1, 0) OR NVL(O.ADD3, 0) <> NVL(T.ADD3, 0) OR NVL(O.ADD2, 0) <> NVL(T.ADD2, 0) OR NVL(O.COUNTRYALT_KEY, 0) <> NVL(T.COUNTRYALT_KEY, 0) OR NVL(O.DISTRICTALT_KEY, 0) <> NVL(T.DISTRICTALT_KEY, 0) OR NVL(O.CITYALT_KEY, 0) <> NVL(T.CITYALT_KEY, 0) OR NVL(O.PINCODE, 0) <> NVL(T.PINCODE, 0) OR NVL(O.CUSTLOCATIONCODE, 0) <> NVL(T.CUSTLOCATIONCODE, 0) OR NVL(O.STD_CODE_RES, 0) <> NVL(T.STD_CODE_RES, 0) OR NVL(O.PHONENO_RES, 0) <> NVL(T.PHONENO_RES, 0) OR NVL(O.STD_CODE_OFF, 0) <> NVL(T.STD_CODE_OFF, 0) OR NVL(O.PHONENO_OFF, 0) <> NVL(T.PHONENO_OFF, 0) OR NVL(O.FAXNO, 0) <> NVL(T.FAXNO, 0) OR NVL(O.EXTENSIONNO, 0) <> NVL(T.EXTENSIONNO, 0) OR NVL(O.SCRCRERROR, 0) <> NVL(T.SCRCRERROR, 0) OR NVL(O.REFCUSTOMERID, 0) <> NVL(T.REFCUSTOMERID, 0) OR NVL(O.ISMAINADDRESS, 0) <> NVL(T.ISMAINADDRESS, 0) OR NVL(O.DUNSNO, 0) <> NVL(T.DUNSNO, 0) OR NVL(O.CIBILPGID, 0) <> NVL(T.CIBILPGID, 0) OR NVL(O.CITYNAME, 0) <> NVL(T.CITYNAME, 0) OR NVL(O.SCRCRERRORSEQ, 0) <> NVL(T.SCRCRERRORSEQ, 0) )) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, O.DATEMODIFIED = POS_3, O.MODIFIEDBY = ''SSISUSER''',79655);
