Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('281txv7uz61br','MERGE INTO RBL_TEMPDB.TEMPADVFACPCDETAIL TEMP USING (SELECT TEMP.ROWID ROW_ID, ACCT.ENTITYKEY FROM RBL_TEMPDB.TEMPADVFACPCDETAIL TEMP JOIN ( SELECT "TEMPADVFACPCDETAIL".ACCOUNTENTITYID , "TEMPADVFACPCDETAIL".PCREFNO , (:B1 + ROW_NUMBER() OVER ( ORDER BY ( SELECT 1 FROM DUAL ) )) ENTITYKEY FROM RBL_TEMPDB.TEMPADVFACPCDETAIL WHERE "TEMPADVFACPCDETAIL".ENTITYKEY = 0 OR "TEMPADVFACPCDETAIL".ENTITYKEY IS NULL ) ACCT ON TEMP.ACCOUNTENTITYID = ACCT.ACCOUNTENTITYID AND ACCT.PCREFNO = TEMP.PCREFNO WHERE TEMP.ISCHANGED IN ( ''N'',''C'' ) ) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.ENTITYKEY = SRC.ENTITYKEY',79674);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8pp5x7kpkz9ff','MERGE INTO RBL_MISDB_PROD.ADVFACPCDETAIL O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVFACPCDETAIL O JOIN RBL_TEMPDB.TEMPADVFACPCDETAIL T ON O.ACCOUNTENTITYID = T.ACCOUNTENTITYID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.PCADVDT, ''1990-01-01'') <> NVL(T.PCADVDT, ''1990-01-01'') OR NVL(O.PCAMT, 0) <> NVL(T.PCAMT, 0) OR NVL(O.PCDUEDT, ''1990-01-01'') <> NVL(T.PCDUEDT, ''1990-01-01'') OR NVL(O.PCDURATIONDAYS, 0) <> NVL(T.PCDURATIONDAYS, 0) OR NVL(O.PCEXTENDEDDUEDT, ''1990-01-01'') <> NVL(T.PCEXTENDEDDUEDT, ''1990-01-01'') OR NVL(O.EXTENSIONREASON, 0) <> NVL(T.EXTENSIONREASON, 0) OR NVL(O.CURRENCYALT_KEY, 0) <> NVL(T.CURRENCYALT_KEY, 0) OR NVL(O.LCNO, 0) <> NVL(T.LCNO, 0) OR NVL(O.LCAMT, 0) <> NVL(T.LCAMT, 0) OR NVL(O.LCISSUEDT, ''1990-01-01'') <> NVL(T.LCISSUEDT, ''1990-01-01'') OR NVL(O.LCISSUINGBANK_FIRMORDER, 0) <> NVL(T.LCISSUINGBANK_FIRMORDER, 0) OR NVL(O.BALANCE, 0) <> NVL(T.BALANCE, 0) OR NVL(O.BALANCEINCURRENCY, 0) <> NVL(T.BALANCEINCURRENCY, 0) OR NVL(O.BALANCEINUSD, 0) <> NVL(T.BALANCEINUSD, 0) OR NVL(O.OVERDUE, 0) <> NVL(T.OVERDUE, 0) OR NVL(O.COMMODITYALT_KEY, 0) <> NVL(T.COMMODITYALT_KEY, 0) OR NVL(O.COMMODITYVALUE, 0) <> NVL(T.COMMODITYVALUE, 0) OR NVL(O.COMMODITYMARKETVALUE, 0) <> NVL(T.COMMODITYMARKETVALUE, 0) OR NVL(O.SHIPMENTDT, ''1990-01-01'') <> NVL(T.SHIPMENTDT, ''1990-01-01'') OR NVL(O.COMMERCIALISATIONDT, ''1990-01-01'') <> NVL(T.COMMERCIALISATIONDT, ''1990-01-01'') OR NVL(O.ECGCPOLICYNO, 0) <> NVL(T.ECGCPOLICYNO, 0) OR NVL(O.CAD, 0) <> NVL(T.CAD, 0) OR NVL(O.CADU, 0) <> NVL(T.CADU, 0) OR NVL(O.OVERDUESINCEDT, ''1990-01-01'') <> NVL(T.OVERDUESINCEDT, ''1990-01-01'') OR NVL(O.TOTALPROV, 0) <> NVL(T.TOTALPROV, 0) OR NVL(O.SECURED, 0) <> NVL(T.SECURED, 0) OR NVL(O.UNSECURED, 0) <> NVL(T.UNSECURED, 0) OR NVL(O.PROVSECURED, 0) <> NVL(T.PROVSECURED, 0) OR NVL(O.PROVUNSECURED, 0) <> NVL(T.PROVUNSECURED, 0) OR NVL(O.PROVDICGC, 0) <> NVL(T.PROVDICGC, 0) OR NVL(O.NPADT, ''1990-01-01'') <> NVL(T.NPADT, ''1990-01-01'') OR NVL(O.COVERGOVGUR, 0) <> NVL(T.COVERGOVGUR, 0) OR NVL(O.DERECOGNISEDINTEREST1, 0) <> NVL(T.DERECOGNISEDINTEREST1, 0) OR NVL(O.DERECOGNISEDINTEREST2, 0) <> NVL(T.DERECOGNISEDINTEREST2, 0) OR NVL(O.CLAIMTYPE, ''AA'') <> NVL(T.CLAIMTYPE, ''AA'') OR NVL(O.CLAIMCOVERAMT, 0) <> NVL(T.CLAIMCOVERAMT, 0) OR NVL(O.CLAIMLODGEDDT, ''1990-01-01'') <> NVL(T.CLAIMLODGEDDT, ''1990-01-01'') OR NVL(O.CLAIMLODGEDAMT, 0) <> NVL(T.CLAIMLODGEDAMT, 0) OR NVL(O.CLAIMRECVDT, ''1990-01-01'') <> NVL(T.CLAIMRECVDT, ''1990-01-01'') OR NVL(O.CLAIMRECEIVEDAMT, 0) <> NVL(T.CLAIMRECEIVEDAMT, 0) OR NVL(O.CLAIMRATE, 0) <> NVL(T.CLAIMRATE, 0) OR NVL(O.ADJDT, ''1990-01-01'') <> NVL(T.ADJDT, ''1990-01-01'') OR NVL(O.ENTITYCLOSUREDATE, ''1990-01-01'') <> NVL(T.ENTITYCLOSUREDATE, ''1990-01-01'') OR NVL(O.ENTITYCLOSUREREASONALT_KEY, 0) <> NVL(T.ENTITYCLOSUREREASONALT_KEY, 0) )) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, O.DATEMODIFIED = POS_3, O.MODIFIEDBY = ''SSISUSER''',79674);
