Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5usvd6k16h41u','MERGE INTO RBL_MISDB_PROD.INVESTMENTBASICDETAIL O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.INVESTMENTBASICDETAIL O JOIN RBL_TEMPDB.TEMPINVESTMENTBASICDETAIL T ON O.INVENTITYID = T.INVENTITYID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.BRANCHCODE, 0) <> NVL(T.BRANCHCODE, 0) OR NVL(O.INVID, 0) <> NVL(T.INVID, 0) OR NVL(O.ISSUERENTITYID, 0) <> NVL(T.INVENTITYID, 0) OR NVL(O.ISIN, 0) <> NVL(T.ISIN, 0) OR NVL(O.INSTRTYPEALT_KEY, 0) <> NVL(T.INSTRTYPEALT_KEY, 0) OR NVL(O.INSTRNAME, 0) <> NVL(T.INSTRNAME, 0) OR NVL(O.INVESTMENTNATURE, 0) <> NVL(T.INVESTMENTNATURE, 0) OR NVL(O.INTERNALRATING, 0) <> NVL(T.INTERNALRATING, 0) OR NVL(O.INRATINGDATE, ''1990-01-01'') <> NVL(T.INRATINGDATE, ''1990-01-01'') OR NVL(O.INRATINGEXPIRYDATE, ''1990-01-01'') <> NVL(T.INRATINGEXPIRYDATE, ''1990-01-01'') OR NVL(O.EXRATING, 0) <> NVL(T.EXRATING, 0) OR NVL(O.EXRATINGAGENCY, 0) <> NVL(T.EXRATINGAGENCY, 0) OR NVL(O.EXRATINGDATE, ''1990-01-01'') <> NVL(T.EXRATINGDATE, ''1990-01-01'') OR NVL(O.EXRATINGEXPIRYDATE, ''1990-01-01'') <> NVL(T.EXRATINGEXPIRYDATE, ''1990-01-01'') OR NVL(O.SECTOR, 0) <> NVL(T.SECTOR, 0) OR NVL(O.INDUSTRY_ALTKEY, 0) <> NVL(T.INDUSTRY_ALTKEY, 0) OR NVL(O.LISTEDSTKEXCHANGE, 0) <> NVL(T.LISTEDSTKEXCHANGE, 0) OR NVL(O.EXPOSURETYPE, 0) <> NVL(T.EXPOSURETYPE, 0) OR NVL(O.SECURITYVALUE, 0) <> NVL(T.SECURITYVALUE, 0) OR NVL(O.MATURITYDT, ''1990-01-01'') <> NVL(T.MATURITYDT, ''1990-01-01'') OR NVL(O.RESTRUCTUREDATE, ''1990-01-01'') <> NVL(T.RESTRUCTUREDATE, ''1990-01-01'') OR NVL(O.MORTGAGESTATUS, 0) <> NVL(T.MORTGAGESTATUS, 0) OR NVL(O.NHBSTATUS, 0) <> NVL(T.NHBSTATUS, 0) OR NVL(O.RESIPURPOSE, 0) <> NVL(T.RESIPURPOSE, 0) )) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, O.DATEMODIFIED = POS_3, O.MODIFIEDBY = ''SSISUSER''',81595);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('f77vk9mfm6j5t','INSERT INTO RBL_STGDB.EXCEPTIONFINALSTATUSTYPE_ALLDATA ( DATEOFDATA, HOSTSYSTEM, CUSTOMERACID, CUSTOMERID, UCIC, FLAG, AMOUNT, STATUSDATE, STATUSTYPE ) ( SELECT * FROM ( SELECT TO_DATE(REPORTDATA,''YYYY-MM-DD'') DATE_ , ''Finacle'' HOSTSYSTEM , CUSTOMERACID , CUSTOMERID , NULL UCIC , NULL FLAG , SUM(WRITEOFFAMOUNT) AMOUNT , MIN(UTILS.CONVERT_TO_VARCHAR2(WRITEOFFDATE,200)) STATUSDATE , ''WO'' STATUSTYPE FROM DWH_RBL_MISDB_PROD.WRITEOFFDATA_SCF GROUP BY CUSTOMERACID,TO_DATE(REPORTDATA,''YYYY-MM-DD''),HOSTSYSTEM,CUSTOMERID UNION ALL SELECT TO_DATE(REPORTDATA,''YYYY-MM-DD'') DATE_ , HOSTSYSTEM , CUSTOMERACID , CUSTOMERID , UCIC , WRITEOFFFLAG , WRITEOFFAMOUNT AMOUNT , UTILS.CONVERT_TO_VARCHAR2(WRITEOFFDATE,200) STATUSDATE , ''WO'' STATUSTYPE FROM DWH_RBL_MISDB_PROD.WRITEOFFDATA UNION ALL SELECT TO_DATE(DATEOFDATA,''YYYY-MM-DD'') DATE_ , SOURCESYSTEM , CUSTOMERACID , CUSTOMERID , UCIC_ID , SETTLEMENT_FLAG , 0 AMOUNT , UTILS.CONVERT_TO_VARCHAR2(SETTLEMENT_DATE,200) STATUSDATE , ''Settlement'' STATUSTYPE FROM RBL_STGDB.ACCOUNT_ALL_SOURCE_SYSTEM WHERE ( SETTLEMENT_DATE IS NOT NULL OR SETTLEMENT_FLAG = ''Y'' ) UNION ALL SELECT DATE_OF_DATA , ''SCF'' HOSTSYSTEM , REFSYSTEMACID , NULL REFSYSTEMACID_CIF_ID , NULL REFSYSTEMACID_UCIC , SETTLEMENT_FLAG , 0 AMOUNT , MIN(UTILS.CONVERT_TO_VARCHAR2(SETTLEMENT_DATE,200)) STATUSDATE , ''Settlement'' STATUSTYPE FROM DWH_RBL_MISDB_PROD.BILLS_DATA_STG_SCF WHERE ( SETTLEMENT_DATE IS NOT NULL OR SETTLEMENT_FLAG = ''Y'' ) GROUP BY REFSYSTEMACID,DATE_OF_DATA,SETTLEMENT_FLAG UNION ALL SELECT TO_DATE(DATE_OF_DATA,''YYYY-MM-DD'') , ''VisionPlus'' HOSTSYSTEM , TO_CHAR(CUSTOMER_AC_ID) REFSYSTEMACID , TO_CHAR(CUSTOMER_ID) CUSTOMERID , TO_CHAR(UCIC) , TO_CHAR(CHARGE_OFF_FLAG) , TO_NUMBER(CHARGE_OFF_AMOUNT) AMOUNT , UTILS.CONVERT_TO_VARCHAR2(CHARGE_OFF_DATE,200) STATUSDATE , ''Charge Off'' STATUSTYPE FROM RBL_STGDB.ACCOUNT_DATA_VISIONPLUS WHERE ( CHARGE_OFF_DATE IS NOT NULL OR CHARGE_OFF_FLAG = ''Y'' ) UNION ALL SELECT DATE_OF_DATA , ''Finacle'' HOSTSYSTEM , CUSTOMER_AC_ID REFSYSTEMACID , CUSTOMER_ID CUSTOMERID , UCIC , CHARGE_OFF_FLAG , NULL AMOUNT , TO_CHAR(CHARGE_OFF_DATE) STATUSDATE , ''Charge Off'' STATUSTYPE FROM DWH_STG.ACCOUNT_DATA_FINACLE WHERE ( CHARGE_OFF_DATE IS NOT NULL OR CHARGE_OFF_FLAG = ''Y'' ) AND BALANCE_OUTSTANDING_INR > 0 UNION ALL SELECT DATE_OF_DATA , SOURCE_SYSTEM_NAME , ISSUERID REFSYSTEMACID , NULL CUSTOMERID , UCIC_ID , SETTLEMENT_FLAG , NULL AMOUNT , UTILS.CONVERT_TO_VARCHAR2(SETTLEMENT_DATE,200) STATUSDATE , ''Settlement'' STATUSTYPE FROM DWH_RBL_MISDB_PROD.INVESTMENTISSUERDETAIL WHERE ( SETTLEMENT_DATE IS NOT NULL OR SETTLEMENT_FLAG = ''Y'' ) ) A )',86132);
