Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('a0x94rznwwwsk','MERGE INTO RBL_TEMPDB.TEMPINVESTMENTBASICDETAIL TEMP USING (SELECT TEMP.ROWID ROW_ID, ACCT.ENTITYKEY FROM RBL_TEMPDB.TEMPINVESTMENTBASICDETAIL TEMP JOIN ( SELECT "TEMPINVESTMENTBASICDETAIL".INVENTITYID , (:B1 + ROW_NUMBER() OVER ( ORDER BY ( SELECT 1 FROM DUAL ) )) ENTITYKEY FROM RBL_TEMPDB.TEMPINVESTMENTBASICDETAIL WHERE "TEMPINVESTMENTBASICDETAIL".ENTITYKEY = 0 OR "TEMPINVESTMENTBASICDETAIL".ENTITYKEY IS NULL ) ACCT ON TEMP.INVENTITYID = ACCT.INVENTITYID WHERE TEMP.ISCHANGED IN ( ''N'',''C'' ) ) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.ENTITYKEY = SRC.ENTITYKEY',81595);
