Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('1d6swf4jkrdgn','INSERT INTO GTT_TEMPWER12_2 ( SELECT * FROM ( SELECT DISTINCT A.CUSTOMERID , A.CUSTOMERACID , A.SCHEME_PRODUCTCODE , A.BALANCEOUTSTANDINGINR , A.POSBALANCE , CASE WHEN A.COLLATERALID IS NULL THEN B.COLLATERALID ELSE A.COLLATERALID END COLLATERALID , CASE WHEN A.SECURITYCODE IS NULL THEN B.SECURITYCODE ELSE A.SECURITYCODE END SECURITYCODE , CASE WHEN A.SECURITYVALUE IS NULL THEN B.SECURITYVALUE ELSE A.SECURITYVALUE END SECURITYVALUE , CASE WHEN A.VALUATIONEXPIRYDATE IS NULL THEN B.VALUATIONEXPIRYDATE ELSE A.VALUATIONEXPIRYDATE END VALUATIONEXPIRYDATE , CASE WHEN A.COLLATERAL_TYPE IS NULL THEN B.COLLATERAL_TYPE ELSE A.COLLATERAL_TYPE END COLLATERAL_TYPE , CASE WHEN A.APPORTIONED_VALUE IS NULL THEN B.SECURITY ELSE A.APPORTIONED_VALUE END APPORTIONED_VALUE , CASE WHEN A.VALUATIONDATE IS NULL THEN B.VALUATIONDATE ELSE A.VALUATIONDATE END VALUATIONDATE , A.SEC_PERF_FLG , NVL(B.TYPE_OF_CURRENCY, A.TYPE_OF_CURRENCY) CURRENCY_CODE FROM GTT_TEMP456_2 A LEFT JOIN GTT_TEMP123_2 B ON A.CUSTOMERID = B.CUSTOMER_ID AND A.CUSTOMERACID = B.CUSTOMERACID WHERE ( A.COLLATERALID IS NULL OR B.COLLATERALID IS NULL ) UNION SELECT A.CUSTOMERID , A.CUSTOMERACID , A.SCHEME_PRODUCTCODE , A.BALANCEOUTSTANDINGINR , A.POSBALANCE , A.COLLATERALID , A.SECURITYCODE , A.SECURITYVALUE , A.VALUATIONEXPIRYDATE , A.COLLATERAL_TYPE , A.APPORTIONED_VALUE , A.VALUATIONDATE , A.SEC_PERF_FLG , NVL(B.TYPE_OF_CURRENCY, A.TYPE_OF_CURRENCY) CURRENCY_CODE FROM GTT_TEMP456_2 A LEFT JOIN GTT_TEMP123_2 B ON A.CUSTOMERID = B.CUSTOMER_ID AND A.CUSTOMERACID = B.CUSTOMERACID WHERE A.COLLATERALID IS NOT NULL AND B.COLLATERALID IS NOT NULL UNION SELECT A.CUSTOMERID , A.CUSTOMERACID , A.SCHEME_PRODUCTCODE , A.BALANCEOUTSTANDINGINR , A.POSBALANCE , B.COLLATERALID , B.SECURITYCODE , B.SECURITYVALUE , B.VALUATIONEXPIRYDATE , B.COLLATERAL_TYPE , B.SECURITY , B.VALUATIONDATE , A.SEC_PERF_FLG , NVL(B.TYPE_OF_CURRENCY, A.TYPE_OF_CURRENCY) CURRENCY_CODE FROM GTT_TEMP456_2 A LEFT JOIN GTT_TEMP123_2 B ON A.CUSTOMERID = B.CUSTOMER_ID AND A.CUSTOMERACID = B.CUSTOMERACID WHERE A.COLLATERALID IS NOT NULL AND B.COLLATERALID IS NOT NULL ) A )',86116);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('4frp0c33hhk9n','INSERT INTO RBL_STGDB.SECURITY_ALL_SOURCE_SYSTEM ( DATEOFDATA, SOURCESYSTEM, ACCOUNTID, COLLATERALID, SECURITYCODE, SECURITYVALUE, VALUATIONDATE, SECURITYCHARGESTATUS, VALUATIONEXPIRYDATE, CUSTOMERID, CARATVALUE, GOLDWEIGHTNETGMS, SECURITY_ID, CHARGE_TYPE_CODE, VALUATION_SOURCE, COLLATERAL_TYPE ) ( SELECT A.DATEOFDATA , SOURCESYSTEM , ACCOUNTID , NULL COLLATERALID , NULL SECURITYCODE , (GOLDWEIGHTNETGMS * RATE) SECURITYVALUE , NULL VALUATIONDATE , NULL SECURITYCHARGESTATUS , NULL VALUATIONEXPIRYDATE , CUSTOMERID , CARATVALUE , GOLDWEIGHTNETGMS , NULL SECURITY_ID , NULL CHARGE_TYPE_CODE , NULL VALUATION_SOURCE , NULL COLLATERAL_TYPE FROM RBL_STGDB.SECURITY_SOURCESYSTEM04_STG A JOIN RBL_STGDB.MIFINGOLDMASTER B ON A.CARATVALUE = B.CARATMARKET )',86116);
