Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('fkgsk551hscu6','MERGE INTO RBL_MISDB_PROD.ADVCUSTNPADETAIL AA USING (SELECT AA.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVCUSTNPADETAIL AA WHERE AA.EFFECTIVETOTIMEKEY = 49999 AND NOT EXISTS ( SELECT 1 FROM RBL_TEMPDB.TEMPADVCUSTNPADETAIL BB WHERE AA.CUSTOMERENTITYID = BB.CUSTOMERENTITYID AND BB.EFFECTIVETOTIMEKEY = 49999 )) SRC ON ( AA.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, DATEMODIFIED = POS_3, MODIFIEDBY = ''SSISUSER''',79657);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5f57svv41wask','MERGE INTO RBL_MISDB_PROD.ADVCUSTNPADETAIL O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVCUSTNPADETAIL O JOIN RBL_TEMPDB.TEMPADVCUSTNPADETAIL T ON O.CUSTOMERENTITYID = T.CUSTOMERENTITYID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.CUST_ASSETCLASSALT_KEY, 0) <> NVL(T.CUST_ASSETCLASSALT_KEY, 0) OR NVL(O.NPADT, ''1990-01-01'') <> NVL(T.NPADT, ''1990-01-01'') OR NVL(O.LASTINTTCHARGEDDT, ''1990-01-01'') <> NVL(T.LASTINTTCHARGEDDT, ''1990-01-01'') OR NVL(O.LOSDT, ''1990-01-01'') <> NVL(T.LOSDT, ''1990-01-01'') OR NVL(O.DBTDT, ''1990-01-01'') <> NVL(T.DBTDT, ''1990-01-01'') OR NVL(O.DEFAULTREASON1ALT_KEY, 0) <> NVL(T.DEFAULTREASON1ALT_KEY, 0) OR NVL(O.DEFAULTREASON2ALT_KEY, 0) <> NVL(T.DEFAULTREASON2ALT_KEY, 0) OR NVL(O.STAFFACCOUNTABILITY, 0) <> NVL(T.STAFFACCOUNTABILITY, 0) OR NVL(O.LASTINTBOOKED, ''1990-01-01'') <> NVL(T.LASTINTBOOKED, ''1990-01-01'') OR NVL(O.REFCUSTOMERID, 0) <> NVL(T.REFCUSTOMERID, 0) OR NVL(O.MOCSTATUS, 0) <> NVL(T.MOCSTATUS, 0) OR NVL(O.MOCDATE, ''1990-01-01'') <> NVL(T.MOCDATE, ''1990-01-01'') OR NVL(O.MOCTYPEALT_KEY, 0) <> NVL(T.MOCTYPEALT_KEY, 0) OR NVL(O.NPA_REASON, 0) <> NVL(T.NPA_REASON, 0) )) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, O.DATEMODIFIED = POS_3, O.MODIFIEDBY = ''SSISUSER''',79657);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('cukhu3vw1cb5z','MERGE INTO RBL_TEMPDB.TEMPADVCUSTNPADETAIL A USING (SELECT A.ROWID ROW_ID, ''C'' FROM RBL_TEMPDB.TEMPADVCUSTNPADETAIL A JOIN RBL_MISDB_PROD.ADVCUSTNPADETAIL B ON B.CUSTOMERENTITYID = A.CUSTOMERENTITYID WHERE B.EFFECTIVETOTIMEKEY = :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ISCHANGED = ''C''',79657);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('br4dmxb0fa235','MERGE INTO RBL_TEMPDB.TEMPADVSECURITYDETAIL TEMP USING (SELECT TEMP.ROWID ROW_ID, ACCT.ENTITYKEY FROM RBL_TEMPDB.TEMPADVSECURITYDETAIL TEMP JOIN ( SELECT "TEMPADVSECURITYDETAIL".CUSTOMERENTITYID , "TEMPADVSECURITYDETAIL".ACCOUNTENTITYID , "TEMPADVSECURITYDETAIL".COLLATERALID , "TEMPADVSECURITYDETAIL".SECURITYENTITYID , "TEMPADVSECURITYDETAIL".SECURITYTYPE , (:B1 + ROW_NUMBER() OVER ( ORDER BY ( SELECT 1 FROM DUAL ) )) ENTITYKEY FROM RBL_TEMPDB.TEMPADVSECURITYDETAIL WHERE "TEMPADVSECURITYDETAIL".ENTITYKEY = 0 OR "TEMPADVSECURITYDETAIL".ENTITYKEY IS NULL ) ACCT ON CASE WHEN TEMP.SECURITYTYPE = ''P'' THEN TEMP.ACCOUNTENTITYID ELSE TEMP.CUSTOMERENTITYID END = CASE WHEN ACCT.SECURITYTYPE = ''P'' THEN ACCT.ACCOUNTENTITYID ELSE ACCT.CUSTOMERENTITYID END AND TEMP.COLLATERALID = ACCT.COLLATERALID AND TEMP.SECURITYENTITYID = ACCT.SECURITYENTITYID WHERE TEMP.ISCHANGED IN ( ''N'',''C'' ) ) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.ENTITYKEY = SRC.ENTITYKEY',79676);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('3c9d2z6y311fm','MERGE INTO RBL_MISDB_PROD.ADVSECURITYDETAIL AA USING (SELECT AA.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVSECURITYDETAIL AA LEFT JOIN RBL_TEMPDB.TEMPADVACBASICDETAIL BB ON BB.CUSTOMERENTITYID = AA.CUSTOMERENTITYID AND BB.SOURCEALT_KEY IN ( 1,4 ) WHERE AA.EFFECTIVETOTIMEKEY = 49999 AND AA.SECURITYTYPE <> ''P'' AND NOT EXISTS ( SELECT 1 FROM RBL_TEMPDB.TEMPADVSECURITYDETAIL BB WHERE BB.CUSTOMERENTITYID = AA.CUSTOMERENTITYID AND AA.SECURITYENTITYID = BB.SECURITYENTITYID AND AA.SECURITYTYPE <> ''P'' AND AA.COLLATERALID = BB.COLLATERALID AND BB.EFFECTIVETOTIMEKEY = 49999 )) SRC ON ( AA.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, DATEMODIFIED = POS_3, MODIFIEDBY = ''SSISUSER''',79676);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gtkw1nyhctcwd','MERGE INTO RBL_TEMPDB.TEMPADVSECURITYDETAIL A USING (SELECT A.ROWID ROW_ID, ''N'' FROM RBL_TEMPDB.TEMPADVSECURITYDETAIL A WHERE NOT EXISTS ( SELECT 1 FROM RBL_MISDB_PROD.ADVSECURITYDETAIL B WHERE B.EFFECTIVETOTIMEKEY = 49999 AND CASE WHEN B.SECURITYTYPE = ''P'' THEN B.ACCOUNTENTITYID ELSE B.CUSTOMERENTITYID END = CASE WHEN A.SECURITYTYPE = ''P'' THEN A.ACCOUNTENTITYID ELSE A.CUSTOMERENTITYID END AND A.SECURITYENTITYID = B.SECURITYENTITYID )) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ISCHANGED = ''N''',79676);
