Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('496k1mcu9k4ah','MERGE INTO RBL_MISDB_PROD.INVESTMENTISSUERDETAIL O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.INVESTMENTISSUERDETAIL O JOIN RBL_TEMPDB.TEMPINVESTMENTISSUERDETAIL T ON O.ISSUERID = T.ISSUERID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.BRANCHCODE, '' '') <> NVL(T.BRANCHCODE, '' '') OR NVL(O.ISSUERNAME, '' '') <> NVL(T.ISSUERNAME, '' '') OR NVL(O.RATINGSTATUS, '' '') <> NVL(T.RATINGSTATUS, '' '') OR NVL(O.ISSUERACCPRATING, '' '') <> NVL(T.ISSUERACCPRATING, '' '') OR NVL(O.ISSUERACCPRATINGDT, ''1990-01-01'') <> NVL(T.ISSUERACCPRATINGDT, ''1990-01-01'') OR NVL(O.ISSUERRATINGAGENCY, 0) <> NVL(T.ISSUERRATINGAGENCY, 0) OR NVL(O.REF_TXN_SYS_CUST_ID, '' '') <> NVL(T.REF_TXN_SYS_CUST_ID, '' '') OR NVL(O.ISSUER_CATEGORY_CODE, '' '') <> NVL(T.ISSUER_CATEGORY_CODE, '' '') OR NVL(O.GRPENTITYOFBANK, 0) <> NVL(T.GRPENTITYOFBANK, 0) OR NVL(O.UCIFID, '' '') <> NVL(T.UCIFID, '' '') )) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, O.DATEMODIFIED = POS_3, O.MODIFIEDBY = ''SSISUSER''',81650);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0gtqyd2r3r2kr','INSERT INTO FINACLE_ODFD_DATA ( SELECT CUSTOMERID , CUSTOMERACID , SCHEME_PRODUCTCODE , BALANCEOUTSTANDINGINR , POSBALANCE , COLLATERALID , SECURITYCODE , SECURITYVALUE , VALUATIONEXPIRYDATE , COLLATERAL_TYPE , APPORTIONED_VALUE * NVL(B.RATE, 1) APPORTIONED_VALUE , VALUATIONDATE , SEC_PERF_FLG , CURRENCY_CODE FROM GTT_TEMPWER12_2 A LEFT JOIN GTT_TEMPCURRENCY1 B ON A.CURRENCY_CODE = B.CURRENCY )',86116);
