Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('6988qnw004z41','INSERT INTO GTT_TEMP123_2 SELECT DISTINCT CUSTOMER_ID , APPORTIONED_VALUE TOTALAPPORTIONED_VALUE , COLLATERALID , CUSTOMERACID , SCHEME_PRODUCTCODE , SECURITYCODE , SECURITYVALUE , VALUATIONEXPIRYDATE , COLLATERAL_TYPE , B.BALANCEOUTSTANDINGINR , POSBALANCE , C.BALANCEOUTSTANDINGINR TOTALBALANCEOUTSTANDINGINR , (B.BALANCEOUTSTANDINGINR * 100) / C.BALANCEOUTSTANDINGINR BALANCEOUTSTANDINGINR_ , (APPORTIONED_VALUE * ((B.BALANCEOUTSTANDINGINR * 100) / C.BALANCEOUTSTANDINGINR)) / 100 SECURITY , VALUATIONDATE , TYPE_OF_CURRENCY FROM ( SELECT CUSTOMER_ID , COLLATERALID , SECURITYCODE , SECURITYVALUE , VALUATIONEXPIRYDATE , COLLATERAL_TYPE , SUM(APPORTIONED_VALUE) APPORTIONED_VALUE , VALUATIONDATE , TYPE_OF_CURRENCY FROM SECURITY_SOURCESYSTEM01_STG WHERE COLLATERAL_TYPE = ''Deposits'' AND SECURITYCODE <> ''DSRA'' AND NVL(ACCOUNTID, '' '') = '' '' GROUP BY CUSTOMER_ID,COLLATERALID,SECURITYCODE,SECURITYVALUE,VALUATIONEXPIRYDATE,COLLATERAL_TYPE,VALUATIONDATE,TYPE_OF_CURRENCY ) A JOIN ( SELECT CUSTOMERID , CUSTOMERACID , SCHEME_PRODUCTCODE , BALANCEOUTSTANDINGINR , POSBALANCE FROM ACCOUNT_SOURCESYSTEM01_STG WHERE SCHEME_PRODUCTCODE IN ( SELECT PRODUCTCODE FROM RBL_MISDB_PROD.DIMPRODUCT WHERE PRODUCTGROUP = ''FDSEC'' ) AND NVL(BALANCEOUTSTANDINGINR, 0) > 0 ) B ON A.CUSTOMER_ID = B.CUSTOMERID JOIN ( SELECT CUSTOMERID , SUM(BALANCEOUTSTANDINGINR) BALANCEOUTSTANDINGINR FROM ACCOUNT_SOURCESYSTEM01_STG WHERE SCHEME_PRODUCTCODE IN ( SELECT PRODUCTCODE FROM RBL_MISDB_PROD.DIMPRODUCT WHERE PRODUCTGROUP = ''FDSEC'' ) AND NVL(BALANCEOUTSTANDINGINR, 0) > 0 GROUP BY CUSTOMERID ) C ON C.CUSTOMERID = B.CUSTOMERID ORDER BY 1',86116);
