Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('a6yxth284tckj','MERGE INTO RBL_TEMPDB.TEMPADVSECURITYDETAIL A USING (SELECT A.ROWID ROW_ID, ''C'' FROM RBL_TEMPDB.TEMPADVSECURITYDETAIL A JOIN RBL_MISDB_PROD.ADVSECURITYDETAIL B ON CASE WHEN B.SECURITYTYPE = ''P'' THEN B.ACCOUNTENTITYID ELSE B.CUSTOMERENTITYID END = CASE WHEN A.SECURITYTYPE = ''P'' THEN A.ACCOUNTENTITYID ELSE A.CUSTOMERENTITYID END AND A.SECURITYENTITYID = B.SECURITYENTITYID WHERE B.EFFECTIVETOTIMEKEY = :B1 ) SRC ON ( A.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET A.ISCHANGED = ''C''',79676);
