Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('5bayzxuqt1jr2','MERGE INTO RBL_MISDB_PROD.ADVSECURITYDETAIL O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVSECURITYDETAIL O JOIN RBL_TEMPDB.TEMPADVSECURITYDETAIL T ON CASE WHEN O.SECURITYTYPE = ''P'' THEN O.ACCOUNTENTITYID ELSE O.CUSTOMERENTITYID END = CASE WHEN T.SECURITYTYPE = ''P'' THEN T.ACCOUNTENTITYID ELSE T.CUSTOMERENTITYID END AND O.SECURITYENTITYID = T.SECURITYENTITYID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.CUSTOMERENTITYID, 0) <> NVL(T.CUSTOMERENTITYID, 0) OR NVL(O.SECURITYTYPE, 0) <> NVL(T.SECURITYTYPE, 0) OR NVL(O.COLLATERALTYPE, 0) <> NVL(T.COLLATERALTYPE, 0) OR NVL(O.SECURITYALT_KEY, 0) <> NVL(T.SECURITYALT_KEY, 0) OR NVL(O.SECURITY_REFNO, 0) <> NVL(T.SECURITY_REFNO, 0) OR NVL(O.SECURITYNATURE, 0) <> NVL(T.SECURITYNATURE, 0) OR NVL(O.SECURITYCHARGETYPEALT_KEY, 0) <> NVL(T.SECURITYCHARGETYPEALT_KEY, 0) OR NVL(O.CURRENCYALT_KEY, 0) <> NVL(T.CURRENCYALT_KEY, 0) OR NVL(O.ENTRYTYPE, 0) <> NVL(T.ENTRYTYPE, 0) OR NVL(O.SCRCRERROR, 0) <> NVL(T.SCRCRERROR, 0) OR NVL(O.INWARDNO, 0) <> NVL(T.INWARDNO, 0) OR NVL(O.LIMITNODE_FLAG, 0) <> NVL(T.LIMITNODE_FLAG, 0) OR NVL(O.REFCUSTOMERID, 0) <> NVL(T.REFCUSTOMERID, 0) OR NVL(O.REFSYSTEMACID, 0) <> NVL(T.REFSYSTEMACID, 0) OR NVL(O.SECURITYPARTICULAR, 0) <> NVL(T.SECURITYPARTICULAR, 0) OR NVL(O.OWNERTYPEALT_KEY, 0) <> NVL(T.OWNERTYPEALT_KEY, 0) OR NVL(O.ASSETOWNERNAME, 0) <> NVL(T.ASSETOWNERNAME, 0) OR NVL(O.VALUEATSANCTIONTIME, 0) <> NVL(T.VALUEATSANCTIONTIME, 0) OR NVL(O.BRANCHLASTINSPECDATE, ''1990-01-01'') <> NVL(T.BRANCHLASTINSPECDATE, ''1990-01-01'') OR NVL(O.SATISFACTIONNO, 0) <> NVL(T.SATISFACTIONNO, 0) OR NVL(O.SATISFACTIONDATE, ''1990-01-01'') <> NVL(T.SATISFACTIONDATE, ''1990-01-01'') OR NVL(O.BANKSHARE, 0) <> NVL(T.BANKSHARE, 0) OR NVL(O.ACTIONTAKENREMARK, 0) <> NVL(T.ACTIONTAKENREMARK, 0) OR NVL(O.SECCHARGE, 0) <> NVL(T.SECCHARGE, 0) OR NVL(O.SEC_PERF_FLG, 0) <> NVL(T.SEC_PERF_FLG, 0) )) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, O.DATEMODIFIED = POS_3, O.MODIFIEDBY = ''SSISUSER''',79676);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7dcd454aw6bmu','MERGE INTO RBL_MISDB_PROD.INVESTMENTISSUERDETAIL AA USING (SELECT AA.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.INVESTMENTISSUERDETAIL AA WHERE AA.EFFECTIVETOTIMEKEY = 49999 AND NOT EXISTS ( SELECT 1 FROM RBL_TEMPDB.TEMPINVESTMENTISSUERDETAIL BB WHERE AA.ISSUERID = BB.ISSUERID AND BB.EFFECTIVETOTIMEKEY = 49999 )) SRC ON ( AA.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, DATEMODIFIED = POS_3, MODIFIEDBY = ''SSISUSER''',81650);
