Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8amp21v1racr2','MERGE INTO RBL_TEMPDB.TEMPADVSECURITYVALUEDETAIL TEMP USING (SELECT TEMP.ROWID ROW_ID, ACCT.ENTITYKEY FROM RBL_TEMPDB.TEMPADVSECURITYVALUEDETAIL TEMP JOIN ( SELECT "TEMPADVSECURITYVALUEDETAIL".COLLATERALID , "TEMPADVSECURITYVALUEDETAIL".SECURITYENTITYID , (:B1 + ROW_NUMBER() OVER ( ORDER BY ( SELECT 1 FROM DUAL ) )) ENTITYKEY FROM RBL_TEMPDB.TEMPADVSECURITYVALUEDETAIL WHERE "TEMPADVSECURITYVALUEDETAIL".ENTITYKEY = 0 OR "TEMPADVSECURITYVALUEDETAIL".ENTITYKEY IS NULL ) ACCT ON TEMP.SECURITYENTITYID = ACCT.SECURITYENTITYID AND TEMP.COLLATERALID = ACCT.COLLATERALID WHERE TEMP.ISCHANGED IN ( ''N'',''C'' ) ) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.ENTITYKEY = SRC.ENTITYKEY',79682);
