Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('7016hwb0stz9x','MERGE INTO RBL_MISDB_PROD.ADVCUSTOTHERDETAIL AA USING (SELECT AA.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVCUSTOTHERDETAIL AA WHERE AA.EFFECTIVETOTIMEKEY = 49999 AND NOT EXISTS ( SELECT 1 FROM RBL_TEMPDB.TEMPADVCUSTOTHERDETAIL BB WHERE AA.CUSTOMERENTITYID = BB.CUSTOMERENTITYID AND BB.EFFECTIVETOTIMEKEY = 49999 )) SRC ON ( AA.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, DATEMODIFIED = POS_3, MODIFIEDBY = ''SSISUSER''',79659);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gpy2m8wjkfa9y','MERGE INTO RBL_TEMPDB.TEMPADVCUSTOTHERDETAIL TEMP USING (SELECT TEMP.ROWID ROW_ID, ACCT.CUSTOMER_KEY FROM RBL_TEMPDB.TEMPADVCUSTOTHERDETAIL TEMP JOIN ( SELECT "TEMPADVCUSTOTHERDETAIL".CUSTOMERENTITYID , (:B1 + ROW_NUMBER() OVER ( ORDER BY ( SELECT 1 FROM DUAL ) )) CUSTOMER_KEY FROM RBL_TEMPDB.TEMPADVCUSTOTHERDETAIL WHERE "TEMPADVCUSTOTHERDETAIL".ENTITYKEY = 0 OR "TEMPADVCUSTOTHERDETAIL".ENTITYKEY IS NULL ) ACCT ON TEMP.CUSTOMERENTITYID = ACCT.CUSTOMERENTITYID WHERE TEMP.ISCHANGED IN ( ''N'',''C'' ) ) SRC ON ( TEMP.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET TEMP.ENTITYKEY = SRC.CUSTOMER_KEY',79659);
