Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('0hzs8pad2p0vb','MERGE INTO RBL_MISDB_PROD.ADVSECURITYVALUEDETAIL O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.ADVSECURITYVALUEDETAIL O JOIN RBL_TEMPDB.TEMPADVSECURITYVALUEDETAIL T ON O.SECURITYENTITYID = T.SECURITYENTITYID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.VALUATIONSOURCEALT_KEY, 0) <> NVL(T.VALUATIONSOURCEALT_KEY, 0) OR NVL(O.VALUATIONDATE, ''1990-01-01'') <> NVL(T.VALUATIONDATE, ''1990-01-01'') OR NVL(O.CURRENTVALUE, 0) <> NVL(T.CURRENTVALUE, 0) OR NVL(O.VALUATIONEXPIRYDATE, ''1990-01-01'') <> NVL(T.VALUATIONEXPIRYDATE, ''1990-01-01'') OR NVL(O.SECURITYVALUEMAIN, 0) <> NVL(T.SECURITYVALUEMAIN, 0) )) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, O.DATEMODIFIED = POS_3, O.MODIFIEDBY = ''SSISUSER''',79682);
