Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('01atjf91urw4w','MERGE INTO RBL_MISDB_PROD.METAGRIDCUSTOMERMASTER O USING (SELECT O.ROWID ROW_ID, :B1 , UTILS.CONVERT_TO_VARCHAR2(SYSDATE,200,P_STYLE=>103) AS POS_3, ''SSISUSER'' FROM RBL_MISDB_PROD.METAGRIDCUSTOMERMASTER O JOIN RBL_TEMPDB.TEMPMETAGRIDCUSTOMERMASTER T ON O.CUSTOMER_ID = T.CUSTOMER_ID AND O.EFFECTIVETOTIMEKEY = 49999 AND T.EFFECTIVETOTIMEKEY = 49999 WHERE ( NVL(O.UCIC_ID, 0) <> NVL(T.UCIC_ID, 0) OR NVL(O.CUSTOMER_ID, 0) <> NVL(T.CUSTOMER_ID, 0) OR NVL(O.CUSTOMER_NAME, 0) <> NVL(T.CUSTOMER_NAME, 0) OR NVL(O.CUSTOMER_CONSTITUTION, 0) <> NVL(T.CUSTOMER_CONSTITUTION, 0) OR NVL(O.GENDER, 0) <> NVL(T.GENDER, 0) OR NVL(O.CUSTOMER_SEGMENT_CODE, 0) <> NVL(T.CUSTOMER_SEGMENT_CODE, 0) OR NVL(O.PAN_NO, 0) <> NVL(T.PAN_NO, 0) OR NVL(O.ASSET_CLASS, 0) <> NVL(T.ASSET_CLASS, 0) OR NVL(O.NPA_DATE, ''1900-01-01'') <> NVL(T.NPA_DATE, ''1900-01-01'') OR NVL(O.DBT_LOS_DATE, ''1900-01-01'') <> NVL(T.DBT_LOS_DATE, ''1900-01-01'') OR NVL(O.ALWAYS_NPA, 0) <> NVL(T.ALWAYS_NPA, 0) )) SRC ON ( O.ROWID = SRC.ROW_ID ) WHEN MATCHED THEN UPDATE SET O.EFFECTIVETOTIMEKEY = V_VEFFECTIVETO, O.DATEMODIFIED = POS_3, O.MODIFIEDBY = ''SSISUSER''',82102);
