Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('1d8233m9tuu9y','SELECT C. "NAME" MYNAME, ''CHECK'' MYCHECK, LT.OBJID_GEN MYTABLE, D. "DEFINITION" MYDEFINITION, ''MSTSQL'' MYLANGUAGE, COL.COLID_GEN MYCOLID, P.VALUE COMMENTS FROM STAGE_SS2K5_OBJECTS A, STAGE_SS2K5_OBJECTS A2, STAGE_SS2K5_OBJECTS C, STAGE_SS2K5_CHECK_CONSTRAINTS D, STAGE_SS2K5_TABLES LT, STAGE_SS2K5_COLUMNS COL, STAGE_SS2K5_SYSPROPERTIES P WHERE A. "TYPE" =''C'' AND A.OBJECT_ID = C.OBJECT_ID AND D. "OBJECT_ID" = A. "OBJECT_ID" AND D. "PARENT_COLUMN_ID" <> 0 AND A.PARENT_OBJECT_ID = A2.OBJECT_ID AND LT.OBJECT_ID = A2.OBJECT_ID AND A.SVRID_FK = :B1 AND COL.OBJECT_ID = LT.OBJECT_ID AND D. "PARENT_COLUMN_ID" = COL.COLUMN_ID AND COL.SVRID_FK = :B1 AND A2.SVRID_FK = :B1 AND C.SVRID_FK = :B1 AND D.SVRID_FK = :B1 AND LT.SVRID_FK = :B1 AND COL.DBID_GEN_FK = A.DBID_GEN_FK AND A2.DBID_GEN_FK = A.DBID_GEN_FK AND C.DBID_GEN_FK = A.DBID_GEN_FK AND D.DBID_GEN_FK = A.DBID_GEN_FK AND LT.DBID_GEN_FK = A.DBID_GEN_FK AND LT.NAME NOT IN (''sysdiagrams'') AND EXISTS (SELECT 1 FROM MD_TABLES MDT WHERE MDT.ID=LT.OBJID_GEN ) AND P.CLASS(+) = 1 AND P.SVRID_FK(+) = :B1 AND P.MAJOR_ID(+) = A.OBJECT_ID AND P.MINOR_ID(+) = 0 AND P.DBID_GEN_FK(+) = A.DBID_GEN_FK ',87524);
