Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('12unhb9vg4aca','INSERT INTO MD_ADDITIONAL_PROPERTIES ( CONNECTION_ID_FK, REF_ID_FK, REF_TYPE, PROPERTY_ORDER, PROP_KEY, "VALUE" ) ( SELECT C.SVRID_FK, C.COLID_GEN, ''MD_COLUMNS'' , NULL, ''INCREMENT'', INCREMENT_VALUE FROM STAGE_SS2K5_COLUMNS C, STAGE_SS2K5_IDENTITY_COLUMNS I , STAGE_SS2K5_TABLES TABST WHERE TABST.SVRID_FK = :B1 AND TABST.OBJID_GEN = C.ID_GEN_FK AND C.ID_GEN_FK IS NOT NULL AND C.ID_GEN_FK != 0 AND C.SVRID_FK = :B1 AND I.SVRID_FK = :B1 AND C.DBID_GEN_FK = I.DBID_GEN_FK AND I.COLUMN_ID = C.COLUMN_ID AND I.OBJECT_ID = C.OBJECT_ID AND SEED_VALUE IS NOT NULL AND INCREMENT_VALUE IS NOT NULL AND EXISTS ( SELECT 1 FROM MD_TABLES T WHERE T.ID=C.ID_GEN_FK ) )',86887);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8mz9n2qmsvrk3','SELECT FK.OBJECT_ID MYID, O.OBJID_GEN MDID, P.VALUE COMMENTS, FK.DBID_GEN_FK THEDATABASEGEN FROM STAGE_SS2K5_FN_KEYS FK, STAGE_SS2K5_TABLES LT, STAGE_SS2K5_OBJECTS O, STAGE_SS2K5_SYSPROPERTIES P WHERE O.PARENT_OBJECT_ID!=0 AND O.PARENT_OBJECT_ID =LT.OBJECT_ID AND FK.SVRID_FK = :B1 AND LT.SVRID_FK = :B1 AND O.SVRID_FK = :B1 AND LT.DBID_GEN_FK = FK.DBID_GEN_FK AND O.DBID_GEN_FK = FK.DBID_GEN_FK AND O.OBJECT_ID = FK.OBJECT_ID AND LT.NAME NOT IN (''sysdiagrams'') AND EXISTS (SELECT 1 FROM MD_TABLES MDT WHERE MDT.ID=LT.OBJID_GEN ) AND P.CLASS(+) = 1 AND P.SVRID_FK(+) = :B1 AND P.MAJOR_ID(+) = FK.OBJECT_ID AND P.MINOR_ID(+) = 0 AND P.DBID_GEN_FK(+) = FK.DBID_GEN_FK ',86887);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gqbakvv4tjugp','INSERT INTO MD_USER_DEFINED_DATA_TYPES ( SCHEMA_ID_FK, DATA_TYPE_NAME, DEFINITION, NATIVE_SQL, NATIVE_KEY, COMMENTS, SECURITY_GROUP_ID, CREATED_ON, CREATED_BY, LAST_UPDATED_ON, LAST_UPDATED_BY ) (SELECT SS.ID, B.NAME, SS2K5ALLPLATFORM.PRINTUDTDEF(A.NAME, B.PRECISION, B.SCALE, B. "MAX_LENGTH"), SS2K5ALLPLATFORM.PRINTUDTDEF(A.NAME, B.PRECISION, B.SCALE, B. "MAX_LENGTH"), ''0'', PP.VALUE, 0, SYSDATE, NULL, NULL, NULL FROM STAGE_SS2K5_TYPES A, STAGE_SS2K5_TYPES B, STAGE_SS2K5_SCHEMAS S, MD_SCHEMAS SS, STAGE_SS2K5_SYSPROPERTIES PP WHERE A.USER_TYPE_ID = B.SYSTEM_TYPE_ID AND B.USER_TYPE_ID != B.SYSTEM_TYPE_ID AND B.SCHEMA_ID = S.SCHEMA_ID AND S.SUID_GEN = SS.ID AND A.SVRID_FK = :B1 AND B.SVRID_FK = :B1 AND S.SVRID_FK = :B1 AND A.DBID_GEN_FK = B.DBID_GEN_FK AND S.DBID_GEN_FK = B.DBID_GEN_FK AND PP.CLASS(+) = 6 AND PP.SVRID_FK(+) = :B1 AND PP.MAJOR_ID(+) = B.USER_TYPE_ID AND PP.MINOR_ID(+) = 0 AND PP.DBID_GEN_FK(+) = B.DBID_GEN_FK )',86887);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('9paxa8yfcnabu','SELECT DISTINCT A.OBJID_GEN, A. "NAME", A.SUID_GEN_FK, A.DBID_GEN_FK FROM STAGE_SYB12_SYSOBJECTS A, STAGE_SYB12_SYSUSERS B WHERE A.DB_TYPE=''V '' AND A.DB_UID = B.DB_UID AND A.SVRID_FK = B.SVRID_FK AND A.DBID_GEN_FK = B.DBID_GEN_FK AND B.SUID>0 AND A.SVRID_FK = :B1 AND A.NAME <> ''sysquerymetrics''',87358);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8gsc34cs5k2ds','SELECT DISTINCT A.SVRID_FK, A.DBID_GEN_FK, A.OBJID_GEN, A.DB_TYPE, A. "NAME", A.SUID_GEN_FK, C.DB_NUMBER FROM STAGE_SYB12_SYSOBJECTS A, STAGE_SYB12_SYSUSERS B, STAGE_SYB12_SYSCOMMENTS C WHERE ( A.DB_TYPE=''P '' OR A.DB_TYPE = ''SF'' OR A.DB_TYPE = ''FN'' OR A.DB_TYPE = ''TF'' OR A.DB_TYPE = ''IF'' ) AND A.DB_UID = B.DB_UID AND A.SVRID_FK = B.SVRID_FK AND C.SVRID_FK = A.SVRID_FK AND A.DBID_GEN_FK = B.DBID_GEN_FK AND C.DBID_GEN_FK = A.DBID_GEN_FK AND C.ID = A.ID AND B.SUID>0 AND A.SVRID_FK = :B1 ',87358);
