Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('90vyhj3ympk13','INSERT INTO MD_USER_DEFINED_DATA_TYPES ( SCHEMA_ID_FK, DATA_TYPE_NAME, DEFINITION, NATIVE_SQL, NATIVE_KEY, COMMENTS, SECURITY_GROUP_ID, CREATED_ON, CREATED_BY, LAST_UPDATED_ON, LAST_UPDATED_BY) WITH LOWESTTYPE AS ( SELECT DISTINCT DB_TYPE ,MIN(USERTYPE) USERTYPEX FROM STAGE_SYB12_SYSTYPES X GROUP BY DB_TYPE ), LOWESTSCHEMA AS ( SELECT MIN(A.SUID_GEN) MIN_SUID_GEN FROM STAGE_SYB12_SYSUSERS A WHERE A.SVRID_FK = :B1 AND A.SUID>0 AND A.DB_UID IN (SELECT DISTINCT DB_UID FROM STAGE_SYB12_SYSOBJECTS) ) SELECT DISTINCT (SELECT MIN_SUID_GEN FROM LOWESTSCHEMA), Y.NAME UDTNAME, SYB12ALLPLATFORM.GETDESCRIPTION(X.NAME, Y.PREC, Y.SCALE, Y.LENGTH) DEFINITION, SYB12ALLPLATFORM.GETDESCRIPTION(X.NAME, Y.PREC, Y.SCALE, Y.LENGTH), ''0'', NULL, 0, SYSDATE, NULL, NULL, NULL FROM STAGE_SYB12_SYSTYPES Y, STAGE_SYB12_SYSTYPES X, LOWESTTYPE L WHERE Y.DB_TYPE = L.DB_TYPE AND X.USERTYPE = L.USERTYPEX AND Y.USERTYPE > 100',87358);
