Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('8mz9n2qmsvrk3','SELECT FK.OBJECT_ID MYID, O.OBJID_GEN MDID, P.VALUE COMMENTS, FK.DBID_GEN_FK THEDATABASEGEN FROM STAGE_SS2K5_FN_KEYS FK, STAGE_SS2K5_TABLES LT, STAGE_SS2K5_OBJECTS O, STAGE_SS2K5_SYSPROPERTIES P WHERE O.PARENT_OBJECT_ID!=0 AND O.PARENT_OBJECT_ID =LT.OBJECT_ID AND FK.SVRID_FK = :B1 AND LT.SVRID_FK = :B1 AND O.SVRID_FK = :B1 AND LT.DBID_GEN_FK = FK.DBID_GEN_FK AND O.DBID_GEN_FK = FK.DBID_GEN_FK AND O.OBJECT_ID = FK.OBJECT_ID AND LT.NAME NOT IN (''sysdiagrams'') AND EXISTS (SELECT 1 FROM MD_TABLES MDT WHERE MDT.ID=LT.OBJID_GEN ) AND P.CLASS(+) = 1 AND P.SVRID_FK(+) = :B1 AND P.MAJOR_ID(+) = FK.OBJECT_ID AND P.MINOR_ID(+) = 0 AND P.DBID_GEN_FK(+) = FK.DBID_GEN_FK ',87524);
Insert into SYS.PLSCOPE_SQL$ (SQL_ID,SQL_TEXT,OBJ#) values ('gqbakvv4tjugp','INSERT INTO MD_USER_DEFINED_DATA_TYPES ( SCHEMA_ID_FK, DATA_TYPE_NAME, DEFINITION, NATIVE_SQL, NATIVE_KEY, COMMENTS, SECURITY_GROUP_ID, CREATED_ON, CREATED_BY, LAST_UPDATED_ON, LAST_UPDATED_BY ) (SELECT SS.ID, B.NAME, SS2K5ALLPLATFORM.PRINTUDTDEF(A.NAME, B.PRECISION, B.SCALE, B. "MAX_LENGTH"), SS2K5ALLPLATFORM.PRINTUDTDEF(A.NAME, B.PRECISION, B.SCALE, B. "MAX_LENGTH"), ''0'', PP.VALUE, 0, SYSDATE, NULL, NULL, NULL FROM STAGE_SS2K5_TYPES A, STAGE_SS2K5_TYPES B, STAGE_SS2K5_SCHEMAS S, MD_SCHEMAS SS, STAGE_SS2K5_SYSPROPERTIES PP WHERE A.USER_TYPE_ID = B.SYSTEM_TYPE_ID AND B.USER_TYPE_ID != B.SYSTEM_TYPE_ID AND B.SCHEMA_ID = S.SCHEMA_ID AND S.SUID_GEN = SS.ID AND A.SVRID_FK = :B1 AND B.SVRID_FK = :B1 AND S.SVRID_FK = :B1 AND A.DBID_GEN_FK = B.DBID_GEN_FK AND S.DBID_GEN_FK = B.DBID_GEN_FK AND PP.CLASS(+) = 6 AND PP.SVRID_FK(+) = :B1 AND PP.MAJOR_ID(+) = B.USER_TYPE_ID AND PP.MINOR_ID(+) = 0 AND PP.DBID_GEN_FK(+) = B.DBID_GEN_FK )',87524);
